                    { 155, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\dqK9Hag1054tghRQSqLSfrkvQnA.jpg", 185000000L, new List<string> { "Drama", "Action", "Crime", "Thriller" }, "https://www.warnerbros.com/movies/dark-knight/", "tt0468569", new List<string> { "US" }, "en", "The Dark Knight", "Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.", 111.178, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\qJ2tW6WMUDux911r6m7haRef0WH.jpg", new List<string> { "United Kingdom", "United States of America" }, new DateTime(2008, 7, 16, 0, 0, 0, 0, DateTimeKind.Utc), 1004558444L, 152, new List<string> { "English", "Mandarin" }, "Released", "Welcome to a world without rules.", "The Dark Knight", 8.5, 31970 },
                    { 238, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\tmU7GeKVybMWFButWEGl2M4GeiP.jpg", 6000000L, new List<string> { "Drama", "Crime" }, "http://www.thegodfather.com/", "tt0068646", new List<string> { "US" }, "en", "The Godfather", "Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.", 109.274, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\3bhkrj58Vtu7enYsRolD1fZdja1.jpg", new List<string> { "United States of America" }, new DateTime(1972, 3, 14, 0, 0, 0, 0, DateTimeKind.Utc), 245066411L, 175, new List<string> { "English", "Italian", "Latin" }, "Released", "An offer you can't refuse.", "The Godfather", 8.6999999999999993, 19869 },
                    { 240, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\kGzFbGhp99zva6oZODW5atUtnqi.jpg", 13000000L, new List<string> { "Drama", "Crime" }, "", "tt0071562", new List<string> { "US" }, "en", "The Godfather Part II", "In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.", 152.72200000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg", new List<string> { "United States of America" }, new DateTime(1974, 12, 20, 0, 0, 0, 0, DateTimeKind.Utc), 102600000L, 202, new List<string> { "English", "Italian", "Latin", "Spanish" }, "Released", "The rise and fall of the Corleone empire.", "The Godfather Part II", 8.5999999999999996, 11994 },
                    { 278, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\zfbjgQE1uSd9wiPTX4VzsLi0rGG.jpg", 25000000L, new List<string> { "Drama", "Crime" }, "", "tt0111161", new List<string> { "US" }, "en", "The Shawshank Redemption", "Imprisoned in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.", 115.57599999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\9cqNxx0GxF0bflZmeSMuL5tnGzr.jpg", new List<string> { "United States of America" }, new DateTime(1994, 9, 23, 0, 0, 0, 0, DateTimeKind.Utc), 28341469L, 142, new List<string> { "English" }, "Released", "Fear can hold you prisoner. Hope can set you free.", "The Shawshank Redemption", 8.6999999999999993, 26206 },
                    { 346, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\qvZ91FwMq6O47VViAr8vZNQz3WI.jpg", 2000000L, new List<string> { "Action", "Drama" }, "", "tt0047478", new List<string> { "JP" }, "ja", "七人の侍", "A samurai answers a village's request for protection after he falls on hard times. The town needs protection from bandits, so the samurai gathers six others to help him teach the people how to defend themselves, and the villagers provide the soldiers with food.", 28.609999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\8OKmBV5BUFzmozIC3pPWKHy17kx.jpg", new List<string> { "Japan" }, new DateTime(1954, 4, 26, 0, 0, 0, 0, DateTimeKind.Utc), 346300L, 207, new List<string> { "Japanese" }, "Released", "The Mighty Warriors Who Became the Seven National Heroes of a Small Town", "Seven Samurai", 8.5, 3500 },
                    { 389, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\qqHQsStV6exghCM7zbObuYBiYxw.jpg", 350000L, new List<string> { "Drama" }, "", "tt0050083", new List<string> { "US" }, "en", "12 Angry Men", "The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors' prejudices and preconceptions about the trial, the accused, and each other.", 72.099999999999994, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\ow3wq89wM8qd5X7hWKxiRfsFf9C.jpg", new List<string> { "United States of America" }, new DateTime(1957, 4, 10, 0, 0, 0, 0, DateTimeKind.Utc), 1000000L, 97, new List<string> { "English" }, "Released", "Life is in their hands. Death is on their minds.", "12 Angry Men", 8.5410000000000004, 8272 },
                    { 424, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\zb6fM1CX41D9rF9hdgclu0peUmy.jpg", 22000000L, new List<string> { "Drama", "History", "War" }, "http://www.schindlerslist.com/", "tt0108052", new List<string> { "US" }, "en", "Schindler's List", "The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.", 76.924000000000007, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg", new List<string> { "United States of America" }, new DateTime(1993, 12, 15, 0, 0, 0, 0, DateTimeKind.Utc), 321365567L, 195, new List<string> { "German", "Polish", "Hebrew", "English" }, "Released", "Whoever saves one life, saves the world entire.", "Schindler's List", 8.5999999999999996, 15402 },
                    { 429, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\Adrip2Jqzw56KeuV2nAxucKMNXA.jpg", 1200000L, new List<string> { "Western" }, "http://www.mgm.com/#/our-titles/766/The-Good,-the-Bad-and-the-Ugly", "tt0060196", new List<string> { "IT" }, "it", "Il buono, il brutto, il cattivo", "While the Civil War rages on between the Union and the Confederacy, three men – a quiet loner, a ruthless hitman, and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.", 67.308999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\bX2xnavhMYjWDoZp1VM6VnU1xwe.jpg", new List<string> { "United States of America", "Italy", "Spain", "Germany" }, new DateTime(1966, 12, 22, 0, 0, 0, 0, DateTimeKind.Utc), 38900000L, 161, new List<string> { "Italian" }, "Released", "For three men the Civil War wasn't hell. It was practice.", "The Good, the Bad and the Ugly", 8.4670000000000005, 8280 },
                    { 497, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\vxJ08SvwomfKbpboCWynC3uqUg4.jpg", 60000000L, new List<string> { "Fantasy", "Drama", "Crime" }, "http://thegreenmile.warnerbros.com/", "tt0120689", new List<string> { "US" }, "en", "The Green Mile", "A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people's ailments. When the cell block's head guard, Paul Edgecomb, recognizes Coffey's miraculous gift, he tries desperately to help stave off the condemned man's execution.", 94.129000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\8VG8fDNiy50H4FedGwdSVUPoaJe.jpg", new List<string> { "United States of America" }, new DateTime(1999, 12, 10, 0, 0, 0, 0, DateTimeKind.Utc), 286801374L, 189, new List<string> { "French", "English" }, "Released", "Paul Edgecomb didn't believe in miracles. Until the day he met one.", "The Green Mile", 8.5050000000000008, 16843 },
                    { 539, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\uif5fUshJrXyyDzfpzp1DLw3N0S.jpg", 806947L, new List<string> { "Horror", "Thriller", "Mystery" }, "", "tt0054215", new List<string> { "US" }, "en", "Psycho", "When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother.", 194.96100000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\yz4QVqPx3h1hD1DfqqQkCq3rmxW.jpg", new List<string> { "United States of America" }, new DateTime(1960, 6, 22, 0, 0, 0, 0, DateTimeKind.Utc), 32000000L, 109, new List<string> { "English" }, "Released", "A new— and altogether different— screen excitement!!!", "Psycho", 8.4000000000000004, 9744 },
                    { 550, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\hZkgoQYus5vegHoetLkCJzb17zJ.jpg", 63000000L, new List<string> { "Drama" }, "http://www.foxmovies.com/movies/fight-club", "tt0137523", new List<string> { "US" }, "en", "Fight Club", "A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.", 261.79300000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\pB8BM7pdSp6B6Ih7QZ4DrQ3PmJK.jpg", new List<string> { "Germany", "United States of America" }, new DateTime(1999, 10, 15, 0, 0, 0, 0, DateTimeKind.Utc), 100853753L, 139, new List<string> { "English" }, "Released", "Mischief. Mayhem. Soap.", "Fight Club", 8.4410000000000007, 28563 },
                    { 637, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\gavyCu1UaTaTNPsVaGXT6pe5u24.jpg", 20000000L, new List<string> { "Comedy", "Drama" }, "", "tt0118799", new List<string> { "IT" }, "it", "La vita è bella", "A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.", 43.985999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\74hLDKjD5aGYOotO6esUVaeISa2.jpg", new List<string> { "Italy" }, new DateTime(1997, 12, 20, 0, 0, 0, 0, DateTimeKind.Utc), 230098753L, 116, new List<string> { "German", "Czech", "English", "Italian" }, "Released", "An unforgettable fable that proves love, family and imagination conquer all.", "Life Is Beautiful", 8.452, 12722 },
                    { 680, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\suaEOtk1N1sgg2MTM7oZd2cfVp3.jpg", 8500000L, new List<string> { "Thriller", "Crime" }, "https://www.miramax.com/movie/pulp-fiction/", "tt0110912", new List<string> { "US" }, "en", "Pulp Fiction", "A burger-loving hit man, his philosophical partner, a drug-addled gangster's moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.", 377.41699999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg", new List<string> { "United States of America" }, new DateTime(1994, 9, 10, 0, 0, 0, 0, DateTimeKind.Utc), 213928762L, 154, new List<string> { "English", "Spanish", "French" }, "Released", "You won't know the facts until you've seen the fiction.", "Pulp Fiction", 8.4890000000000008, 27126 },
                    { 769, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\sw7mordbZxgITU877yTpZCud90M.jpg", 25000000L, new List<string> { "Drama", "Crime" }, "http://www.warnerbros.com/goodfellas", "tt0099685", new List<string> { "US" }, "en", "GoodFellas", "The true story of Henry Hill, a half-Irish, half-Sicilian Brooklyn kid who is adopted by neighbourhood gangsters at an early age and climbs the ranks of a Mafia family under the guidance of Jimmy Conway.", 270.82299999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\aKuFiU82s5ISJpGZp7YkIr3kCUd.jpg", new List<string> { "United States of America" }, new DateTime(1990, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), 46800000L, 145, new List<string> { "Italian", "English" }, "Released", "Three decades of life in the mafia.", "GoodFellas", 8.5, 12409 },
                    { 11216, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\k3SBILYxHRgjORb5tbvA5dm2N4h.jpg", 5000000L, new List<string> { "Drama", "Romance" }, "", "tt0095765", new List<string> { "IT" }, "it", "Nuovo Cinema Paradiso", "A filmmaker recalls his childhood, when he fell in love with the movies at his village's theater and formed a deep friendship with the theater's projectionist.", 32.420000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\8SRUfRUi6x4O68n0VCbDNRa6iGL.jpg", new List<string> { "France", "Italy" }, new DateTime(1988, 11, 17, 0, 0, 0, 0, DateTimeKind.Utc), 11990401L, 124, new List<string> { "Italian" }, "Released", "An enchanted village. A wonderful friendship. Star-crossed lovers. And the magic of the movies.", "Cinema Paradiso", 8.4529999999999994, 4203 },
                    { 12477, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\dlC0ed9Ugh3FzydnkBtV5lRXUu4.jpg", 3700000L, new List<string> { "Animation", "Drama", "War" }, "https://gkids.com/films/grave-of-the-fireflies", "tt0095327", new List<string> { "JP" }, "ja", "火垂るの墓", "In the final months of World War II, 14-year-old Seita and his sister Setsuko are orphaned when their mother is killed during an air raid in Kobe, Japan. After a falling out with their aunt, they move into an abandoned bomb shelter. With no surviving relatives and their emergency rations depleted, Seita and Setsuko struggle to survive.", 0.034000000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\k9tv1rXZbOhH7eiCk378x61kNQ1.jpg", new List<string> { "Japan" }, new DateTime(1988, 4, 16, 0, 0, 0, 0, DateTimeKind.Utc), 516962L, 89, new List<string> { "Japanese" }, "Released", "", "Grave of the Fireflies", 8.4629999999999992, 5253 },
                    { 19404, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\90ez6ArvpO8bvpyIngBuwXOqJm5.jpg", 13200000L, new List<string> { "Comedy", "Drama", "Romance" }, "", "tt0112870", new List<string> { "IN" }, "hi", "दिलवाले दुल्हनिया ले जायेंगे", "Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.", 33.734999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\lfRkUr7DYdHldAqi3PwdQGBRBPM.jpg", new List<string> { "India" }, new DateTime(1995, 10, 20, 0, 0, 0, 0, DateTimeKind.Utc), 100000000L, 190, new List<string> { "Hindi" }, "Released", "Come… Fall In love, All Over Again…", "Dilwale Dulhania Le Jayenge", 8.5380000000000003, 4387 },
                    { 157336, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\xJHokMbljvjADYdit5fK5VQsXEG.jpg", 165000000L, new List<string> { "Adventure", "Drama", "Science Fiction" }, "http://www.interstellarmovie.net/", "tt0816692", new List<string> { "US" }, "en", "Interstellar", "The adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.", 397.38400000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\gEU2QniE6E77NI6lCU6MxlNBvIx.jpg", new List<string> { "United Kingdom", "United States of America" }, new DateTime(2014, 11, 5, 0, 0, 0, 0, DateTimeKind.Utc), 701729206L, 169, new List<string> { "English" }, "Released", "Mankind was born on Earth. It was never meant to die here.", "Interstellar", 8.4339999999999993, 34407 },
                    { 372058, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\dIWwZW7dJJtqC6CgWzYkNVKIUm8.jpg", 0L, new List<string> { "Animation", "Romance", "Drama" }, "https://www.funimationfilms.com/movie/yourname/", "tt5311514", new List<string> { "JP" }, "ja", "君の名は。", "High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.", 80.281999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\q719jXXEzOoYaps6babgKnONONX.jpg", new List<string> { "Japan" }, new DateTime(2016, 8, 26, 0, 0, 0, 0, DateTimeKind.Utc), 358000000L, 106, new List<string> { "Japanese" }, "Released", "Separated by distance, connected by fate.", "Your Name.", 8.4949999999999992, 10979 },
                    { 372754, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\3RMLbSEXOn1CzLoNT7xFeLfdxhq.jpg", 0L, new List<string> { "Romance", "Animation" }, "http://doukyuseimovie.com/", "tt5526028", new List<string> { "JP" }, "ja", "同級生", "Rihito Sajo, an honor student with a perfect score on the entrance exam and Hikaru Kusakabe, in a band and popular among girls, would have never crossed paths. Until one day they started talking at the practice for their school’s upcoming chorus festival. After school, the two meet regularly, as Hikaru helps Rihito to improve his singing skills. While they listen to each other’s voice and harmonize, their hearts start to beat together.", 13.188000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\cIfRCA5wEvj9tApca4UDUagQEiM.jpg", new List<string> { "Japan" }, new DateTime(2016, 2, 20, 0, 0, 0, 0, DateTimeKind.Utc), 0L, 61, new List<string> { "Japanese" }, "Released", "Sincerely, Slowly, Falling in Love.", "Dou kyu sei – Classmates", 8.4350000000000005, 356 },
                    { 496243, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\TU9NIjwzjoKPwQHoHshkFcQUCG.jpg", 11363000L, new List<string> { "Comedy", "Thriller", "Drama" }, "https://www.parasite-movie.com/", "tt6751668", new List<string> { "KR" }, "ko", "기생충", "All unemployed, Ki-taek's family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.", 79.751000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\7IiTTgloJzvGI1TAYymCfbfl3vT.jpg", new List<string> { "South Korea" }, new DateTime(2019, 5, 30, 0, 0, 0, 0, DateTimeKind.Utc), 257591776L, 133, new List<string> { "English", "German", "Korean" }, "Released", "Act like you own the place.", "Parasite", 8.5090000000000003, 17564 },
                    { 1058694, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\backdrops\\gutU32BiBxJvJdzLv5RWC9hQhNh.jpg", 10000000L, new List<string> { "Drama" }, "https://www.radical.movie", "tt14570440", new List<string> { "US" }, "en", "Radical", "In a Mexican border town plagued by neglect, corruption, and violence, a frustrated teacher tries a radical new method to break through his students’ apathy and unlock their curiosity, their potential… and maybe even their genius.", 57.658999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\posters\\eSatbygYZp8ooprBHZdb6GFZxGB.jpg", new List<string> { "Mexico", "United States of America" }, new DateTime(2023, 10, 19, 0, 0, 0, 0, DateTimeKind.Utc), 21066351L, 127, new List<string> { "Spanish" }, "Released", "Think for yourself.", "Radical", 8.4450000000000003, 365 }
