                {
                    { 24, "Robert Lee Zemeckis (born May 14, 1951) is an American film director, producer and screenwriter. Zemeckis first came to public attention in the 1980s as the director of the comedic time-travel Back to the Future film series, as well as the Academy Award-winning live-action/animation epic Who Framed Roger Rabbit (1988), though in the 1990s he diversified into more dramatic fare, including 1994's Forrest Gump, for which he won an Academy Award for Best Director.\n\nHis films are characterized by an interest in state-of-the-art special effects, including the early use of match moving in Back to the Future Part II (1989) and the pioneering performance capture techniques seen in The Polar Express (2004), Beowulf (2007) and A Christmas Carol (2009). Though Zemeckis has often been pigeonholed as a director interested only in effects, his work has been defended by several critics, including David Thomson, who wrote that \"No other contemporary director has used special effects to more dramatic and narrative purpose.\"", new DateTime(1951, 5, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000709", "Directing", "Robert Zemeckis", new List<string> { "روبرت زيميكس", "Роберт Земекис", "羅拔·湛米基斯", "โรเบิร์ต เซเม็กคิส", "ロバート・ゼメキス", "로버트 저메키스" }, "Chicago, Illinois, USA", 15.544, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lPYDQ5LYNJ12rJZENtyASmVZ1Ql.jpg" },
                    { 26, "From Wikipedia, the free encyclopedia.\n\nWinston F. Groom, Jr. (born March 23, 1944) is an American novelist and non-fiction writer, best known for his book Forrest Gump, which was adapted into a film in 1994.\n\nDescription above from the Wikipedia article Winstom Groom, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1944, 3, 23, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 9, 16, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0343165", "Writing", "Winston Groom", new List<string>(), "Washington, District of Columbia, USA", 5.2050000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d5SooICKys7VofhLcBHi5LjGe63.jpg" },
                    { 27, "Eric Roth (born 22 March 1945) is an American screenwriter. He won the Oscar for Best Adapted Screenplay for Forrest Gump (1994). He also co-wrote the screenplay for Michael Mann's The Insider (1999), the Steven Spielberg film Munich (2005), David Fincher's film The Curious Case of Benjamin Button (2008) and Denis Villeneuve's Dune (2021) , all of which were nominated for Oscars.\n\nRoth was born in New York City, New York, the son of Miriam \"Mimi\", a teacher, studio executive, and radio writer, and Leon Roth, a university teacher and film producer. He has a Master of Fine Arts (MFA) from UCLA Film School as well as a degree from University of California,", new DateTime(1945, 3, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0744839", "Writing", "Eric Roth", new List<string>(), "New York City, New York, USA", 10.269, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\p61cF5pqC6cH6CgXQUuBpW6P2qa.jpg" },
                    { 28, "", new DateTime(1961, 8, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0277704", "Production", "Wendy Finerman", new List<string>(), null, 4.4029999999999996, null },
                    { 29, "", null, null, 2, null, "nm0005494", "Production", "Steve Tisch", new List<string>(), null, 5.3410000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1qXa4o8gSQqxXSRp0X0lvRM018O.jpg" },
                    { 30, "", null, null, 2, null, "nm0823330", "Production", "Steve Starkey", new List<string>(), null, 7.3490000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8YCSIPhLZ6HHbbypEFZY05B7l16.jpg" },
                    { 31, "Thomas Jeffrey Hanks (born July 9, 1956) is an American actor and filmmaker. Known for both his comedic and dramatic roles, Hanks is one of the most popular and recognizable film stars worldwide, and is widely regarded as an American cultural icon.\n\nHanks made his breakthrough with leading roles in the comedies Splash (1984) and Big (1988). He won two consecutive Academy Awards for Best Actor for starring as a gay lawyer suffering from AIDS in Philadelphia (1993) and a young man with below-average IQ in Forrest Gump (1994). Hanks collaborated with film director Steven Spielberg on five films: Saving Private Ryan (1998), Catch Me If You Can (2002), The Terminal (2004), Bridge of Spies (2015), and The Post (2017), as well as the 2001 miniseries Band of Brothers, which launched him as a director, producer, and screenwriter.\n\nHanks' other notable films include the romantic comedies Sleepless in Seattle (1993) and You've Got Mail (1998); the dramas Apollo 13 (1995), The Green Mile (1999), Cast Away (2000), Road to Perdition (2002), and Cloud Atlas (2012); and the biographical dramas Saving Mr. Banks (2013), Captain Phillips (2013), Sully (2016), and A Beautiful Day in the Neighborhood (2019). He has also appeared as the title character in the Robert Langdon film series, and has voiced Sheriff Woody in the Toy Story film series.\n\nDescription above from the Wikipedia article Tom Hanks, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1956, 7, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000158", "Acting", "Tom Hanks", new List<string> { "Thomas Jeffrey Hanks", "Том Хэнкс", "توم هانكس", "トム・ハンクス", "톰 행크스", "ทอม แฮงส์", "汤姆·汉克斯", "Том Генкс", "Том Хенкс", "Томас Джеффрі Генкс", "Τομ Χανκς", "टॉम हैंक्स", "ടോം ഹാങ്ക്സ്", "湯姆‧漢克斯", "湯姆·漢克", "托马斯·杰弗里·汉克斯", "Thomas Hanks", "湯漢斯 飾", "טום הנקס", "湯姆·漢克斯" }, "Concord, California, USA", 79.861999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xndWFsBlClOJFRdhSt4NBwiPq2o.jpg" },
                    { 32, "Robin Gayle Wright (born April 8, 1966) is an American actress. She is best known for her roles as Jenny Curran in Forrest Gump, as Buttercup in The Princess Bride, and as Mary Surratt in The Conspirator. She has also been credited as Robin Wright Penn.", new DateTime(1966, 4, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000705", "Acting", "Robin Wright", new List<string> { "Robin Wright-Penn", "로빈 라이트", "Robin Virginia Gayle Wright", "Robin Gayle Wright", "Робин Райт", "罗宾·怀特", "Робин Райт-Пенн", "罗宾·赖特", "رابین رایت", "羅賓·懷特" }, "Dallas, Texas, USA", 33.125999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d3rIv0y2p0jMsQ7ViR7O1606NZa.jpg" },
                    { 33, "Gary Alan Sinise (born March 17, 1955) is an American actor, film director, humanitarian, and musician. Among other awards, he has won a Primetime Emmy Award, a Golden Globe Award, a Tony Award, and four Screen Actors Guild Awards. He has also received a star on the Hollywood Walk of Fame, and was nominated for an Academy Award.\n\nHe has also received numerous awards and honors for his extensive humanitarian work and involvement with charitable organizations. He is a supporter of various veterans' organizations and founded the Lt. Dan Band (named after his character in Forrest Gump), which plays at military bases around the world.\n\nHis acting career started on stage with the Steppenwolf Theatre Company in 1983 when he directed and starred in a production of Sam Shepard's True West for which he earned a Obie Award. He would later earn four Tony Award nominations including for his performances in The Grapes of Wrath and One Flew Over the Cuckoo's Nest. He earned the Tony Award's Regional Theatre Award alongside the Steppenwolf Theatre Company.\n\nHe first starred in the film adaptation of John Steinbeck's classic novel Of Mice and Men which he also directed and produced. Sinise played George Milton alongside John Malkovich who played Lennie.\n\nOne of his most well-known roles is as Lieutenant Dan Taylor in Forrest Gump (1994) for which he was nominated for the Academy Award for Best Supporting Actor. He also appeared in other feature films including Ron Howard's Apollo 13 (1995), Ransom (1996), Frank Darabont's The Green Mile (1999) and Impostor (2002).\n\nHis television performances include Harry S. Truman in Truman  (1995), for which he won a Golden Globe, and the title role in the television film George Wallace, for which he received a Primetime Emmy Award.\n\nHe had a leading role as Detective Mac Taylor in the CBS drama series CSI: NY (2004–13). From 2016 to 2017, he starred as Special Agent Jack Garrett in Criminal Minds: Beyond Borders. In 2017, he had a role on the Netflix series 13 Reasons Why.\n\nHe has also been a narrator on multiple docuseries and documentaries.", new DateTime(1955, 3, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.garysinise.com/", "nm0000641", "Acting", "Gary Sinise", new List<string> { "Gary A. Sinise" }, "Blue Island, Illinois, USA", 22.225000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\olRjiV8ZhBixQiTvrGwXhpVXxsV.jpg" },
                    { 34, "Michael T. 'Mykelti' Williamson (born March 4, 1957) is an American actor best known for his role as Benjamin Buford 'Bubba' Blue in the 1994 film Forrest Gump, as Detective Bobby 'Fearless' Smith in the critically acclaimed but commercially unsuccessful crime drama Boomtown, and recently for appearing as the head of CTU for season 8 of the hit TV series 24.", new DateTime(1957, 3, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0932112", "Acting", "Mykelti Williamson", new List<string> { "Michael T. Williamson", "Mykel T. Williamson", "Mikel T. Williamson" }, "St. Louis, Missouri, USA", 28.652999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\e5f7XCZAUEQ55rVhdphqzdMMI8b.jpg" },
                    { 35, "Sally Margaret Field (born November 6, 1946) is an American actress. She has received many awards and nominations, including two Academy Awards, three Primetime Emmy Awards, two Golden Globe Awards, a Screen Actors Guild Award, a Cannes Film Festival Award for Best Actress, and nominations for a Tony Award and for two British Academy Film Awards.\n\nField began her career on television, starring in the comedies Gidget (1965–1966), The Flying Nun (1967–1970), and The Girl with Something Extra (1973–1974). In 1967, she was also in the western The Way West. In 1976, she attracted critical acclaim for her performance in the television film Sybil, for which she received the Primetime Emmy Award for Outstanding Lead Actress in a Limited Series or Movie. Her film debut was as an extra in Moon Pilot (1962). Her film career escalated during the 1970s with starring roles in films including Stay Hungry (1976), Smokey and the Bandit (1977), Heroes (1977), The End (1978), and Hooper (1978). During the 1980s she won the Academy Award for Best Actress twice for Norma Rae (1979) and Places in the Heart (1984), and she appeared in Smokey and the Bandit II (1980), Absence of Malice (1981), Kiss Me Goodbye (1982), Murphy's Romance (1985), Steel Magnolias (1989), Soapdish (1991), Mrs. Doubtfire (1993), and Forrest Gump (1994).\n\nIn the 2000s, Field returned to television with a recurring role on the NBC medical drama ER, for which she won the Primetime Emmy Award for Outstanding Guest Actress in a Drama Series in 2001 and the following year made her stage debut with Edward Albee's The Goat, or Who Is Sylvia?. For her portrayal of Nora Walker in the ABC television family drama series Brothers & Sisters (2006-2011), Field won the Primetime Emmy Award for Outstanding Lead Actress in a Drama Series. She starred as Mary Todd Lincoln in Lincoln (2012), for which she was nominated for the Academy Award for Best Supporting Actress, and she portrayed Aunt May in The Amazing Spider-Man (2012) and its 2014 sequel, with the first being her highest-grossing release. In 2015, she portrayed the title character in Hello, My Name Is Doris, for which she was nominated for the Critics' Choice Movie Award for Best Actress in a Comedy. In 2017, she returned to the stage after an absence of 15 years with the revival of Tennessee Williams's The Glass Menagerie, for which was nominated for the Tony Award for Best Actress in a Play. In 2014, she was presented with a star on the Hollywood Walk of Fame and in 2019, she received the Kennedy Center Honor.", new DateTime(1946, 11, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000398", "Acting", "Sally Field", new List<string> { "Sally Margaret Field" }, "Pasadena, California, USA", 29.300000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5fBK36MdmdwQQMuP0W70rXADXih.jpg" },
                    { 36, "Don Michael Burgess, ASC, (born May 28, 1956) is an American cinematographer who was nominated for the Academy Award and BAFTA Award for Best Cinematography for Forrest Gump (1994), directed by frequent collaborator Robert Zemeckis. Burgess was Director of Photography for films including Cast Away (2000), Spider-Man (2002), The Polar Express (2004) Enchanted (2007), Source Code (2011), The Muppets (2011), The Conjuring 2 (2016), and Aquaman (2018). He studied at the ArtCenter College of Design in Los Angeles.", new DateTime(1956, 5, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0121281", "Camera", "Don Burgess", new List<string> { "Don Michael Burgess", "Mike Burgess", "Michael Burgess" }, "Santa Monica, California, USA", 3.2440000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cY0jPTTmrgebRGW1qpmYlpM2e10.jpg" },
                    { 37, "Alan Anthony Silvestri is an American composer and conductor known for his film and television scores. Silvestri is known for scoring MCU's Captain America: The First Avenger, The Avengers, Avengers: Infinity War, and Avengers: Endgame. He has frequently collaborated with director Robert Zemeckis, scoring such films as the Back to the Future trilogy, Who Framed Roger Rabbit, Cast Away, and Forrest Gump. He is a two-time Academy Award and Golden Globe Award nominee, and a three-time Saturn Award and Primetime Emmy Award recipient.", new DateTime(1950, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.alansilvestri.com", "nm0006293", "Sound", "Alan Silvestri", new List<string>(), "New York City, New York, USA", 6.742, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pQOAsQDuYMR4cKaPAP0wkRlCSNo.jpg" },
                    { 38, "From Wikipedia, the free encylopedia.\n\nArthur Robert Schmidt (June 17, 1937 – August 5, 2023) was an American film editor with about 27 film credits between 1977 and 2005. Schmidt had an extended collaboration with director Robert Zemeckis from the Back to the Future film trilogy (1985—1990) to Cast Away (2000).\n\nDescription above from the Wikipedia article Arthur Schmidt, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1937, 6, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2023, 8, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0772831", "Editing", "Arthur Schmidt", new List<string> { "Arthur R. Schmidt" }, "Los Angeles, California, U.S.", 6.1390000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bSgfOvtFrtaftXSwXFLcI7Z0zKe.jpg" },
                    { 48, "Shaun Mark Bean (born 17 April 1959) is an English actor. After graduating from the Royal Academy of Dramatic Art, Bean made his professional debut in a theatre production of Romeo and Juliet in 1983. Retaining his Yorkshire accent, he first found mainstream success for his portrayal of Richard Sharpe in the ITV series Sharpe, which originally ran from 1993 to 1997.\n\nBean's film roles include Patriot Games (1992), GoldenEye (1995), Ronin (1998), Don't Say a Word (2001), The Lord of the Rings trilogy (2001–2003), Equilibrium (2002), National Treasure (2004), Troy (2004), Flightplan (2005), North Country (2005), The Island (2005), Silent Hill (2006), Percy Jackson & the Olympians: The Lightning Thief (2010), Black Death (2010), Jupiter Ascending (2015), and The Martian (2015).\n\nHis television roles include the BBC anthology series Accused, Broken, Game of Thrones, and the ITV historical drama series Henry VIII and Legends. As a voice actor, Bean has been featured in the video games The Elder Scrolls IV: Oblivion, Sid Meier's Civilization VI, and the feature films Wolfwalkers and Mummies among others. Bean has also been the main voice over for O2 and their adverts for over 20 years having originally taken the job in 2002.\n\nIn 2022, Bean won the British Academy Television Award as Leading Actor in Time, a BBC One drama.", new DateTime(1959, 4, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000293", "Acting", "Sean Bean", new List<string> { "Shaun Mark Bean", "Шон Бин", "Шон Бін", "肖恩·宾", "숀 빈", "西恩·賓" }, "Sheffield, South Yorkshire, England, UK", 36.113, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kTjiABk3TJ3yI0Cto5RsvyT6V3o.jpg" },
                    { 52, "David Bowditch Morse (born October 11, 1953) is an American stage, television, and film actor. He first came to national attention as Dr. Jack Morrison in the medical drama St. Elsewhere from 1982 to 1988. Morse continued his movie career with roles in Dancer in the Dark, The Negotiator, The Green Mile, Disturbia, The Long Kiss Goodnight, The Crossing Guard, The Rock, Extreme Measures, Twelve Monkeys, 16 Blocks, and Hounddog.\n\nIn 2006, Morse had a recurring role as Detective Michael Tritter on the medical drama House for which he received an Emmy Award nomination.  Morse portrayed George Washington in the 2008 HBO Miniseries John Adams, which garnered him a second Emmy nomination. Morse has received acclaim for his portrayal of Uncle Peck on the Off-Broadway play How I Learned to Drive for which he earned a Drama Desk and Obie Award. He also had success on Broadway, portraying James \"Sharky\" Harkin in The Seafarer. As of 2011, Morse is a regular on the HBO series, \"Treme\".\n\n​From Wikipedia, the free encyclopedia", new DateTime(1953, 10, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001556", "Acting", "David Morse", new List<string> { "David Bowditch Morse", "大衛摩斯" }, "Hamilton, Massachusetts, USA", 46.356999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A6zGbkFjM3uajIakgsSeNTmSKqY.jpg" },
                    { 62, "Walter Bruce Willis (born March 19, 1955) is a retired American actor. His career began on the off-Broadway stage in the 1970s. He achieved fame with a leading role on the comedy-drama series Moonlighting (1985–1989) and has since appeared in over 70 films, gaining widespread recognition as an action hero after his portrayal of John McClane in the Die Hard franchise (1988–2013) and other subsequent roles.\n\nWillis's other credits include The Last Boy Scout (1991), Pulp Fiction (1994), 12 Monkeys (1995), Last Man Standing (1996), The Fifth Element (1997), Armageddon (1998), The Sixth Sense (1999), Hart's War (2002), Tears of the Sun (2003), Hostage (2005), Lucky Number Slevin (2006), Surrogates (2009), Moonrise Kingdom (2012), Rock the Kasbah (2015) and Motherless Brooklyn (2019).\n\nAs a singer, Willis released his debut album The Return of Bruno in 1987, followed by two more successful albums in 1989 and 2001. He made his Broadway debut in the stage adaptation of Misery in 2015. Willis has received numerous accolades during his career, including a Golden Globe, two Primetime Emmy Awards, and two People's Choice Awards. He received a star on the Hollywood Walk of Fame in 2006.\n\nIn March 2022, Willis announced that he was retiring from acting after being diagnosed with aphasia, which affects his ability to communicate. In February 2023, Willis' family announced that they had received a more accurate diagnosis and he had been diagnosed with frontotemporal dementia.", new DateTime(1955, 3, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000246", "Acting", "Bruce Willis", new List<string> { "Брюс Уиллис", "ブルース・ウィリス", "بروس ويليس", "브루스 윌리스", "บรูซ วิลลิส", "ברוס וויליס", "Walter Bruce Willis", "Bruno", "Γουόλτερ Μπρους Γουίλις", "Μπρους Γουίλις", "布鲁斯·威利斯", "Брюс Вілліс", "Брус Вилис" }, "Idar-Oberstein, Germany", 44.155000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A1XBu3CffBpSK8HEIJM8q7Mn4lz.jpg" },
                    { 64, "Gary Leonard Oldman (born 21 March 1958) is an English actor and filmmaker. Regarded as one of the best actors of his generation, he is known for his versatility and intense acting style. He received various accolades, including an Academy Award, a Golden Globe Award, a Screen Actors Guild Award, and three British Academy Film Awards. His films have grossed over $11 billion worldwide, making him one of the highest-grossing actors to date.\n\nOldman began acting in theatre in 1979 and made his film debut in Remembrance (1982). He continued to follow a stage career in London's Royal Court and was a member of the Royal Shakespeare Company, with credits including Cabaret, Romeo and Juliet, Entertaining Mr Sloane, Saved, The Country Wife and Hamlet. He rose to prominence in British film with his portrayals of Sid Vicious in Sid and Nancy (1986), Joe Orton in Prick Up Your Ears (1987) and Rosencrantz in Rosencrantz & Guildenstern Are Dead (1990), while also attracting attention as the leader of a gang of football hooligans in the television film The Firm (1989). Regarded as a member of the \"Brit Pack\", he achieved greater recognition as a New York gangster in State of Grace (1990), Lee Harvey Oswald in JFK (1991) and Count Dracula in Bram Stoker's Dracula (1992).\n\nOldman portrayed the villains in films such as True Romance (1993), The Fifth Element (1997), Air Force One (1997) and The Contender (2000); corrupt DEA agent Norman Stansfield, whom he played in Léon: The Professional (1994), was called one of cinema's best villains. He also played Ludwig van Beethoven in Immortal Beloved (1994) and later appeared in franchise roles such as Sirius Black in the Harry Potter series, James Gordon in The Dark Knight Trilogy (2005–2012) and a human leader, Dreyfus in Dawn of the Planet of the Apes (2014). He won the Academy Award for Best Actor for his role as Winston Churchill in Darkest Hour (2017), and was nominated for his portrayals of George Smiley in Tinker Tailor Soldier Spy (2011) and Herman J. Mankiewicz in Mank (2020).\n\nOldman was executive producer of films like The Contender, Plunkett & Macleane (1999) and Nil by Mouth (1997), the latter of which he also wrote and directed. He featured in television shows such as Fallen Angels, Tracey Takes On... and Friends, voiced Ignitius and Viktor Reznov respectively in The Legend of Spyro and Call of Duty video games and appeared in music videos for David Bowie, Guns N' Roses and Annie Lennox.", new DateTime(1958, 3, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000198", "Acting", "Gary Oldman", new List<string> { "Gary Leonard Oldman", "แกรี โอลด์แมน", "Гари Олдман", "ゲイリー・オールドマン", "غاري أولدمان", "게리 올드먼", "게리 올드만", "Γκάρι Όλντμαν", "Гэри Олдман", "Ґері Олдмен", "Гері Олдмен", "گری اولدمن", "გარი ოლდმენი", "加里·奥德曼", "蓋瑞·歐德曼" }, "New Cross, London, England, UK", 154.804, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2v9FVVBUrrkW2m3QOcYkuhq9A6o.jpg" },
                    { 65, "Sir Ian Holm Cuthbert CBE (12 September 1931 – 19 June 2020) was an English actor. After beginning his career on the British stage as a leading member of the Royal Shakespeare Company, he became a successful and prolific performer on television and in films. He received numerous accolades including two BAFTA Awards and a Tony Award, along with nominations for an Academy Award and two Emmy Awards. He was made a Commander of the Order of the British Empire (CBE) in 1989 by Queen Elizabeth II.\n\nHolm won the 1967 Tony Award for Best Featured Actor for his performance as Lenny in the Harold Pinter play The Homecoming. He won the Laurence Olivier Award for Best Actor for his performance in the title role in the 1998 West End production of King Lear. For his television roles he received two Primetime Emmy Award nominations for King Lear (1998), and the HBO film The Last of the Blonde Bombshells (2003).\n\nHe gained acclaim for his role in The Bofors Gun (1968) winning the BAFTA Award for Best Actor in a Supporting Role. He was nominated for an Academy Award for Best Supporting Actor and a BAFTA Award win for his role as athletics trainer Sam Mussabini in Chariots of Fire (1981). Other notable films he appeared in include Alien (1979), Brazil (1985), Henry V (1989), The Madness of King George (1994), The Fifth Element (1997), The Sweet Hereafter (1997), and The Aviator (2004). He gained wider appreciation for his role as the elderly Bilbo Baggins in Peter Jackson's The Lord of the Rings and The Hobbit trilogies. He also voiced Chef Skinner in the Pixar animated film Ratatouille (2007).\n\nDescription above from the Wikipedia article Ian Holm, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1931, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 6, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000453", "Acting", "Ian Holm", new List<string> { "Ian Holm Cuthbert", "Sir Ian Holm Cuthbert CBE", "Sir Ian Holm Cuthbert", "Sir Ian Holm", "Иэн Холм", "Ієн Голм", "이안 홈", "伊恩·霍姆" }, "Goodmayes, Essex, England, UK", 19.515999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tz81JSiPdcLM7b624W1BcYdxd4D.jpg" },
                    { 99, "Amanda Michael Plummer (born March 23, 1957) is an American actress. Plummer was born in New York City, New York, the daughter of actors Tammy Grimes and Christopher Plummer. Plummer attended Middlebury College in Vermont and acting classes at the Neighborhood Playhouse in New York. Early in life, her interest was in riding and tending to horses on the East Coast and in Ireland.\n\nPlummer began appearing in small to mid size roles in television and films in the early 1980s. Her first successes came from her stage work. She made her Broadway debut as Josephine in the 1981 revival of A Taste of Honey. She won a Tony Award nomination and Theatre World Award for her portrayal. The following year, she won a Tony Award for Featured Actress and a Drama Desk Award for her portrayal of Sister Agnes in the play Agnes of God.\n\nFollowing her successes on the stage, Plummer began appearing in major roles on television and in film. One of her most recognized appearances was on L.A. Law as Alice Hackett, a developmentally disabled girlfriend of Benny Stulwitz, played by Larry Drake, for which she received an Emmy Award nomination. Two other well-known roles were Yolanda (a.k.a. \"Honey Bunny\") in Pulp Fiction and Rose in So I Married An Axe Murderer.\n\nHer film roles have been described as \"spooky, kooky, half-mad characters.\"", new DateTime(1957, 3, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001625", "Acting", "Amanda Plummer", new List<string> { "아만다 플러머", "阿曼达·普拉莫", "Amanda Michael Plummer" }, "New York City, New York, USA", 26.411000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wEwyajjePFVVn2wFdH1NH7z9Qn5.jpg" },
                    { 108, "Sir Peter Robert Jackson, (born 31 October 1961) is a New Zealand film director, producer, actor, and screenwriter, known for his Lord of the Rings film trilogy, adapted from the novel by J. R. R. Tolkien. He is also known for his 2005 remake of King Kong and as the producer of District 9. He won international attention early in his career with his \"splatstick\" horror comedies, before coming to mainstream prominence with Heavenly Creatures, for which he shared an Academy Award Best Screenplay nomination with his wife, Fran Walsh. Jackson has been awarded three Academy Awards in his career, including the award for Best Director in 2003.\n\nDescription above from the Wikipedia article Peter Jackson, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1961, 10, 31, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001392", "Directing", "Peter Jackson", new List<string> { "Sir Peter Jackson", "Питер Джексон", "ピーター・ジャクソン", "彼得·杰克逊", "ปีเตอร์ แจ็กสัน", "피터 잭슨", "بيتر جاكسون", "पीटर जैक्सन", "ਪੀਟਰ ਜੈਕਸਨ", "פיטר ג'קסון", "பீட்டர் ஜாக்சன்", "పీటర్ జాక్సన్", "彼得·傑克遜", "Пітер Джексон" }, "Pukerua Bay, North Island, New Zealand", 25.558, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bNc908d59Ba8VDNr4eCcm4G1cR.jpg" },
                    { 109, "Elijah Wood is an American actor.\n\nElijah Wood possesses a remarkable and enduring career in entertainment, his initial rise to fame as Frodo Baggins in Peter Jackson's iconic 'The Lord of the Rings' trilogy merely the opening chapter. With a career beginning in childhood, he has proven both his longevity and his ability to transition from celebrated child actor to adult performer with a diverse range of roles across genres and mediums.\n\nWood's early filmography demonstrates his youthful promise. Films like 'Paradise' (1991), 'Radio Flyer' (1992), and the psychological thriller 'The Good Son' (1993) established him as a talented presence. Though starring in 'North' (1994) proved a critical misstep, his performance was often singled out as a bright spot. His exploration of more mature roles in 'The Ice Storm' (1997), 'Deep Impact' (1998), and 'The Faculty' (1998) showcased a growing versatility as Wood gracefully navigated the transition to young adult.\n\nThe 'Lord of the Rings' trilogy (2001-2003) transformed him into a global star. His heartfelt portrayal of Frodo Baggins, the humble hobbit burdened with the extraordinary task of destroying the One Ring, earned him widespread acclaim. Rather than remaining typecast following this success, Wood actively pursued challenging, offbeat roles that showcased his depth. He delivered a chilling performance as the sociopathic Kevin in 'Sin City' (2005) and lent his voice to both animation ('Happy Feet,' '9') and quirky television projects ('American Dad!,' 'Robot Chicken').\n\nBalancing both mainstream and independent cinema, Wood starred as a tormented writer in 'Maniac' (2012) while also reprising his role as Frodo Baggins in 'The Hobbit: An Unexpected Journey' (2012). He played the lead role in the BBC America series 'Dirk Gently's Holistic Detective Agency' (2016-2017), where his portrayal of the endearingly eccentric Todd Brotzman brought him further recognition.\n\nAn avid music lover, Wood demonstrates his entrepreneurial side as the founder of the record label Simian Records. His interest in the production side of the entertainment industry led to the creation of the production company SpectreVision in 2010. Specializing in horror and genre films, SpectreVision has backed titles like 'Cooties' (2014), 'A Girl Walks Home Alone at Night' (2014), and the acclaimed 'Mandy' (2018).\n\nIn recent years, Wood has continued his eclectic filmography with parts in films like 'Come to Daddy' (2019), 'I Don't Feel at Home in This World Anymore' (2017), and 'Color Out of Space' (2019). He also voiced characters in the video games 'Broken Age' (2014) and '11-11: Memories Retold' (2018). He further expanded his production work with the VR game 'Transference' (2018).\n\nIMDb mini bio by : yusufpiskin", new DateTime(1981, 1, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000704", "Acting", "Elijah Wood", new List<string> { "Элайджа Вуд", "Элайджа Джордан Вуд", "일라이저 우드", "伊利亚·伍德", "伊莱贾·伍德", "伊莱贾·乔丹·伍德", "イライジャ・ウッド" }, "Cedar Rapids, Iowa, USA", 32.609999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7UKRbJBNG7mxBl2QQc5XsAh6F8B.jpg" },
                    { 110, "Viggo Peter Mortensen, Jr. (born October 20, 1958) is an American actor, writer, director, producer, musician, and multimedia artist. Born and raised in the state of New York to a Danish father and American mother, he also lived in Argentina during his childhood. He is the recipient of various accolades including a Screen Actors Guild Award and has been nominated for three Academy Awards, three BAFTA Awards, and four Golden Globe Awards.", new DateTime(1958, 10, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://percevalpress.com/", "nm0001557", "Acting", "Viggo Mortensen", new List<string> { "Viggo Peter Mortensen Jr.", "Вигго Мортенсен", "비고 모텐슨", "维戈·莫滕森", "ヴィゴ・モーテンセン", "Вігго Мортенсен" }, "Watertown, New York, USA", 37.648000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vH5gVSpHAMhDaFWfh0Q7BG61O1y.jpg" },
                    { 112, "Catherine Elise Blanchett (born 14 May 1969) is an Australian actor and producer. Regarded as one of the best actresses of her generation, she is known for her versatile work across independent films, blockbusters, and the stage. Blanchett is the recipient of numerous accolades, including two Academy Awards, three British Academy Film Awards, three Screen Actors Guild Awards, and three Golden Globe Awards.\n\nAfter graduating from the National Institute of Dramatic Art, Blanchett began her acting career on the Australian stage, taking on roles in Electra in 1992 and Hamlet in 1994. She came to international attention as Elizabeth I in the drama film Elizabeth (1998), for which she won the Golden Globe and BAFTA Award for Best Actress, and received her first of seven Academy Award nominations. Her portrayal of Katharine Hepburn in Martin Scorsese's The Aviator (2004) won her the Academy Award for Best Supporting Actress. She later won the Academy Award for Best Actress for playing a neurotic former socialite in Woody Allen's comedy-drama Blue Jasmine (2013). Blanchett's other Oscar-nominated roles include Notes on a Scandal (2006), I'm Not There (2007), Elizabeth: The Golden Age (2007), and Carol (2015). Her highest-grossing films include The Lord of the Rings (2001–2003) and The Hobbit (2012–2014) trilogies, The Curious Case of Benjamin Button (2008), Indiana Jones and the Kingdom of the Crystal Skull (2008), Cinderella (2015), Thor: Ragnarok (2017), and Ocean's 8 (2018).\n\nBlanchett has performed in over 20 theatre productions. From 2008 to 2013, she and her husband, Andrew Upton, were the artistic directors of the Sydney Theatre Company. Some of her stage roles during that period were in revivals of A Streetcar Named Desire, Uncle Vanya and The Maids, garnering several theatre awards and nominations. She made her Broadway debut in 2017 in The Present, for which she received a Tony Award for Best Actress in a Play nomination. Blanchett has also received Emmy Award nominations for Outstanding Lead Actress in a Limited Series or Movie and Outstanding Limited Series as producer for the FX/Hulu historical drama miniseries Mrs. America (2020).", new DateTime(1969, 5, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000949", "Acting", "Cate Blanchett", new List<string> { "Кейт Бланшетт", "凯特·布兰切特", "เคต บลานเชตต์", "ケイト・ブランシェット", "케이트 블란쳇", "Catherine Élise Blanchett", "Κέιτ Μπλάνσετ", "கேத்தரின் எலிஸ் பிளான்செட்", "کیت بلانشت", "קייט בלאנשט", "凯特·布兰切特饰" }, "Melbourne, Victoria, Australia", 34.101999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9V83uemR0ra9Wd9iRXTMlfAQlTB.jpg" },
                    { 113, "Christopher Lee (May 5, 1922 - June 7, 2015) was an English actor and musician. Lee initially portrayed villains and became famous for his role as Count Dracula in a string of Hammer Horror films. Other notable roles include Lord Summerisle in The Wicker Man (1973), Francisco Scaramanga in The Man with the Golden Gun (1974), Count Dooku in Star Wars episodes II and III (2002, 2005) and Saruman in The Lord of the Rings film trilogy (2001–2003). Lee considers his most important role to have been his portrayal of Pakistan's founder Muhammad Ali Jinnah in the biopic Jinnah (1998). He is well known for his deep, strong voice. Lee has performed roles in 266 films since 1948 making him the Guinness book world record holder for most film acting roles ever. He was knighted in 2009 and received the BAFTA Fellowship in 2011.", new DateTime(1922, 5, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 6, 7, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000489", "Acting", "Christopher Lee", new List<string> { "Кристофер Ли ", "Christopher Frank Carandini Lee", "Σερ Κρίστοφερ Φρανκ Καραντίνι Λι", "Κρίστοφερ Φρανκ Καραντίνι Λι", "Κρίστοφερ Λι" }, "Westminster, London, England, UK", 32.68, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dA26fBr3t7mKqjn3OYW6kbD1LXM.jpg" },
                    { 114, "Orlando Jonathan Blanchard Copeland Bloom (born 13 January 1977) is an English actor. He made his breakthrough as the character Legolas in The Lord of the Rings film series, a role he reprised in The Hobbit film series. He gained further notice appearing in epic fantasy, historical, and adventure films, notably as Will Turner in the Pirates of the Caribbean film series.\n\nBloom appeared in Hollywood films such as Paris in Troy (2004) and Balian de Ibelin in Kingdom of Heaven (2005). He stars in the Amazon Prime Video series Carnival Row (2019–present).\n\nHe made his professional stage debut in In Celebration at the Duke of York's Theatre in the West End in 2007 and starred in a Broadway adaption of Romeo and Juliet in 2013. In 2009, Bloom was named a UNICEF Goodwill Ambassador. In 2015 he received the BAFTA Britannia Humanitarian Award.", new DateTime(1977, 1, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0089217", "Acting", "Orlando Bloom", new List<string> { "奥兰多·布鲁姆", "ออร์แลนโด บลูม", "Орландо Блум", "オーランド・ブルーム", "أورلاندو بلوم", "올랜도 블룸", "Orlando Jonathan Blanchard Bloom", "Ορλάντο Μπλουμ", "奧蘭多·布魯" }, "Canterbury, Kent, England, UK", 45.761000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lwQoA0qJTCZ6l2FH6PjmhRQjiaB.jpg" },
                    { 117, "Howard Leslie Shore OC (born October 18, 1946) is a Canadian composer and conductor noted for his film scores. He has composed the scores for over 80 films, most notably the scores for The Lord of the Rings and The Hobbit film trilogies. He won three Academy Awards for his work on The Lord of the Rings, with one being for the song \"Into the West\", an award he shared with Eurythmics lead vocalist Annie Lennox and writer/producer Fran Walsh, who wrote the lyrics. He is also a consistent collaborator with director David Cronenberg, having scored all but one of his films since 1979.\n\nShore has also composed a few concert works including one opera, The Fly, based on the plot of Cronenberg's 1986 film, which premiered at the Théâtre du Châtelet in Paris on July 2, 2008; a short piece named Fanfare for the Wanamaker Organ and the Philadelphia Orchestra; and a short overture for the Swiss 21st Century Symphony Orchestra. Shore has also composed for television, including serving as the original musical director for the American sketch comedy show Saturday Night Live from 1975 to 1980.\n\nIn addition to his three Academy Awards, Shore has also won three Golden Globe Awards and four Grammy Awards.", new DateTime(1946, 10, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.howardshore.com/", "nm0006290", "Sound", "Howard Shore", new List<string> { "Howard Leslie Shore" }, "Toronto, Ontario, Canada", 6.5140000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nJ606tXnL8vDVHi7qavrV292ljt.jpg" },
                    { 123, "", new DateTime(1944, 2, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0651614", "Production", "Barrie M. Osborne", new List<string> { "Barrie Osborne" }, "New York City, New York, USA", 5.7009999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xWtXYk6M5NFroddcQDviLlxOnkU.jpg" },
                    { 126, "Dame Frances Rosemary Walsh DNZM (born 10 January 1959) is a New Zealand screenwriter and film producer.\n\nThe partner of filmmaker Peter Jackson, Walsh has contributed to all of their films since 1989: as co-writer since Meet the Feebles, and as producer since The Lord of the Rings Trilogy. She has won three Academy Awards for the final film of the trilogy, The Lord of the Rings: The Return of the King.\n\nDescription above from the Wikipedia article Fran Walsh, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1959, 1, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0909638", "Writing", "Fran Walsh", new List<string>(), "Wellington, New Zealand", 13.593, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\roXPta5fAmGzqdOIvUQbDavZy8Y.jpg" },
                    { 128, "From Wikipedia, the free encyclopedia.  Philippa Boyens, MNZM, is a New Zealand screenwriter who co-wrote the screenplay for Peter Jackson's film series The Lord of the Rings with Peter Jackson and Fran Walsh, for which the trio won an Oscar at the 76th Academy Awards in 2004. Boyens worked with the same collaborators on the screenplay for Jackson's version of King Kong. Following that movie's completion, the trio once again worked together on The Lovely Bones, Jackson's film adaptation of Alice Sebold's novel of the same name, which was released in 2009. She is also collaborating with Jackson, Walsh and Guillermo del Toro on The Hobbit films which are scheduled for release in 2011 and 2012. Prior to turning to screenwriting with The Lord of the Rings, Boyens was a playwright.\n\nBoyens was a part-time student at the University of Auckland, graduating with a BA in English and History in 1994. She received a Distinguished Alumni Award from the university in 2006.  She has three children, daughter Phoebe Gittins, and sons Calum Gittins (both with actor Paul Gittins) and Isaac Miller. Calum starred as Haleth in The Lord of the Rings: The Two Towers.\n\nDescription above from the Wikipedia article Philippa Boyens, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1962, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0101991", "Writing", "Philippa Boyens", new List<string>(), "Auckland, New Zealand", 10.599, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vfPQnrMZ87uPjyJYrSkQtqI6c0H.jpg" },
                    { 129, "John Ronald Reuel Tolkien, CBE (3 January 1892 – 2 September 1973) was an English writer, poet, philologist, and university professor, best known as the author of the classic high-fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion.\n\nHe served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow of Pembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis - they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972.  After Tolkien's death, his son Christopher published a series of works based on his father's extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings.  \n\nWhile many other authors had published works of fantasy before Tolkien, the great success of The Hobbit and The Lord of the Rings led directly to a popular resurgence of the genre. This has caused Tolkien to be popularly identified as the \"father\" of modern fantasy literature - or, more precisely, of high fantasy.  In 2008, The Times ranked him sixth on a list of \"The 50 greatest British writers since 1945\". Forbes ranked him the 5th top-earning \"dead celebrity\" in 2009. - Wikipedia", new DateTime(1892, 1, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1973, 2, 9, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0866058", "Writing", "J.R.R. Tolkien", new List<string> { "John Ronald Reuel Tolkien", "JRR Tolkien", "J·R·R·托尔金", "约翰·罗纳德·瑞尔·托尔金" }, "Bloemfontein, Orange Free State, South Africa", 9.3559999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8AYNNfNuhpzPHxki7cBISG9JpGx.jpg" },
                    { 138, "Quentin Jerome Tarantino (born March 27, 1963) is an American film director, screenwriter, producer, cinematographer and actor. In the early 1990s he was an independent filmmaker whose films used nonlinear storylines and aestheticization of violence. His films have earned him a variety of Academy Award, Golden Globe, BAFTA and Palme d'Or Awards and he has been nominated for Emmy and Grammy Awards. In 2007, Total Film named him the 12th-greatest director of all time.\n\nTarantino was born in Knoxville, Tennessee, the son of Connie McHugh Tarantino Zastoupil, a health care executive and nurse born in Knoxville, and Tony Tarantino, an actor and amateur musician born in Queens, New York. Tarantino's mother allowed him to quit school at age 17, to attend an acting class full time. Tarantino gave up acting while attending the acting school, saying that he admired directors more than actors. Tarantino also worked in a video rental store before becoming a filmmaker, paid close attention to the types of films people liked to rent, and has cited that experience as inspiration for his directorial career.\n\nDescription above from the Wikipedia article Quentin Tarantino, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1963, 3, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000233", "Directing", "Quentin Tarantino", new List<string> { "Quentin Jerome Tarantino", "Квентин Тарантино", "كوينتن تارانتينو", "昆汀·塔伦蒂诺", "เควนติน แทแรนติโน", "クエンティン・タランティーノ", "쿠엔틴 타란티노", "Квентін Тарантіно" }, "Knoxville, Tennessee, USA", 34.235999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1gjcpAa99FAOWGnrUvHEXXsRs7o.jpg" },
                    { 139, "Uma Karuna Thurman (born April 29, 1970) is an American actress, writer, producer and model. She has acted in a variety of films, from romantic comedies and dramas to science fiction and action films. Following her appearances on the December 1985 and May 1986 covers of British Vogue, Thurman's breakthrough role was Dangerous Liaisons (1988) in which she starred. She rose to international prominence with her role as Mia Wallace in Quentin Tarantino's 1994 film Pulp Fiction, for which she was nominated for the Academy Award, the BAFTA Award, and the Golden Globe Award for Best Supporting Actress. Often hailed as Tarantino's muse, she reunited with the director to play the main role of The Bride in Kill Bill: Volume 1 and 2 (2003, 2004), which brought her two additional Golden Globe Award nominations.\n\nEstablished as a Hollywood leading lady, her other notable films include Henry & June (1990), The Truth About Cats & Dogs (1996), Batman & Robin (1997), Gattaca (1997), Les Misérables (1998), Paycheck (2003), The Producers (2005), My Super Ex-Girlfriend (2006), Percy Jackson & the Olympians: The Lightning Thief (2010), Lars von Trier's Nymphomaniac (2013) and The House That Jack Built (2018). In 2011, Thurman was a member of the jury for the main competition at the 64th Cannes Film Festival, and in 2017, she was named president of the 70th edition's \"Un Certain Regard\" jury. Thurman made her Broadway debut in The Parisian Woman (2017–2018).\n\nFor her performance in the made-for-HBO film Hysterical Blindness (2002), Thurman won the Golden Globe Award for Best Actress in a Television Film, and for her five-episode role in the NBC musical series Smash (2012), she received a Primetime Emmy Award nomination for Outstanding Guest Actress in a Drama Series. Thurman has starred in the miniseries The Slap (2015) and the series Imposters (2017–2018).\n\nDescription above from the Wikipedia article Uma Thurman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1970, 4, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000235", "Acting", "Uma Thurman", new List<string> { "우마 서먼", "Ума Турман", "乌玛·瑟曼", "Uma Karuna Thurman", "Ούμα Καρούνα Θέρμαν", "Ούμα Θέρμαν", "ユマ・サーマン", "鄔瑪·舒曼" }, "Boston, Massachusetts, USA", 54.640999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\g8Y2jm5FznG7lGV6vNg6wEq0KFF.jpg" },
                    { 151, "Roger Alexander Deakins, CBE, ASC, BSC (born May 24, 1949) is an English cinematographer. Often cited as one of the greatest and most influential cinematographers of all time, he is known for his work on the films of the Coen brothers, Sam Mendes, and Denis Villeneuve. He is the recipient of five BAFTA Awards for Best Cinematography, and two Academy Awards for Best Cinematography from sixteen nominations. His best-known works include The Shawshank Redemption (1994), Fargo (1996), O Brother, Where Art Thou? (2000), A Beautiful Mind (2001), Skyfall (2012), Sicario (2015), Blade Runner 2049 (2017), and 1917 (2019), the last two of which earned him Academy Awards.", new DateTime(1949, 5, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.rogerdeakins.com", "nm0005683", "Camera", "Roger Deakins", new List<string> { "Sir Roger Deakins", "Roger A. Deakins" }, "Torquay, Devon, England, UK", 8.718, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pSCN7CfILlfQrxX43Kgqrx5mBYQ.jpg" },
                    { 153, "Thomas Montgomery Newman (born October 20, 1955) is an American composer best known for his many film scores. In a career that has spanned over four decades, he has scored numerous classics including The Player, The Shawshank Redemption, Cinderella Man, American Beauty, The Green Mile, In the Bedroom, Angels in America, Finding Nemo, WALL-E, the James Bond films Skyfall, Spectre, and the war film 1917.\n\nNewman has been nominated for fifteen Academy Awards, tying him with fellow composer Alex North for the most nominations without a win. He has also been nominated for four Golden Globes, and has won two BAFTAs, six Grammys and an Emmy Award. Newman was honored with the Richard Kirk award at the 2000 BMI Film and TV Awards. The award is given annually to a composer who has made significant contributions to film and television music. His achievements have contributed to the Newmans being the most nominated Academy Award extended family, with a collective 92 nominations in various music categories.\n\nDescription above from the Wikipedia article Thomas Newman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1955, 10, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0002353", "Sound", "Thomas Newman", new List<string> { "Tom Newman" }, "Los Angeles, California, USA", 3.952, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\j8rIiOSdBjtDL5vji8m5BtChZou.jpg" },
                    { 154, "Walter Scott Murch (born July 12, 1943) is an American film editor, director, writer and sound designer. With a career stretching back to 1969, including work on THX 1138, Apocalypse Now, The Godfather I, II, and III, American Graffiti, The Conversation, and The English Patient, with three Academy Award wins (from nine nominations: six for picture editing and three for sound mixing), he has been referred to by Roger Ebert as \"the most respected film editor and sound designer in the modern cinema.\"", new DateTime(1943, 7, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0004555", "Editing", "Walter Murch", new List<string>(), "New York, New York, U.S.A.", 4.2969999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kQh7U7kRLF9NKEMpxiGjZEIu0o3.jpg" },
                    { 156, "Sally JoAnne Menke (December 17, 1953 – September 27, 2010) was an American television and film editor.\n\nShe had a long-time collaboration with director Quentin Tarantino, editing all of his films until her death. Menke was nominated for the Academy Award for Best Film Editing for Pulp Fiction and Inglourious Basterds, of which Variety's Todd McCarthy wrote, \"Sally Menke's editing reps the definition of precision.\"\n\nDescription above from the Wikipedia article Sally Menke, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1953, 12, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2010, 9, 27, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0579673", "Editing", "Sally Menke", new List<string> { "Sally Jo Menke" }, "Mineola, New York, USA", 4.5679999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ggD5FOF6kgCz2X9NQESmxJwCCWc.jpg" },
                    { 190, "Clinton \"Clint\" Eastwood Jr. (born May 31, 1930) is an American film actor, director, producer, composer and former politician. Following his breakthrough role on the TV series \"Rawhide\" (1959–65), Eastwood starred as the Man with No Name in Sergio Leone's Dollars Trilogy of spaghetti westerns (\"A Fistful of Dollars,\" \"For a Few Dollars More,\" and \"The Good, the Bad and the Ugly\") in the 1960s, and as San Francisco Police Department Inspector Harry Callahan in the Dirty Harry films (\"Dirty Harry,\" \"Magnum Force,\" \"The Enforcer,\" \"Sudden Impact,\" and \"The Dead Pool\") during the 1970s and 1980s. These roles, along with several others in which he plays tough-talking no-nonsense police officers, have made him an enduring cultural icon of masculinity.\n\nEastwood won Academy Awards for Best Director and Producer of the Best Picture, as well as receiving nominations for Best Actor, for his work in the films \"Unforgiven\" (1992) and \"Million Dollar Baby\" (2004). These films in particular, as well as others including \"Play Misty for Me\" (1971), \"The Outlaw Josey Wales\" (1976), \"Pale Rider\" (1985), \"In the Line of Fire\" (1993), \"The Bridges of Madison County\" (1995), and \"Gran Torino\" (2008), have all received commercial success and/or critical acclaim. Eastwood's only comedies have been \"Every Which Way but Loose\" (1978) and its sequel \"Any Which Way You Can\" (1980); despite being widely panned by critics they are the two highest-grossing films of his career after adjusting for inflation.\n\nEastwood has directed most of his own star vehicles, but he has also directed films in which he did not appear such as \"Mystic River\" (2003) and \"Letters from Iwo Jima\" (2006), for which he received Academy Award nominations and \"Changeling\" (2008), which received Golden Globe Award nominations. He has received considerable critical praise in France in particular, including for several of his films which were panned in the United States, and was awarded two of France's highest honors: in 1994 he received the Ordre des Arts et des Lettres medal and in 2007 was awarded the Légion d'honneur medal. In 2000 he was awarded the Italian Venice Film Festival Golden Lion for lifetime achievement.\n\nSince 1967 Eastwood has run his own production company, Malpaso, which has produced the vast majority of his films. He also served as the nonpartisan mayor of Carmel-by-the-Sea, California, from 1986 to 1988. Eastwood has seven children by five women, although he has only married twice. An audiophile, Eastwood is also associated with jazz and has composed and performed pieces in several films along with his eldest son, Kyle Eastwood.\n\nDescription above adapted from the Wikipedia article Clint Eastwood, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1930, 5, 31, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000142", "Acting", "Clint Eastwood", new List<string> { "كلينت إيستوود", "클린트 이스트우드", "クリント・イーストウッド", "克林·伊斯威特", "คลินต์ อีสต์วุด", "Clinton \"Clint\" Eastwood, Jr.", "Κλιντ Ίστγουντ", "Clinton Eastwood Jr.", "Clinton Eastwood", "克林特·伊斯特伍德" }, "San Francisco, California, USA", 69.203000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dU35NnjZ4aGw5abIJe3WXVf3Eey.jpg" },
                    { 192, "Morgan Freeman (born June 1, 1937) is an American actor, director, and narrator. Noted for his distinctive deep voice, Freeman is known for his various roles in a wide variety of film genres. Throughout his career spanning over five decades, he has received multiple accolades, including an Academy Award, a Screen Actors Guild Award, and a Golden Globe Award.\n\nBorn in Memphis, Tennessee, Freeman was raised in Mississippi where he began acting in school plays. He studied theatre arts in Los Angeles and appeared in stage productions in his early career. He rose to fame in the 1970s for his role in the children's television series The Electric Company. Freeman then appeared in the Shakespearean plays Coriolanus and Julius Caesar, the former of which earned him an Obie Award. His breakout role was in Street Smart (1987), playing a hustler, which earned him an Academy Award nomination for Best Supporting Actor. He achieved further stardom in Glory, the biographical drama Lean on Me, and comedy-drama Driving Miss Daisy (all 1989), the latter of which garnered him his first Academy Award nomination for Best Actor.\n\nIn 1992, Freeman starred alongside Clint Eastwood in the western revenge film Unforgiven; this would be the first of several collaborations with Eastwood. In 1994, he starred in the prison drama The Shawshank Redemption for which he received another Academy Award nomination. Freeman also starred in David Fincher's crime thriller Se7en (1995), and Steven Spielberg's historical drama Amistad (1997). Freeman won the Academy Award for Best Supporting Actor for his performance in Clint Eastwood's 2004 sports drama Million Dollar Baby. In 2009, he received his fifth Oscar nomination for playing former South African President Nelson Mandela in Eastwood's Invictus. Freeman is also known for his performance as Lucius Fox in Christopher Nolan's The Dark Knight Trilogy (2005–2012).\n\nIn addition to acting, Freeman has directed the drama Bopha! (1993). He also founded film production company Revelations Entertainment with business partner Lori McCreary. He is the recipient of the Kennedy Center Honor, the AFI Life Achievement Award, the Cecil B. DeMille Award, and the Screen Actors Guild Life Achievement Award. For his performances in theatrical productions, he has won three Obie Awards, one of the most prestigious honors for recognizing excellence in theatre.\n\nDescription above from the Wikipedia article Morgan Freeman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1937, 6, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000151", "Acting", "Morgan Freeman", new List<string> { "Morgan Porterfield Freeman Jr.", "Morgan J. Freeman", "مورغان فريمان", "모건 프리먼", "モーガン・フリーマン", "Морган Фриман", "Морган Фримен", "มอร์แกน ฟรีแมน", "摩根·弗里曼", "Μόργκαν Φρίμαν", "مورگان فریمن", "Морґан Фрімен", "Μόργκαν Πόρτερφιλντ Φρίμαν Τζούνιορ", "מורגן פרימן", "摩根·費里曼" }, "Memphis, Tennessee, USA", 95.087000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jPsLqiYGSofU4s6BjrxnefMfabb.jpg" },
                    { 282, "Charles \"Chuck\" Roven (born August 2, 1949) is an American film producer and the president and co-founder of Atlas Entertainment. He is known for producing the superhero films The Dark Knight Trilogy, Man of Steel, Batman v Superman: Dawn of Justice, Suicide Squad and more.\n\nHis film American Hustle was nominated for the Academy Award for Best Picture in 2014, as well as in 9 other categories. In January 2018, Roven received the David O. Selznick Achievement Award for his body of work from the Producers Guild of America. and he received a Golden Globe Award for Best Motion Picture - Drama for his producing in Oppenheimer, along with Emma Thomas and Christopher Nolan. He also received the Academy Award for Best Picture for Oppenheimer alongside Nolan and Thomas.", new DateTime(1949, 8, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0746273", "Production", "Charles Roven", new List<string> { "Chuck Roven", "Charles \"Chuck\" Roven" }, "Los Angeles, California, USA", 6.992, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4uJLoVstC1CBcArXFOe53N2fDr1.jpg" },
                    { 287, "William Bradley Pitt (born December 18, 1963) is an American actor and film producer. He is the recipient of various accolades, including an Academy Award, a British Academy Film Award, and two Golden Globe Awards for his acting, in addition to a second Academy Award, a second British Academy Film Award, a third Golden Globe Award, and a Primetime Emmy Award as a producer under his production company, Plan B Entertainment.\n\nPitt first gained recognition as a cowboy hitchhiker in the road film Thelma & Louise (1991). His first leading roles in big-budget productions came with the drama films A River Runs Through It (1992) and Legends of the Fall (1994), and the horror film Interview with the Vampire (1994). He gave critically acclaimed performances in the crime thriller Seven (1995) and the science fiction film 12 Monkeys (1995), the latter earning him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination.\n\nPitt starred in Fight Club (1999) and the heist film Ocean's Eleven (2001), as well as its sequels, Ocean's Twelve (2004) and Ocean's Thirteen (2007). His greatest commercial successes have been Ocean's Eleven (2001), Troy (2004), Mr. & Mrs. Smith (2005), World War Z (2013), and Once Upon a Time in Hollywood (2019), for which he won a second Golden Globe Award and the Academy Award for Best Supporting Actor. Pitt's other Academy Award nominated performances were in The Curious Case of Benjamin Button (2008) and Moneyball (2011). He produced The Departed (2006) and 12 Years a Slave (2013), both of which won the Academy Award for Best Picture, and also The Tree of Life (2011), Moneyball (2011) and The Big Short (2015), all of which were nominated for Best Picture. Pitt is the second actor to have won Academy Awards for both Best Supporting Actor and Best Picture.\n\nIn a court filing in Los Angeles, filed as part of a legal battle over a winery the prominent Hollywood actors once owned together, lawyers for Ms. Jolie stated that negotiations to sell her share of the business to Mr. Pitt had broken down over his demand that she sign “a nondisclosure agreement that would have contractually prohibited her from speaking outside of court about Pitt’s physical and emotional abuse of her and their children.”\n\nHer filing goes on to describe an extended physical and verbal outburst in September 2016 as Mr. Pitt, Ms. Jolie and their six children flew from France to California. “Pitt choked one of the children and struck another in the face” and “grabbed Jolie by the head and shook her,” the filing states, adding that at one point “he poured beer on Jolie; at another, he poured beer and red wine on the children.”", new DateTime(1963, 12, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000093", "Acting", "Brad Pitt", new List<string> { "布拉德·皮特", "布萊德·彼特", "布拉德•皮特饰" }, "Shawnee, Oklahoma, USA", 52.384999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9y83M7bHeqlG3JB93WhNakloEtq.jpg" },
                    { 373, "", null, null, 2, null, "nm0413466", "Sound", "Doug Jackson", new List<string> { "Douglas Jackson" }, null, 3.3719999999999999, null },
                    { 376, "Arnon Milchan (born 6 December 1944) is an Israeli businessman, film producer and spy. He has been involved in over 130 full-length motion pictures and is the founder of production company Regency Enterprises. Regency's film credits include 12 Years a Slave, JFK, Heat, Fight Club, and Mr. & Mrs. Smith. Milchan has earned two nominations for the Academy Award for Best Picture, for L.A. Confidential and The Revenant. Milchan was also an Israeli intelligence operative from the mid-1960s to the mid-1980s.\n\nDescription above from the Wikipedia article Arnon Milchan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1944, 12, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0586969", "Production", "Arnon Milchan", new List<string>(), "Rehovot, Israel", 7.149, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\b2hBExX4NnczNAnLuTBF4kmNhZm.jpg" },
                    { 380, "Robert Anthony De Niro (born August 17, 1943) is an American actor. Known for his collaborations with Martin Scorsese, he is considered to be one of the best actors of his generation. De Niro is the recipient of various accolades, including two Academy Awards, a Golden Globe Award, the Cecil B. DeMille Award, and a Screen Actors Guild Life Achievement Award. In 2009, De Niro received the Kennedy Center Honor, and earned a Presidential Medal of Freedom from U.S. President Barack Obama in 2016.\n\nDe Niro studied acting at HB Studio, Stella Adler Conservatory, and Lee Strasberg's Actors Studio. His first collaboration with Scorsese was with the 1973 film Mean Streets. De Niro earned two Academy Awards, one for Best Supporting Actor for his role as Vito Corleone in Francis Ford Coppola's The Godfather Part II (1974) and the other for Best Actor portraying Jake LaMotta in Scorsese's drama Raging Bull (1980). His other Oscar-nominated roles were for Taxi Driver (1976), The Deer Hunter (1978), Awakenings (1990), Cape Fear (1991), and Silver Linings Playbook (2012).\n\nOther notable roles include in 1900 (1976), The King of Comedy (1982), Once Upon a Time in America (1984), Brazil (1985), The Mission (1986), Goodfellas (1990), This Boy's Life (1993), Mary Shelley’s Frankenstein (1994), Heat (1995), Casino (1995), Jackie Brown (1997), The Good Shepherd (2006), Joker (2019), and The Irishman (2019). He made his directorial film debut with A Bronx Tale (1993). His comedic roles include Midnight Run (1988), Wag the Dog (1997), Analyze This (1999), the Meet the Parents films (2000-2010), and The Intern (2015).\n\nAlso known for his television roles, De Niro portrayed Bernie Madoff in the HBO film The Wizard of Lies (2017), earning a Primetime Emmy Award for Outstanding Lead Actor in a Limited Series or Movie nomination. He received further Emmy Award nominations for producing the Netflix limited series When They See Us (2019), and for portraying Robert Mueller on Saturday Night Live.[1]\n\nDe Niro and producer Jane Rosenthal founded the film and television production company TriBeCa Productions in 1989, which has produced several films alongside his own. Also with Rosenthal, he founded the Tribeca Film Festival in 2002. Six of De Niro's films have been inducted into the United States National Film Registry by the Library of Congress as \"culturally, historically, or aesthetically significant\".", new DateTime(1943, 8, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000134", "Acting", "Robert De Niro", new List<string> { "Robert DeNiro", " Robert Anthony De Niro Jr. ", "Bobby DeNiro ", "Роберт Де Ниро", "روبرت دي نيرو", "ロバート・デ・ニーロ", "罗伯特·德尼罗", "รอเบิร์ต เดอ นิโร", "로버트 드 니로", "Ρόμπερτ Ντε Νίρο", "Ρόμπερτ Μάριο Ντε Νίρο", "رابرت دنیرو", "De Niro, Robert", "רוברט דה נירו", "Роберт Де Ніро", "勞勃·狄尼洛" }, "Greenwich Village, New York City, New York, USA", 48.484000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cT8htcckIuyI1Lqwt1CvD02ynTh.jpg" },
                    { 457, "Albert Stotland Ruddy (born March 28, 1930) is a Canadian-American film and television producer. He is known for producing The Godfather (1972) and Million Dollar Baby (2004), both of which won him the Academy Award for Best Picture, as well as co-creating the CBS sitcom Hogan's Heroes (1965–1971).", new DateTime(1930, 3, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0748665", "Production", "Albert S. Ruddy", new List<string> { "Al Ruddy " }, "Montreal, Quebec, Canada", 10.714, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jSkLkR79OmqYHg0kx4WWXI1TYPP.jpg" },
                    { 488, "Steven Allan Spielberg (born December 18, 1946) is an American film director, writer and producer. A major figure of the New Hollywood era and pioneer of the modern blockbuster, he is the most commercially successful director of all time. Spielberg is the recipient of various accolades, including three Academy Awards, a Kennedy Center honor, four Directors Guild of America Awards, two BAFTA Awards, a Cecil B. DeMille Award and an AFI Life Achievement Award. Seven of his films have been inducted into the National Film Registry by the Library of Congress as \"culturally, historically or aesthetically significant\".\n\nSpielberg was born in Cincinnati, Ohio, and grew up in Phoenix, Arizona. He moved to California and studied film in college. After directing several episodes for television including Night Gallery and Columbo, he directed the television film Duel (1971) which gained acclaim from critics and audiences. He made his directorial film debut with The Sugarland Express (1974), and became a household name with the 1975 summer blockbuster Jaws. He then directed huge box office successes Close Encounters of the Third Kind (1977), E.T. the Extra-Terrestrial (1982) and the Indiana Jones original trilogy (1981-89). Spielberg subsequently explored drama in the acclaimed The Color Purple (1985) and Empire of the Sun (1987).\n\nAfter a brief hiatus, Spielberg directed the science fiction thriller Jurassic Park (1993), the highest-grossing film ever at the time, and the Holocaust drama Schindler's List (1993), which has often been listed as one of the greatest films ever made. He won the Academy Award for Best Director for the latter and for the 1998 World War II epic Saving Private Ryan. Spielberg continued in the 2000s with science fiction films A.I. Artificial Intelligence (2001), Minority Report (2002) and War of the Worlds (2005). He also directed the adventure films The Adventures of Tintin (2011) and Ready Player One (2018); the historical dramas Amistad (1997), Munich (2005), War Horse (2011), Lincoln (2012), Bridge of Spies (2015) and The Post (2017); the musical West Side Story (2021); and the semi-autobiographical drama The Fabelmans (2022). He has been a producer on several successful films, including Poltergeist (1982), Gremlins (1984), Back to the Future (1985) and Who Framed Roger Rabbit (1988) as well as the miniseries Band of Brothers (2001).\n\nSpielberg co-founded Amblin Entertainment and DreamWorks, and has served as a producer for many successful films and television series. He is also known for his long collaboration with the composer John Williams, with whom he has worked for all but five of his feature films. Several of Spielberg's works are among the highest-grossing and greatest films all time. Premiere ranked him first place in the list of 100 Most Powerful People in Movies in 2003. In 2013, Time listed him as one of the 100 most influential people.", new DateTime(1946, 12, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://amblin.com/", "nm0000229", "Directing", "Steven Spielberg", new List<string> { "斯蒂芬·斯皮尔伯格", "สตีเวน สปีลเบิร์ก", "スティーヴン・スピルバーグ", "스티븐 스필버그", "ستيفن سبيلبرغ", "Стивен Спилберг", "Stīvens Spīlbergs", "סטיבן שפילברג", "स्टीवन स्पिलबर्ग", "Стевен Спиелберг", "Stevenas Spielbergas", "Στίβεν Σπίλμπεργκ", "اسٹیون اسپیلبرگ", "స్టీవెన్ స్పీల్బర్గ్", "ಸ್ಟೀವನ್ ಸ್ಪೀಲ್ಬರ್ಗ್", "ஸ்டீவன் ஸ்பில்பேர்க்", "ስቲቨን ስፒልበርግ", "Սթիվեն Սփիլբերգ", "স্টিভেন স্পিলবার্গ", "ស្តេវិនស្ពៀលប៊ឺក", "Стівен Спілберґ", "斯蒂文·斯皮尔伯格", "სტივენ სპილბერგი", "סטיבן ספילברג", "Steven Allan Spielberg" }, "Cincinnati, Ohio, USA", 38.015000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tZxcg19YQ3e8fJ0pOs7hjlnmmr6.jpg" },
                    { 489, "Kathleen Kennedy (born June 5, 1953) is an American film producer and current president of Lucasfilm. In 1981, she co-founded the production company Amblin Entertainment with Steven Spielberg and husband Frank Marshall.\n\nHer first film as a producer was E.T. the Extra-Terrestrial (1982). She subsequently produced the Jurassic Park franchise, the first two of which became two of the top ten highest-grossing films of the 1990s. In 1992, she co-founded The Kennedy/Marshall Company with her husband Frank Marshall. On October 30, 2012, she became the president of Lucasfilm after The Walt Disney Company acquired the company for over $4 billion. She received the Irving G. Thalberg Award from the Academy of Motion Picture Arts and Sciences in 2018.\n\nOverall, Kennedy participated in the making of 60 films, mostly as executive producer, that garnered 8 Academy Award nominations and over $11 billion worldwide, including three of the highest-grossing films in motion picture history. Kennedy is second only to Spielberg in domestic box office receipts, with over $7 billion as of January 2018.", new DateTime(1953, 6, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "https://www.lucasfilm.com/leadership/kathleen-kennedy", "nm0005086", "Production", "Kathleen Kennedy", new List<string> { "Кэтлин Кеннеди" }, "Berkeley, California, USA", 9.234, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ndgYlie0PHkyqEiEBGM8SqrPOkr.jpg" },
                    { 491, "John Towner Williams (born February 8, 1932) is an American composer, conductor, and pianist. Widely regarded as one of the greatest American composers of all time, he has composed some of the most popular, recognizable, and critically acclaimed film scores in cinematic history in a career spanning over six decades. Williams has won 24 Grammy Awards, seven British Academy Film Awards, five Academy Awards, and four Golden Globe Awards. With 51 Academy Award nominations, he is the second most-nominated individual, after Walt Disney. In 2005, the American Film Institute selected Williams's score to 1977's Star Wars as the greatest American film score of all time. The soundtrack to Star Wars was additionally preserved by the Library of Congress into the National Recording Registry for being \"culturally, historically, or aesthetically significant\".\n\nWilliams has composed for many critically acclaimed and popular movies, including the Star Wars series, Jaws, Close Encounters of the Third Kind, Superman, E.T. the Extra-Terrestrial, the Indiana Jones series, the first two Home Alone films, Hook, the first two Jurassic Park films, Schindler's List, and the first three Harry Potter films. He has been associated with director Steven Spielberg since 1974, composing music for all but four of his feature films––Duel, The Color Purple, Bridge of Spies and Ready Player One. Other works by Williams include theme music for the 1984 Summer Olympic Games, NBC Sunday Night Football, \"The Mission\" theme used by NBC News and Seven News in Australia, the television series Lost in Space and Land of the Giants, and the incidental music for the first season of Gilligan's Island.\n\nWilliams has also composed numerous classical concertos and other works for orchestral ensembles and solo instruments. He served as the Boston Pops's principal conductor from 1980 to 1993, and is its laureate conductor. He was inducted into the Hollywood Bowl's Hall of Fame in 2000, and was a recipient of the Kennedy Center Honors in 2004 and the AFI Life Achievement Award in 2016. Williams composed the score for eight of the top 20 highest-grossing films at the U.S. box office (adjusted for inflation).", new DateTime(1932, 2, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.johnwilliams.org", "nm0002354", "Sound", "John Williams", new List<string> { "John Towner Williams", "Johnny Williams" }, "Queens, New York, USA", 15.648999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\KFyMqUWeiBdP9tJcZyGWOqnrgK.jpg" },
                    { 492, "Janusz Zygmunt Kamiński is a Polish cinematographer and director of film and television. He has established a partnership with Steven Spielberg, working as a cinematographer on his films since 1993.", new DateTime(1959, 6, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001405", "Camera", "Janusz Kamiński", new List<string> { " Janesz Kaminsky ", "Jennifer Stoltz ", "Janusz Kaminski", "Janusz Zygmunt Kamiński", "야누즈 카민스키" }, "Ziebice, Dolnoslaskie, Poland", 6.1289999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5yURZbwMmhiXXlvDmRdz4V14Ufs.jpg" },
                    { 493, "Michael Kahn is an American film editor. His credits range from TV's Hogan's Heroes to feature films directed by George C. Scott and Steven Spielberg, with whom he has had an extended, notable collaboration for over 40 years.  Born: December 8, 1935", new DateTime(1935, 12, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0434883", "Editing", "Michael Kahn", new List<string>(), "New York City, New York, USA", 7.3540000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jb4Y9q1q91VRQJue0VXhU7VcXce.jpg" },
                    { 496, "Rick Carter is an American production designer and art director. He is known for his work in the film Forrest Gump, which earned him an Oscar nomination, as well as numerous nominations of other awards for his work in Amistad and A.I.", null, null, 2, null, "nm0141437", "Art", "Rick Carter", new List<string> { "Richard Carter Jr.", "Richard Carter" }, "Los Angeles, California, USA", 8.7469999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5QlzL72Du5zVs1E27pQ0OlFLImI.jpg" },
                    { 498, "", null, null, 1, null, "nm0426693", "Costume & Make-Up", "Joanna Johnston", new List<string>(), null, 5.6470000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xuCe7ZgtqOCaY6MUvXpG7buckXO.jpg" },
                    { 502, "Miranda Otto (born December 16, 1967) is an Australian actress. The daughter of actors Lindsay and Barry Otto and the sister of actress Gracie Otto, she began acting at age eighteen, and has performed in a variety of independent and major studio films.\n\nHer first major film appearance was in the 1986 film Emma's War, in which she played a teenager who moves to Australia's bush country during World War II. In 1996, director Shirley Barrett cast Otto as a shy waitress in the film Love Serenade. She starred in the 1997 films Doing Time for Patsy Cline and The Well, for which earned her third Australian Film Institute nomination.  Her next project was the romantic comedy Dead Letter Office (1998). The film was Otto's first with her father, Barry, who makes a brief appearance. Later that year, she starred in the film In the Winter Dark, directed by James Bogle, for which she was nominated for her fourth Australian Film Institute Award.\n\nAfter a decade of critically acclaimed roles in Australian films, she gained Hollywood's attention after appearing in supporting roles in The Thin Red Line (1998) and What Lies Beneath (2000). In 2001, she was cast as a naturalist in the comedy Human Nature and appeared in the BBC adaptation of Anthony Trollope's The Way We Live Now, as a strong-willed American Southerner.  Her breakthrough role came in 2002, when she portrayed Éowyn in The Lord of the Rings trilogy. Her character was introduced in the trilogy's second film The Lord of the Rings: The Two Towers in 2002 and appeared in the third film, The Lord of the Rings: The Return of the King, the following year. Her performance earned her an Academy of Science Fiction, Fantasy & Horror Films nomination for Best Supporting Actress.\n\nDirector Steven Spielberg, impressed by Otto's performance in The Lord of the Rings, called her to ask if she would play opposite Tom Cruise in the big-budget science fiction film War of the Worlds (2005). Otto, pregnant at the time, believed she would have to turn down the role, but the script was reworked to accommodate her.\n\nHer next project was playing the lead in the Australian film Danny Deckchair (2003). She then took on the Australian television miniseries Through My Eyes: The Lindy Chamberlain Story (2004). At the 2005 Logie Awards, Otto won Most Outstanding Actress in a Drama Series for her role.\n\nIn 2007, Otto starred as Cricket Stewart, the wife of a successful director, in the television miniseries The Starter Wife. She had a starring role in the 2008 American television series Cashmere Mafia, and Australian films such as In Her Skin and Blessed (2009). She starred opposite Stephanie Sigman and Anthony LaPaglia in the horror prequel Annabelle: Creation. She portrayed Zelda Spellman in Netflix's Chilling Adventures of Sabrina (2018-2020).\n\nShe made her theatrical debut in the 1986 production of The Bitter Tears of Petra Von Kant for the Sydney Theatre Company.[28] Three more theatrical productions for the Sydney Theatre Company followed in the late 1980s and early 1990s. In 2002, she returned to the stage playing Nora Helmer in A Doll's House opposite her future husband Peter O'Brien. Otto's performance earned her a 2003 Helpmann Award nomination and the MO Award for \"Best Female Actor in a Play\". Her next stage role was in the psychological thriller Boy Gets Girl (2005).", new DateTime(1967, 12, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001584", "Acting", "Miranda Otto", new List<string> { "Μιράντα Ότο", "	Miranda Lin Otto" }, "Brisbane, Queensland, Australia", 21.542000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lVkzCNNGwesZjOmwrDjro6ZPar.jpg" },
                    { 504, "Timothy Francis Robbins (born October 16, 1958) is an American actor, screenwriter, director, producer, and musician. He is best known for his portrayal of Andy Dufresne in the prison drama film The Shawshank Redemption (1994).", new DateTime(1958, 10, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://timrobbins.net/", "nm0000209", "Acting", "Tim Robbins", new List<string> { "提姆·羅賓斯" }, "West Covina, California, USA", 24.027999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\djLVFETFTvPyVUdrd7aLVykobof.jpg" },
                    { 518, "Danny DeVito (born November 17, 1944) is an American actor, comedian, director, and producer. He first gained prominence for his portrayal of Louie De Palma on Taxi, for which he won a Golden Globe and an Emmy.\n\nDeVito founded the production company Jersey Films with his wife Rhea Perlman.", new DateTime(1944, 11, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000362", "Acting", "Danny DeVito", new List<string> { "Daniel Michael DeVito Jr.", "Danny De Vito", "Ντάνι Ντε Βίτο", "Денні ДеВіто", "Daniel Michael DeVito", "Дани де Вито" }, "Asbury Park, New Jersey, USA", 30.984999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gNHF2SNXFFCRqwIQ2Xv6r6aV6UD.jpg" },
                    { 525, "Christopher Edward Nolan, CBE (born 30 July 1970) is a British-American film director, screenwriter, and producer. He was born in Westminster, London, England and holds both British and American citizenship due to his American mother. He is known for writing and directing critically acclaimed films such as Memento (2000), The Prestige (2006), The Dark Knight Trilogy (2005-12), Inception (2010), Interstellar (2014) and Dunkirk (2017). Nolan is the founder of the production company Syncopy Films. He often collaborates with his wife, producer Emma Thomas, and his brother, screenwriter Jonathan Nolan.", new DateTime(1970, 7, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0634240", "Directing", "Christopher Nolan", new List<string> { "Кристофер Нолан", "Крістофер Нолан", "克里斯托弗·诺兰", "คริสโตเฟอร์ โนแลน", "クリストファー・ノーラン", "كريستوفر نولان", "크리스토퍼 놀란", "Κρίστοφερ Νόλαν", "Christopher Edward Nolan", "כריסטופר נולאן", "Chris Nolan", "Sir Christopher Nolan", "Christorawr" }, "Westminster, London, England, UK", 54.859999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xuAIuYSmsUzKlUMBFGVZaWsY3DZ.jpg" },
                    { 527, "Jonathan Nolan (born 6 June 1976) is a British-American screenwriter, television producer, director, and author. He is the creator of the CBS science fiction series Person of Interest (2011–2016) and co-creator of the HBO science fiction western series Westworld (2016–present).\n\nNolan has collaborated on several films with his brother, director Christopher Nolan, who adapted Jonathan's short story \"Memento Mori\" into the neo-noir thriller film Memento (2000). Together, the siblings co-wrote the mystery thriller film The Prestige (2006), the superhero films The Dark Knight (2008) and The Dark Knight Rises (2012), and the science fiction film Interstellar (2014).\n\nNolan was nominated for the Academy Award for Best Original Screenplay for Memento, and for the Primetime Emmy Award for Outstanding Writing for a Drama Series and Outstanding Directing for a Drama Series for Westworld, among a number of other awards.", new DateTime(1976, 6, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0634300", "Writing", "Jonathan Nolan", new List<string> { "조너선 놀란", "조나단 놀란", "乔纳森 诺兰", "جوناثان نولان", "ჯონათან ნოლანი", "乔纳森·诺兰", "조너선 놀런", "強納森諾蘭" }, "London, England, UK", 9.3350000000000009, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qd8d381vz2skpreY1BfVuSfLJts.jpg" },
                    { 535, "", null, null, 2, null, "nm0270383", "Acting", "Russ Fega", new List<string> { "Расс Фега", "Russ Figa", "拉什·費加" }, null, 4.8300000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d0W7kq97Ul8Iz5LZIVNDKxSly8M.jpg" },
                    { 555, "", null, null, 1, null, "nm0354101", "Art", "Nancy Haigh", new List<string>(), null, 4.8710000000000004, null },
                    { 556, "Emma Thomas Nolan (born 9 December 1971) is a British film producer. She earned recognition for producing all of the feature films directed by her husband Christopher Nolan, which have grossed more than $6 billion worldwide and have been regarded as some of the greatest films of their respective decades. The recipient of various accolades, Thomas is the first British woman to win the Academy Award for Best Picture, which she received for her work on the biographical thriller Oppenheimer (2023). She co-founded and runs the production company Syncopy Inc. with Nolan.", new DateTime(1971, 12, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0858799", "Production", "Emma Thomas", new List<string> { "Emma Thomas Nolan", "Dame Emma Thomas Nolan" }, "London, England, UK", 9.7550000000000008, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\utc1PS6WVWR5tknzTJqXtnD0kBp.jpg" },
                    { 559, "Walter C. Pfister (born July 8, 1961) is an American director and former cinematographer, who is best known for his work with filmmaker Christopher Nolan. Some of his collaborations with Nolan include Memento (2000), The Dark Knight Trilogy (2005–2012), and Inception (2010). For his work on Inception, Pfister won an Academy Award for Best Cinematography and received a BAFTA Award nomination.\n\nDescription above from the Wikipedia article Wally Pfister, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1961, 7, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0002892", "Camera", "Wally Pfister", new List<string> { "Walter Pfister" }, "Chicago, Illinois, USA", 5.8460000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uyWeYsERTTLjpjkE79QeSETLIoA.jpg" },
                    { 561, "John Papsidera is an American casting director for film and television productions.", null, null, 2, "http://www.automaticsweat.com", "nm0660667", "Production", "John Papsidera", new List<string>(), null, 5.3680000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\egwEVyrAmdWhtuLqE5fcThZf41E.jpg" },
