                    { 598, "Mike Fenton was born in 1935 in Los Angeles, California, USA as Ronald Michael Fenton. He was a casting director and producer.", null, new DateTime(2020, 12, 30, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0272067", "Production", "Mike Fenton", new List<string> { "Ronald Michael Fenton", "Michael Fenton", "Roos-Fenton" }, "Los Angeles, California, USA", 5.3440000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oIKCBb2w47iZps9neDo2GY29g1y.jpg" },
                    { 605, "Michael Kaplan is an American costume designer for film. Born in Philadelphia, Pennsylvania, Kaplan has been working in the Hollywood film industry since the 1978 film Thank God It's Friday.", null, null, 2, null, "nm0438325", "Costume & Make-Up", "Michael Kaplan", new List<string>(), "Philadelphia, Pennsylvania, USA", 6.2569999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bNarnI5K4XYIKaHsX6HAitllyQr.jpg" },
                    { 608, "Hayao Miyazaki (Miyazaki Hayao, born January 5, 1941) is a Japanese manga artist and prominent film director and animator of many popular anime feature films. Through a career that has spanned nearly five decades, Miyazaki has attained international acclaim as a maker of animated feature films and, along with Isao Takahata, co-founded Studio Ghibli, an animation studio and production company. The success of Miyazaki's films has invited comparisons with American animator Walt Disney, British animator Nick Park as well as Robert Zemeckis, who pioneered Motion Capture animation, and he has been named one of the most influential people by Time Magazine.\n\nMiyazaki began his career at Toei Animation as an in-between artist for Gulliver's Travels Beyond the Moon where he pitched his own ideas that eventually became the movie's ending. He continued to work in various roles in the animation industry over the decade until he was able to direct his first feature film Lupin III: The Castle of Cagliostro which was published in 1979. After the success of his next film, Nausicaä of the Valley of the Wind, he co-founded Studio Ghibli where he continued to produce many feature films until Princess Mononoke whereafter he temporarily retired.\n\nWhile Miyazaki's films have long enjoyed both commercial and critical success in Japan, he remained largely unknown to the West until Miramax released his 1997 film, Princess Mononoke. Princess Mononoke was the highest-grossing film in Japan—until it was eclipsed by another 1997 film, Titanic—and the first animated film to win Picture of the Year at the Japanese Academy Awards. Miyazaki returned to animation with Spirited Away. The film topped Titanic's sales at the Japanese box office, also won Picture of the Year at the Japanese Academy Awards and was the first anime film to win an American Academy Award.\n\nMiyazaki's films often incorporate recurrent themes, such as humanity's relationship to nature and technology, and the difficulty of maintaining a pacifist ethic. Reflecting Miyazaki's feminism, the protagonists of his films are often strong, independent girls or young women. Miyazaki is a vocal critic of capitalism and globalization. While two of his films, The Castle of Cagliostro and Castle in the Sky, involve traditional villains, his other films such as Nausicaa or Princess Mononoke present morally ambiguous antagonists with redeeming qualities.", new DateTime(1941, 1, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.ghibli.jp/", "nm0594503", "Directing", "Hayao Miyazaki", new List<string> { "Сабуро Акицу", "宮崎 駿", "Хаяо Миядзаки", "秋津 三朗", "Akitsu Saburo", "هاياو ميازاكي", "ฮะยะโอะ มิยะซะกิ", "미야자키 하야오", "宫崎骏", "हयाओ मियाज़ाकी", "Hayao Miyazaki", "宮﨑駿" }, "Tokyo, Japan", 26.719999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mG3cfxtA5jqDc7fpKgyzZMKoXDh.jpg" },
                    { 628, "Isao Takahata (October 29, 1935 - April 5, 2018), co-founder of Studio Ghibli, was one of the most famous directors of Japanese animated films. Unlike most anime directors, he did not draw and never worked as an animator before becoming a director.\n\nFor the first two decades of his career from the 1960s to the 1980s, Takahata worked primarily as director for anime television. In 1985 he and his long-time collaborative partner Hayao Miyazaki formed Studio Ghibli with Toshio Suzuki and Yasuyoshi Tokuma. From that point, his career transitioned into producing, directing, and writing films for Studio Ghibli. He is known for his five feature length anime films released under Ghibli, Grave of the Fireflies (1988), Only Yesterday (1991), Pom Poko (1994), My Neighbors the Yamadas (1999) and The Tale of the Princess Kaguya (2013).", new DateTime(1935, 10, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 4, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0847223", "Directing", "Isao Takahata", new List<string> { "Такахата Исао", "高畑勲", "たかはた いさお", "Paku-san", "타카하타 이사오", "高畑勋", "高畑勳" }, "Ujiyamada, Mie prefecture, Japan", 13.378, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xTkZOWe1VU4xNba1lO0T9trFLHm.jpg" },
                    { 636, "Mamoru Fujisawa (藤澤 守, Fujisawa Mamoru, born December 6, 1950), known professionally as Joe Hisaishi (久石 譲, Hisaishi Jō), is a Japanese composer, musical director, conductor and pianist, known for over 100 film scores and solo albums dating back to 1981. Hisaishi's music has been known to explore and incorporate different genres, including minimalist, experimental electronic, Western classical, and Japanese classical. He has also worked as a music engraver and arranger. He has been associated with director and animator Hayao Miyazaki since 1984, having written scores for all but one of Miyazaki's films.", new DateTime(1950, 12, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://joehisaishi.com/", "nm0386749", "Sound", "Joe Hisaishi", new List<string> { "藤澤 守", "Хисаиси Дзё", "Mamoru Fujisawa", "Фудзисава Мамору", "Jō Hisaishi", "久石讓", "히사이시 조", "久石穣", "久石譲" }, "Nagano, Japan", 7.1260000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dVxq90QHGMKBI3RpZYJlBVM59Nt.jpg" },
                    { 655, "John Rhys-Davies (born 5 May 1944) is a Welsh actor and vocal artist. He is perhaps best known for playing the charismatic Arab excavator Sallah in the Indiana Jones films and the dwarf Gimli in The Lord of the Rings trilogy, in which he also voiced the ent, Treebeard. He also played Agent Michael Malone in the 1993 remake of the 1950s television series The Untouchables, Professor Maximillian Arturo in Sliders, King Richard I in Robin of Sherwood, General Leonid Pushkin in the James Bond film The Living Daylights, and Macro in I, Claudius. Additionally, he provided the voices of Cassim in Disney's Aladdin and the King of Thieves, Man Ray in SpongeBob SquarePants, and Tobias in the computer game Freelancer. He is also the narrator for the TV show Wildboyz.\n\nDescription above from the Wikipedia article John Rhys-Davies, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1944, 5, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://johnsonlaird.com/our-actors/John-Rhys-Davies", "nm0722636", "Acting", "John Rhys-Davies", new List<string> { "John Rhys Davies", "Jonathan Rhys-Davies", "John Rhys-Davis", "Джон Рис-Дэвис" }, "Ammanford, Wales, UK", 24.202000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bfn4WvhGo2QKYtv5ynk7tKu7NnL.jpg" },
                    { 691, "From Wikipedia, the free encyclopedia.\n\nAmrish Lal Puri (June 22, 1932 - January 12, 2005) was an iconic theater and film actor from India, who was a key player in the Indian theater movement that picked up steam in the 1960s. He worked with notable playwrights of the time, such as Satyadev Dubey and Girish Karnad. However, he is primarily remembered for essaying some iconic negative roles in Hindi cinema. He is most remembered for his role as Mogambo in the Hindi film Mr India (1987). As Mola Ram in the Hollywood film Indiana Jones and the Temple of Doom (1984), he crossed over to international cinema as well.\n\nDescription above from the Wikipedia article Amrish Puri, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1932, 6, 22, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2005, 1, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0700869", "Acting", "Amrish Puri", new List<string> { "Amrish Lal Singh Puri", "Amrish Lal Puri", "Amrish Singh Puri", "Mogambo", "Mola Ram", "अमरीश पुरी" }, "Jalandhar, Punjab, India", 27.379999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uhMGFS7tuG71LDv2wk9LfZZ4EG6.jpg" },
                    { 794, "", null, null, 2, null, "nm0333908", "Art", "Angelo P. Graham", new List<string>(), null, 2.411, null },
                    { 819, "Edward Harrison Norton (born August 18, 1969) is an American actor and filmmaker. He has received numerous awards and nominations, including a Golden Globe Award and three Academy Award nominations.\n\nBorn in Boston, Massachusetts and raised in Columbia, Maryland, Norton was drawn to theatrical productions at local venues as a child. After graduating from Yale College in 1991, he worked for a few months in Japan before moving to New York City to pursue an acting career. He gained immediate recognition and critical acclaim for his debut in Primal Fear (1996), which earned him a Golden Globe for Best Supporting Actor and an Academy Award nomination in the same category. His role as a reformed neo-Nazi in American History X (1998) earned him an Academy Award nomination for Best Actor. He also starred in the film Fight Club (1999), which garnered a cult following.\n\nNorton emerged as a filmmaker in the 2000s. He established the production company Class 5 Films in 2003, and was director or producer of the films Keeping the Faith (2000), Down in the Valley (2005), and The Painted Veil (2006). He continued to receive critical acclaim for his acting roles in films such as The Score (2001), 25th Hour (2002), The Illusionist (2006), Moonrise Kingdom (2012), and The Grand Budapest Hotel (2014). His biggest commercial successes have been Red Dragon (2002), Kingdom of Heaven (2005), The Incredible Hulk (2008), and The Bourne Legacy (2012). For his role in the black comedy Birdman (2014), Norton earned another Academy Award nomination for Best Supporting Actor.", new DateTime(1969, 8, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001570", "Acting", "Edward Norton", new List<string> { " Edward Harrison ", "Ed Norton", "爱德华·诺顿", "เอ็ดเวิร์ด นอร์ตัน", "Эдвард Нортон", "エドワード・ノートン", "إدوارد نورتون", "에드워드 노튼", "Έντουαρντ Νόρτον", "Edward Harrison Norton", "אדוארד נורטון", "ادوارد نورتون", "艾德華·諾頓" }, "Boston, Massachusetts, USA", 31.486000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5XBzD5WuTyVQZeS4VI25z2moMeY.jpg" },
                    { 882, "Liv Rundgren Tyler (born Liv Rundgren, July 1, 1977) is an American actress, producer, singer and former model. She is best known for her portrayal of Arwen Undómiel in the Lord of the Rings film trilogy (2001–2003). Tyler began a career in modeling at age 14. She later decided to focus on acting and made her film debut in Silent Fall (1994); she went on to achieve critical recognition with starring roles in Heavy and Empire Records (both 1995), as well as That Thing You Do! and Stealing Beauty (both 1996). She then appeared in films such as Inventing the Abbotts (1997), Armageddon (1998), Cookie's Fortune and Onegin (both 1999), Dr. T & the Women (2000), and One Night at McCool's (2001).\n\nFollowing the success of Lord of the Rings, Tyler has appeared in a variety of roles, including the films Jersey Girl (2004), Lonesome Jim (2005), Reign Over Me (2007), The Strangers, The Incredible Hulk (both 2008), Super (2010), Space Station 76 (2014), Wildling (2018), and Ad Astra (2019). Outside of film, she starred in the HBO supernatural drama series The Leftovers (2014–2017), the BBC period drama series Gunpowder (2017), the ITV/Hulu period drama series Harlots (2018–2019) and the Fox procedural drama series 9-1-1: Lone Star (2020).\n\nTyler is also a singer. Having sung with composer Howard Shore, she appeared as guest vocalist on The Lemonheads' album Varshons (2009) singing a cover of the Leonard Cohen song \"Hey, That's No Way to Say Goodbye\". She appeared on the 2017 bonus disk of Evan Dando's album Baby I'm Bored (2003) providing featured vocals for the song \"Shots Is Fired\". In 2011, Tyler released her debut single, \"Need You Tonight\".\n\nTyler has served as a UNICEF Goodwill Ambassador for the United States since 2003, and as a spokesperson for Givenchy's line of perfume and cosmetics. She is the daughter of Steven Tyler and Bebe Buell, although she has a very close relationship with her adoptive father Todd Rundgren.", new DateTime(1977, 7, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000239", "Acting", "Liv Tyler", new List<string> { "Liv Rundgren", "丽芙·泰勒", "Лив Тайлер", "Liv Rundgren Tyler", "Λιβ Τάιλερ", "리브 타일러", "リヴ・タイラー", "リヴ・ラングレン・タイラー" }, "New York City, New York, USA", 65.980999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eQnuADVICaY40nl2ZseYvfkGQCc.jpg" },
                    { 884, "An American actor, writer and director. He was born in Brooklyn, New York, the son of Dorothy, who worked as a hostess at Howard Johnson's, and John Buscemi, a sanitation worker and Korean War veteran. Buscemi's father was Sicilian American and his mother Irish American. He has three brothers: Jon, Ken, and Michael. Buscemi was raised Roman Catholic.\n\nBuscemi has starred and supported in successful Hollywood and indie films, including Parting Glances (1986), New York Stories (1989), Mystery Train (1989), Reservoir Dogs (1992), Pulp Fiction (1994), Desperado (1995), Con Air (1997), Armageddon (1998), The Grey Zone (2001), Ghost World (2001), Big Fish (2003), Lean on Pete (2017), and The Death of Stalin (2017). He is also known for his appearances in many films by Coen brothers: Miller's Crossing (1990), Barton Fink (1991), The Hudsucker Proxy (1994), Fargo (1996), and The Big Lebowski (1998). Buscemi provides the voice of Randall Boggs in the Monsters, Inc. franchise.\n\nFrom 2010 to 2014, he portrayed Enoch \"Nucky\" Thompson in the critically acclaimed series Boardwalk Empire, which earned him two Screen Actors Guild Awards, a Golden Globe, and two nominations for an Emmy Award. He made his directorial debut in 1996, with Trees Lounge, in which he also starred. Other works include Animal Factory (2000), Lonesome Jim (2005), and Interview (2007).\n\nBuscemi has one son, Lucian, with his wife Jo Andres.", new DateTime(1957, 12, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000114", "Acting", "Steve Buscemi", new List<string> { "史蒂夫·布西密", "ستيف بوشيمي", "스티브 부세미", "スティーヴ・ブシェミ", "Стив Бушеми", "สตีฟ บูเซมี", "Steven Vincent Buscemi", "史蒂夫·布希密" }, "New York City, New York, USA", 31.27, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lQKdHMxfYcCBOvwRKBAxPZVNtkg.jpg" },
                    { 886, "William Edward Fichtner (born November 27, 1956) is an American actor. He has appeared in a number of notable film and TV series. His best known movie roles are as Dellrayne in Hypnotic, Colonel Mulholland in 12 Strong, Mike in The Neighbor, General Adams in Independence Day: Resurgence, Eric Sacks in the live action remake of Teenage Mutant Ninja Turtles (2014), John Carlyle in Elysium, Butch Cavendish in The Lone Ranger, Guidry in Seal Team Six: The Raid on Osama Bin Laden, DA Frank Crenshaw in Date Night, Darren MacElroy in Blades of Glory, Captain Knauer in the 2005 remake of The Longest Yard, SFC Jeff Sanderson in Black Hawk Down, David \"Sully\" Sullivan in The Perfect Storm, Colonel Willie Sharp in Armageddon, Kent in Contact, Roger Van Zant in Heat, and William Wallace in Virtuosity. He was also the voice of the marriage counselor Dr. Wexler in Mr. & Mrs. Smith.\n\nHis best known TV roles are as Leo Nicoletti on ABC's The Company You Keep, Adam Janikowski on CBS's sitcom Mom, Carl Hickman on NBC's drama Crossing Lines, Alexander Mahone on FOX's drama Prison Break, Sheriff Tom Underlay in the ABC cult series Invasion, and Dr. Bruce Kellerman on ABC's medical drama MDs.", new DateTime(1956, 11, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001209", "Acting", "William Fichtner", new List<string> { "Bill Fichtner", "William Edward Fichtner", " Уильям Фихтнер", "Γουίλιαμ Έντουαρτ \"Μπιλ\" Φίχτνερ", "Μπιλ Φίχτνερ", "Γουίλιαμ Φίχτνερ", "윌리암 피츠너" }, "Mitchell Field Air Force Base, East Meadow, Long Island, New York, USA", 21.236000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wWtJOoaNAwPparpzMNuRBjvxwEf.jpg" },
                    { 900, "Christopher Boyes is an American sound engineer. He has won four Academy Awards and has been nominated for another ten. He has worked on more than 70 films since 1991", null, null, 2, null, "nm0102110", "Sound", "Christopher Boyes", new List<string> { "Chris Boyo", "Chris Boyes" }, "Des Moines, Iowa, USA", 3.198, null },
                    { 930, "", new DateTime(1932, 6, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 11, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0527322", "Production", "Branko Lustig", new List<string>(), "Osijek, Croatia, Yugoslavia", 2.2160000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yHRAgKCRESvnLN72L32BUwXLHIT.jpg" },
                    { 947, "Hans Florian Zimmer (born September 12th, 1957) is a German composer and record producer. Since the 1980s, he has composed music for over 150 films. His works include The Lion King, for which he won Academy Award for Best Original Score in 1994, the Pirates of the Caribbean series, The Thin Red Line, Gladiator, The Last Samurai, The Dark Knight Trilogy, Inception, and Interstellar. Zimmer spent the early part of his career in the United Kingdom before moving to the United States. He is the head of the film music division at DreamWorks studios and works with other composers through the company that he founded, Remote Control Productions.  Zimmer's works are notable for integrating electronic music sounds with traditional orchestral arrangements. He has received fourGrammy Awards, three Classical BRIT Awards, two Golden Globes, and an Academy Award. He was also named on the list of Top 100 Living Geniuses, published by The Daily Telegraph.", new DateTime(1957, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://hans-zimmer.com", "nm0001877", "Sound", "Hans Zimmer", new List<string> { "Ханс Циммер", "Ганс Ціммер", "ฮานซ์ ซิมเมอร์" }, "Frankfurt am Main, Germany", 19.199000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tpQnDeHY15szIXvpnhlprufz4d.jpg" },
                    { 949, "", new DateTime(1938, 10, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 12, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0226544", "Production", "Louis DiGiaimo", new List<string> { "Louis Di Giaimo", "Lou DiGiaimo" }, "Paterson, New Jersey, USA", 3.6320000000000001, null },
                    { 954, "María Luisa Paredes Bartolomé, born on 3 April 1946 in Madrid, better known in show business as Marisa Paredes, is a Spanish actress.", new DateTime(1946, 4, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0004650", "Acting", "Marisa Paredes", new List<string>(), "Madrid, Spain", 11.59, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aDfNPZ2plaCmdrYkCkburjBqYnP.jpg" },
                    { 1004, "​From Wikipedia, the free encyclopedia\n\nDaniel Louis Aiello Jr. (June 20, 1933 – December 12, 2019) was an American actor who appeared in numerous motion pictures, including The Godfather Part II (1974), The Front (1976), Once Upon a Time in America (1984), The Purple Rose of Cairo (1985), Moonstruck (1987), Harlem Nights (1989), Hudson Hawk (1991), Ruby (1992), Léon: The Professional (1994), 2 Days in the Valley (1996), Dinner Rush (2000), and Lucky Number Slevin (2006). He had a pivotal role in the Spike Lee film Do the Right Thing (1989) as Salvatore \"Sal\" Frangione, earning a nomination for the Academy Award for Best Supporting Actor. He played Don Domenico Clericuzio in the miniseries The Last Don (1997).", new DateTime(1933, 6, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 12, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000732", "Acting", "Danny Aiello", new List<string> { "Daniel Louis Aiello Jr.", "Daniel Aiello", "Dan Aiello ", "丹尼·愛羅" }, "Manhattan, New York City, New York, USA", 16.283000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\e7Q6hgWilShqGZ572ByWF9eshMm.jpg" },
                    { 1032, "Martin Charles Scorsese (born November 17, 1942) is an American film director, producer, screenwriter, and actor. One of the major figures of the New Hollywood era, he is widely regarded as one of the greatest and most influential directors in film history. Scorsese's body of work explores themes such as Italian-American identity, Catholic concepts of guilt and redemption, faith, machismo, nihilism, crime and sectarianism. Many of his films are known for their depiction of violence and the liberal use of profanity. Scorsese has also dedicated his life to film preservation and film restoration by founding the nonprofit organization The Film Foundation in 1990, as well as the World Cinema Foundation in 2007 and the African Film Heritage Project in 2017.\n\nScorsese studied at New York University (NYU), where he received a bachelor's degree in English literature in 1964, and received a master's degree in fine arts in film from NYU's Tisch School of the Arts in 1968. In 1967 Scorsese's first feature film Who's That Knocking at My Door was released and was accepted into the Chicago Film Festival, where critic Roger Ebert saw it and called it \"a marvelous evocation of American city life, announcing the arrival of an important new director\".\n\nHe has established a filmmaking history involving repeat collaborations with actors and film technicians, including nine films made with Robert De Niro. His films with De Niro are the psychological thriller Taxi Driver (1976), the biographical sports drama Raging Bull (1980), the satirical black comedy The King of Comedy (1982), the musical drama New York, New York (1977), the psychological thriller Cape Fear (1991), and the crime films Mean Streets (1973), Goodfellas (1990), Casino (1995) and The Irishman (2019). Scorsese has also been noted for his collaborations with actor Leonardo DiCaprio, having directed him in five films: the historical epic Gangs of New York (2002), the Howard Hughes biography The Aviator (2004), the crime thriller The Departed (2006), the psychological thriller Shutter Island (2010), and the Wall Street black comedy The Wolf of Wall Street (2013). The Departed won Scorsese an Academy Award for Best Director, and for Best Picture. Scorsese is also known for his long-time collaboration with film editor Thelma Schoonmaker, who has edited every Scorsese film beginning with Raging Bull. Scorsese's other film work includes the black comedy After Hours (1985), the romantic drama The Age of Innocence (1993), the children's adventure drama Hugo (2011), and the religious epics The Last Temptation of Christ (1988), Kundun (1997) and Silence (2016).", new DateTime(1942, 11, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000217", "Directing", "Martin Scorsese", new List<string> { "Мартин Скорсезе", "มาร์ติน สกอร์เซซี", "マーティン・スコセッシ", "마틴 스코세이지", "Μάρτιν Σκορσέζε", "마틴 스콜세지", "Мартін Скорсезе", "מרטין סקורסזה", "मार्टिन स्कोर्सेसे", "মার্টিন স্কোরসেজি", "மார்ட்டின் ஸ்கோர்செசி", "ਮਾਰਟਿਨ ਸਕੌਰਸੀਜ਼ੇ", "Մարտին Սկորսեզե", "马丁•斯科塞斯", "Marty Scorsese", "마틴 스콜시지", "مارتن سكورسيزي", "مارتین اسکورسیزی", "Iwan Jones" }, "Queens, New York City, New York, USA", 31.238, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9U9Y5GQuWX3EZy39B8nkk4NY01S.jpg" },
                    { 1037, "Harvey Keitel (born May 13, 1939) is an American actor known for his portrayal of morally ambiguous and \"tough guy\" characters. He rose to prominence during the New Hollywood movement, and has held a long-running association with director Martin Scorsese, starring in six of his films: Who's That Knocking at My Door (1967), Mean Streets (1973), Alice Doesn't Live Here Anymore (1974), Taxi Driver (1976), The Last Temptation of Christ (1988), and The Irishman (2019).\n\nKeitel received the Academy Award for Best Supporting Actor nomination for his portrayal of Mickey Cohen in Bugsy (1991). He won the AACTA Award for Best Actor in a Leading Role for The Piano (1993). Other films include Blue Collar (1978), Thelma & Louise (1991), Reservoir Dogs (1992), Bad Lieutenant (1992), Pulp Fiction (1994), From Dusk till Dawn (1996), Holy Smoke! (1998), Cop Land (1997), and Youth (2015).\n\nHe has acted in the Wes Anderson films Moonrise Kingdom (2012), The Grand Budapest Hotel (2014), and Isle of Dogs (2018). He played FBI Agent Peter Sadusky in both National Treasure (2004), and National Treasure: Book of Secrets (2006) and reprised his role in the Disney+ series National Treasure: Edge of History (2022). From 1995 to 2017, he was a co-president of the Actors Studio, alongside Al Pacino and Ellen Burstyn.\n\nDescription above from the Wikipedia article Harvey Keitel, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1939, 5, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000172", "Acting", "Harvey Keitel", new List<string> { "هارفي كيتل", "하비 카이텔", "ハーヴェイ・カイテル", "Харви Кейтель", "哈维·凯特尔", "Гарві Кейтель", "哈維·凱托" }, "Brooklyn, New York City, New York, USA", 34.683, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7P30hza1neYWW3r7rSQOC736K2Z.jpg" },
                    { 1044, "Michael Crawford Chapman, A.S.C. (November 21, 1935 – September 20, 2020) was an American cinematographer and film director well known for his work on many films of the American New Wave of the 1970s and in the 1980s with directors such as Martin Scorsese and Ivan Reitman. He shot more than forty feature films, over half of those with only three different directors.\n\nDescription above from the Wikipedia article Michael Chapman (cinematographer), licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1935, 11, 21, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 9, 20, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0152469", "Camera", "Michael Chapman", new List<string>(), "New York City, New York, USA", 6.992, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vFFWHlwwIgWoi2NPoVq3uzikCnM.jpg" },
                    { 1045, "Bernard Herrmann (born Max Herman; June 29, 1911 – December 24, 1975) was an American composer best known for his work in composing for motion pictures. As a conductor, he championed the music of lesser-known composers.\n\nAn Academy Award-winner (for The Devil and Daniel Webster, 1941; later renamed All That Money Can Buy), Herrmann is particularly known for his collaborations with director Alfred Hitchcock, most famously Psycho, North by Northwest, The Man Who Knew Too Much, and Vertigo. He also composed scores for many other movies, including Citizen Kane, The Day the Earth Stood Still, The Ghost and Mrs. Muir, Cape Fear, and Taxi Driver. He worked extensively in radio drama (composing for Orson Welles), composed the scores for several fantasy films by Ray Harryhausen, and many TV programs, including Rod Serling's The Twilight Zone and Have Gun–Will Travel.", new DateTime(1911, 6, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1975, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0002136", "Sound", "Bernard Herrmann", new List<string> { "Benny", "Bernard Hermann" }, "New York City, New York, USA", 6.6630000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vpIPFhUpHBqDrbgbnaQnDCYekDI.jpg" },
                    { 1046, "", null, null, 1, null, "nm0852681", "Production", "Juliet Taylor", new List<string> { " Juilet Taylor ", "Juliette Taylor" }, null, 4.2450000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yZpHkHDJ38MC9ochQcitEA52oFB.jpg" },
                    { 1054, "", null, null, 0, null, "nm0295930", "Sound", "James Fritch", new List<string>(), null, 1.875, null },
                    { 1088, "Ludger Pistor was born on March 16, 1959 in Recklinghausen, Germany. He is an actor, known for X-Men: First Class (2011), Run Lola Run (1998) and Casino Royale (2006). He is best known for appearing in big name films such as Schindler's List as Josef Liepold, Casino Royale as the Swiss banker Mendel and in Inglourious Basterds as Hauptmann (Captain) Wolfgang. He also played in X-Men: First Class where he played the small role of a German former Nazi hiding in Argentina posing as pig farmer, and gets killed by Michael Fassbender's character, Magneto, in a bar. In Germany he is better known, since he played in over 100 movies and television series.[1] E.g. Balko (for which he got the \"Deutscher Fernsehpreis\"-the German Television Award and the Adolf-Grimme-Preis), Texas - Doc Snyder hält die Welt in Atem, Crazy Race,", new DateTime(1959, 3, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0685598", "Acting", "Ludger Pistor", new List<string>(), "Recklinghausen, Germany", 4.1239999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pixOQw3AM7XhOR6fjSoP6L3ml0g.jpg" },
                    { 1113, "", null, null, 1, null, "nm0843514", "Production", "Lucinda Syson", new List<string>(), null, 7.8360000000000003, null },
                    { 1158, "Alfredo James Pacino (born April 25, 1940) is an American actor and filmmaker. In a career spanning over five decades, he has received many awards and nominations, including an Academy Award, two Tony Awards, and two Primetime Emmy Awards. He is one of the few performers to have received the Triple Crown of Acting. He has also been honored with the AFI Life Achievement Award, the Cecil B. DeMille Award, and the National Medal of Arts.\n\nA method actor and former student of the HB Studio and the Actors Studio, where he was taught by Charlie Laughton and Lee Strasberg, Pacino's film debut came at the age of 29 with a minor role in Me, Natalie (1969). He gained favorable notice for his first lead role as a heroin addict in The Panic in Needle Park (1971). Wide acclaim and recognition came with his breakthrough role as Michael Corleone in Francis Ford Coppola's The Godfather (1972), for which he received his first Oscar nomination, and he would reprise the role in the sequels The Godfather Part II (1974) and The Godfather Part III (1990).\n\nHis portrayal of Michael Corleone is regarded as one of the greatest in film history. Pacino received nominations for the Academy Award for Best Actor for Serpico (1973), The Godfather Part II, Dog Day Afternoon (1975), and ...And Justice for All (1979), ultimately winning it for playing a blind military veteran in Scent of a Woman (1992). For his performances in The Godfather, Dick Tracy (1990), Glengarry Glen Ross (1992), and The Irishman (2019), he earned Best Supporting Actor Oscar nominations.\n\nOther notable portrayals include Tony Montana in Scarface (1983), Carlito Brigante in Carlito's Way (1993), Benjamin Ruggiero in Donnie Brasco (1997), and Lowell Bergman in The Insider (1999). He has also starred in the thrillers Heat (1995), The Devil's Advocate (1997), Insomnia (2002), and appeared in Once Upon a Time in Hollywood (2019). On television, Pacino has acted in several productions for HBO, including Angels in America (2003) and the Jack Kevorkian biopic You Don't Know Jack (2010), winning a Primetime Emmy Award for Outstanding Lead Actor in a Miniseries or a Movie for each. Pacino currently stars in the Amazon Video web television series Hunters (2020–present).\n\nHe has also had an extensive career on stage. He is a two-time Tony Award winner, in 1969 and 1977, for his performances in Does a Tiger Wear a Necktie? and The Basic Training of Pavlo Hummel. Pacino made his filmmaking debut with Looking for Richard (1996), directing and starring in this documentary about Richard III; Pacino had played the lead role on stage in 1977. He has also acted as Shylock in a 2004 feature film adaptation and 2010 stage production of The Merchant of Venice. Pacino directed and starred in Chinese Coffee (2000), Wilde Salomé (2011), and Salomé (2013). Since 1994, he has been the joint president of the Actors Studio.​\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1940, 4, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000199", "Acting", "Al Pacino", new List<string> { "Аль Пачино", "آل باتشينو", "艾尔·帕西诺", "อัล ปาชิโน", "アル・パチーノ", "알 파치노", "Αλφρέντο Τζέημς \"Αλ\" Πατσίνο", "Αλ Πατσίνο", "Αλφρέντο Τζέημς Πατσίνο", "Alfredo James Pacino", "അൽ പച്ചിനോ", "ال پاچینو", "Ал Пачино", "آل پاچینو" }, "New York City, New York, USA", 45.768000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fMDFeVf0pjopTJbyRSLFwNDm8Wr.jpg" },
                    { 1213, "American composer, orchestrator, and music producer James Newton Howard is an eight-time Academy Award nominee.  He is best known for his frequent collaborations with director M. Night Shyamalan. He is well known for his highly emotional and powerfully subtle music, supplying his talent to an array of films such as The Fugitive, The Sixth Sense, Signs, The Village, the two Christopher Nolan Batman films; Batman Begins and The Dark Knight with Hans After Howard left the University of Southern California, he toured with Elton John as a keyboardist during the late 1970s and early 1980s. Howard also arranged strings for several of Elton's songs during this period including on the hits \"Don't Go Breaking My Heart\" and \"Sorry Seems To Be The Hardest Word\", as well as playing additional keyboards and synthesizers on several of Elton's studio albums, including \"Rock of The Westies\" (1975), \"Blue Moves\" (1976), \"21 At 33\" (1980), and \"The Fox\" (1981). After his tenure with John, Howard toured briefly with Crosby, Stills and Nash before moving into film music in the mid-1980s. Howard scored the blockbuster Pretty Woman (1990). He received his first Academy Award nomination for his score for Barbra Streisand's drama The Prince of Tides (1991). Howard achieved four more best original score Oscar nominations, for the Harrison Ford action feature The Fugitive (1993), the Julia Roberts romantic comedy My Best Friend's Wedding (1997), M. Night Shyamalan's The Village (2004) and most recently, Michael Clayton (2007). In addition, Howard received Best Song nods for scoring the Western epic Wyatt Earp (1994), Kevin Costner's Waterworld (1995), and Primal Fear (1996).   Howard scored Space Jam (1996), Dante's Peak (1997) (theme only - score was composed by John Frizzell), and Collateral (2004). Howard has  scored three Disney films which are Dinosaur (2000), Treasure Planet and Atlantis: The Lost Empire. Howard also earned an Emmy nomination in 1995 the theme and pilot to the television drama, ER. He also won an Emmy for the them to Gideon's Crossing.  He went on to win a Golden Globe nomination for Best Original Score for the feature King Kong. He went on to receive Oscar nominations for the features Michael Clayton (2007) and Defiace (2008).", new DateTime(1951, 6, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0006133", "Sound", "James Newton Howard", new List<string> { "James Howard Newton", "James Newton-Howard" }, "Los Angeles, California, USA", 6.4480000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qB4JgzCXCjr7NwW7UNrgBrWZDlo.jpg" },
                    { 1254, "From Wikipedia, the free encyclopedia\n\nArt Linson (born 1942) is an American film producer, director and screenwriter.\n\nHe was born in Chicago, Illinois. His directorial debut was the 1980 comedy, Where the Buffalo Roam, which was loosely based on stories by Hunter S. Thompson and starred Bill Murray as the writer. He also directed 1984's The Wild Life.\n\nLinson has produced many films including Car Wash, Fast Times at Ridgemont High, Fight Club, Melvin and Howard and the Brian De Palma films The Untouchables, Casualties of War, and The Black Dahlia. He has worked with Michael Mann, David Mamet, and Cameron Crowe. He produced Sunset Strip with his son John.\n\nHis writing credits include the film American Hot Wax and two books, What Just Happened? Bitter Hollywood Tales from the Front Line (ISBN 1-58234-240-7), which was adapted into the film What Just Happened, and A Pound of Flesh: Perilous Tales of How to Produce Movies in Hollywood (ISBN 0-8021-3551-X).\n\nHe is an executive producer for the FX drama series Sons of Anarchy.\n\nLinson produced a film based on the band The Runaways, with his son John Linson as a co-producer.\n\nDescription above from the Wikipedia article Art Linson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1942, 3, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0513165", "Production", "Art Linson", new List<string>(), "Chicago, Illinois, USA", 5.9809999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\p9JPMQt4RRHYdQgvnrmFNiZ4eW6.jpg" },
                    { 1259, "Ennio Morricone OMRI (Italian: [ˈɛnnjo morriˈkoːne]; November 10, 1928 – July 6, 2020) was an Italian composer, orchestrator, conductor, trumpeter, and pianist who wrote music in a wide range of styles. With more than 400 scores for cinema and television, as well as more than 100 classical works, Morricone is widely considered one of the most prolific and greatest film composers of all time. He has received numerous accolades including two Academy Awards, three Grammy Awards, three Golden Globes, six BAFTAs, ten David di Donatello, eleven Nastro d'Argento, two European Film Awards, the Golden Lion Honorary Award, and the Polar Music Prize in 2010.", new DateTime(1928, 11, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 7, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.enniomorricone.org/", "nm0001553", "Sound", "Ennio Morricone", new List<string> { "Leo Nichols", "Dan Savio", "Enio Morricone", "Ennio Moriconi", "Эннио Морриконе" }, "Rome, Italy", 6.2720000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\avjgzi45bdXgC1AtyNsRc5nxtFM.jpg" },
                    { 1262, "Mali Finn (March 8, 1938 – November 28, 2007), born Mary Alice Mann, was an American casting director and former English and drama teacher. She cast numerous actors in successful films, including Edward Furlong, Leonardo DiCaprio, and Russell Crowe.", new DateTime(1938, 3, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2007, 11, 28, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0278139", "Production", "Mali Finn", new List<string> { "Mally Finn", "Mary Alice Mann" }, "Danville, Illinois, USA", 4.5250000000000004, null },
                    { 1276, "Patricia Davies Clarkson (born December 29, 1959) is an American actress. After studying drama on the East Coast, Clarkson launched her acting career in 1985, and has worked steadily in both film and television. She twice won the Emmy for Outstanding Guest Actress in Six Feet Under. Film roles included The Green Mile, Far From Heaven, The Station Agent and was nominated for an Academy Award for Best Supporting Actress for her performance in Pieces of April (2003).\n\nDescription above from the Wikipedia article Patricia Clarkson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1959, 12, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0165101", "Acting", "Patricia Clarkson", new List<string> { "Patty Clarkson", "Patricia Davies Clarkson", "Патриша Кларксон ", "派翠西亞·克拉克森" }, "New Orleans, Louisiana, USA", 20.443000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rHHM9G83fpBAcFathbSyV4Tot5j.jpg" },
                    { 1283, "Helena Bonham Carter CBE (born May 26, 1966) is an English actress. Known for her roles in independent films and blockbusters, especially period dramas, she is the recipient of various accolades, including a British Academy Film Award and three Screen Actors Guild Awards, in addition to nominations for two Academy Awards, four British Academy Television Awards, nine Golden Globe Awards, and five Primetime Emmy Awards.\n\nBonham Carter rose to prominence by playing Lucy Honeychurch in A Room with a View (1985) and the title character in Lady Jane (1986). Her early period roles saw her typecast as a virginal \"English rose\", a label she was uncomfortable with. She is best known for her eccentric fashion, dark aesthetic, and for often playing quirky women. For her role as Kate Croy in The Wings of the Dove (1997), Bonham Carter received a nomination for the Academy Award for Best Actress, and for her portrayal of Queen Elizabeth The Queen Mother in The King's Speech (2010), she won the BAFTA Award for Best Actress in a Supporting Role, and was nominated for the Academy Award for Best Supporting Actress. Her other films include Hamlet (1990), Howards End (1992), Mary Shelley's Frankenstein (1994), Mighty Aphrodite (1995), Fight Club (1999), Wallace & Gromit: The Curse of the Were-Rabbit (2005), the Harry Potter series (2007–2011) as Bellatrix Lestrange, Great Expectations (2012) as Miss Havisham, Les Misérables (2012), Cinderella (2015), Ocean's 8 (2018), and Enola Holmes (2020). Her collaborations with director Tim Burton, her former domestic partner, include Big Fish (2003), Corpse Bride (2005), Charlie and the Chocolate Factory (2005), Sweeney Todd: The Demon Barber of Fleet Street (2007) as Mrs. Lovett, Alice in Wonderland (2010) as the Red Queen, and Dark Shadows (2012).\n\nFor her role as children's author Enid Blyton in the BBC Four biographical film Enid (2009), she won the 2010 International Emmy Award for Best Actress and was nominated for the British Academy Television Award for Best Actress. Her other television films include Fatal Deception: Mrs. Lee Harvey Oswald (1993), Live from Baghdad (2002), Toast (2010), and Burton & Taylor (2013). From 2019 to 2020, she portrayed Princess Margaret, Countess of Snowdon in seasons three and four of Netflix's The Crown.", new DateTime(1966, 5, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000307", "Acting", "Helena Bonham Carter", new List<string> { "Helena Bonham-Carter", "헬레나 본햄 카터", "Хелена Бонем Картер", "Гелена Бонем Картер", "海倫娜·寶漢·卡特" }, "Golders Green, London, England, UK", 49.743000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hJMbNSPJ2PCahsP3rNEU39C8GWU.jpg" },
                    { 1303, "", new DateTime(1955, 4, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0568273", "Art", "Alex McDowell", new List<string>(), "Borneo, Malaysia", 6.423, null },
                    { 1307, "Bob Weinstein is an American film and theatre producer, the founder and head of Dimension Films, former co-chairman of Miramax Films and The Weinstein Company, all of which he co-founded with his brother, Harvey. He has focused on making commercially successful action and horror films.", new DateTime(1954, 10, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0918424", "Production", "Bob Weinstein", new List<string>(), "New York City, New York, USA", 5.9930000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lCLIlmY3oZN9n0YgrH3i0oZygPU.jpg" },
