                    { 1322, "Beryl Dickson ONZM (born 1958) is a costume designer from New Zealand. Her most notable work is in The Lord of the Rings: The Return of the King and The Lord of the Rings: The Fellowship of the Ring, both of which were filmed in New Zealand, as well as her years of work on Xena: Warrior Princess and Hercules: The Legendary Journeys. She and Richard Taylor won the Academy Award for Best Costume Design for the Lord of the Rings: The Return of the King (2004). Other Academy Award nominations were for Lord of the Rings: The Fellowship of the Ring (2002) and The Last Samurai (2004). She received British Film and Television Award nominations for Lord of the Rings: The Fellowship of the Ring (2002)  and Lord of the Rings: The Return of the King (2004). She and Richard Taylor won a BAFTA for Lord of the Rings: The Two Towers (2003). She won the Costume Designers Guild Award for Lord of the Rings: The Return of the King (2004)", new DateTime(1958, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0225699", "Costume & Make-Up", "Ngila Dickson", new List<string>(), "Dunedin, New Zealand", 10.737, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\agoIBi3G9ezonrfiMyouSaPMwBi.jpg" },
                    { 1323, "From Wikipedia, the free encyclopedia\n\nSir Richard Leslie Taylor KNZM (born 8 February 1965) is the founder, creative director and head of New Zealand film prop and special effects company Wētā Workshop.", new DateTime(1965, 2, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0853050", "Costume & Make-Up", "Richard Taylor", new List<string> { "Sir Richard Leslie Taylor", "Sir Richard Leslie Taylor KNZM" }, "Cheadle, Cheshire, England, UK", 5.3959999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bPPFdE7FRGuBiIAN5P3bzaUQN0Y.jpg" },
