                    { 1326, "", null, null, 1, "http://theproactors.co.nz/actors/liz-mullane-2/", "nm0611943", "Production", "Liz Mullane", new List<string>(), null, 3.157, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hwcIHjn8gwDMty6dw2rxGLJhOVq.jpg" },
                    { 1327, "Sir Ian Murray McKellen, CH, CBE (born May 25, 1939) is an English actor. He is the recipient of six Laurence Olivier Awards, a Tony Award, a Golden Globe Award, a Screen Actors Guild Award, a BIF Award, two Saturn Awards, four Drama Desk Awards and two Critics' Choice Awards. He has also received two Academy Award nominations, eight BAFTA film and TV nominations and five Emmy Award nominations. McKellen's work spans genres ranging from Shakespearean and modern theatre to popular fantasy and science fiction. His notable film roles include Gandalf in The Lord of the Rings and The Hobbit trilogies and Magneto in the X-Men films.", new DateTime(1939, 5, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.mckellen.com", "nm0005212", "Acting", "Ian McKellen", new List<string> { "Иэн МакКеллен", "Sir Ian McKellen", "伊恩·麦克莱恩", "Sir Ian Murray McKellen", "Σερ Ίαν Μάρεϊ ΜακΚέλεν", "Ίαν ΜακΚέλεν", "Ίαν Μάρεϊ ΜακΚέλεν", "Ian McKellern", "이안 맥켈런", "イアン・マッケラン", "伊恩·麦凯伦", "伊恩·麥克連" }, "Burnley, Lancashire, England, UK", 33.860999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5cnnnpnJG6TiYUSS7qgJheUZgnv.jpg" },
                    { 1328, "Sean Astin (born February 25, 1971) is an American film actor, director, and producer better known for his film roles as Mikey Walsh in The Goonies, the title character of Rudy, and Samwise Gamgee in the Lord of the Rings trilogy. In television, he appeared as Lynn McGill in the fifth season of 24. He also provided the voice for the title character in Disney's Special Agent Oso.", new DateTime(1971, 2, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000276", "Acting", "Sean Astin", new List<string> { "Шон Эстин", "Sean Patrick Duke", "ショーン・アスティン" }, "Santa Monica, California, USA", 42.454000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ywH1VvdwqlcnuwUVr0pV0HUZJQA.jpg" },
                    { 1329, "​From Wikipedia, the free encyclopedia.  \n\nBilly Boyd (born 28 August 1968) is a Scottish actor and musician most widely known for playing the character Peregrin \"Pippin\" Took in the film adaptations of The Lord of the Rings and Barret Bonden in Master and Commander: The Far Side of the World.\n\nDescription above from the Wikipedia article Billy Boyd, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1968, 8, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0101710", "Acting", "Billy Boyd", new List<string>(), "Glasgow, Scotland, UK", 24.783999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cX5MkKKfBoOzLjGWIZsB9ZUFjmE.jpg" },
                    { 1330, "Dominic Monaghan (born December 8, 1976) is an English actor. He has received international attention from playing Merry in Peter Jackson's adaptation of J. R. R. Tolkien's The Lord of the Rings and for his role as Charlie Pace on the television show Lost.", new DateTime(1976, 12, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0597480", "Acting", "Dominic Monaghan", new List<string> { "Dominic Bernard Patrick Luke Monaghan", "도미닉 모나한" }, "Berlin, Germany", 14.926, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lOWmAvBu6evsj9MCcIHqy7Sg3iZ.jpg" },
                    { 1331, "Hugo Wallace Weaving AO (born April 4, 1960) is an English actor. Born in Colonial Nigeria to English parents, he has resided in Australia for the entirety of his career. He is the recipient of six Australian Academy of Cinema and Television Arts Awards (AACTA) and has also been recognised as an Honorary Officer of the Order of Australia.\n\nWeaving landed his first major role as English cricket captain Douglas Jardine on the Australian television series Bodyline (1984). Continuing to act in Australia, he rose to prominence with his appearances in the films Proof (1991) and The Adventures of Priscilla, Queen of the Desert (1994), winning his first AACTA Award for Best Actor in a Leading Role with the former. By the turn of the millennium, Weaving achieved international recognition through appearances in mainstream American productions. His most notable film roles include Agent Smith in the first three The Matrix films (1999–2003), Elrond in The Lord of the Rings (2001–2003) and The Hobbit (2012–2014) trilogies, the title character in V for Vendetta (2005), and Johann Schmidt / Red Skull in the Marvel Cinematic Universe (MCU) film Captain America: The First Avenger (2011).\n\nIn addition to his live action appearances, Weaving has had several voice over roles, including in the films Babe (1995), Happy Feet (2006) and Happy Feet Two (2011), and the Transformers series as Megatron (2007–2011). He also reprised his roles of Agent Smith and Elrond in Matrix and Lord of the Rings video game adaptations.\n\nDescription above is from the Wikipedia article Hugo Weaving, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1960, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0915989", "Acting", "Hugo Weaving", new List<string> { "Хьюго Уивинг", "휴고 위빙", "雨果·维文", "ヒューゴ・ウィーヴィング", "ヒューゴ・ウォレス・ウィーヴィング", "雨果·威明" }, "Ibadan, Nigeria", 26.576000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\t4ScpYIHlXVD41scEyiGdQDYflX.jpg" },
                    { 1332, "Craig Parker (born 12 November 1970) is a New Zealand actor based in Los Angeles, California. He known for his roles as Haldir in the films The Fellowship of the Ring (2001) and The Two Towers (2002), Darken Rahl in the television series Legend of the Seeker, Stéphane Narcisse in the CW television series Reign, and Gaius Claudius Glaber in the television series Spartacus.", new DateTime(1970, 11, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0662164", "Acting", "Craig Parker", new List<string> { "Крэйг Паркер" }, "Suva, Viti Levu, Fiji", 15.499000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gV5dbZ0gorOtIJXmJz7g3maDGgM.jpg" },
                    { 1333, "Andrew Clement Serkis (born 20 April 1964) is an English actor, director and producer of Iraqi and Armenian descent. He is best known for his performance capture roles comprising motion capture acting, animation, and voice work for computer-generated characters such as Gollum in The Lord of the Rings film trilogy (2001–2003) and The Hobbit: An Unexpected Journey (2012), King Kong in the eponymous 2005 film, Caesar in the Planet of the Apes reboot series (2011–2017), Captain Haddock / Sir Francis Haddock in Steven Spielberg's The Adventures of Tintin (2011), and Supreme Leader Snoke in the Star Wars sequel trilogy films The Force Awakens (2015) and The Last Jedi (2017). In 2018, he portrayed the character of Baloo in his self-directed film, Mowgli: Legend of the Jungle.\n\nSerkis is one of the highest-grossing actors of all time, number ten, and his film work in motion capture has been critically acclaimed. He has received an Empire Award and two Saturn Awards for his motion-capture acting. He earned a Golden Globe nomination for his portrayal of serial killer Ian Brady in the British television film Longford (2006) and was nominated for a BAFTA for his portrayal of new wave and punk rock musician Ian Dury in the biopic Sex & Drugs & Rock & Roll (2010). In 2020, Serkis received the BAFTA Award for Outstanding British Contribution To Cinema. In 2021, he won a Daytime Emmy Award for the series The Letter for the King (2020).\n\nSerkis portrayed Ulysses Klaue in the Marvel Cinematic Universe films Avengers: Age of Ultron (2015) and Black Panther (2018). He also played Alfred Pennyworth in The Batman (2022). Serkis has his own production company and motion capture workshop, The Imaginarium in London, which he used for Mowgli: Legend of the Jungle. He made his directorial debut with Imaginarium's 2017 film Breathe. He directed Venom: Let There Be Carnage (2021), which is set in Sony's Spider-Man Universe.", new DateTime(1964, 4, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.serkis.com/", "nm0785227", "Acting", "Andy Serkis", new List<string> { "أندي سركيس", "앤디 서키스", "アンディ・サーキス", "Энди Серкис", "安迪·瑟克斯", "Άντι Σέρκις" }, "Ruislip, Middlesex, England, UK", 47.581000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eNGqhebQ4cDssjVeNFrKtUvweV5.jpg" },
                    { 1365, "", new DateTime(1968, 3, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0538692", "Acting", "Lawrence Makoare", new List<string>(), "Baston Point, Auckland, New Zealand", 8.1999999999999993, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gNWX2QLQXzjPzynCwa0azyKYG4M.jpg" },
                    { 1366, "Sala Baker is an actor and stuntman from Wellington, New Zealand. Originally hired as one of several stunt performers for The Lord of the Rings film trilogy, he ended up landing the part of the Dark Lord Sauron. In addition, he also played several Orcs, a Gondorian, and one of the Rohirrim. Outside of the trilogy, Baker has performed in The Chronicles of Narnia: The Lion, the Witch and the Wardrobe and two Pirates of the Caribbean movies. Baker was also a part of the miscellaneous crew in the making of The Last Samurai in 2003.", new DateTime(1976, 9, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1019674", "Acting", "Sala Baker", new List<string> { "Elisala Baker" }, "Wellington, New Zealand", 12.832000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zSWNRVboxLJ3bhj7YBIS76HPCrC.jpg" },
                    { 1367, "From Wikipedia, the free encyclopedia\n\nAlan MacKenzie Howard, CBE, (5 August 1937–14 February 2015) was an English actor known for his roles on stage, television and film.\n\nHe was a member of the Royal Shakespeare Company from 1966 to 1983, and played leading roles at the Royal National Theatre between 1992 and 2000.\n\nDescription above from the Wikipedia article Alan Howard, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1937, 8, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 2, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0397102", "Acting", "Alan Howard", new List<string> { "Алан Ховард", "Alan MacKenzie Howard" }, "London, England, UK", 9.2200000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jYHkGkFzRGrVRoX568Omr3ipmde.jpg" },
                    { 1369, "Bernard Hill (17 December 1944 – 5 May 2024) was an English actor. He was known as a character actor of film, stage and television, having acted in nearly 130 projects. He is best known to British television viewers for playing Yosser Hughes in the groundbreaking 1982 TV series Boys from the Blackstuff. On film he has played Captain Edward John Smith in Titanic, King Théoden in The Lord of the Rings film trilogy, and the Warden of San Quentin Prison in the Clint Eastwood film True Crime. Hill is the only actor to have appeared in more than one of the three films awarded 11 Oscars, and one of only three actors to have starred in more than one film grossing more than $1 billion USD, namely: Titanic and The Return of the King (the others being Orlando Bloom who also starred in The Return of the King, as well as Pirates of the Caribbean and Johnny Depp who also starred in Pirates of the Caribbean, as well as Alice in Wonderland). Hill has appeared in three films which have won Best Picture: Gandhi, Titanic, and The Return of the King. Hill died on 5th May 2024 at the age of 79.", new DateTime(1944, 12, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2024, 5, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0384060", "Acting", "Bernard Hill", new List<string>(), "Blackley, Manchester, England, UK", 27.934999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5i8bj2nsTrFU2ddSynleOjapxor.jpg" },
                    { 1370, "Bradford Claude \"Brad\" Dourif is an American film and television actor who gained early fame for his portrayal of Billy Bibbit in One Flew Over the Cuckoo's Nest.\n\nHe has since appeared in a number of memorable roles, including the voice of Chucky in the Child's Play franchise, Younger Brother in Ragtime, the mentat Piter De Vries in David Lynch's Dune, Gríma Wormtongue in The Lord of the Rings, the homicidal Betazoid Lon Suder in the TV series Star Trek: Voyager, serial killer Charles Dexter/Brother Edward in the acclaimed science fiction television series Babylon 5, and Doc Cochran in the HBO television series Deadwood.\n\nDourif has also worked with renowned film director Werner Herzog at many occasions, appearing in Scream of Stone, The Wild Blue Yonder, Bad Lieutenant: Port of Call New Orleans and My Son, My Son, What Have Ye Done?", new DateTime(1950, 3, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000374", "Acting", "Brad Dourif", new List<string> { "Bradford Claude Dourif " }, "Huntington, West Virginia, USA", 25.175000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\z2LYR7Ickql7g5hnWJSIAWMPD4o.jpg" },
                    { 1371, "David Wenham (born 21 September 1965) is an Australian actor who has appeared in movies, television series and theatre productions. He is known in Hollywood for his roles as Faramir in The Lord of the Rings film trilogy, Carl in Van Helsing and Dilios in 300. He is also known in his native Australia for his role as Diver Dan in SeaChange.\n\nDescription above from the Wikipedia David Wenham, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1965, 9, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0920992", "Acting", "David Wenham", new List<string> { "Ντέιβιντ Γουένχαμ", "Daisy", "Дэвид Уэнэм", "大卫·文翰", "Девід Венем" }, "Marrickville, Sydney, Australia", 21.158999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\F7CWSqUE75HtrcdqIQ7UMZ9aTX.jpg" },
                    { 1372, "Karl-Heinz Urban (born 7 June 1972) is a New Zealand actor. His career began with appearances in New Zealand films and TV series such as Xena: Warrior Princess. His first Hollywood role was in the 2002 horror film Ghost Ship. Since then, he has starred in many high-profile movies, including as Éomer in the second and third installments of The Lord of the Rings trilogy, Vaako in the second and third installments of Riddick film series, Leonard McCoy in the Star Trek reboot film series, Kirill in The Bourne Supremacy (2004), John \"Reaper\" Grimm in Doom (2005), Judge Dredd in Dredd (2012), Gavin Magary in Pete's Dragon (2016), and Skurge in Marvel Studios' Thor: Ragnarok (2017). In 2013, he starred in the sci-fi series Almost Human. Since 2019, he has starred as Billy Butcher in Amazon's superhero streaming television series The Boys.", new DateTime(1972, 6, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://johnsonlaird.com/our-actors/Karl-Urban", "nm0881631", "Acting", "Karl Urban", new List<string> { "Карл Урбан", "Καρλ Ούρμπαν", "칼 어반", "Karl-Heinz Urban", "卡尔·厄本", "カール・アーバン", "卡爾·厄本" }, "Wellington, New Zealand", 45.156999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aMkragCSEihmGhLp5xJ8Jnw2ZMY.jpg" },
                    { 1373, "", null, null, 2, null, "nm0377172", "Art", "Dan Hennah", new List<string> { "Daniel Hennah" }, "Hastings, New Zealand", 3.9580000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ojzCZyCln9P6U4Gn1GIaIgWF5fh.jpg" },
                    { 1381, "John Noble (born 20 August 1948) is an Australian actor. He is known for his roles as Denethor in the Lord of the Rings film trilogy, Dr. Walter Bishop on the science fiction series Fringe, Henry Parrish on the action-horror series Sleepy Hollow, and Morland Holmes on the police procedural Elementary. Noble has also done voice work as Leland Monroe in the video game L.A. Noire, Unicron in the animated series Transformers: Prime, and Scarecrow in the DC Comics video game Batman: Arkham Knight.\n\nDescription above from the Wikipedia article John Noble, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1948, 8, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0633604", "Acting", "John Noble", new List<string>(), "Port Pirie, South Australia, Australia", 24.254000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\t9dB8uU27sQDaEEFMiQvp5sbrXU.jpg" },
                    { 1382, "", new DateTime(1952, 2, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0635264", "Acting", "Paul Norell", new List<string>(), "London, England, UK", 16.239999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oa3NNRzbvxCHzrurjxAFwsWxWwb.jpg" },
                    { 1383, "", null, null, 2, null, "nm0992718", "Acting", "Thomas Robins", new List<string>(), null, 3.488, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\b8ELvyAhsEoPUBUzJfRvAQ0U1aC.jpg" },
                    { 1390, "Jamie Selkirk is an award-winning editor and producer, best known for frequently working with acclaimed director Peter Jackson.", null, null, 2, null, "nm0783241", "Editing", "Jamie Selkirk", new List<string>(), null, 3.4470000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lCvardvUvKrycENzypEAEEUNVsr.jpg" },
                    { 1417, "Toshio Suzuki is a producer and President at Studio Ghibli. He has produced the work of two of Japan's foremost animators, Isao Takahata and Hayao Miyazaki.", new DateTime(1948, 8, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0840699", "Production", "Toshio Suzuki", new List<string> { "鈴木 敏夫", "铃木敏夫" }, "Nagoya, Aichi, Japan", 16.838000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\h8KzdSl5kIHgXputSBhxDZ1CA1g.jpg" },
                    { 1579, "Margalit \"Maggie\" Ruth Gyllenhaal (born November 16, 1977) is an American actress and filmmaker. Part of the Gyllenhaal family, she is the daughter of filmmakers Stephen Gyllenhaal and Naomi Achs, and the older sister of actor Jake Gyllenhaal.\n\nGyllenhaal began her career as a teenager with small roles in several of her father's films, and appeared with her brother in the cult favorite Donnie Darko (2001). She then appeared in Adaptation, Confessions of a Dangerous Mind (both 2002), and Mona Lisa Smile (2003). Gyllenhaal received critical acclaim for her leading performances in the erotic romantic comedy drama Secretary (2002) and the drama Sherrybaby (2006), each of which earned her a Golden Globe Award nomination. After several commercially successful films in 2006, including World Trade Center, she received wider recognition for playing Rachel Dawes in the superhero film The Dark Knight (2008).\n\nFor her performance as a single mother in Crazy Heart (2009), she received a nomination for Academy Award for Best Supporting Actress. She subsequently starred in the comedies and dramas: Nanny McPhee and the Big Bang (2010), Hysteria (2011), and Won't Back Down (2012). Her other roles include a Secret Service agent in the action-thriller White House Down (2013), a musician in Frank (2014), and the title role in the drama The Kindergarten Teacher (2018). In 2021, Gyllenhaal made her writing and directing debut with the psychological drama The Lost Daughter, for which she won the Venice International Film Festival's Best Screenplay Award and was nominated for the Academy Award for Best Adapted Screenplay.\n\nGyllenhaal has also appeared in five stage productions since 2000, including making her Broadway debut in a revival of The Real Thing. She has starred in several television series, including the BBC political-thriller miniseries The Honourable Woman. For her performance, she won a Golden Globe award for Best Actress, and was nominated for a Primetime Emmy Award. She also produced and starred in the HBO period drama series The Deuce (2017–19). Gyllenhaal has been married to actor Peter Sarsgaard since 2009 and they have two children together.", new DateTime(1977, 11, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0350454", "Acting", "Maggie Gyllenhaal", new List<string> { "Мэгги Джилленхол", "매기 질렌할", "玛吉·吉伦哈尔" }, "Lower East Side, New York City, New York, USA", 29.908000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qxgM5LzzG4uWTprCL3gBVVJ2Q1K.jpg" },
                    { 1697, "Takeshi Seyama (born 1944) is a Japanese film editor from Tokyo.\n\nSeyama is the editor of many anime series and movies from Studio Ghibli, Katsuhiro Otomo, and Satoshi Kon, including hits such as Princess Mononoke, Steamboy, and Paprika. In 1992, Seyama founded the \"Seyama Editing Room,\" which specializes in editing anime.", new DateTime(1944, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0786707", "Editing", "Takeshi Seyama", new List<string> { "瀬山武司" }, "Tokyo, Japan", 4.2779999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2ZoMQKCyNiUCYo8sy6pDIb30ViV.jpg" },
                    { 1769, "Sofia Carmina Coppola (born May 14, 1971) is an American filmmaker and actress. The youngest child and only daughter of filmmakers Eleanor and Francis Ford Coppola, she made her film debut as an infant in her father's acclaimed crime drama film The Godfather (1972). Coppola later appeared in several music videos, as well as a supporting role in Peggy Sue Got Married (1986). Coppola then portrayed Mary Corleone, the daughter of Michael Corleone, in The Godfather Part III (1990). After her performance drew criticism, she turned her attention to filmmaking.\n\nCoppola made her feature-length directorial debut with the coming-of-age drama The Virgin Suicides (1999). It was the first of her collaborations with actress Kirsten Dunst. In 2004, Coppola received the Academy Award for Best Original Screenplay for the comedy-drama Lost in Translation and became the third woman to be nominated for an Academy Award for Best Director. In 2006, Coppola directed the historical drama Marie Antoinette, starring Dunst as the title character. In 2010, with the drama Somewhere, Coppola became the first American woman (and fourth American filmmaker) to win the Golden Lion, the top prize at the Venice Film Festival. In 2013, she directed the satirical crime film The Bling Ring, based on the crime ring of the same name which drew from the Vanity Fair article \"The Suspects Wore Louboutins\" by Nancy Jo Sales about the real group of burglarizing teens who were \"motivated by vanity and worship.\" The film premiered at the Cannes Film Festival.\n\nIn 2015 she released her Christmas special, A Very Murray Christmas starring Bill Murray on Netflix. At the 2017 Cannes Film Festival, she won Best Director for her work on the drama film The Beguiled, becoming the second woman in the festival's history to win the award. Her latest film, On the Rocks (2020) received a limited theatrical release in October 2020 by A24 as well as a streaming release on AppleTV+. The film received positive reviews, however critics also stated that On the Rocks \"isn't destined to achieve the same kind of iconic status as some of Coppola's previous work\".", new DateTime(1971, 5, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001068", "Directing", "Sofia Coppola", new List<string> { "Domino Coppola", "Sofia Carmina Coppola", "Domino", "София Коппола", "โซเฟีย คอปโปลา", "蘇菲亞·柯波拉", "ソフィア・コッポラ", "소피아 코폴라", "صوفيا كوبولا", "Софія Коппола", "蘇菲亞哥普拉" }, "New York City, New York, USA", 12.250999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dzHC2LxmarkBxWLhjp2DRa5oCev.jpg" },
                    { 1776, "Francis Ford Coppola (born April 7, 1939) is an American film director, producer and screenwriter. He is widely acclaimed as one of Hollywood's most celebrated and influential film directors. He epitomized the group of filmmakers known as the New Hollywood, which included George Lucas, Martin Scorsese, Robert Altman, Woody Allen and William Friedkin, who emerged in the early 1970s with unconventional ideas that challenged contemporary filmmaking.\n\nHe co-authored the script for Patton, winning the Academy Award in 1970. His directorial fame escalated with the release of The Godfather in 1972. The film revolutionized movie-making in the gangster genre, garnering universal laurels from critics and public alike. It went on to win three Academy Awards, including his second, which he won for Best Adapted Screenplay, and it was instrumental in cementing his position as one of the prominent American film directors. Coppola followed it with an equally successful sequel The Godfather Part II, which became the first ever sequel to win the Academy Award for Best Picture. The film received yet higher praises than its predecessor, and gave him three Academy Awards—for Best Adapted Screenplay, Best Director and Best Picture. In the same year was released The Conversation, which he directed, produced and wrote. The film went on to win the Palme d'Or at the 1974 Cannes Film Festival. His next directorial venture was Apocalypse Now in 1979, and it was as notorious for its lengthy and troubled production as it was critically acclaimed for its vivid and stark depiction of the Vietnam War. It won his second Palme d'Or at the 1979 Cannes Film Festival.\n\nAlthough some of Coppola's ventures in the 1980s and early 1990s were critically lauded, Coppola's later work has not met the same level of critical and commercial success as his '70s films.\n\nDescription above from the Wikipedia article Francis Ford Coppola, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1939, 4, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000338", "Directing", "Francis Ford Coppola", new List<string> { "Фрэнсис Форд Коппола", "فرانسيس فورد كوبولا", "弗朗西斯·科波拉", "ฟรานซิส ฟอร์ด คอปโปลา", "フランシス・フォード・コッポラ", "프랜시스 포드 코폴라", "Thomas Colchart", "Francis Coppola", "프란시스 포드 코폴라", "프랜시스 코폴라", "프란시스 코폴라", "Френсіс Форд Коппола" }, "Detroit, Michigan, USA", 20.907, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3Pblihd6KjXliie9vj4iQJwbNPU.jpg" },
                    { 1810, "Heath Andrew Ledger (4 April 1979 – 22 January 2008) was an Australian actor and music video director. After playing roles in several Australian television and film productions during the 1990s, Ledger moved to the United States in 1998 to develop his film career further. His work consisted of twenty films, including 10 Things I Hate About You (1999), The Patriot (2000), A Knight's Tale (2001), Monster's Ball (2001), Lords of Dogtown (2005), Brokeback Mountain (2005), Candy (2006), I'm Not There (2007), The Dark Knight (2008), and The Imaginarium of Doctor Parnassus (2009), the latter two being posthumous releases. He also produced and directed music videos and aspired to be a film director.\n\nFor his portrayal of Ennis Del Mar in Brokeback Mountain, Ledger won the New York Film Critics Circle Award for Best Actor and the Best International Actor Award from the Australian Film Institute; he was the first actor to win the latter award posthumously. He was nominated for the BAFTA Award, Screen Actors Guild Award, Golden Globe Award and the Academy Award for Best Actor, becoming the eighth-youngest nominee in the category at that time. Posthumously, he shared the 2007 Independent Spirit Robert Altman Award with the rest of the ensemble cast, the director, and the casting director for the film I'm Not There, which was inspired by the life and songs of American singer-songwriter Bob Dylan. In the film, Ledger portrayed a fictional actor named Robbie Clark, one of six characters embodying aspects of Dylan's life and persona.\n\nLedger died on 22 January 2008 as a result of an accidental overdose of medications. A few months before his death, Ledger had finished filming his role as the Joker in The Dark Knight. At the time of his death, The Dark Knight was in post-production, and The Imaginarium of Doctor Parnassus, in which he was playing his last role as Tony, was in the midst of filming. His death affected the subsequent promotion of The Dark Knight. His performance as the Joker in The Dark Knight earned him universal acclaim and popularity from fans and critics alike. Ledger also received numerous posthumous awards for his work on The Dark Knight, including the Academy Award for Best Supporting Actor, a Best Actor International Award at the 2008 Australian Film Institute Awards, the 2008 Los Angeles Film Critics Association Award for Best Supporting Actor, the 2009 Golden Globe Award for Best Supporting Actor – Motion Picture, and the 2009 BAFTA Award for Best Supporting Actor.", new DateTime(1979, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2008, 1, 22, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0005132", "Acting", "Heath Ledger", new List<string> { "Хит Леджер", "ฮีธ เลดเจอร์", "ヒース・レジャー", "히스 레저", "希斯·萊傑", "هيث ليدجر", "ჰიტ ლეჯერი", "希斯·莱杰", "Heath Andrew Ledger" }, "Perth, Western Australia, Australia", 35.390999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5Y9HnYYa9jF4NunY9lSgJGjSe8E.jpg" },
                    { 1813, "Anne Jacqueline Hathaway (born November 12, 1982) is an American actress. She is the recipient of various accolades, including an Academy Award, a Golden Globe Award, and a Primetime Emmy Award, and was among the world's highest-paid actresses in 2015. Her films have grossed over $6.8 billion worldwide, and she appeared on the Forbes Celebrity 100 list in 2009.\n\nAs a teenager, she was cast in the television series Get Real (1999–2000) and made her breakthrough as the protagonist in her debut film, the Disney comedy The Princess Diaries (2001). Hathaway made a transition to adult roles with the 2005 dramas Havoc and Brokeback Mountain. The comedy-drama The Devil Wears Prada (2006), in which she played an assistant to a fashion magazine editor, was her biggest commercial success to that point.\n\nShe played a recovering addict with a mental illness in the drama Rachel Getting Married (2008), which earned her a nomination for the Academy Award for Best Actress. She went on to star in several commercially successful films, including the comedy Get Smart (2008), the romances Bride Wars (2009), Valentine's Day (2010), and Love & Other Drugs (2010), and the fantasy film Alice in Wonderland (2010). In 2012, she starred as Selina Kyle / Catwoman in her highest-grossing film, The Dark Knight Rises. Also that year, she played Fantine, a prostitute dying of tuberculosis, in the musical Les Misérables, for which she won the Academy Award for Best Supporting Actress.\n\nShe has since played a scientist in the science fiction film Interstellar (2014), the owner of an online fashion site in the comedy The Intern (2015), a haughty actress in the heist film Ocean's 8 (2018), a con artist in the comedy The Hustle (2019), and Rebekah Neumann in the miniseries WeCrashed (2022).\n\nIn addition to film roles, she won a Primetime Emmy Award for her voice role in the sitcom The Simpsons, sung for soundtracks, appeared on stage, and hosted events.", new DateTime(1982, 11, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0004266", "Acting", "Anne Hathaway", new List<string> { "Энн Хэтэуэй", "Anne Whitney Hathaway", "앤 해서웨이", "Anne Jacqueline Hathaway", "Αν Χάθαγουεϊ", "安妮·海瑟薇", "Енн Гетевей", "安·海瑟薇", "Αν Γουίτνεϊ Χάθαγουεϊ", "آن هاتاوی", "アン・ハサウェイ", " ენ ჰეთვეი" }, "Brooklyn, New York City, New York, USA", 116.532, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kRYxBuUtN3vNz5pLfqCf32ZYlw2.jpg" },
                    { 1892, "Matthew Paige Damon (born October 8, 1970) is an American actor, film producer, and screenwriter. He is the recipient of various accolades, including an Academy Award from five nominations, and two Golden Globe Awards. He also received three BAFTA Award nominations, seven Primetime Emmy Award nominations, and six Screen Actors Guild Awards.\n\nDamon made his professional acting debut in the film Mystic Pizza (1988). He came to prominence when he and Ben Affleck wrote and starred in Good Will Hunting (1997), which won them the Academy Award for Best Screenplay. He continued to garner praise for his roles in Saving Private Ryan (1998), The Talented Mr. Ripley (1999), the Ocean's trilogy (2001-2007), the Bourne franchise (2002-2016), The Departed (2006), Invictus (2009), True Grit (2010), Behind The Candelabra (2013), The Martian (2015), Ford v Ferrari (2019), and Air (2023).\n\nDamon has co-written the feature films Good Will Hunting (1997), Gerry (2002), Promised Land (2012) and The Last Duel (2021).\n\nHe has produced the reality series Project Greenlight (2001-2015) as well as multiple films including Manchester by the Sea (2016) and The Last Duel (2021). In 2022, he co-founded the production company Artists Equity.", new DateTime(1970, 10, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000354", "Acting", "Matt Damon", new List<string> { "马特·达蒙", "Мэтт Дэймон", "Мэтт Деймон", "แม็ตต์ เดม่อน", "マット・デイモン", "맷 데이먼", "مات ديمون", "Метт Деймон", "Dickie Greenleaf", "Ματ Ντέιμον", "麥特·戴蒙", "מאט דיימון", "Matthew Paige Damon" }, "Boston, Massachusetts, USA", 67.484999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\At3JgvaNeEN4Z4ESKlhhes85Xo3.jpg" },
                    { 1893, "Casey Affleck is a renowned American actor, filmmaker, and producer recognized for his captivating performances and commitment to independent cinema.\n\nAffleck's breakout role came in Andrew Dominik's critically acclaimed character drama, \"The Assassination of Jesse James by the Coward Robert Ford\" (2007). His performance as Robert Ford, a young man consumed by a complex cocktail of admiration and resentment for the notorious outlaw Jesse James (portrayed by Brad Pitt), earned him widespread recognition, including Academy Award, Golden Globe, and Screen Actors Guild Award nominations.\n\nHe solidified his critical acclaim with a starring role in his brother Ben Affleck's directorial debut, \"Gone, Baby, Gone\" (2007). This gripping neo-noir followed two Boston-based private detectives searching for an abducted young girl. Affleck's performance, showcasing both vulnerability and determination, further cemented his reputation as a rising dramatic force.\n\nThe following decade saw Affleck continue to diversify his roles, venturing outside the realm of independent drama to blockbuster productions. He was seen in Christopher Nolan's ambitious sci-fi epic \"Interstellar\" (2014) alongside an ensemble cast including Matthew McConaughey and Anne Hathaway. Affleck also appeared in Scott Cooper's gritty crime thriller, \"Out of the Furnace\" (2013), where he shared the screen with Christian Bale.\n\nHis versatility continued to shine with his performance in the independent film \"Ain't Them Bodies Saints\" (2013), showcasing a quieter, more brooding side to his acting talents. That same year, Affleck turned his attention to production, establishing The Affleck/Middleton Project with John Powers Middleton as a platform to develop and produce a diverse array of film and television projects.\n\nAffleck's directorial work came to fruition with the release of the mockumentary \"I'm Still Here\" (2010), which he directed, wrote, and produced, featuring Joaquin Phoenix in a performance art piece that blurred the lines between fiction and reality. This experimental project demonstrated Affleck's willingness to challenge conventional storytelling formats.\n\nIn 2016, Affleck returned to the spotlight with his career-defining performance in Kenneth Lonergan's profoundly moving drama, \"Manchester by the Sea.\" His portrayal of Lee Chandler, a grief-stricken man coping with immense loss, earned him the Academy Award for Best Actor. This raw and unforgettable performance cemented Affleck's status as one of the industry's finest dramatic actors.\n\nAffleck has continued to take on challenging projects that have pushed his boundaries as an actor. Most recently, he starred opposite Elisabeth Moss in the psychological thriller \"Light of My Life\" (2019), which he also wrote and directed.\n\nHis upcoming projects include a pivotal role in Christopher Nolan's highly-anticipated \"Oppenheimer\" (2023), where he portrays theoretical physicist Robert Oppenheimer himself. Affleck is also slated to star in \"Slingshot\" (2024), a science fiction thriller set in space.\n\nIMDb mini bio by: yusufpiskin", new DateTime(1975, 8, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000729", "Acting", "Casey Affleck", new List<string> { "Кейси Аффлек", "Κέισι Άφλεκ", "케이시 애플렉", "卡西·阿弗莱克" }, "Falmouth, Massachusetts, USA", 21.763999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vD5MtCjHPHpmU9XNn74EPGMHT7o.jpg" },
                    { 1904, "Michael Anthony Hall (born April 14, 1968), known professionally as Anthony Michael Hall, is an American actor best known for his leading role as Johnny Smith in The Dead Zone from 2002 to 2007. He also rose to fame starring in films with John Hughes, which include the teen classics Sixteen Candles, The Breakfast Club, and Weird Science.\n\nHall diversified his roles to avoid becoming typecast as his geek persona, joining the cast of Saturday Night Live (1985–1986) and starring in films such as Out of Bounds (1986), Johnny Be Good (1988), Edward Scissorhands (1990) and Six Degrees of Separation (1993). After a series of minor roles in the 1990s, he starred as Microsoft's Bill Gates in the 1999 television film Pirates of Silicon Valley and started in 2001 comedy Freddy Got Fingered. He had the leading role in the USA Network series The Dead Zone from 2002 to 2007. In 2008, he appeared in a minor role in The Dark Knight. In 2020, he appeared in ABC's The Goldbergs. Additionally, he starred in the slasher film Halloween Kills (2021).", new DateTime(1968, 4, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.anthonymichaelhall.net", "nm0001309", "Acting", "Anthony Michael Hall", new List<string>(), "Boston, Massachusetts, USA", 29.879999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nLthzoCuNxxd3KteIrnnMg1066G.jpg" },
                    { 1936, "Martin Henry Balsam (November 4, 1919 – February 13, 1996) was an American character actor. He is best known for a number of film roles, including detective Milton Arbogast in Alfred Hitchcock's Psycho (1960), Arnold Burns in A Thousand Clowns (1965), which earned him the Academy Award for Best Supporting Actor, Juror #1 in 12 Angry Men (1957), and Mr. Green in The Taking of Pelham One Two Three (1974), as well as for his role as Murray Klein in the television sitcom Archie Bunker's Place (1979–1983).", new DateTime(1919, 11, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1996, 2, 13, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000842", "Acting", "Martin Balsam", new List<string> { "Martin Henry Balsam" }, "Bronx, New York, USA", 14.132, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2j4LJJfTPQtvnjp8LfSGOvWFATO.jpg" },
                    { 1959, "Brigitte Fossey (born June 15, 1946 in Tourcoing, Nord) is a French actress.", new DateTime(1946, 6, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0287637", "Acting", "Brigitte Fossey", new List<string> { "Brigitte Florence Fossey" }, "Tourcoing, Nord, France", 17.501000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qXCNw4csA2Bbg6kCNhJmya46Fme.jpg" },
                    { 2026, "", null, null, 2, null, "nm0809593", "Art", "Peter Landsdown Smith", new List<string> { "Peter J. Smith", "Peter John Smith", "Peter Lansdown Smith", "Peter Smith", "Pete Smith" }, null, 4.2039999999999997, null },
                    { 2037, "Cillian Murphy (born 25 May 1976) is an Irish actor.\n\nHe made his professional debut in Enda Walsh's 1996 play Disco Pigs, a role he later reprised in the 2001 screen adaptation. His early notable film credits include the horror film 28 Days Later (2002), the dark comedy Intermission (2003), the thriller Red Eye (2005), the Irish war drama The Wind That Shakes the Barley (2006), and the science fiction thriller Sunshine (2007). He played a transgender Irish woman in the comedy-drama Breakfast on Pluto (2005), which earned him a Golden Globe Award nomination.\n\nMurphy began collaborating with filmmaker Christopher Nolan in 2005, playing Dr. Jonathan Crane / Scarecrow in The Dark Knight Trilogy (2005–2012) as well as appearing in Inception (2010) and Dunkirk (2017) and portraying the lead role of J. Robert Oppenheimer in the biographical epic Oppenheimer (2023). By the year 2023, Murphy has already worked with Nolan for around 20 years and six films. He also gained prominence for his role as Tommy Shelby in the BBC period drama series Peaky Blinders (2013–2022) and for starring in the horror sequel A Quiet Place Part II (2020).\n\nIn 2011, Murphy won the Irish Times Theatre Award for Best Actor and Drama Desk Award for Outstanding Solo Performance for the one-man play Misterman. In 2020, The Irish Times named him one of the greatest Irish film actors.", new DateTime(1976, 5, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0614165", "Acting", "Cillian Murphy", new List<string> { "Киллиан Мерфи", "คิลเลียน เมอร์ฟี", "キリアン・マーフィー", "基利安·墨菲", "킬리언 머피", "كيليان مورفي", "希里安·墨菲", "کیلین مورفی", "Кілліан Мерфі", "基里安·墨菲", "席尼·墨菲", "קיליאן מרפי", "சில்லியன் மர்பி" }, "Douglas, Cork, Ireland", 58.222000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2lKs67r7FI4bPu0AXxMUJZxmUXn.jpg" },
                    { 2141, "​From Wikipedia, the free encyclopedia\n\nNed Bellamy (born May 7, 1957) is an American actor. Bellamy was born in Dayton, Ohio. After graduating UCLA, he founded the Los Angeles based theater company The Actors' Gang with fellow actor Tim Robbins. He was featured on a role on an episode of Seinfeld entitled The Fatigues. His brother, Mark Bellamy, was the United States Ambassador to Kenya from 2003-2006.\n\nDescription above from the Wikipedia article Ned Bellamy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1957, 5, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0068709", "Acting", "Ned Bellamy", new List<string> { "Ned Bellemy", "Нед Беллами" }, " Dayton, Ohio, USA", 7.2809999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9qj6thu0g6iUc2hvfoEYlO4GSbY.jpg" },
                    { 2144, "Joseph Henry Tobin Jr. (born August 7, 1942), known professionally as Tobin Bell, is an American actor and producer. He has appeared in a number of television shows and films, but is most recognized for his role as John Kramer / Jigsaw in the Saw films franchise, which has earned him five award nominations and two wins.\n\nAn American film and television character actor. After years of work doing stand-ins and background work on films, he got his first major acting job in Mississippi Burning (1988) and went on to star in made-for-television films and guest star in television shows throughout the 1990s. Bell is best known as the villain John \"Jigsaw\" Kramer of the Saw film series. He provided his voice in two video games based on the films, Saw and its sequel, Saw II: Flesh & Blood, in which he also provided his likeness.", new DateTime(1942, 8, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.officialtobinbell.com", "nm0068551", "Acting", "Tobin Bell", new List<string> { "Joseph H. Tobin, Jr.", "Тобин Белл", "토빈 벨", "托宾·贝尔" }, "Queens, New York City, New York, USA", 28.641999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\q21uuCtTioIVcGc3a1Q0DpdcNMO.jpg" },
                    { 2162, "", new DateTime(1950, 4, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0643553", "Production", "Lynda Obst", new List<string> { " Lynda Rosen Obst" }, null, 2.6739999999999999, null },
                    { 2165, "Rosanna Lisa Arquette (born August 10, 1959) is an American actress. She was nominated for an Emmy Award for her performance in the TV film The Executioner's Song (1982) and won the BAFTA Award for Best Actress in a Supporting Role for the film Desperately Seeking Susan (1985). Her other film roles include After Hours (also 1985), The Big Blue (1988), Pulp Fiction (1994), and Crash (1996). She also directed the documentary Searching for Debra Winger (2002) and starred in the ABC sitcom What About Brian? from 2006 to 2007.\n\nDescription above from the Wikipedia article Rosanna Arquette, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1959, 8, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000275", "Acting", "Rosanna Arquette", new List<string> { "罗姗娜·阿奎特", "로잔나 아퀘트", "Rosanna Lisa Arquette" }, "New York City, New York, USA", 24.298999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qfS5G5VHW2gz2sYGDhIYRBoy3vY.jpg" },
                    { 2169, "From Wikipedia, the free encyclopedia.\n\nRobert Michael Jeter (August 26, 1952 – March 30, 2003) was an American character actor of film, stage, and television. His television roles included Herman Stiles on the sitcom Evening Shade from 1990 until 1994 and Mr. Noodle's brother, Mister Noodle on the Elmo's World segments of Sesame Street from 2000 until 2003. Jeter's film roles include Zelig, Tango & Cash, The Fisher King, Sister Act 2: Back in the Habit, Waterworld, Air Bud, Patch Adams, The Green Mile, Jurassic Park III, Welcome to Collinwood, Open Range, and The Polar Express.", new DateTime(1952, 8, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2003, 3, 30, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0005052", "Acting", "Michael Jeter", new List<string>(), "Lawrenceburg, Tennessee, USA", 22.617999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pNBf8X56wCOHH7cArsMYJuke4fO.jpg" },
                    { 2211, "From Wikipedia, the free encyclopedia.\n\nGerald Robert Molen (born January 6, 1935) is a high profile American film producer. He works very closely with Steven Spielberg, having produced five of his films, and won an Academy Award for co-producing Schindler's List. Gerald \"Jerry\" Molen is now semi-retired and spends his time alternating between Montana and Las Vegas, Nevada.\n\nMolen was born in Great Falls, Montana, the son of Edith Lorraine (née Meyer) and Gerald Richard Molen. He grew up in North Hollywood, California, after moving from Montana, with a number of younger brothers and sisters. His mother ran a diner, \"The Blue Onion\", which was located across from one of the major studios. Molen got his start in the movie business by changing tires on studio trucks.\n\nMolen has appeared in cameos in several of the films he produced, including Rain Man, Days of Thunder, and Jurassic Park. The name 'Molen' can be seen painted on the front of a large black cauldron in the movie Hook as the camera pans across the pirate docks in Neverland.\n\nMolen is an active member of The Church of Jesus Christ of Latter-day Saints.\n\nDescription above from the Wikipedia article Gerald R. Molen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1935, 1, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0596520", "Production", "Gerald R. Molen", new List<string>(), "Great Falls, Montana, USA", 4.6710000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\m1C2E9MWClm3ITzxQzUxmE1qphL.jpg" },
                    { 2231, "Samuel Leroy Jackson (born December 21, 1948) is an American actor and producer. One of the most widely recognized actors of his generation, the films in which he has appeared have collectively grossed over $27 billion worldwide, making him the second highest-grossing actor of all time. The Academy of Motion Picture Arts and Sciences gave him an Academy Honorary Award in 2022 as \"A cultural icon whose dynamic work has resonated across genres and generations and audiences worldwide\".\n\nJackson started his career on stage making his professional theatre debut in Mother Courage and her Children in 1980 at The Public Theatre. From 1981 to 1983 he originated the role of Private Louis Henderson in A Soldier's Play Off-Broadway. He also originated the role of Boy Willie in August Wilson's The Piano Lesson in 1987 at the Yale Repertory Theatre. He returned to the play in the 2022 Broadway revival playing Doaker Charles. Jackson early film roles include Coming to America (1988), Goodfellas (1990), Patriot Games (1992), Juice (1992), True Romance (1993), and Jurassic Park (1993), Menace II Society (1993), and Fresh (1994). His collaborations with Spike Lee led to greater prominence with films such as School Daze (1988), Do the Right Thing (1989), Mo' Better Blues (1990), Jungle Fever (1991), Oldboy (2013), and Chi-Raq (2015).\n\nJackson's breakout role was in Quentin Tarantino's Pulp Fiction (1994) which earned him a BAFTA Award win and a nomination for the Academy Award for Best Supporting Actor. He further collaborated with Tarantino, acting in Jackie Brown (1997), Django Unchained (2012), and The Hateful Eight (2015). He's known for having appeared in a number of big-budget films, including Die Hard with a Vengeance (1995), A Time to Kill (1996), The Long Kiss Goodnight (1996), The Negotiator (1997), Deep Blue Sea (1999), Unbreakable (2000), Shaft (2000) and its reboot (2019), XXX (2002), S.W.A.T. (2003), Coach Carter (2005), Snakes on a Plane (2006), Kingsman: The Secret Service (2014), Kong: Skull Island (2017), and Glass (2019).\n\nHe also gained widespread recognition as the Jedi Mace Windu in the Star Wars prequel trilogy (1999–2005), later voicing the role in the animated film Star Wars: The Clone Wars (2008) and the video game Lego Star Wars: The Clone Wars (2011). With his permission, his likeness was used for the Ultimate version of the Marvel Comics character Nick Fury; he subsequently played Fury in 11 Marvel Cinematic Universe films, beginning with a cameo appearance in Iron Man (2008), as well as guest-starring in the television series Agents of S.H.I.E.L.D. He will reprise this role in the upcoming Disney+ series Secret Invasion, which is set to premiere on June 21, 2023. Jackson has provided his voice for several animated films, documentaries, television series, and video games, including Lucius Best / Frozone in the Pixar films The Incredibles (2004) and Incredibles 2 (2018).", new DateTime(1948, 12, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000168", "Acting", "Samuel L. Jackson", new List<string> { "Sam Jackson", "Samuel Jackson", "森姆·積遜", "サミュエル・L・ジャクソン", "새뮤얼 L. 잭슨", "사무엘 L. 잭슨", "صامويل جاكسون", "Сэмюэл Л. Джексон", "Σάμιουελ Λ. Τζάκσον", "סמואל ל. ג'קסון", "Семюел Л. Джексон", "ซามูเอล แอล. แจ็คสัน", "山繆·傑克森" }, "Washington, D.C., USA", 42.048000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nCJJ3NVksYNxIzEHcyC1XziwPVj.jpg" },
                    { 2242, "", null, null, 1, null, "nm0507161", "Production", "Ellen Lewis", new List<string>(), "Chicago, Illinois, USA", 4.5529999999999999, null },
                    { 2260, "Steven Zaillian (born January 30, 1953) is an Armenian-American screenwriter, film director, film editor, producer, and founder of Film Rites, a film production company. He won an Academy Award for his screenplay for Schindler's List and he has been nominated two times for Awakenings and Gangs of New York. The Times called him \"the most artful and subtle screenwriter Hollywood has had since Robert Towne.\"\n\nZaillian was born in Fresno, California, the son of Jim Zaillian, a radio news reporter. He attended Sonoma State University, graduated from San Francisco State University and lives in Los Angeles.\n\nDescription above from the Wikipedia article Steven Zaillian, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1953, 1, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001873", "Writing", "Steven Zaillian", new List<string> { "Steven Ernest Bernard Zaillian " }, "Fresno, California, USA", 11.938000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\a8OqAfO2m7TAuewIS0dOv4ip1Vr.jpg" },
                    { 2282, "Sir Ben Kingsley (born Krishna Pandit Bhanji; December 31, 1943) is an English actor. He has received various accolades throughout his career spanning five decades, including an Academy Award, a British Academy Film Award, a Grammy Award, and two Golden Globe Awards. Kingsley was appointed Knight Bachelor in 2002 for services to the British film industry. In 2010, he was awarded a star on the Hollywood Walk of Fame. In 2013, he received the Britannia Award for Worldwide Contribution to Filmed Entertainment.\n\nDescription above from the Wikipedia article Ben Kingsley, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1943, 12, 31, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001426", "Acting", "Ben Kingsley", new List<string> { " Sir Ben Kingsley ", "Krishna Pandit Bhanji", "بن كينغسلي", "벤 킹즐리", "ベン・キングズレー", "เบน คิงสลีย์", "本·金斯利", "Бен Кингсли", "Krishna Bhanji", "Σερ Μπεν Κίνγκσλεϊ", "Μπεν Κίνγκσλεϊ", "बेन किंग्सले", "Сер Бен Кингсли", "בן קינגסלי", "班·金斯利" }, "Snainton, North Riding of Yorkshire, England, UK", 25.672999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vQtBqpF2HDdzbfXHDzR4u37i1Ac.jpg" },
                    { 2319, "Maria de Medeiros Esteves Vitorino de Almeida (born August 19, 1965), better known as Maria de Medeiros, is a Portuguese actress, director, and singer who has been involved in both European and American film productions.", new DateTime(1965, 8, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.mariademedeiros.net/", "nm0210218", "Acting", "Maria de Medeiros", new List<string> { "Maria de Medeiros Esteves Vitorino de Almeida", "Marie De Medeiros", "玛丽亚·德·梅黛洛" }, "Lisbon, Portugal", 13.278, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xDo5mRSKXUZRmcZjUn42ICiyyI8.jpg" },
                    { 2361, "From Wikipedia, the free encyclopedia\n\nTonino Delli Colli (20 November 1923 – 16 August 2005) was an Italian cinematographer.\n\nCousin of Franco Delli Colli, Antonio (Tonino) Delli Colli was born in Rome, and began work at Rome's Cinecittà studio in 1938, at the age of sixteen. By the mid-1940s he was working as a cinematographer and in 1952 shot the first Italian film in colour, Totò a colori. He went on to work with a number of acclaimed and diverse directors including, Sergio Leone (The Good, the Bad and the Ugly, Once Upon a Time in the West and Once Upon a Time in America), Roman Polanski (Death and the Maiden and Bitter Moon), Louis Malle (Lacombe, Lucien), Jean-Jacques Annaud (The Name of the Rose), and Federico Fellini, whose last three films he photographed.\n\nHis collaboration with Pier Paolo Pasolini was especially fruitful: they made twelve films together, including Pasolini's debut Accattone (1961), Mamma Roma (1962), The Gospel According to St. Matthew (1964), The Decameron (1971), The Canterbury Tales (1972) and Salò o le 120 giornate di Sodoma (1976).\n\nHis last film was Roberto Benigni's Life Is Beautiful (1997), for which he won his fourth David di Donatello for Best Cinematography. In 2005 he was awarded the American Society of Cinematographers' International Achievement Award. In August of the same year, he died at home in Rome.\n\nTonino Delli Colli died from a heart attack in 2005 at the age of 81 in Rome, Italy.\n\nIn 2005, Delli Colli was posthumously awarded the Lifetime Achievement Award at the 13th annual Camerimage Film Festival in Łódź, Poland.\n\n ", new DateTime(1922, 11, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2005, 8, 16, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0005686", "Camera", "Tonino Delli Colli", new List<string> { "Antonio Delli Colli" }, "Rome, Italy", 7.5250000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sgr90whx93wMsLqRTFUzETI3Z8U.jpg" },
                    { 2378, "Franco Cristaldi (Turin, 3 October 1924 – Montecarlo, 1 July 1992) was an Italian film producer, credited with producing (or co-producing) feature films from the 1950s to the 1990s.\n\nIn 1946 Cristaldi founded Vides Cinematografica in Turin. This production company initially produced short and documentary films, and would later be renamed to Cristaldifilm in the 1980s.\n\nIn the 1950s, Cristaldi changed his attention to feature films and moved to Rome. During his long career, he worked with directors and screenwriters such as Francesco Rosi, Pietro Germi, Mario Monicelli, Federico Fellini, Luchino Visconti, and Giuseppe Tornatore. A noted film producer from some years in his native Italy, some of Cristaldi's most successful films internationally included The Name of the Rose and Nuovo cinema Paradiso. (The former winning a César and two BAFTAs, and the latter winning several BAFTAs, the Grand Prix at Cannes, and Best Foreign Language Film at the 62nd Academy Awards).\n\nIn 1977 Cristaldi was elected president of the International Federation of Film Producers Associations, and was a member of the jury at the 1984 Cannes Film Festival.\n\nCristaldi was born in Turin, Italy in 1924, and studied at university for a time before focusing his interests on cinema.\n\nHe was first married to Carla Simonetti with whom he had a son, Massimo. He applied to the Vatican to have this marriage annulled, and from 1966 lived with actress Claudia Cardinale. Cristaldi claimed to have married Cardinale, but she refuted this, saying he threw a marriage party, without ever officially marrying her. He mentored Cardinale through her own film career, producing many of her films, until their separation in 1975. In 1983, he married Eritrean actress Zeudi Araya, who starred in several Cristaldi-produced films.\n\nFranco Cristaldi died in Montecarlo in 1992, survived by his wife Zeudi, son Massimo, and adopted son Patrick, the son of Claudia Cardinale.\n\nSource: Article \"Franco Cristaldi\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1924, 10, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 7, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0188053", "Production", "Franco Cristaldi", new List<string>(), "Turin, Piedmont, Italy", 5.0510000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wDQ19zZKLBSiwSIIuTKdX6gszYn.jpg" },
                    { 2505, "James Oliver Cromwell (born 27 January 1940) is an American film and television actor, probably best known for his role as Dr. Zefram Cochrane in Star Trek: First Contact. He has been nominated for an Oscar, three Emmy Awards, and four Screen Actors Guild Awards during his career.\n\nCromwell was born in Los Angeles, California and was raised in Manhattan, New York. He was adopted by actress Kay Johnson and actor, director and producer John Cromwell, who was blacklisted during the McCarthy era. He was educated at The Hill School, Middlebury College and Carnegie Institute of Technology (now Carnegie Mellon University), where he studied engineering. Like both his parents, he was drawn to the theater, doing everything from Shakespeare to experimental plays.\n\nHe has long been an advocate of leftist causes. In an October 2008 interview, he strongly attacked the Republican Party and the George W. Bush administration, saying their controversial foreign policy would \"either destroy us or the entire planet.\" He became a vegetarian in 1974 after seeing a stockyard in Texas and experiencing the \"smell, terror and anxiety.\" He became an ethical vegan while playing the character of Farmer Hoggett in the movie Babe in 1995. He frequently speaks out on issues regarding animal cruelty for PETA, largely the treatment of pigs.\n\nCromwell was married to Anne Ulvestad from 1976 to 1986. They had three children. He married his second wife, Julie Cobb, on 29 May 1986.", new DateTime(1940, 1, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000342", "Acting", "James Cromwell", new List<string> { "Jim Crowell", "Jamie Cromwell", "Джеймс Кромуэлл", "Τζέιμς Κρόμγουελ", "詹姆斯·克隆威爾", "詹姆斯.克隆威爾" }, "Los Angeles, California, USA", 26.827999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vpNQQbM5PtxsYmVm4oh79SGFyUK.jpg" },
                    { 2545, "Lawrence Bender is an American film producer.", new DateTime(1957, 10, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0004744", "Production", "Lawrence Bender", new List<string>(), "New York City, New York, USA", 6.4320000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mZRwkIvUj8USnS7Jfwd6VdHkY2x.jpg" },
                    { 2555, "From Wikipedia, the free encyclopedia. David Aaron Proval (born May 20, 1942) is an American actor, known for his roles as Richie Aprile on the HBO television series The Sopranos and as Tony DeVienazo in the 1973 Martin Scorsese film Mean Streets opposite Robert De Niro and Harvey Keitel.\n\nProval was born in Brooklyn, New York of Jewish heritage,  the son of actress Clara Katz of Romanian origin.  He has appeared in such feature films as The Shawshank Redemption, Mob Queen, Four Rooms, UHF, Innocent Blood, The Siege, a cameo appearance in Smokin' Aces, and has had recurring roles in television shows such as Picket Fences, Boomtown and Everybody Loves Raymond. In 1977 his voice was heard in the cult animated film WIZARDS, as the robot assassin Necron 99.\n\nIn 2008, David Proval starred in the comedy City of Shoulders and Noses. The film is being produced by Sybil Danning, George Parra, and Tommy Ardolino.\n\nDescription above from the Wikipedia article David Proval, licensed under CC-BY-SA,full list of contributors on Wikipedia.    ", new DateTime(1942, 5, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0698998", "Acting", "David Proval", new List<string> { "Clark Katz" }, "Brooklyn, New York City, New York, USA", 9.4079999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ku3LWQXiJ80nWgs21fKvTMaR6Ui.jpg" },
                    { 2636, "Sir Alfred Joseph Hitchcock, KBE (13 August 1899 – 29 April 1980), was an English director and producer. Labeled as the \"Master of Suspense\", he became known for thrillers, often combined with a dark sense of humor. After a successful career in his native country, Hitchcock moved to Hollywood in 1939. Over a career spanning more than half a century, Hitchcock fashioned for himself a distinctive and recognizable directorial style. He pioneered the use of a camera made to move in a way that mimics a person's gaze, forcing viewers to engage in a form of voyeurism. He framed shots to maximize anxiety, fear, or empathy, and used innovative film editing. His stories frequently feature fugitives on the run from the law alongside icy blonde female characters. Many of Hitchcock's films have twist endings and thrilling plots featuring depictions of violence, murder, and crime, although many of the mysteries function as decoys —or MacGuffins— meant only to serve thematic elements in the film and the extremely complex psychological examinations of the characters. Hitchcock's films also borrow many themes from psychoanalysis and feature strong sexual undertones. Through his cameo appearances in his own films, interviews, film trailers, and the television program Alfred Hitchcock Presents (1955-1965), he became a cultural icon.\n\nHitchcock is widely regarded as one of the most influential figures in the history of cinema. In 2002, Hitchcock was ranked 2nd behind Orson Welles in the critics' top ten poll in the list of The Greatest Directors of All Time compiled by the Sight & Sound magazine. Andrew Sarris in his influential book of film criticism The American Cinema: Directors and Directions 1929–1968 included him in the \"pantheon\" of the 14 greatest film directors who had worked in the United States.\n\nHitchcock's critically most acclaimed film is the psychological thriller film Vertigo (1958). Although being a mild failure upon its release, it has risen in popularity over the decades. In 2012 it even replaced Orson Welles' Citizen Kane as the greatest film ever made in the Sight & Sound critics' poll. Regarding visual style, Vertigo is often declared as Hitchcock's most perfect film. The use of color symbolism, meticulously composed shots, and the famous \"Vertigo effect\" (dolly zoom) continue to be studied and admired.\n\nHitchcock's most commercially successful and most famous film is Psycho (1960), which had a significant impact on the horror genre, especially the slasher film.  Hitchcock was able to prove his skills with the mystery thriller film Rear Window (1954), to create suspense within a confined setting - primarily the protagonist's apartment. In this film, voyeurism, one of Hitchcock's favorite subjects, is an essential aspect.\n\nMany of Hitchcock's spy films, most notably North by Northwest (1959) and Notorious (1946),  had a major impact on the Mission: Impossible and James Bond series.", new DateTime(1899, 8, 13, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1980, 4, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.alfredhitchcock.com", "nm0000033", "Directing", "Alfred Hitchcock", new List<string> { "Hitch", "The Master of Suspense", "Sir Alfred Hitchcock", "Альфред Хичкок", "亞弗列·希治閣", "อัลเฟรด ฮิตช์ค็อก", "アルフレッド・ヒッチコック", "ألفريد هتشكوك", "알프레드 히치콕", "אלפרד היצ'קוק", "Άλφρεντ Χίτσκοκ", "Sir Alfred Joseph Hitchcock", "آلفرد هیچکاک", "Alfred Joseph Hitchcock", "앨프리드 히치콕", "阿尔弗雷德·希区柯克" }, "Leytonstone, London, England, UK", 18.814, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\108fiNM6poRieMg7RIqLJRxdAwG.jpg" },
                    { 2651, "From Wikipedia, the free encyclopedia.\n\nEdward Binns (September 12, 1916 – December 4, 1990) was an American stage, film, and television actor. He had a wide-spanning career in film and television, often portraying competent, hard working, and purposeful characters in his various roles.  Binns was born in Philadelphia, Pennsylvania. One of the first members of the newly formed Actors Studio, Binns began studying with Elia Kazanin the fall of 1947. After appearing in a number of Broadway plays, Binns began appearing in films in the early 1950s. Some of his notable roles include playing Juror #6 in 12 Angry Men and Lieutenant GeneralWalter Bedell Smith in the Academy Award-winning film Patton (1970).  Binns featured in Alfred Hitchcock's North by Northwest as a police detective. He played a key role as bomber pilot Colonel Grady in the 1964 film Fail-Safe.  Binns also appeared in dozens of television programs including NBC's legal drama Justice, Rod Cameron's syndicated State Trooper, the syndicated adventure series Whirlybirds, the ABC/Warner Brotherswestern series, The Dakotas, the ABC rodeo drama, Stoney Burke, and ABC's war drama 12 O'Clock High. He was cast in CBS's Richard Diamond, Private Detective (as Larrabee in the 1958 episode \"Pension Plan\"), The Investigators and Thriller (U.S. TV series).  Binns appeared as Colonel Robert Baldwin with June Allyson as his screen wife, Eleanor Baldwin, in the 1961 episode \"Without Fear\" of Allyson's CBS anthology series, The DuPont Show with June Allyson. Also that year he made two guest appearances on Perry Mason, first as Lloyd Castle in \"The Case of the Angry Dead Man,\" then as Charles Griffin in \"The Case of the Malicious Mariner,\" and in an episode of The Asphalt Jungle. He had a leading role in Rod Serling's The Twilight Zone in the 1960 episode \"I Shot an Arrow into the Air\".  Binns also appeared in two episodes of ABC's The Untouchables as gunman Steve Ballard and in a later episode as a doctor.  He was a cast member of CBS's The Nurses from 1962 through 1964. He appeared in an episode of the ABC espionage drama Blue Light early in 1966, and in ABC's It Takes a Thief (1969–1970) with Robert Wagner. Binns also appeared in one episode of the ABC series A Man Called Shenandoah, with Robert Horton, as General Korshak on CBS's M*A*S*H, in an episode of NBC's The Brian Keith Show, and in three episodes of ABC's The Fugitive. His distinctive voice was also heard in hundreds of radio and television commercials.  Binns died from a heart attack at the age of seventy-four while traveling from New York City to his home inConnecticut. His ashes were scattered at his residence.", new DateTime(1916, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1990, 12, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0083081", "Acting", "Edward Binns", new List<string> { "Ed Binns", "Eddie Binns", "Edwards Binns", "Edwared Binns" }, "Philadelphia, Pennsylvania, USA", 11.744999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\s3fk0d0fwuj6bDVP9AcPUXFsGmK.jpg" },
                    { 2655, "George Tomasini (April 20, 1909 – November 22, 1964) was an American film editor, born in Springfield, Massachusetts who had a decade long collaboration with director Alfred Hitchcock, editing nine of his movies between 1954-1964. Tomasini edited many of Hitchcock's best-known works, such as the horror film classics The Birds (1963) and Psycho (1960), the spy thriller North by Northwest (1959), the director's masterpieces Vertigo (1958) and Rear Window (1954), as well as other memorable films such as the original Cape Fear (1962). On a 2012 listing of the 75 best edited films of all time, compiled by the Motion Picture Editors Guild based on a survey of its members, four films edited by Tomasini for Hitchcock appear. No other editor appeared more than three times on this listing. The listed films were Psycho, Vertigo, Rear Window, and North by Northwest.\n\nGeorge Tomasini was known for his innovative film editing which, together with Hitchcock's stunning techniques, redefined cinematic language. Tomasini's cutting was always stylish and experimental, all the while pursuing the focus of the story and the characters.[citation needed] Hitchcock and Tomasini's editing of Rear Window has been treated at length in Valerie Orpen's monograph, Film Editing: The Art of the Expressive. His dialogue overlapping and use of jump cuts for exclamation points was dynamic and innovative (such as in the scene in The Birds where the car blows up at the gas station and Tippi Hedren's character watches from a window, as well as the infamous \"shower scene\" in Psycho). George Tomasini's techniques would influence many subsequent film editors and filmmakers.\n\nGeorge Tomasini was nominated for the Academy Award for Film Editing for North by Northwest, but Ben-Hur's editors won the award that year.", new DateTime(1909, 4, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1964, 11, 22, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0866462", "Editing", "George Tomasini", new List<string>(), "Springfield, Massachusetts, USA", 3.6949999999999998, null },
                    { 2829, "Andrzej Seweryn (born 25 April 1946) is a Polish actor and director. One of the most successful Polish theatre actors, he starred in over 50 films, mostly in Poland, France and Germany. He is also one of only three non-French actors to be hired by the Paris-based Comédie-Française. He is currently serving as director general of the Polski Theatre in Warsaw. Has three children with three different wives: daughter Maria Seweryn (born 1975) with his first wife, Polish actress, Krystyna Janda and two sons Yann-Baptiste and Maximilien.", new DateTime(1946, 4, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0786614", "Acting", "Andrzej Seweryn", new List<string> { "안제이 세베린" }, "Heilbronn, Germany", 23.0, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uYohJvqAai28Piqa0eEs6zAeFer.jpg" },
