                    { 2875, "Dean Tavoularis is a Greek American motion picture production designer whose work appeared in numerous box office hits such as The Godfather films, Apocalypse Now, The Brink's Job, One from the Heart and Bonnie and Clyde.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1932, 5, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0851790", "Art", "Dean Tavoularis", new List<string>(), "Lowell, Massachusetts, USA", 6.3819999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hrRBaXUn2k29qd1MvAxuag5L32c.jpg" },
                    { 2988, "", new DateTime(1938, 10, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0539794", "Editing", "Barry Malkin", new List<string>(), null, 1.661, null },
                    { 3027, "Stephen King is an American author of contemporary horror, suspense, science fiction, and fantasy fiction. His books have sold more than 350 million copies, which have been adapted into a number of feature films, television movies, and comic books. As of 2011, King has written and published 49 novels, including seven under the pen name Richard Bachman, five non-fiction books, and nine collections of short stories. Many of his stories are set in his home state of Maine. King has received Bram Stoker Awards, World Fantasy Awards, British Fantasy Society Awards, his novella The Way Station was a Nebula Award novelette nominee, and in 2003, the National Book Foundation awarded him the Medal for Distinguished Contribution to American Letters.", new DateTime(1947, 9, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.stephenking.com/", "nm0000175", "Writing", "Stephen King", new List<string> { "Stephen Edwin King ", "John Swithen", "Richard Bachman", "스티븐 킹", "Beryl Evans", "Στίβεν Κινγκ", "Стивен Кинг" }, "Portland, Maine, USA", 21.792000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7r5nEzNanuEhmxtpsKE1uCBU5Jd.jpg" },
                    { 3083, "​From Wikipedia, the free encyclopedia.\n\nMario Gianluigi Puzo  (October 15, 1920 – July 2, 1999) was an American author and screenwriter, known for his novels about the Mafia, including The Godfather (1969), which he later co-adapted into a film with Francis Ford Coppola. He won the Academy Award for Best Adapted Screenplay in both 1972, and 1974.\n\nDescription above from the Wikipedia article Mario Puzo, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1920, 10, 15, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1999, 7, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.mariopuzo.com/", "nm0701374", "Writing", "Mario Puzo", new List<string>(), "New York City, New York, USA", 7.6459999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lEsT1uCZAZg1nYDQe3Fsj9CalzT.jpg" },
                    { 3084, "Marlon Brando Jr. (April 3, 1924 – July 1, 2004) was an American actor. Considered one of the most influential actors of the 20th century, he received numerous accolades throughout his career which spanned six decades, including two Academy Awards, two Golden Globe Awards, and three British Academy Film Awards. Brando was also an activist for many causes, notably the civil rights movement and various Native American movements. Having studied with Stella Adler in the 1940s, he is credited with being one of the first actors to bring the Stanislavski system of acting and method acting, derived from the Stanislavski system, to mainstream audiences.\n\nHe initially gained acclaim and his first Academy Award nomination for Best Actor in a Leading Role for reprising the role of Stanley Kowalski in the 1951 film adaptation of Tennessee Williams' play A Streetcar Named Desire, a role that he originated successfully on Broadway. He received further praise, and a first Academy Award and Golden Globe Award, for his performance as Terry Malloy in On the Waterfront, and his portrayal of the rebellious motorcycle gang leader Johnny Strabler in The Wild One proved to be a lasting image in popular culture. Brando received Academy Award nominations for playing Emiliano Zapata in Viva Zapata! (1952); Mark Antony in Joseph L. Mankiewicz's 1953 film adaptation of Shakespeare's Julius Caesar; and Air Force Major Lloyd Gruver in Sayonara (1957), an adaptation of James A. Michener's 1954 novel.\n\nThe 1960s saw Brando's career take a commercial and critical downturn. He directed and starred in the cult western One-Eyed Jacks, a critical and commercial flop, after which he delivered a series of notable box-office failures, beginning with Mutiny on the Bounty (1962). After ten years of underachieving, he agreed to do a screen test as Vito Corleone in Francis Ford Coppola's The Godfather (1972). He got the part and subsequently won his second Academy Award and Golden Globe Award in a performance critics consider among his greatest. He declined the Academy Award due to alleged mistreatment and misportrayal of Native Americans by Hollywood. The Godfather was one of the most commercially successful films of all time, and alongside his Oscar-nominated performance in Last Tango in Paris (1972), Brando reestablished himself in the ranks of top box-office stars.\n\nAfter a hiatus in the early 1970s, Brando was generally content with being a highly paid character actor in supporting roles, such as Jor-El in Superman (1978), as Colonel Kurtz in Apocalypse Now (1979), and Adam Steiffel in The Formula (1980), before taking a nine-year break from film. According to the Guinness Book of World Records, Brando was paid a record $3.7 million ($16 million in inflation-adjusted dollars) and 11.75% of the gross profits for 13 days' work on Superman.\n\nBrando was ranked by the American Film Institute as the fourth-greatest movie star among male movie stars whose screen debuts occurred in or before 1950. He was one of only six actors named in 1999 by Time magazine in its list of the 100 Most Important People of the Century. In this list, Time also designated Brando as the \"Actor of the Century\".", new DateTime(1924, 4, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2004, 7, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.marlonbrando.com/", "nm0000008", "Acting", "Marlon Brando", new List<string> { "Marlon Brando Jr.", "Bud", "Марлон Брандо", "マーロン・ブランド", "말론 브란도", "มาร์ลอน แบรนโด", "مارلون براندو", "马龙·白兰度", "მარლონ ბრანდო", "Marlon Brando Junior" }, "Omaha, Nebraska, USA", 20.271000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5o8whyfLBWXLODEcMP8K45lPTjT.jpg" },
                    { 3085, "James Edmund Caan (/kɑːn/ KAHN; March 26, 1940 – July 6, 2022) was an American actor who was nominated for several awards, including four Golden Globes, an Emmy, and an Oscar. Caan was awarded a motion pictures star on the Hollywood Walk of Fame in 1978.\n\nAfter early roles in Howard Hawks's El Dorado (1966), Robert Altman's Countdown (1967) and Francis Ford Coppola's The Rain People (1969), he came to prominence for playing his signature role of Sonny Corleone in The Godfather (1972), for which he was nominated for the Academy Award for Best Supporting Actor and the Golden Globe for Best Supporting Actor. He reprised the role of Sonny Corleone in The Godfather Part II (1974) with a cameo appearance at the end.\n\nCaan had significant roles in films such as Brian's Song (1971), Cinderella Liberty (1973), The Gambler (1974), Rollerball (1975), A Bridge Too Far (1977), and Alan J. Pakula's Comes a Horseman (1978). He had sporadically worked in film since the 1980s, with his notable performances including roles in Thief (1981), Gardens of Stone (1987), Misery (1990), Dick Tracy (1990), Bottle Rocket (1996), The Yards (2000), Dogville (2003), and Elf (2003).\n\nDescription above from the Wikipedia article James Caan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1940, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 7, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001001", "Acting", "James Caan", new List<string> { "James Edmund Caan ", "Jimmy Caan", "Джеймс Каан", "詹姆斯·凯恩" }, "The Bronx, New York, USA", 30.934000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\v3flJtQEyczxENi29yJyvnN6LVt.jpg" },
                    { 3086, "​From Wikipedia, the free encyclopedia.\n\nRichard Salvatore Castellano  (September 4, 1933 – December 10, 1988) was an American actor who is best remembered for his role as Peter Clemenza in The Godfather.\n\nDescription above from the Wikipedia article Richard S. Castellano, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1933, 9, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1988, 12, 10, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0144710", "Acting", "Richard S. Castellano", new List<string>(), "The Bronx, New York, U.S", 12.087999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1vr75BdHWret81vuSJ3ugiCBkxw.jpg" },
                    { 3087, "Robert Selden Duvall (born January 5, 1931) is an American actor and filmmaker. He is the recipient of an Academy Award, four Golden Globe Awards, a BAFTA Award, two Primetime Emmy Awards and a Screen Actors Guild Award.\n\nDuvall began appearing in theater in the late 1950s, moving into television and film roles during the early 1960s, playing Boo Radley in To Kill a Mockingbird (1962) and appearing in Captain Newman, M.D. (1963), as Major Frank Burns in the blockbuster comedy M*A*S*H (1970) and the lead role in THX 1138 (1971), as well as Horton Foote's adaptation of William Faulkner's Tomorrow (1972), which was developed at The Actors Studio and is his personal favorite. This was followed by a series of critically lauded performances in commercially successful films.\n\nHe has starred in numerous films and television series, including The Twilight Zone (1963), The Outer Limits (1964), The F.B.I. (1966), Bullitt (1968), True Grit (1969), Joe Kidd (1972), The Godfather (1972), The Godfather Part II (1974), The Conversation (1974), Network (1976), Apocalypse Now (1979), The Great Santini (1979), Tender Mercies (1983) (which earned him the Academy Award for Best Actor), The Natural (1984), Colors (1988), Lonesome Dove (1989), The Handmaid's Tale (1990), Days of Thunder (1990), Rambling Rose (1991), Falling Down (1993), Secondhand Lions (2003), The Judge (2014), and Widows (2018).\n\n​From Wikipedia, the free encyclopedia", new DateTime(1931, 1, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000380", "Acting", "Robert Duvall", new List<string> { "Robert Selden Duvall", "Robert Duval", "Robert S. Duvall", "로버트 듀발", "ロバート・デュヴァル" }, "San Diego, California, USA", 27.678000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3tcKxC5Sc3DJ6XPDKKC2EAomEWn.jpg" },
                    { 3088, "Sterling Walter Hayden, born Sterling Relyea Walter, was an American actor and author. He didn't really harbor any aspirations of being an actor, dropped out of high school at the age of 16 and hired on as mate on a schooner. He was a ship's captain at 22, and in need of cash to buy his own boat, established himself as a model in New York, discovered by Paramount Studios talent scouts and offered a contract.\n\nSterling Hayden, the handsome tall blond actor who played wholesome leading-man movie roles in the 1940's and 1950's and later weathered into a rough-hewn solid character actor in films such as ''Dr. Strangelove'', ''The Godfather,'' \"Nine to Five\" and \"King of the Gypsies\". He appeared in 71 feature films and tv-productions  from the debut in \"Virginia\" 1941 to  the tv mini-series \"The Blue and the Gray\" in 1982.\n\nHe wrote of his obsessive fascination with the sea in a 1963 autobiography, ''Wanderer,'' and in 1970 his 700-page epic novel of the sea, ''Voyage,'' was a main selection of the Book-of-the-Month Club.\n\nSterling Hayden appeared in the German documentary, ''Pharos of Chaos,'' (1983) filmed aboard his barge in Europe, and seemed to be in an alcoholic stupor much of the time, supplementing his wine intake with hashish. On camera he said: ''What confuses me is I ain't all that unhappy. So why do I drink, I don't know.''", new DateTime(1916, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1986, 5, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001330", "Acting", "Sterling Hayden", new List<string> { "Sterling Relyea Walter", "Sterling Walter Hayden" }, "Upper Montclair, New Jersey, USA", 13.779, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eRKaKeHjMKjNPOuENLccfVuyfVm.jpg" },
                    { 3090, "​From Wikipedia, the free encyclopedia.\n\nRichard Conte (March 24, 1910 – April 15, 1975) was an American actor. He appeared in numerous films from the 1940s through 1970s, including I'll Cry Tomorrow and The Godfather.\n\nDescription above from the Wikipedia article Richard Conte, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1910, 3, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1975, 4, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0002017", "Acting", "Richard Conte", new List<string>(), "Jersey City, New Jersey, USA", 9.891, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bDegodf4dYGXMejdm4T6XgOJwlr.jpg" },
                    { 3091, "​From Wikipedia, the free encyclopedia.  \n\nAlfred Lettieri (February 24, 1928–October 18, 1975) was an American actor, known for his portrayal of Virgil Sollozzo, in The Godfather.\n\nLettieri projected an aura of menace and ruthlessness in his film roles, which he attributed to his acquaintance with real-life gangsters, including Joey Gallo. At the age of 36, he made his screen debut in the television film The Hanged Man. Lettieri acted with some of Hollywood's biggest screen names including Steve McQueen in The Getaway, Charles Bronson in Mr. Majestyk, John Wayne in McQ and both Marlon Brando and Al Pacino in The Godfather.\n\nLettieri died of a heart attack in 1975, at the age of 47, leaving two children.\n\nDescription above from the Wikipedia article  Al Lettieri, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1928, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1975, 10, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0504803", "Acting", "Al Lettieri", new List<string> { "Alfredo Lettieri ", "Anthony Lettieri ", "Alfredo \"Al\" Lettieri" }, "New York City, New York, USA", 10.302, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fE5mEWPkkVJlCji0EoKht8PYw89.jpg" },
                    { 3092, "Diane Hall Keaton (born Diane Hall; January 5, 1946) is an American actress. Known for her idiosyncratic personality and fashion style, she has received various accolades throughout her career spanning over six decades, including an Academy Award, a British Academy Film Award, two Golden Globe Awards, and the AFI Life Achievement Award.\n\nKeaton began her career on stage appearing in the original 1968 Broadway production of the musical Hair. The next year, she received a Tony Award for Best Featured Actress in a Play nomination for her performance in Woody Allen's comic play Play it Again, Sam. She then made her screen debut in a small role in Lovers and Other Strangers (1970). She rose to prominence with her first major film role as Kay Adams-Corleone in Francis Ford Coppola's The Godfather (1972), a role she reprised in its sequels The Godfather Part II (1974) and The Godfather Part III (1990). The films that most shaped her career were those with director and co-star Woody Allen, beginning with the film adaptation of Play It Again, Sam (1972). Her next two films with Allen, Sleeper (1973) and Love and Death (1975), established her as a comic actor. Her fourth, the romantic comedy Annie Hall (1977), won her the Academy Award for Best Actress.\n\nTo avoid being typecast as her Annie Hall persona, Keaton appeared in several dramatic films, starring in Looking for Mr. Goodbar (1977) and Allen's Interiors (1978), and received three more Academy Award nominations for playing feminist activist Louise Bryant in Reds (1981), a woman with leukemia in Marvin's Room (1996), and a dramatist in Something's Gotta Give (2003). Keaton's other popular films include Manhattan (1979), Baby Boom (1987), Father of the Bride (1991), Manhattan Murder Mystery (1993), Father of the Bride Part II (1995), The First Wives Club (1996), The Family Stone (2005), Morning Glory (2010), Finding Dory (2016) and Book Club (2018).", new DateTime(1946, 1, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000473", "Acting", "Diane Keaton", new List<string> { "Diane Hall", "Ντάιαν Κίτον", "黛安·基顿", "Даєн Кітон", "Даян Кийтън" }, "Los Angeles, California, USA", 30.786999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\siSWRRFN9uO6iCN7y9OrHU5IaJ.jpg" },
                    { 3093, "Tall, dour-faced and slouch-shouldered character actor Abraham Charles Vigoda (February 24, 1921 – January 26, 2016) proved himself in both gritty dramatic roles, and as an actor with wonderful comedic timing.\n\nVigoda was born in Brooklyn, New York, to Lena (Moses) and Samuel Vigoda, both Russian Jewish immigrants. His father was a tailor on the Lower East Side. He made his first stage appearance at the age of 17 and plodded away in small theater shows for over 20 years. For the majority of film-goers, Vigoda first came to prominence in The Godfather (1972) as the double-crossing Tessio, pleading with Robert Duvall to get him off the hook \"for old times' sake.\" He also appeared in its sequel.\n\nVigoda had roles in a few nondescript TV films before landing the plum part of Sgt. Phil Fish on the brilliant sitcom Barney Miller (1974). Perhaps his best known role, Sgt. Fish proved popular enough to be spun off to his own (short-lived) series Fish (1977).\n\nWith his long face and unusual looks, Vigoda remained in high demand in mafioso-type roles, and for a while in the mid-1980s, he was mistakenly believed to have been dead, leading producers to remark, \"I need an Abe Vigoda type actor,\" not realizing Vigoda was still alive and well. The 1990s and beyond became busy again for him, with appearances in North (1994), The Misery Brothers (1995), A Brooklyn State of Mind (1998), and Crime Spree (2003). He continued acting into his 90s, surprising audiences with his entertaining style.\n\nAbe Vigoda died in his sleep on January 26, 2016 in Woodland Park, New Jersey.", new DateTime(1921, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2016, 1, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001820", "Acting", "Abe Vigoda", new List<string> { "Abraham Charles Vigodah" }, "New York City, New York, USA", 11.602, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\luWKPNb58IgJ2ovrtgPAzHGLLYL.jpg" },
                    { 3094, "Talia Shire, born on April 25, 1946, in Lake Success, New York, is an American actress. She gained widespread recognition for her role as Adrian Pennino, the wife of Rocky Balboa, in the iconic \"Rocky\" film series. Shire's portrayal of the timid but resilient Adrian earned her acclaim and a place in cinematic history. Beyond \"Rocky,\" she also starred as Connie Corleone in \"The Godfather\" films, further establishing her as a versatile and talented actress. With a career spanning several decades, Shire's contributions to film have solidified her as a respected figure in Hollywood.", new DateTime(1946, 4, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001735", "Acting", "Talia Shire", new List<string> { "Talia Coppola" }, "Lake Success, New York, USA", 26.045000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oktJmlLeyYKBCWPNjHskDwAfjct.jpg" },
                    { 3095, "With a singularly nebulous background, which, by his account, included stints as a Las Vegas nightclub emcee, radio personality, and jewelry tycoon, and comparatively little acting experience, Gianni Russo won the role of Carlo Rizzi in The Godfather (1972) on the basis of his screen test. Since then, Russo has remained busy as an actor, mostly playing assorted \"wiseguys\" and Mafia types. He was appeared again with Marlon Brando in a small role in The Freshman (1990) in which Brando parodied his Don Corleone role to good effect. IMDb Mini Biography By: Bob Sorrentino", new DateTime(1943, 12, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0751625", "Acting", "Gianni Russo", new List<string>(), "New York City, New York, USA", 8.6210000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jfeGnQfXMzKXsuSPm9oTxm6FOuz.jpg" },
                    { 3096, "John Holland Cazale (August 12, 1935 - March 12, 1978) was an American actor. He appeared in five films during six years, each one nominated for the Academy Award for Best Picture: The Godfather, The Conversation, The Godfather Part II, Dog Day Afternoon, and The Deer Hunter. He appeared in archival footage in The Godfather Part III, also nominated for Best Picture, making him the only actor to have this multi-film distinction. From his start as a theater actor, he became one of Hollywood's premier character actors, starting with his role as the doomed, weak-minded Fredo Corleone opposite longtime friend Al Pacino in Francis Ford Coppola's film The Godfather and its 1974 sequel.", new DateTime(1935, 8, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1978, 3, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001030", "Acting", "John Cazale", new List<string> { "John Holland Cazale" }, "Boston, Massachusetts, USA", 13.762, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\41wXX1FBalyIuf5eaA4S43Y8IfZ.jpg" },
                    { 3097, "From Wikipedia, the free encyclopedia\n\nGordon Hugh Willis, Jr., ASC (May 28, 1931 – May 18, 2014) was an American cinematographer. He is best known for his work on Francis Ford Coppola's The Godfather series as well as Woody Allen's Annie Hall and Manhattan. Fellow cinematographer William Fraker called Willis's work a \"milestone in visual storytelling\", while one critic suggested that Willis \"defined the cinematic look of the 1970s: sophisticated compositions in which bolts of light and black put the decade's moral ambiguities into stark relief\".\n\nWhen the International Cinematographers Guild conducted a survey in 2003, they placed Willis among the ten most influential cinematographers in history.", new DateTime(1931, 5, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2014, 5, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0932336", "Camera", "Gordon Willis", new List<string> { "Gordon Hugh Willis Jr.", "Gordon Hugh Willis, Jr." }, "Astoria, New York, USA", 6.6660000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6gOmfatlF7UdhaHi2tPsZMb5vmz.jpg" },
                    { 3098, "From Wikipedia, the free encyclopedia\n\nGiovanni \"Nino\" Rota (3 December 1911 – 10 April 1979) was an Italian composer, pianist, conductor and academic who is best known for his film scores, notably for the films of Federico Fellini and Luchino Visconti. He also composed the music for two of Franco Zeffirelli's Shakespeare films, and for the first two films of Francis Ford Coppola's Godfather trilogy, receiving the Academy Award for Best Original Score for The Godfather Part II (1974).\n\nDuring his long career Rota was an extraordinarily prolific composer, especially of music for the cinema. He wrote more than 150 scores for Italian and international productions from the 1930s until his death in 1979—an average of three scores each year over a 46-year period, and in his most productive period from the late 1940s to the mid-1950s he wrote as many as ten scores every year, and sometimes more, with a remarkable thirteen film scores to his credit in 1954. Alongside this great body of film work, he composed ten operas, five ballets and dozens of other orchestral, choral and chamber works, the best known being his string concerto. He also composed the music for many theatre productions by Visconti, Zeffirelli and Eduardo De Filippo as well as maintaining a long teaching career at the Liceo Musicale in Bari, Italy, where he was the director for almost 30 years.", new DateTime(1911, 12, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1979, 4, 10, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000065", "Sound", "Nino Rota", new List<string> { "Giovanni \"Nino\" Rota Rinaldi", "Nino Rotta", "Nino Roto" }, "Milano, Lombardia, Italia", 4.3710000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\v42v3uM7jqwoZxDJ8MlEtT6Ol7a.jpg" },
                    { 3099, "", new DateTime(1910, 6, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1997, 7, 16, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0722000", "Editing", "William Reynolds", new List<string> { "William Henry Reynolds", "William H. Reynolds" }, "Elmira, New York, USA", 2.4740000000000002, null },
