                    { 3103, "", new DateTime(1923, 12, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2004, 3, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0340311", "Sound", "Charles Grenzbach", new List<string> { "Charles 'Bud' Grenzbach", "Bud Grenzbach" }, "New York City, New York, USA", 2.2589999999999999, null },
                    { 3104, "Chris Newman is an American Sound Mixer who has mostly worked on film productions. He won three Academy Awards for Best Sound for his work on the films The Exorcist, Amadeus and The English Patient. He was also nominated for The French Connection, The Godfather, Fame, A Chorus Line and The Silence of the Lambs.", new DateTime(1940, 2, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0628039", "Sound", "Chris Newman", new List<string> { "Christopher Newman", "Chris Newman, CAS" }, "New York City, New York, USA", 3.3100000000000001, null },
                    { 3105, "", new DateTime(1934, 4, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 1, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0692446", "Sound", "Richard Portman", new List<string>(), "Los Angeles, U.S.A", 4.133, null },
                    { 3115, "From Wikipedia, the free encyclopedia.\n\nAndrzej Sekuła (born 1954 in Wrocław, Poland) is a Polish cinematographer and film director. He left his native Poland in 1980 and currently lives in Los Angeles. His cinematography work has appeared in such prominent films as Reservoir Dogs and Pulp Fiction.\n\nIn Armored, Sekula's work helped convey the bleakness at the core of the film, critic A. O. Scott wrote in The New York Times.\n\nDescription above from the Wikipedia article Andrzej Sekuła, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1954, 12, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0782900", "Camera", "Andrzej Sekula", new List<string> { "Sekula" }, "Wrocław, Poland", 5.7949999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8vPRxAkQC1j22qvadt0H8ZByqBb.jpg" },
                    { 3129, "Timothy Simon Roth (born 14 May 1961) is an English actor and producer. He began acting on films and television series in the 1980s. He was among a group of prominent British actors of the era, the \"Brit Pack\".\n\nHe made his television debut in Made in Britain (1982), and theatrical film debut in The Hit (1984), for which he was nominated for the BAFTA Award for Most Promising Newcomer. Since then, he gained more attention for his roles in films, including The Cook, the Thief, His Wife & Her Lover, (1989), Vincent & Theo (1990), and Rosencrantz & Guildenstern Are Dead (1990). Roth collaborated with Quentin Tarantino on several films, such as Reservoir Dogs (1992), Pulp Fiction (1994), Four Rooms (1995), and The Hateful Eight (2015). For his performance in Rob Roy (1995), Roth won the BAFTA Award for Best Actor in a Supporting Role, and was nominated for a Golden Globe Award for Best Supporting Actor – Motion Picture and the Academy Award for Best Supporting Actor.\n\nRoth made his directorial debut with the film The War Zone (1999). He played Cal Lightman in the Fox series Lie to Me (2009–2011) and Jim Worth / Jack Devlin in the Sky Atlantic series Tin Star (2017–2020). Roth also portrayed Emil Blonsky / Abomination in the Marvel Cinematic Universe film The Incredible Hulk (2008), reprising the role in Shang-Chi and the Legend of the Ten Rings (2021) and the Disney+ series She-Hulk: Attorney at Law (2022).", new DateTime(1961, 5, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000619", "Acting", "Tim Roth", new List<string> { "Τιμ Ροθ", "Тим Рот", "팀 로스", "ティム・ロス" }, "London, England, UK", 24.937999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qSizF2i9gz6c6DbAC5RoIq8sVqX.jpg" },
                    { 3130, "Jennifer Beals (born December 19, 1963, height 5' 8½\" (1,74 m)) is an American actress and a former teen model. She is known for her roles as Alexandra \"Alex\" Owens in the 1983 film Flashdance, and as Bette Porter on the Showtime drama series The L Word. She earned an NAACP Image Award and a Golden Globe Award nomination for the former. She has appeared in more than 50 films.\n\nBeals was born on the South Side of Chicago, the daughter of Jeanne (née Anderson), an elementary school teacher, and Alfred Beals, who owned grocery stores. She is multiracial; her father was African American, and her mother is Irish American. She has two brothers, Bobby and Gregory.Her father died when Beals was nine years old, and her mother married Edward Cohen in 1981. Beals has said her biracial heritage had some effect on her, as she \"always lived sort of on the outside\", with an idea \"of being the other in society\". She got her first job at age 13 at an ice cream store, using her height at the time (she is now nearly 5 ft 9 in (1.75 m)), to convince her boss she was 16.\n\nBeals was inspired to become an actress by two events: doing a high school production of Fiddler on the Roof and seeing Balm in Gilead with Joan Allen while volunteer-ushering at the Steppenwolf Theatre.\n\nBeals graduated from the progressive Francis W. Parker School. She also was chosen to attend the elite Goodman Theatre Young People's Drama Workshop. Beals attended Yale University, receiving a B.A. in American literature in 1987; she deferred a term so she could film Flashdance. While at Yale, Beals was a resident of Morse College.\n\nDescription above from the Wikipedia article Jennifer Beals, licensed under CC-BY-SA, full list of contributors on Wikipedia. ​", new DateTime(1963, 12, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://thejenniferbeals.com", "nm0000884", "Acting", "Jennifer Beals", new List<string> { "Дженніфер Білз" }, "Chicago, Illinois, USA", 19.369, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uJYKQC9GfRU3LHugCVDbAP1DrFH.jpg" },
                    { 3137, "He was born in Puerto Rico 1959. Calderon moved to New York with his family at the age of six, where he grew up on the streets of the Lower East Side and Spanish Harlem. Following some time in college, he enlisted in the United States Army and served overseas as an infantryman.  Returning to the States, Calderon set his sights on an acting career. Starting out on the New York stage, he won an Obie Award for his performance in Blade to the Heat at the Public Theatre. His most notable Broadway role was opposite Robert De Niro in Cuba and His Teddy Bear. Calderon also appeared off-Broadway in such plays as Requiem For A Heavyweight and Divine Horsemen, and played Achilles in the New York Shakespeare Festival’s production of Troilus and Cressida in Central Park. He is a founding member of the Touchstone Theatre, the American Folk Theatre and the Labyrinth Theatre Company.\n\nCalderon was originally slated to portray the role of Jules Winnfield in Pulp Fiction; Samuel L. Jackson was subsequently given the role.\n\nCorrection Samuel Jackson told Tarantino he had messed up by not casting him in Reservoir Dogs. Tarantino agreed and told him he was writing a script and had a character that he had written specifically with Jackson in mind. Calderon had a better initial reading than Jackson and Tarantino gave serious consideration to casting him as Jules Winnfield.\n\nCalderon portrays Paul the bartender in dialogue scene between Butch Coolidge and Marsellus Wallace.\n\nCalderon also co-wrote Abel Ferrara's 1992 crime drama Bad Lieutenant, starring Harvey Keitel.\n\nCalderon acted in The Last Castle and the critically acclaimed independent feature Girlfight. His more than three dozen film credits also include Out of Sight, Cop Land, Four Rooms, Pulp Fiction, Bad Lieutenant, The Firm, The Addiction, Q &amp; A, Sea of Love, Clockers and King of New York. In addition, he has made numerous guest appearances on television series, including recurring roles on Dream Street, Law &amp; Order and Miami Vice.\n\nIn 2010, Calderon is set to star as The Businessman in Sanzhar Sultanov's crime drama - The Story.", new DateTime(1959, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0129538", "Acting", "Paul Calderon", new List<string> { "Paul Calderone " }, "Puerto Rico", 16.649999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xIORhcIDmFMlaS3ZS3em1QiTkt5.jpg" },
                    { 3138, "​From Wikipedia, the free encyclopedia.  \n\nKathleen Mary \"Kathy\" Griffin (born November 4, 1960) is an American actress, model, stand-up comedian, television personality, New York Times best-selling author and an LGBT rights advocate. Griffin first gained recognition for appearances on two episodes of Seinfeld, and then for her supporting role on the NBC sitcom Suddenly Susan. She was the star of the Bravo reality show Kathy Griffin: My Life on the D-List, for which she won two Emmy Awards as executive producer. She has also worked as a voice artist and red carpet commentator, in addition to several other career pursuits. From 2008-2013 she was nominated for a Grammy Award for Best Comedy Album, winning in 2013. In her bid to win a Tony Award, she made her Broadway debut in Kathy Griffin Wants a Tony in March 2011.\n\nDescription above from the Wikipedia article Kathy Griffin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1960, 11, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.kathygriffin.net/", "nm0004980", "Acting", "Kathy Griffin", new List<string> { "キャシー・グリフィン", "Kathy Griffith" }, "Chicago, Illinois, USA", 9.2100000000000009, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\psg895Ye46vGenRdX0EXvGOm92p.jpg" },
                    { 3142, "John Marley (October 17, 1907 – May 22, 1984) was an American actor who was known for his role as Phil Cavalleri in Love Story and as Jack Woltz— the defiant movie mogul who awakens to find the severed head of his prized horse in his bed—in The Godfather (1972). He starred in John Cassavetes' breakthrough feature Faces (1968) and appeared in The Glitter Dome (1984).\n\nDescription above from the Wikipedia article John Marley, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1907, 10, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1984, 5, 22, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0549134", "Acting", "John Marley", new List<string> { "John Marlieb", "Mortimer Leon Marlieb" }, "New York City, New York, USA", 12.092000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xyzwd0CiBjXfowH3HcPhvuWcV5B.jpg" },
                    { 3143, "Rudolph Bond (October 10, 1912 – March 29, 1982) was an American actor who was active from 1947 until his death. His work spanned Broadway, Hollywood and US television.\n\nBond was introduced to the world of acting at the age of 16. He was playing basketball with a group of friends when Julie Sutton, the director of a city amateur acting group (Neighborhood Players, which performed in the same building as the basketball area) approached the group and asked if anybody wanted to be in an upcoming play. He volunteered, and acted in several plays before leaving Philadelphia to join the United States Army. He spent four years in the army, was wounded while serving in World War II, and returned to Philadelphia upon his discharge.\n\nHe continued acting in the Neighborhood Players until 1945, when he won second prize in the John Golden Award for Actors, which allowed him to enroll in Elia Kazan's Actor's Studio in New York City. Kazan got him a substantial role in two stage productions. After his success in the second (A Streetcar Named Desire), he was invited to Hollywood to recreate his stage role in the movie version. In 1951 he appeared in \"Romeo and Juliet\" at the Broadhurst Theatre in New York and in 1960 he toured in \"Fiorello\" (which starred Tom Bosley). He spent the next thirty years bouncing between California and New York, and between movie and television work.", new DateTime(1912, 10, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1982, 3, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0094036", "Acting", "Rudy Bond", new List<string>(), "Philadelphia, Pennsylvania, USA", 7.3159999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wpSiw0GOUH2OWp1pkq4XR14VIaE.jpg" },
                    { 3144, "Al Martino was an American traditional pop and jazz singer. He had his greatest success as a singer between the early 1950s and mid-1970s, being described as \"one of the great Italian-American pop crooners\", and also became known as an actor, particularly for his role as singer Johnny Fontane in The Godfather.", new DateTime(1927, 10, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2009, 10, 13, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0553887", "Acting", "Al Martino", new List<string>(), "Philadelphia, Pennsylvania, USA", 4.9729999999999999, null },
                    { 3145, "Simonetta Stefanelli (born 30 November 1954) is an Italian actress, entrepreneur and fashion designer. Internationally, she is best known for her performance as Apollonia Vitelli-Corleone in the 1972 film The Godfather, directed by Francis Ford Coppola. Her other roles include appearances in Moses the Lawgiver, Scandal in the Family and Three Brothers. In 1992, Stefanelli made her last film appearance in the drama Le amiche del cuore (Close Friends) directed by her then husband Michele Placido. Description above from the Wikipedia article Jack Black, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1954, 11, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0824940", "Acting", "Simonetta Stefanelli", new List<string>(), "Rome, Lazio, Italy", 22.481999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sVDrhgxuE6SHnj7q07OG6ywPUYR.jpg" },
                    { 3170, "", null, null, 0, null, "nm0803752", "Production", "Mona Skager", new List<string>(), null, 1.784, null },
                    { 3171, "​From Wikipedia, the free encyclopedia.  \n\nLee Strasberg (November 17, 1901 – February 17, 1982) was an American actor, director and acting teacher.  He cofounded, with directors Harold Clurman and Cheryl Crawford, the Group Theatre in 1931, which was hailed as \"America's first true theatrical collective\".  In 1951, he became director of the non-profit Actors Studio, in New York City, considered \"the nation's most prestigious acting school\".  In 1969, Strasberg founded the Lee Strasberg Theatre and Film Institute in New York City and in Hollywood to teach the work he pioneered. He is considered the \"father of method acting in America,\" according to author Mel Gussow, and from the 1920s until his death in 1982 \"he revolutionized the art of acting by having a profound influence on performance in American theater and movies\".  From his base in New York, he trained several generations of theatre and film's most illustrious talents, including Anne Bancroft, Dustin Hoffman, Montgomery Clift, Marlon Brando, James Dean, Marilyn Monroe, Julie Harris, Paul Newman, Al Pacino, Robert De Niro and director Elia Kazan.  Former student Elia Kazan directed James Dean in East of Eden (1955), for which Kazan and Dean were nominated for Academy Awards. As a student, Dean wrote that Actors Studio was \"the greatest school of the theater [and] the best thing that can happen to an actor\".  Playwright Tennessee Williams, writer of A Streetcar Named Desire, said of Strasberg's actors, \"They act from the inside out. They communicate emotions they really feel. They give you a sense of life.\" Directors like Sidney Lumet, a former student, have intentionally used actors skilled in Strasberg's \"Method\".  Kazan, in his autobiography, wrote, \"He carried with him the aura of a prophet, a magician, a witch doctor, a psychoanalyst, and a feared father of a Jewish home.... [H]e was the force that held the thirty-odd members of the theatre together, and made them 'permanent.'\"  :61 Today, Ellen Burstyn, Al Pacino, and Harvey Keitel lead this nonprofit studio dedicated to the development of actors, playwrights, and directors.\n\nDescription above from the Wikipedia article Lee Strasberg, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1901, 9, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1982, 2, 17, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0833448", "Acting", "Lee Strasberg", new List<string>(), "Budzanów, Austria-Hungary", 4.2949999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\niSM7ejzddgaTcxjgJMYEFCr9Y2.jpg" },
                    { 3172, "", new DateTime(1923, 4, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1995, 2, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0311155", "Acting", "Michael V. Gazzo", new List<string>(), "Hillside, New Jersey, USA", 11.173, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cTY2Hlf6sIR9xLI95bBir7eI0N.jpg" },
                    { 3173, "Gervase Duan Spradlin (August 31, 1920 – July 24, 2011) was an American actor. Known for his distinctive accent and voice, he often played devious authority figures.\n\nDescription above from the Wikipedia article G. D. Spradlin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1920, 8, 31, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 7, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0819525", "Acting", "G. D. Spradlin", new List<string> { "G.D. Spradlin" }, "Pauls Valley, Oklahoma, USA", 9.3499999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pWNa9H3ABB3Ug9CwTfVNtHsCFjV.jpg" },
                    { 3174, "​From Wikipedia, the free encyclopedia.  \n\nRichard J. Bright (June 28, 1937 – February 18, 2006) was an American actor best known for his role as Al Neri in the The Godfather films.\n\nDescription above from the Wikipedia article Richard Bright, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1937, 6, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 2, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0109175", "Acting", "Richard Bright", new List<string> { "Eddie Gambino", "Richard Wright" }, "Brooklyn, New York, USA", 14.255000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\potMaJ2u5PRjXZb7qF9lSW1ldNZ.jpg" },
                    { 3175, "Richard Marks (November 10, 1943 – December 31, 2018) was an American film editor with more than 30 editing credits for feature and television films dating from 1972. In an extended, notable collaboration (1983–2010), he edited all of director James L. Brooks' feature films.", new DateTime(1943, 11, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 12, 31, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0548943", "Editing", "Richard Marks", new List<string>(), "New York City, New York", 1.7589999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gWguYz89bJ4DddPcYr8nntDv10U.jpg" },
                    { 3176, "Vic Ramos was born on September 1, 1930 in Los Angeles, California, USA. He was a casting director known for Star Wars: Episode IV - A New Hope (1977), Thief (1981) and The Taking of Pelham One Two Three (1974). He also acted in a few films. Ramos was married to Virginia Loew, granddaughter of Metro’s parent-company founder Marcus Loew. He died on October 21, 2007 in Manhattan, New York City, New York, USA of pulmonary failure due to pneumonia.", new DateTime(1930, 9, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2007, 10, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0708525", "Production", "Vic Ramos", new List<string>(), "Los Angeles, California, USA", 4.4340000000000002, null },
