                    { 3265, "Eli Herschel Wallach (December 7, 1915 – June 24, 2014) was an American film, television and stage actor, who gained fame in the late 1950s. For his performance in Baby Doll he won a BAFTA Award for Best Newcomer and a Golden Globe nomination. One of his most famous roles is that of Tuco in The Good, the Bad and the Ugly (1966). Other roles include his portrayal of Don Altobello in The Godfather Part III, Calvera in The Magnificent Seven, and Arthur Abbott in The Holiday. Wallach has received BAFTA Awards, Tony Awards and Emmy Awards for his work. Wallach also has a cameo as a liquor store owner in Clint Eastwood's Mystic River.  Wallach received an Honorary Academy Award at the 2nd Annual Governors Awards, presented on November 13, 2010.\n\nDescription above from the Wikipedia article Eli Wallach, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1915, 12, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2014, 6, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0908919", "Acting", "Eli Wallach", new List<string> { "Ely Wallach", "엘리 웰라치", "Елай Воллак", "Eli Herschel Wallach" }, "Brooklyn, New York City, New York, USA", 17.103999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\s452wxFLaOwAIs6juD0rrvxaFxL.jpg" },
