                    { 3641, "Vaughn Taylor  (February 22, 1910 – April 26, 1983) was an American film and television actor. He was born in Boston, Massachusetts. His film credits include Jailhouse Rock, Cat on a Hot Tin Roof, Psycho and In Cold Blood. In his many television appearances, Taylor appeared in several episodes of the Twilight Zone, including the role of the salesman in the episode\" I Sing the Body Electric\". He also appeared in \"Time Enough at Last\", \"Still Valley\", an episode of \"The Outer Limits\" called \"The Guests\" as the character Mr. Latimer, \"The Incredible World of Horace Ford\" and \"The Self-Improvement of Salvadore Ross\". In 1958, he appeared as a doctor shot to death in the back by the brother, played by Nick Adams of an outlaw, portrayed by Michael Landon, whom he had treated in the Steve McQueen CBS western Wanted: Dead or Alive. Taylor appeared three times in the 1960–1961 season in the syndicated series COronado 9 starring Rod Cameron. He guest starred in 1961 as a veterinarian in the ABC sitcom The Hathaways, starring Peggy Cass, Jack Weston, and the Marquis Chimps. Taylor also appeared in 1961 in James Franciscus's short-lived CBS drama series, The Investigators. He was also a frequent guest on the Perry Mason series, appearing a total of eight times (including the first episode). He died in 1983, aged 73, two months before the release of Psycho II, which was the sequel to the original Psycho.\n\nDescription above from the Wikipedia article Vaughn Taylor (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1911, 2, 22, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1983, 4, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0853299", "Acting", "Vaughn Taylor", new List<string> { "Vaughn Everett Taylor" }, "Boston, Massachusetts, USA", 9.5800000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rCrh5P1LADlT8foTKdh5FBsbPcw.jpg" },
                    { 3661, "Thelma Schoonmaker (born January 3, 1940) is an American film editor, best known for her collaboration over five decades with director Martin Scorsese. She is the recipient of numerous accolades, including three Academy Awards, two BAFTA Awards, and four ACE Eddie Awards. She has been honored with the British Film Institute Fellowship in 1997, the Golden Lion for Lifetime Achievement in 2014, and the BAFTA Fellowship in 2019.  started working with Scorsese on his debut feature film, Who's That Knocking at My Door (1967), and has edited all of his films since Raging Bull (1980). She has received nine nominations for the Academy Award for Best Film Editing, winning three—for Raging Bull, The Aviator (2004), and The Departed (2006), both records. She has also been nominated eleven times for the BAFTA Award for Best Editing, winning for Raging Bull and Goodfellas (1990).", new DateTime(1940, 1, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0774817", "Editing", "Thelma Schoonmaker", new List<string> { "Thelma Schoonmaker-Powell" }, "Algiers, French Algeria [now Algeria]", 10.970000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wPkuc1cmcSH4I95uUbE7wgBsYA4.jpg" },
