                    { 3769, "Michael Ballhaus, A.S.C. (August 5, 1935 – April 12, 2017) was a German cinematographer who collaborated with directors such as Rainer Werner Fassbinder, Martin Scorsese, Mike Nichols, James L. Brooks, and Wolfgang Petersen. He was a member of both the Academy of Arts, Berlin, and the American Society of Cinematographers.", new DateTime(1935, 8, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 4, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000841", "Camera", "Michael Ballhaus", new List<string>(), "Berlin, Germany", 6.3109999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9DHIGsrgeTWA0rch3fFGXTOl1lO.jpg" },
                    { 3794, "Bob Kane (born Robert Kahn; October 24, 1915 – November 3, 1998) was an American comic book artist and writer, credited as the creator of the DC Comics superhero Batman. He was inducted into both the comic book industry's Jack Kirby Hall of Fame in 1994 and the Will Eisner Comic Book Hall of Fame in 1996.\n\nDescription above from the Wikipedia article Bob Kane, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", new DateTime(1915, 10, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 11, 3, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0004170", "Writing", "Bob Kane", new List<string> { "Боб Кейн", "Robert Kahn" }, "New York City, New York, USA", 10.773999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vuXwrlqaUydA4t5SFVdQkK9KsZL.jpg" },
                    { 3893, "David Samuel Goyer (born December 22, 1965) is an American screenwriter, film director and comic book writer.", new DateTime(1965, 12, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0275286", "Writing", "David S. Goyer", new List<string> { "David S Goyer", "Cynthia Verlaine", "David Samuel Goyer", "Ricardo Festiva", "David Goyer" }, "Ann Arbor, Michigan, USA", 9.9190000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gf44Hr3HJuWK7ZMHQKzDNBe0ylI.jpg" },
                    { 3894, "Christian Charles Philip Bale (born 30 January 1974) is an English actor. Known for his versatility and physical transformations for his roles, he has been a leading man in films of several genres. He has received various accolades, including an Academy Award and two Golden Globe Awards. Forbes magazine ranked him as one of the highest-paid actors in 2014.\n\nBorn in Wales to English parents, Bale had his breakthrough role at age 13 in Steven Spielberg's 1987 war film Empire of the Sun. After more than a decade of performing in leading and supporting roles in films, he gained wider recognition for his portrayals of serial killer Patrick Bateman in the black comedy American Psycho (2000) and the titular role in the psychological thriller The Machinist (2004). In 2005, he played superhero Batman in Batman Begins and again in The Dark Knight (2008) and The Dark Knight Rises (2012), garnering acclaim for his performance in the trilogy, which is one of the highest-grossing film franchises.\n\nBale continued in starring roles in a range of films outside his work as Batman, including the period drama The Prestige (2006), the action film Terminator Salvation (2009), the crime drama Public Enemies (2009), the epic film Exodus: Gods and Kings (2014) and the superhero film Thor: Love and Thunder (2022). For his portrayal of boxer Dicky Eklund in the 2010 biographical film The Fighter, he won an Academy Award and a Golden Globe Award. Further Academy Award and Golden Globe Award nominations came for his work in the black comedy American Hustle (2013) and the biographical dramedies The Big Short (2015) and Vice (2018). His performances as politician Dick Cheney in Vice and race car driver Ken Miles in the sports drama Ford v Ferrari (2019) earned him a second win and a fifth nomination respectively at the Golden Globe Awards.", new DateTime(1974, 1, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000288", "Acting", "Christian Bale", new List<string> { "Кристиан  Бейл ", "克里斯汀·貝爾", "คริสเตียน เบล", "クリスチャン・ベール", "크리스찬 베일", "كريستيان بيل", "Christian Charles Philip Bale", "Κρίστιαν Μπέιλ", "克里斯蒂安·贝尔", " ქრისტიან ბეილი", "Крістіан Бейл", "کریستین بیل", "كریسچن بەیڵ" }, "Haverfordwest, Pembrokeshire, Wales, UK", 37.305999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\v2Oks7DTbZcKzSi2Pw58C7SSLzM.jpg" },
                    { 3895, "Sir Michael Caine CBE (born Maurice Joseph Micklewhite Jr.; March 14, 1933) is a retired English actor. Known for his distinctive South London accent, he has appeared in more than 160 films in a career spanning seven decades, and is considered a British film icon. As of February 2017, the films in which Caine has appeared have grossed over $7.8 billion worldwide.\n\nOften playing a Cockney, Caine made his breakthrough in the 1960s with starring roles in British films such as Zulu (1964), The Ipcress File (1965), Alfie (1966), The Italian Job (1969), and Battle of Britain (1969). He was nominated for an Academy Award for Alfie. His roles in the 1970s included Get Carter (1971), The Last Valley (1971), Sleuth (1972), The Man Who Would Be King (1975), The Eagle Has Landed (1976) and A Bridge Too Far (1977). He earned his second Academy Award nomination for Sleuth and achieved some of his greatest critical success in the 1980s, with Educating Rita (1983) earning him the BAFTA and Golden Globe Award for Best Actor and Woody Allen's Hannah and Her Sisters (1986) earning him his first Academy Award for Best Supporting Actor.\n\nCaine is also known for his performance as Ebenezer Scrooge in The Muppet Christmas Carol (1992), and for his comedic roles in Dirty Rotten Scoundrels (1988), Miss Congeniality (2000), Austin Powers in Goldmember (2002), and Secondhand Lions (2003). He received his second Golden Globe Award for Little Voice (1998). In 1999, he received his second Academy Award for Best Supporting Actor for his performance as a sympathetic doctor in The Cider House Rules. He portrayed a British journalist in Vietnam in The Quiet American (2002), earning his sixth Oscar nomination, and appeared in Alfonso Cuaron's dystopian drama film Children of Men (2006). Caine portrayed Alfred Pennyworth in Christopher Nolan's The Dark Knight Trilogy (2005–2012). He appeared in several other of Nolan's films including The Prestige (2006), Inception (2010), Interstellar (2014) and Tenet (2020). He also appeared in the heist thriller film Now You See Me (2013), the action comedy film Kingsman: The Secret Service (2014), the Italian drama Youth (2015) and the crime film King of Thieves (2018).\n\nCaine officially confirmed his retirement from acting on 13 October 2023.", new DateTime(1933, 3, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.michaelcaine.com/", "nm0000323", "Acting", "Michael Caine", new List<string> { "Michael Scott ", "Sir Michael Caine", "Майкл Кейн", "米高·肯恩", "ไมเคิล เคน", "マイケル・ケイン", "마이클 케인", "مايكل كين", "迈克尔·凯恩", "Maurice Joseph Micklewhite Jr.", "סר מייקל קיין" }, "Rotherhithe, London, England, UK", 36.314999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bVZRMlpjTAO2pJK6v90buFgVbSW.jpg" },
                    { 3896, "He was born in Ballymena, County Antrim, Northern Ireland and educated at Saint Patrick's College, Ballymena Technical College and Queen's University Belfast. He moved to Dublin after university to further his acting career, joining the renowned Abbey Theatre. In the early 1990s, he moved again to the United States, where the wide acclaim for his performance in Schindler's List led to more high-profile work. He is widowed and lives in New York with his two sons.\n\nAn Irish actor who has been nominated for an Oscar, a BAFTA and three Golden Globe Awards. He has starred in a number of notable roles including Oskar Schindler in Schindler's List, Michael Collins in Michael Collins, Peyton Westlake in Darkman, Jean Valjean in Les Misérables, Qui-Gon Jinn in Star Wars Episode I: The Phantom Menace, Alfred Kinsey in Kinsey, Ras Al Ghul in Batman Begins and the voice of Aslan in The Chronicles of Narnia film series. He has also starred in several other notable films, from major Hollywood studio releases (ie. Excalibur, The Dead Pool, Nell, Rob Roy, The Haunting, Love Actually, Kingdom of Heaven, Taken, Clash of the Titans, The A-Team, Unknown) to smaller arthouse films (ie. Deception, Breakfast on Pluto, Chloe).\n\nDescription from the Wikipedia article Liam Neeson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1952, 6, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000553", "Acting", "Liam Neeson", new List<string> { "連恩·尼遜", "เลียม นีสัน", "リーアム・ニーソン", "리암 니슨", "ليام نيسون", "Ліам Нісон", "Вільям Джон Нісон", "连姆·尼森", "William John \"Liam\" Neeson OBE", "Λίαμ Νίσον", "连姆·尼森饰", "Liams Nīsons", "Lijam Nison", "Лијам Нисон" }, "Ballymena, County Antrim, Northern Ireland, UK", 76.861999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bboldwqSC6tdw2iL6631c98l2Mn.jpg" },
                    { 3904, "Lee Smith was born in Sydney, New South Wales, Australia. He was nominated for the Academy Award for Best Film Editing for Master and Commander: The Far Side of the World (2004) and The Dark Knight (2008). He was also nominated for the BAFTA Award for Best Editing for The Dark Knight and for Inception (2010). He was nominated for the BAFTA Award for Best Sound for The Piano (1993). He began his career as a sound editor/sound designer for films such as Dead Calm (1989), The Piano (1993) (for which he was nominated for the BAFTA Award for Best Sound), The Portrait of a Lady (1996), and Holy Smoke! (1999). Smith was also editing films during this interval; he was one of the editors for RoboCop 2 (1990).\n\nHe began his notable collaboration with director Peter Weir on the 1982 film The Year of Living Dangerously, on which he was an associate editor working with Weir's longtime editor William M. Anderson. He was credited as a co-editor with Anderson for Fearless (1993) and for The Truman Show (1998). He was the sole editor for Weir's Master and Commander: The Far Side of the World (2003), for which Smith was nominated for the Academy Award for Film Editing and for an \"Eddie Award\" from the American Cinema Editors.\n\nMore recently, Smith has edited seven films with director Christopher Nolan. He was nominated for a second Academy Award and American Cinema Editors Award for The Dark Knight (2008). In 2010, he received another nomination for the American Cinema Editors Award for his editing work on Inception; Inception was listed as the 35th best-edited film of all time in a 2012 survey of members of the Motion Picture Editors Guild. In 2018, he received an Academy Award for his work on Nolan's Dunkirk.", new DateTime(1960, 6, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0809059", "Editing", "Lee Smith", new List<string> { "Ли Смит" }, "Sydney, New South Wales, Australia", 10.346, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zlnK1i7CqdzIFTFqfMsYLyt2Sk8.jpg" },
                    { 3965, "", null, null, 1, null, "nm0032597", "Production", "Deborah Aquila", new List<string> { "Debra Aquila", "Deb Aquila " }, null, 5.431, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\21tKfmoNpulz84RuWXPUXHuAwU2.jpg" },
                    { 3970, "From Wikipedia, the free encyclopedia\n\nErwin Alois Robert Leder (born 30 July 1951 in St. Pölten, Lower Austria, Austria) is an Austrian actor. He is best known for his role as Chief Mechanic Johann in Das Boot, a 1981 feature film directed by Wolfgang Petersen about a mission of one World War II U-boat and its crew.\n\nIn 2003, Leder appeared as the lycan scientist Singe in the gothic horror/action film Underworld. He reprised his role in the sequel in a brief cameo as a corpse.", new DateTime(1951, 7, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.erwin-leder.com/", "nm0496441", "Acting", "Erwin Leder", new List<string>(), "St. Pölten, Austria", 7.1319999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4V6ewUr0KAMl8C2xvWvg8JPjsab.jpg" },
                    { 3992, "", null, null, 1, null, "nm0096187", "Sound", "Gloria S. Borders", new List<string> { "Gloria Borders" }, null, 2.831, null },
                    { 4027, "Frank Darabont (born January 28, 1959) is a Hungarian-American film director, screenwriter and producer who has been nominated for three Academy Awards and a Golden Globe. He was born in France by Hungarian parents who fled Budapest during the 1956 uprising, but the family moved to Los Angeles while he was still an infant.\n\nHe has directed the films The Shawshank Redemption, The Green Mile, and The Mist, all based on stories by Stephen King. In 2010 he developed and executive produced the first season of the AMC network television series The Walking Dead.\n\nDescription above from the Wikipedia article Frank Darabont, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1959, 1, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001104", "Directing", "Frank Darabont", new List<string> { "Френк Дарабонт", "Frank A. Darabont", "Ardeth Bey", "프랭크 다라본트" }, "Montbéliard, Doubs, France", 16.548999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7LqmE3p1XTwCdNCOmBxovq210Qk.jpg" },
                    { 4028, "", null, null, 0, null, "nm0555550", "Production", "Niki Marvin", new List<string>(), null, 1.871, null },
                    { 4029, "Robert Patrick \"Bob\" Gunton, Jr. (born November 15, 1945) is an American actor. He is known for playing strict, authoritarian characters, with his best known roles as Warden Samuel Norton in the 1994 prison film The Shawshank Redemption, Chief George Earle in 1993's Demolition Man, and President Juan Peron in the original Broadway cast of Evita.\n\nDescription above from the Wikipedia article Bob Gunton , licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1945, 11, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0348409", "Acting", "Bob Gunton", new List<string> { "Боб Гантон", "Μπομπ Γκάντον", "Robert Patrick Gunton Jr.", "巴布·岡頓" }, "Santa Monica, California, USA", 16.071999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ulbVvuBToBN3aCGcV028hwO0MOP.jpg" },
                    { 4054, "", null, null, 2, null, "nm0504434", "Production", "David V. Lester", new List<string> { "David Lester" }, null, 3.5779999999999998, null },
                    { 4078, "Clarence LeRoy \"Lee\" Van Cleef Jr. was an American actor best known for his roles in Spaghetti Westerns such as For A Few Dollars More and The Good, the Bad and the Ugly. Hatchet-faced with piercing eyes, he had declined to have his nose altered to play a sympathetic character in his film debut, High Noon, and was relegated to a non-speaking outlaw as a result. For a decade he was typecast as a minor villain, his sinister features overshadowing his acting skills. After suffering serious injuries in a car crash, Van Cleef began to lose interest in his apparently waning career by the time Sergio Leone gave him a major role in For a Few Dollars More. The film made him a box-office draw, especially in Europe.\n\nMilitary service:\n\nAfter basic training and further training at the Naval Fleet Sound School, Van Cleef was assigned to a submarine chaser and then to a minesweeper, USS Incredible, on which he worked as a sonarman.\n\nAfter leaving the Navy, Van Cleef read for a part in Our Town at the Little Theater Group in Clinton, New Jersey and received his first stage role. From there, he continued to meet with the group and audition for parts. The next biggest part was that of the boxer, Joe Pendleton, in the play Heaven Can Wait. During this time, he was observed by visiting talent scouts, who were impressed by Van Cleef's stage presence and delivery. One of these scouts later took him to New York City talent agent Maynard Morris of the MCA agency, who then sent him to the Alvin Theater for an audition.\n\nVan Cleef's screen debut came in High Noon. During a performance of Mister Roberts in Los Angeles, he was noticed by film director Stanley Kramer, who offered Van Cleef a role in his upcoming film. Kramer originally wanted Van Cleef for the role of the deputy Harvey Pell, but as he wanted Van Cleef to have his \"distinctive nose\" fixed, Van Cleef declined the role in favor of the part of the silent gunslinger Jack Colby. He was then cast mostly in villainous roles, due to his sharp cheeks and chin, piercing eyes, and hawk-like nose, from the part of Tony Romano in Kansas City Confidential (1952), culminating 14 years later in Sergio Leone's The Good, the Bad and the Ugly (1966)\n\nDespite suffering from heart disease from the late 1970s and having a pacemaker installed in the early 1980s, Van Cleef continued to work in films until his death on December 16, 1989, at age 64. He was buried at Forest Lawn Memorial Park Cemetery, Hollywood Hills, California, with an inscription on his grave marker referring to his many acting performances as a villain: \"BEST OF THE BAD\".  Description above from the Wikipedia article Lee Van Cleef, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1925, 1, 9, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1989, 12, 16, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001812", "Acting", "Lee Van Cleef", new List<string> { "Clarence Leroy Van Cleef Jr.", "李·范克里夫", "리 밴 클리프" }, "Somerville, New Jersey, USA", 27.338000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yQc5wjNCdRZzPp5E2wRPRYsEq9a.jpg" },
                    { 4159, "", new DateTime(1963, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0120961", "Acting", "Nicole Burdette", new List<string>(), null, 12.044, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\F7QJmA8m3PDRb6NiZE43jBxqrl.jpg" },
                    { 4188, "", null, null, 2, null, "nm0089193", "Art", "Leslie Bloom", new List<string> { "Leslie S. Bloom", " Les 'Soft Shoes' Bloom", "Les Bloom" }, null, 2.528, null },
                    { 4385, "Sergio Leone (January 3, 1929 – April 30, 1989) was an Italian film director, producer and screenwriter most associated with the \"Spaghetti Western\" genre. Leone's film-making style includes juxtaposing extreme close-up shots with lengthy long shots. His movies include The Colossus of Rhodes, the Dollars Trilogy (A Fistful of Dollars; For a Few Dollars More; and The Good, the Bad and the Ugly), Once Upon a Time in the West; Duck, You Sucker!; and Once Upon a Time in America.\n\nDescription above from the Wikipedia article Sergio Leone,  licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1929, 1, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1989, 4, 30, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001466", "Directing", "Sergio Leone", new List<string> { "Bob Robertson", "세르지오 레오네" }, "Rome, Italy", 12.587999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2576qoW8l9Z1nKGM10ar60aIwUu.jpg" },
                    { 4517, "Joseph Frank “Joe” Pesci (born February 9, 1943) is an American actor, comedian, singer and musician. He is known for his roles as violent mobsters, funnymen, comic foils and quirky sidekicks. Pesci has starred in a number of high profile films such as Goodfellas, Casino, Raging Bull, Once Upon a Time in America, My Cousin Vinny, Easy Money, JFK, Moonwalker, Home Alone, Home Alone 2: Lost in New York, and the 2nd, 3rd, and 4th Lethal Weapon films. In 1990, Pesci won the Academy Award for Best Supporting Actor for his role as the psychopathic mobster Tommy DeVito in Goodfellas, ten years after receiving a nomination in the same category for Raging Bull.", new DateTime(1943, 2, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000582", "Acting", "Joe Pesci", new List<string> { "Joseph Frank Pesci", "Џо Пеши", "Τζο Πέσι", "Joey Dee", "조 페시", "Joseph „Joe“ Francesco DeLores Eliot Pesci " }, "Newark, New Jersey, USA ", 33.304000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4AO0Rwdg2ky8Usmgzgj0dvhy7Zw.jpg" },
                    { 4610, "John Landis (born August 3, 1950) is an American film director, screenwriter, actor, and producer. He is known for his comedies, his horror films, and his music videos with singer Michael Jackson.", new DateTime(1950, 8, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000484", "Directing", "John Landis", new List<string> { "존 랜디스" }, "Chicago, Illinois, USA", 23.129999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nXKdxxELgAaGecCpxAWCoj6TV3f.jpg" },
