                    { 4658, "", null, null, 2, null, "nm0093120", "Crew", "Danilo Bollettini", new List<string>(), null, 3.0030000000000001, null },
                    { 4659, "", new DateTime(1939, 2, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0180935", "Crew", "Giovanni Corridori", new List<string>(), "Rome, Lazio, Italy", 2.2999999999999998, null },
                    { 4661, "Benito Stefanelli (2 September 1928 – 18 December 1999) was an Italian film actor, stuntman and weapons master who made over 60 appearances in film between 1955 and 1991.", new DateTime(1928, 9, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1999, 12, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0824934", "Acting", "Benito Stefanelli", new List<string> { "Ben Steffen" }, "Rome, Lazio, Italy", 8.4830000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\g8wrcKWLuxq3Rmtp3LXItaGVLoQ.jpg" },
                    { 4670, "Nino Baragli (1 October 1925 – 29 May 2013) was an Italian film editor with more than 200 film credits. Among his films in English, The Good, the Bad and the Ugly (1966) and Once Upon a Time in the West (1968), both directed by Sergio Leone, are perhaps the best known.\n\nBorn in Rome as Giovanni Baragli, he was introduced in the film industry by his uncle, the renowned editor Eraldo Da Roma. He started his career in 1944 as film operator and assistant editor for Marinai senza stelle by Francesco De Robertis.\n\nDuring his career he worked as editor in more than 200 productions between 1944 and 1996, including works by Federico Fellini, Pier Paolo Pasolini, Sergio Leone, Damiano Damiani, Luigi Zampa, Giuliano Montaldo, Sergio Corbucci, Mauro Bolognini, Luigi Comencini, Cristina Comencini, Florestano Vancini, Gabriele Salvatores, Alberto Lattuada, Tinto Brass, Margarethe von Trotta, Pál Sándor, Bernardo Bertolucci, Roberto Benigni, Massimo Troisi.  The single largest impact of Baragli's editing is likely on the films of Pier Paolo Pasolini. Gino Moliterno as described Pasolini as follows: \"Outside Italy Pasolini is usually remembered as one of the most significant of the directors who emerged in the second wave of Italian postwar cinema in the early 1960s but, within Italy itself, Pasolini was always much more than just a distinctive and innovative filmmaker. By the time he came to make his first film, Accattone, in 1961, he had already published numerous collections of poetry, two highly-acclaimed novels, had collaborated widely in cultural-literary journals and firmly established himself as one of Italy’s leading writer-intellectuals.\"\n\nStefano Musi has called Baragli's contributions to Pasolini's films \"enormous\"; Baragli edited every one of Pasolini's feature films from his first, Accattone (1961), to his final film Salò, or the 120 Days of Sodom (1975), which was released shortly after his murder. Geoffrey Nowell-Smith has written of the editing innovations in their early films, \"When Accatone and Mamma Roma came out, Pasolini and his editor Nino Baragli were widely condemned as amateurish and incompetent, which is rather like saying that Cezanne's brushstrokes showed that he couldn't paint.\" Perhaps the best-known of Pasolini's films to English-speaking audiences is The Gospel According to Saint Matthew (1964), now considered a masterpiece by many critics. Nowell-Smith writes of the editing that \"large sections of the film do not even bother to respect continuity, let alone to pay obeisance to it. ... Each shot simply presents itself as reality in its own right but there is no attempt to maintain the realistic illusion that had been the foundation of cinema since the early 1920s if not before.\" ...\n\nSource: Article \"Nino Baragli\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1925, 10, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 5, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0052849", "Editing", "Nino Baragli", new List<string> { "Nino Barragli", "Giovanni Baragli" }, "Rome, Lazio, Italy", 8.8510000000000009, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2iWNZkKmuo17q4QCI8TMhGPD7PA.jpg" },
                    { 4690, "Christopher Walken (born Ronald Walken, March 31, 1943) is an American actor. He has appeared in more than 100 films and television programs, including Annie Hall (1977), The Deer Hunter (1978), The Dogs of War (1980), The Dead Zone (1983), A View to a Kill (1985), Batman Returns (1992), True Romance (1993), Pulp Fiction (1994), Antz (1998), Vendetta (1999), Sleepy Hollow (1999), Joe Dirt (2001), Catch Me If You Can (2002), Hairspray (2007), Seven Psychopaths (2012), the first three Prophecy films, The Jungle Book (2016), and Irreplaceable You (2018). He has received a number of awards and nominations, including the Academy Award for Best Supporting Actor for The Deer Hunter.", new DateTime(1943, 3, 31, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000686", "Acting", "Christopher Walken", new List<string> { "크리스토퍼 워컨", "كريستوفر واكن", "クリストファー・ウォーケン", "Кристофер Уокен", "คริสโตเฟอร์ วอลเคน", "克里斯托弗·沃肯", "Крістофер Вокен", "Ronald Walken", "Ronnie Walken", "כריסטופר ווקן" }, "Queens, New York City, New York, USA", 38.866, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ApgDL7nudR9T2GpjCG4vESgymO2.jpg" },
                    { 4692, "Frank Adonis (born October 27, 1935), sometimes credited as Frank Martin, is an American film and television actor.\n\nHe was born Frank Testaverde Scioscia in Brooklyn, New York.  Adonis is a long-time character actor frequently cast in gangster roles.", new DateTime(1935, 10, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 12, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0012376", "Acting", "Frank Adonis", new List<string> { "Frankie Adonis", "Frank Martin", "Frank Scioscia" }, "Brooklyn, New York City, New York, USA", 5.5899999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ewgcaacrrpFO4CzBjIUq5BUUGPS.jpg" },
                    { 4702, "", null, null, 2, null, "nm0881130", "Production", "Bill Unger", new List<string>(), null, 1.371, null },
                    { 4818, "Roberto Benigni, (born October 27, 1952, Misericordia, Arezzo, Italy), Italian actor and director known for his comedic work, most notably La vita è bella (1997; Life Is Beautiful), for which he won an Academy Award for best actor.\n\nBenigni was the son of a poor tenant farmer who had worked in a German forced-labour camp during World War II. The elder Benigni used humour in retelling his experiences, which helped shape his son’s comedic skill. Benigni briefly attended a Jesuit seminary in Florence, and, after a stint as a magician’s assistant, he joined an underground theatre group in the late 1960s.", new DateTime(1952, 10, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000905", "Acting", "Roberto Benigni", new List<string> { "Roberto Remigio Benigni ", "羅貝托·貝尼尼" }, "Manciano La Misericordia, Castiglion Fiorentino, Arezzo, Italy", 17.481000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\noelOhwX1oaNSvU9NLKhPrHTFI3.jpg" },
                    { 4924, "From Wikipedia, the free encyclopedia\n\nMartin Semmelrogge (born 8 December 1955, Boll-Eckwälden, Bad Boll, Germany) is a German actor, best known for his role as the comical 2WO (1st Lieutenant/Second Watch Officer) in the film Das Boot. He is the brother of former actor Joachim Bernhard, who appeared in Das Boot as the religious sailor.\n\nLike many of his Das Boot co-stars, Semmelrogge went on to have a successful career in the German cinema.", new DateTime(1955, 12, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0783847", "Acting", "Martin Semmelrogge", new List<string>(), "Bad Boll, Germany", 10.304, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\w8UBZMC8SAX9ldIVaFkC1q0hNLo.jpg" },
                    { 4936, "", new DateTime(1959, 4, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0293695", "Acting", "Jochen Nickel", new List<string>(), "Witten, Germany", 8.907, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mVNh33yMHoTneAF2OrsC4nvwBGL.jpg" },
                    { 4958, "Henry Jaynes Fonda (May 16, 1905 – August 12, 1982) was an American actor who had a career that spanned five decades in Hollywood. Fonda cultivated a strong, appealing screen image in several films now considered to be classics, earning one Academy Award for Best Actor on two nominations.\n\nFonda made his mark early as a Broadway actor and made his Hollywood film debut in 1935. His film career began to gain momentum with roles such as Bette Davis's fiancee in her Academy Award-winning performance in Jezebel (1938), brother Frank in Jesse James (1939), and the future President in Young Mr. Lincoln (1939), directed by John Ford. His early career peaked with his Academy Award-nominated performance as Tom Joad in The Grapes of Wrath, about an Oklahoma family who moved to California during the Dust Bowl 1930s. This film is widely considered to be among the greatest American films.\n\nIn 1941 he starred opposite Barbara Stanwyck in the screwball comedy classic The Lady Eve. Book-ending his service in WWII were his starring roles in two highly regarded westerns: The Ox-Bow Incident (1943) and My Darling Clementine (1946), the latter directed by John Ford, and he also starred in Ford's western Fort Apache (1948). After a seven-year break from films, during which Fonda focused on stage productions, he returned with the WWII war-boat ensemble Mister Roberts (1955). In 1957 he starred as Juror No.8, the hold-out juror, in 12 Angry Men. Fonda, who was also co-producer, won the BAFTA for Best Foreign Actor.\n\nLater in his career, Fonda moved into darker roles, such as the villain in the epic Once Upon a Time in the West (1968), underrated and a box office disappointment at its time of release, but now regarded as one of the best westerns of all time. He also played in lighter-hearted fare such as Yours, Mine and Ours with Lucille Ball, but also often played important military figures, such as a Colonel in Battle of the Bulge (1965), and Admiral Nimitz in Midway (1976). He finally won the Academy Award for Best Actor at the 54th Academy Awards for his final film role in On Golden Pond (1981), which also starred Katharine Hepburn and his daughter Jane Fonda, but was too ill to attend the ceremony. He died from heart disease a few months later.\n\nDescription above from the Wikipedia article Henry Fonda, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1905, 5, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1982, 8, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.henry-fonda.com/", "nm0000020", "Acting", "Henry Fonda", new List<string> { "Hank Fonda", "Henry Jaynes Fonda", "One-Take Fonda", "Генри Фонда" }, "Grand Island, Nebraska, USA", 24.962, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6wXWsqSXF3wCsGcwVqiszy6RX9X.jpg" },
                    { 4985, "", null, null, 0, null, "nm0045271", "Crew", "Eros Bacciucchi", new List<string> { "Eros Baciucchi", "Erasmo Baciucchi" }, null, 2.9889999999999999, null },
                    { 5026, "Akira Kurosawa (Japanese: 黒澤 明, Hepburn: Kurosawa Akira, March 23, 1910 – September 6, 1998) was a Japanese filmmaker and painter who directed 30 films in a career spanning over five decades. He is widely regarded as one of the greatest and most influential filmmakers in the history of cinema. Kurosawa displayed a bold, dynamic style, strongly influenced by Western cinema yet distinct from it; he was involved with all aspects of film production.\n\nKurosawa entered the Japanese film industry in 1936, following a brief stint as a painter. After years of working on numerous films as an assistant director and scriptwriter, he made his debut as a director during World War II with the popular action film Sanshiro Sugata (1943). After the war, the critically acclaimed Drunken Angel (1948), in which Kurosawa cast the then little-known actor Toshiro Mifune in a starring role, cemented the director's reputation as one of the most important young filmmakers in Japan. The two men would go on to collaborate on another fifteen films.\n\nRashomon (1950), which premiered in Tokyo, became the surprise winner of the Golden Lion at the 1951 Venice Film Festival. The commercial and critical success of that film opened up Western film markets for the first time to the products of the Japanese film industry, which in turn led to international recognition for other Japanese filmmakers. Kurosawa directed approximately one film per year throughout the 1950s and early 1960s, including a number of highly regarded (and often adapted) films, such as Ikiru (1952), Seven Samurai (1954), Throne of Blood (1957), Yojimbo (1961) and High and Low (1963). After the 1960s he became much less prolific; even so, his later work—including two of his final films, Kagemusha (1980) and Ran (1985)—continued to receive great acclaim.\n\nIn 1990, he accepted the Academy Award for Lifetime Achievement. Posthumously, he was named \"Asian of the Century\" in the \"Arts, Literature, and Culture\" category by AsianWeek magazine and CNN, cited there as being among the five people who most prominently contributed to the improvement of Asia in the 20th century. His career has been honored by many retrospectives, critical studies and biographies in both print and video, and by releases in many consumer media.\n\nDescription above from the Wikipedia article Akira Kurosawa , licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1910, 3, 23, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 9, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000041", "Directing", "Akira Kurosawa", new List<string> { "黒澤明", "أكيرا كوروساوا", "อะกิระ คุโระซะวะ", "Акира Куросава", "黑澤明", "구로사와 아키라", "אקירה קורוסאווה", "Kurosawa Akira", "黑泽明", "아키라 구로사와", "쿠로사와 아키라", "아키라 쿠로사와" }, "Shinagawa, Tokyo Prefecture, Japan", 21.085000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eGexa6MZ22T1MZxce1qR3RcAYaS.jpg" },
                    { 5048, "Harry Dean Stanton (July 14, 1926 – September 15, 2017) was an American actor. In a career that spanned more than six decades, Stanton played supporting roles in films including Cool Hand Luke (1967), Kelly's Heroes (1970), Dillinger (1973), The Godfather Part II (1974), Alien (1979), Escape from New York (1981), Christine (1983), Repo Man (1984), One Magic Christmas (1985), Pretty in Pink (1986), The Last Temptation of Christ (1988), Wild at Heart (1990), The Straight Story (1999), The Green Mile (1999), The Man Who Cried (2000), Alpha Dog (2006), and Inland Empire (2006). He had rare lead roles in Paris, Texas (1984) and in Lucky (2017).\n\nDescription above from the Wikipedia article Harry Dean Stanton, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1926, 7, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 9, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001765", "Acting", "Harry Dean Stanton", new List<string> { "Χάρι Ντιν Στάντον", "Гарри Дин Стентон", "Dean Stanton" }, "West Irvine, Kentucky, USA", 16.786999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\197UiLVdxPOv8196sqmUpJzOQB5.jpg" },
                    { 5063, "", new DateTime(1936, 3, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0706554", "Acting", "Joseph Ragno", new List<string>(), "Brooklyn, New York, USA", 4.0510000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fF7M5JyfA2kUeh8YItkiCd1of1b.jpg" },
                    { 5149, "Bonnie Lynne Hunt (born September 22, 1961) is an American actress, comedian, writer, director, television producer and daytime television host.", new DateTime(1961, 9, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001372", "Acting", "Bonnie Hunt", new List<string>(), "Chicago Lawn, Chicago, Illinois, USA", 29.827000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tT9C6uLztgN8OxJULq6F9iEzqlA.jpg" },
                    { 5170, "An American actor. Known for his large size at 6' 3\" or 190 cm, he has typically been typecast as playing thugs or henchmen. Starr was born in Flushing, Queens, New York to a retail employee mother and a meatpacker father. His older brother Beau Starr is also an actor. Mike Starr is a graduate of Hofstra University. He and his family reside in Riverdale, New York.", new DateTime(1950, 7, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0823563", "Acting", "Mike Starr", new List<string> { "Michael Starr ", "Michael \"Mike\" Starr" }, "Flushing, Queens, New York City, New York, USA", 21.811, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hJGhV91dSUiFJ8GwGDTEEri79LX.jpg" },
                    { 5246, "Reginald Rose (December 10, 1920 – April 19, 2002) was an American film and television writer most widely known for his work in the early years of television drama. Rose's work is marked by its treatment of controversial social and political issues. His realistic approach helped create the slice of life school of television drama, which was particularly influential in the anthology programs of the 1950s.\n\nBorn in Manhattan, Rose attended Townsend High School and briefly attended City College (now part of the City University of New York) before serving in the U.S. Army in 1942-46, where he became a first lieutenant.\n\nRose was married twice, to Barbara Langbart in 1943, with whom he had four children, and to Ellen McLaughlin in 1963, with whom he had two children. He died in 2002 from complications of heart failure.\n\nDescription above from the Wikipedia article Reginald Rose, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1920, 12, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2002, 4, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0741627", "Writing", "Reginald Rose", new List<string> { "Ed Tashley" }, "Manhattan, New York City, New York, USA", 9.7420000000000009, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qscQc09Nh6fTfenlwl2pNvnD2MQ.jpg" },
                    { 5247, "John Donald Fielder (February 3, 1925 - June 25, 2005) was an American actor. The son of an Irish-German beer salesman, Fiedler knew he wanted to be an actor from the childhood days when he had a full head of reddish-yellow hair. He made his first professional appearances on stage, branched out into live TV in New York and, then, during the 20 years he lived in Hollywood (1960-80), turned up in many films and an ever greater number of popular TV series. His career lasted more than 55 years in stage, film, television, and radio.", new DateTime(1925, 2, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2005, 6, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0275835", "Acting", "John Fiedler", new List<string> { "Johnny Fiedler" }, "Platteville, Wisconsin, USA", 14.295999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6vfLLGeGuO6Ko0VRnyhgE2v6RUu.jpg" },
                    { 5248, "Lee J. Cobb (December 8, 1911 - February 11, 1976) ) was an American actor best known for his performance in 12 Angry Men (1957), his Academy Award-nominated performance in On the Waterfront, and one of his last films, The Exorcist (1973). He also played the role of Willy Loman in the original Broadway production of Arthur Miller's 1949 play Death of a Salesman under the direction of Elia Kazan. On television, Cobb costarred in the first four seasons of the popular, long-running western series The Virginian. He typically played arrogant, intimidating, and abrasive characters, but often had roles as respectable figures such as judges.  Born Leo Jacob in New York City, he grew up in The Bronx,  before studying at New York University and making his film debut in The Vanishing Shadow (1934).  Cobb performed in numerous theater productions and companies, including Group Theatre (New York) before serving in the First Motion Picture Unit of the Army Air Force during World War II.  \n\nFollowing the war, Cobb returned to film, television and theater before being accused of being a Communist in 1951 testimony before the House Un-American Activities Committee by Larry Parks, himself a former Communist Party member. Cobb was called to testify before HUAC but refused to do so for two years until, with his career threatened by the blacklist, he relented in 1953 and gave testimony in which he named 20 people as former members of the Communist Party USA. Following the hearing he resumed his career and worked with Elia Kazan and Budd Schulberg, two other HUAC \"friendly witnesses\", on the 1954 film On the Waterfront, which is widely seen as an allegory and apologia for testifying.  His 1968 performance as King Lear achieved the longest run (72 performances) for the play in Broadway history.  One of his final film roles was that of police detective Lt. Kinderman in the 1973 horror film The Exorcist.\n\nCobb died of a heart attack in February 1976 in Woodland Hills, California, and was buried in Mount Sinai Memorial Park Cemetery in Los Angeles. He was survived by his second wife, Mary Hirsch, and daughter, also an accomplished actress, Julie Cobb.", new DateTime(1911, 12, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1976, 2, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0002011", "Acting", "Lee J. Cobb", new List<string> { "Lee Colt", "Leo Jacoby", "Cpl. Lee Cobb", "Lee Cobb", "Ли Дж. Кобб" }, "New York City, New York, USA", 18.893000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aSQj0q6l734wxzutUGuYCGtJmZv.jpg" },
                    { 5249, "E. G. Marshall (June 18, 1914 – August 24, 1998) was an American actor, best known for his television roles as the lawyer Lawrence Preston on The Defenders in the 1960s, and as neurosurgeon David Craig on The Bold Ones: The New Doctors in the 1970s. Among his film roles, he is perhaps best known as the unflappable Juror #4 in Sidney Lumet's courtroom drama 12 Angry Men (1957).\n\n​From Wikipedia, the free encyclopedia", new DateTime(1914, 6, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 8, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0550855", "Acting", "E.G. Marshall", new List<string> { "Э. Дж. Маршалл", "Everett Eugene Grunz" }, "Owatonna, Minnesota, USA", 15.356, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\psimeVoRk64DV7UNm4cLQylRFy2.jpg" },
                    { 5250, "As a film character actor, Klugman was the epitome of the everyman. He was one of the pioneers of television acting in the 1950s, and is best remembered for his 1970s TV work as Oscar Madison on \"The Odd Couple\" (1970) and as the medical examiner on \"Quincy M.E.\" (1976).", new DateTime(1922, 4, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001430", "Acting", "Jack Klugman", new List<string> { "Jacob Joachim Klugman", "杰克·克卢格曼" }, "Philadelphia, Pennsylvania, USA", 9.9149999999999991, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oJxveOxlunD8C9OczqKeryU0k6D.jpg" },
                    { 5251, "Jack Warden (born John Warden Lebzelter Jr.; September 18, 1920 – July 19, 2006) was an American actor. He was nominated for the Academy Award for Best Supporting Actor for Shampoo (1975) and Heaven Can Wait (1978). He received a BAFTA nomination for the former, and won a Primetime Emmy Award for his performance in Brian's Song (1971).\n\nDescription above from the Wikipedia article Jack Warden, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1920, 9, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 7, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0912001", "Acting", "Jack Warden", new List<string> { "John Warden Lebzelter, Jr.", "Джек Уорден" }, "Newark, New Jersey, USA ", 17.876999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hSShXiYMfRpMByaB5euZ59qCKN.jpg" },
                    { 5252, "Joseph Sweeney (July 26, 1884 (other sources state 1882) – November 25, 1963) was an American actor who worked in stage productions, television and movies. His most famous role was as the elderly Juror #9 in the 1957 film 12 Angry Men, the role he originated in a 1954 Westinghouse Studio One live teleplay of which the film was an adaptation.", new DateTime(1884, 7, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1963, 11, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0842137", "Acting", "Joseph Sweeney", new List<string> { "Joe Sweeney" }, "Philadelphia, Pennsylvania, USA", 8.8130000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\m0liVGH2JrhcvCr3buYUeXwhAyV.jpg" },
                    { 5254, "Founded Czech avantgarde theatre and film group 'Osvobozene divadlo' with actor Jan Werich in 1927. Affiliated with the Poetist movement (Karel Teige). Made succesfull comedy shows with political themes. Voskovec left Czechoslovakia after the German invasion, 1938/39 and emigrated to the US.", new DateTime(1905, 6, 19, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1981, 7, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0903667", "Acting", "George Voskovec", new List<string> { "Jiří Voskovec", "Jiří Wachsmann", "Jiri Voskovec", "Petr Dolan ", "F. Formen", "Иржи Восковец", "Петр Долан", "Джордже Восковец" }, "Sázava, Bohemia, Austria-Hungary (now Czech Republic)", 7.2130000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nxW7pLtG8xLo4J3QHXzLxt8fd8P.jpg" },
                    { 5255, "Over his 40-year career as one of Hollywood's veteran character actors, Robert Webber always marked his spot by playing all types of roles and was not stereotyped into playing just one kind of character. Sometimes he even got to play a leading role (see Hysteria (1965)). Webber first started out in small stage shows and a few Broadway plays and served a stint in the army before he landed the role of Juror 12 in 12 Angry Men (1957). He was also known for numerous war films, playing Lee Marvin's general in The Dirty Dozen (1967) or as real-life Admiral Frank J. Fletcher in Midway (1976). Webber's other best known movies include The Great White Hope (1970), Revenge of the Pink Panther (1978), 10 (1979) (as composer Dudley Moore's lyricist partner), Private Benjamin (1980), Wild Geese II (1985) and co-starring with Richard Dreyfuss and Barbra Streisand as prosecutor Francis McMillian in Nuts (1987). In 1989 he died of Lou Gehrig's disease (amyotrophic lateral sclerosis) in Malibu, California, shortly after completing the 1988 TV production Something Is Out There (1988) (TV). He bore a resemblance to character actor Kevin McCarthy.", new DateTime(1924, 10, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1989, 5, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0916434", "Acting", "Robert Webber", new List<string>(), "Santa Ana, California, USA ", 10.090999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1RlhCcfCkaSz0cWRSowsj5FiKXg.jpg" },
                    { 5257, "Billy Nelson was an American vaudeville comedian.", new DateTime(1903, 7, 19, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1973, 8, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0625180", "Acting", "Billy Nelson", new List<string> { "William Nelson" }, "New York City, New York, USA", 3.6309999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cIwqyZX89h3LZ94oemmbvTuFX0o.jpg" },
