                    { 5262, "American film editor and film director.\n\nMr. Lerner's editor credits included Klute, The Swimmer, with Burt Lancaster, Requiem for a Heavyweight, Middle of the Night The Fugitive Kind,  The Goddess, and 12 Angry Men.\n\nHe had directed commercial 1 and industrial films and was director and editor of Black Like Me.\n\nMr. Lerner had taught film technique at City College, New York University, the School of Visual Arts, and other institutions, and had written many articles on the subject.", new DateTime(1912, 6, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1973, 8, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0503594", "Editing", "Carl Lerner", new List<string>(), "Philadelphia, Pennsylvania, USA", 3.5640000000000001, null },
