                    { 5265, "", new DateTime(1922, 10, 21, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1993, 9, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0322302", "Sound", "James A. Gleason", new List<string> { "Jim Gleason", "James Gleason" }, "New York City, New York, USA", 0.93200000000000005, null },
                    { 5298, "Victor Colicchio is a New York City based actor, screenwriter musician, and songwriter. His screenwriting credits include Summer of Sam, co-written with actor Michael Imperioli. and High Times' Potluck. As an actor his credits include Inside Man, The Brave One, Goodfellas, The Deli, Bullets over Broadway, The Sopranos, and multiple episodes of Law & Order. He also played Slick Rick in New York Undercover. In the 1970s he was involved with New York film collective Total Impact. He also directed the documentary Rockin' America, about a multi-band tour of the USA that suffers serious problems when the promoter quits. His credits as songwriter includes the composition His Music Will Never Die, co-written with Doc Pomus. and Elvis Song's co-written with Otis Blackwell. Victor's musical credits include lead singer, and guitarist, and singer for the New York Based rock band The Squirrels, and performances with Chuck Berry, David Peel, Rufus Thompson, and Tommy Boyce.", new DateTime(1953, 8, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0171470", "Acting", "Victor Colicchio", new List<string> { "Pepe Valentine", "Michael King", "Pepe", "Peppy", "Julio Rios", "J. B. Fine" }, "New York, New York, USA", 3.2869999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9tb9liRCS3qdwDRHmI5lTENbRQe.jpg" },
                    { 5339, "", null, null, 2, null, "nm0099597", "Sound", "David Boulton", new List<string> { "Dave Bolton", "Dave Boulton", "David Bolton" }, null, 1.9570000000000001, null },
                    { 5381, "Michael Shamberg is a movie and TV producer and Advisor to BuzzFeed Motion Pictures. He was nominated for a Best Picture Academy Award for producing Erin Brockovich and The Big Chill. His other film credits include the science-based movies Contagion and Gattaca. Shamberg was an Executive Producer of Pulp Fiction and Django Unchained. His true story films include Freeheld, World Trade Center, and Man on the Moon. His other credits are eclectic including Out of Sight, Wish I Was Here, Get Shorty, Reality Bites, Garden State, Along Came Polly, The Skeleton Key, How High, A Walk Among the Tombstones, and A Fish Called Wanda. He was also an Executive Producer of the TV show Reno 911.", null, null, 2, null, "nm0787834", "Production", "Michael Shamberg", new List<string>(), null, 7.1989999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\iLb0qo8YW21AR6FiU0eud9M8vHp.jpg" },
                    { 5382, "Stacey Sher is an American film producer. She has produced more than two dozen major motion pictures amassing nearly $2.2 billion at the global box office. Her many critically acclaimed and commercially successful production credits include such notable titles as Quentin Tarantino’s Pulp Fiction, Django Unchained and The Hateful Eight; Steven Soderbergh’s Erin Brockovich, Out of Sight and Contagion; Garden State; Reality Bites; and Get Shorty.", new DateTime(1962, 11, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0792049", "Production", "Stacey Sher", new List<string>(), "New York City, New York", 5.3029999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7tzrJthPFmv8ncG7uLELqHOqNV9.jpg" },
                    { 5469, "Ralph Nathaniel Twisleton-Wykeham-Fiennes (born December 22, 1962) is an English actor, film producer, and director. Since 1999, Fiennes has served as an ambassador for UNICEF UK. A Shakespeare interpreter, he first achieved success onstage at the Royal National Theatre. He made his film debut playing Heathcliff in Emily Brontë's Wuthering Heights.\n\nA noted Shakespeare interpreter, he first achieved success onstage at the Royal National Theatre. Fiennes' portrayal of Nazi war criminal Amon Göth in Schindler's List (1993) earned him nominations for the Academy Award for Best Supporting Actor and the Golden Globe Award for Best Supporting Actor, and he won the BAFTA Award for Best Actor in a Supporting Role. His performance as Count Almásy in The English Patient (1996) garnered him a second Academy Award nomination, for Best Actor, as well as BAFTA and Golden Globe nominations.\n\nSince then, Fiennes has been in a number of notable films, including Quiz Show (1994), Strange Days (1995), The End of the Affair (1999), Red Dragon (2002), The Constant Gardener (2005), In Bruges (2008), The Reader (2008), Clash of the Titans (2010), Great Expectations (2012), and The Grand Budapest Hotel (2014). He voiced Rameses in The Prince of Egypt (1998).\n\nFiennes is most known for his role in the major film franchise series of Harry Potter films (2005–2011), in which he played the main villain, Lord Voldemort. In the James Bond series he played Gareth Mallory / M, starting with the 2012 film Skyfall.\n\nIn 2011, Fiennes made his directorial debut with his film adaptation of Shakespeare's tragedy Coriolanus, in which he also played the title character. Fiennes won a Tony Award for playing Prince Hamlet on Broadway.", new DateTime(1962, 12, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000146", "Acting", "Ralph Fiennes", new List<string> { "Рэйф Файнс", "レイフ・ファインズ", "Рейф Файнз", "רייף פיינס", "雷夫·范恩斯" }, "Ipswich, Suffolk, England, UK", 41.292000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tJr9GcmGNHhLVVEH3i7QYbj6hBi.jpg" },
                    { 5507, "", null, null, 1, null, "nm0947733", "Production", "Ronnie Yeskel", new List<string>(), null, 4.2629999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tYYDKsMlTFn8GJUyhxiqfF5XIjT.jpg" },
                    { 5555, "Sergio Donati (born 13 April 1933) is an Italian screenwriter. He has written for more than 70 films since 1952. He was born in Rome, Italy. He started as a writer and had some of his books optioned for film.  He is well known for his collaboration with Italian director Sergio Leone, who encouraged him to take up screenwriting as a full-time career, and with Italian producer Dino de Laurentis.", new DateTime(1933, 4, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0006872", "Writing", "Sergio Donati", new List<string>(), "Rome, Italy", 9.4700000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\feFhEMfI6bRHa48vlgO3uS8KS5k.jpg" },
                    { 5557, "Andrea Crisanti (12 June 1936, in Rome – 7 May 2012) was an Italian production designer and art director.\n\nCrisanti studied art at the Academy of Fine Arts in Rome. He began his film career as assistant set designer to Mario Garbuglia by working on the set of The Great War (1959) with Mario Monicelli. His independent debut came with Maciste in Hell (1962) by Riccardo Freda.\n\nIn 1970, Crisanti met Francesco Rosi, which proved crucial to the success of his career. He later worked on Cinema Paradiso (1988) and A Pure Formality (1994) by Giuseppe Tornatore, which won a David di Donatello Award. Sicily was one of his favourite places, and he recalled the pomp of the 17-century Bourbon period for the set of The Council of Egypt (2002) by Emidio Greco. Crisanti worked on Michelangelo Antonioni's Identification of a Woman (1982), Franzo Zeffirelli's Young Toscanini (1988), Gianni Amelio's The Stolen Children (1992), and Andrei Tarkovsky's Nostalghia (1983).\n\nHe taught art at Rome's Experimental Cinematography Centre from 1995 until his death, and was president of A.S.C., the Set and Costume Designers Association.\n\nSource: Article \"Andrea Crisanti\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1936, 6, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 5, 7, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0187936", "Art", "Andrea Crisanti", new List<string>(), "Rome, Lazio, Italy", 3.1240000000000001, null },
                    { 5578, "Debi Mazar (born August 13, 1964) is an American actress, perhaps best known for her trademark Jersey Girl-type appearances, and as edgy, sharp-tongued women in independent films and her recurring role on Entourage.", new DateTime(1964, 8, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000529", "Acting", "Debi Mazar", new List<string> { "Deborah Mazar", "Debi", "Debi M.", "Debbie Mazar", "Debbi Mazar", "Debra Mazar", "데비 마자르", "Деби Мазар" }, "New York City, New York, USA", 16.809999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cU3LhqOjXzOqpGCSDFj5otlZreu.jpg" },
                    { 5710, "", new DateTime(1955, 5, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1997, 6, 16, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0564296", "Costume & Make-Up", "Elizabeth McBride", new List<string>(), null, 2.532, null },
                    { 5714, "From Wikipedia, the free encyclopedia.\n\nCarlos Saldanha (born July 20, 1968) is a Brazilian director of animated films. He was the director of Ice Age: The Meltdown (2006) and Ice Age: Dawn of the Dinosaurs (2009), and the co-director of Ice Age (2002) and Robots (2005).\n\nSaldanha was born in Rio de Janeiro, Brazil. He left his hometown in 1991 to follow his artistic instinct and passion for animation. With a background in computer science and a natural artistic sensibility, he found New York City the perfect locale to merge these skills and become an animator. He attended the MFA program at New York's School of Visual Arts, where he graduated with honors in 1993, after completing two animated shorts, The Adventures of Korky, the Corkscrew (1992) and Time For Love (1993). The shorts have been screened at animation festivals around the world. At SVA, Saldanha met Chris Wedge, one of the cofounders of Blue Sky Studios, who invited him to join their growing team of artists.\n\nHe also worked as animator on Wedge's short film Bunny.\n\nDescription above from the Wikipedia article Carlos Saldanha, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", new DateTime(1965, 1, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0757858", "Directing", "Carlos Saldanha", new List<string> { "카를로스 살다나", "Карлос Салдан" }, "Rio de Janeiro, Rio de Janeiro, Brazil", 11.067, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oxUlCSgxKaoCRYFyS65PC2fZWrk.jpg" },
                    { 5779, "", null, null, 2, null, "nm0913300", "Art", "David Wasco", new List<string>(), null, 3.1920000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9LUyCSUqUnuJmausxwMzD70gZDz.jpg" },
                    { 5789, "From Wikipedia, the free encyclopedia.\n\nHorst Werner Buchholz  (4 December 1933 – 3 March 2003) was a German actor, remembered for his part in The Magnificent Seven and Nine Hours to Rama. He appeared in over sixty films during his acting career from 1952–2002. He was married to French actress Myriam Bru from 1958 to his death, and one of their two children is the actor Christopher Buchholz.", new DateTime(1933, 12, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2003, 3, 3, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001976", "Acting", "Horst Buchholz", new List<string> { "Хорст Буххольц", "Хорст Бухгольц", "the German James Dean", "Horst Werner Buchholz" }, "Berlin, Germany", 14.773, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9V38Di9T0qsjKBl2dR7sZMN1N0i.jpg" },
                    { 5810, "Luciano Vincenzoni (7 March 1926 – 22 September 2013) was an Italian screenwriter, known as the \"script doctor\". He wrote for 65 films between 1954 and 2000.\n\nVincenzoni was born in Treviso, Veneto. He is probably best known in world cinema for his scriptwriting of Sergio Leone's For a Few Dollars More (1965) and The Good, the Bad and the Ugly in 1966, but he also wrote for a number of other Spaghetti Westerns.", new DateTime(1926, 3, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 9, 22, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0898812", "Writing", "Luciano Vincenzoni", new List<string>(), "Treviso, Veneto, Italy", 13.407999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wdBJYGShpng8bZefKgfuBpwazTx.jpg" },
                    { 5811, "Agenore Incrocci (4 July 1919 – 15 November 2005), best known as Age, was an Italian screenwriter, considered one of the fathers of the commedia all'italiana as one of the two members of the duo Age & Scarpelli, together with Furio Scarpelli.  Incrocci was born in Brescia, into a family including several actors, such as his sister Zoe, and spent his youth moving with them to numerous places of Italy. His first work in the cinema world was a dubber for Mario Monicelli's first movie, I ragazzi della Via Paal (1935). Subsequently, he worked for a radio, and in the meantime he started writing comic scripts. He also studied law, but without graduating.\n\nHe spent the first four years of World War II in France, as a prisoner of the French Army first and, later, of the Wehrmacht. He managed to escape, however, and fought for a year with the US Army. Back from the front, he worked again in the radio and for wrote for theatre and humour magazine.\n\nIn wrote his first screenplay for I due orfanelli, directed by Mario Mattoli. In 1949 started his famous collaboration with Furio Scarpelli, as the duo Age & Scarpelli.\n\nTogether with Scarpelli, he worked on a total of 120 Italian movies. These include some of the most famous of all, such as Sergio Leone's The Good, the Bad and the Ugly, Mario Monicelli's I soliti ignoti and many Totò movies. He also worked on some scripts on his own, such as that of Pietro Germi's Divorzio all'italiana.\n\nAs an actor, he took part to La terrazza by Ettore Scola (screenplay by Age & Scarpelli, of course) and Ecce Bombo by Nanni Moretti.\n\nHe died in Rome in 2005.", new DateTime(1919, 7, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2005, 11, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0408488", "Writing", "Agenore Incrocci", new List<string> { "Age-Scapelli", "Age", "Agilberto Incrocci" }, "Brescia, Lombardy, Italy", 5.444, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nVIsX7ZvqMwk3I8iGysm2P5SMy6.jpg" },
                    { 5812, "Furio Scarpelli (16 December 1919 – 28 April 2010), also called Scarpelli, was an Italian screenwriter, famous for his collaboration on numerous Commedia all'italiana films with Agenore Incrocci, forming the duo Age & Scarpelli.\n\nHe was the son of journalist Filiberto Scarpelli. During his childhood he devoted himself to writing and drawing. During World War II, he started to work as an illustrator for satire magazines, together with Federico Fellini and Ettore Scola, and he met Agenore Incrocci, better known as \"Age\".\n\nFurio was born and died in Rome, Italy.\n\nIn 1949, he started his famous collaboration with Age as the duo Age & Scarpelli, writing some of the first Totò successes until 1952.\n\nTogether with Age, he worked on a total of 120 Italian movies. These include some of the most famous of all, such as Sergio Leone's The Good, the Bad and the Ugly and Mario Monicelli's I soliti ignoti. After closing his relationship with Age, he wrote several movies with Ettore Scola, and the first works of directors such as Francesca Archibugi and Paolo Virzì. His third Nomination to Oscar was for Il Postino: The Postman, written with his son Giacomo. He also taught at the Centro Sperimentale di Cinematografia. The film Tormenti (2011), adapted from his graphic novel, was released shortly after his death.\n\nSource: Article \"Furio Scarpelli\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1919, 12, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2010, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0769249", "Writing", "Furio Scarpelli", new List<string> { "Scarpelli", "F. Scarpelli" }, "Rome, Italy", 8.1630000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\f1TCz5Wwff0W3nseJJ15PPm9zGQ.jpg" },
                    { 5813, "From Wikipedia, the free encyclopedia\n\nAldo Giuffrè (10 April 1924 – 26 June 2010) was an Italian film actor and comedian who appeared in over 90 films between 1948 and 2001. He was born in Naples.\n\nHe is known for his roles in The Four Days of Naples, and as the alcoholic Union Army captain in the Sergio Leone film The Good, the Bad and the Ugly in 1966.\n\nGiuffrè died in Rome in 2010 of peritonitis.", new DateTime(1924, 4, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2010, 6, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0321294", "Acting", "Aldo Giuffrè", new List<string> { "Aldo Giuffre'", "Альдо Джуффре" }, "Naples, Italy", 11.435, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aT6eECl1R3YGYL4KatyIQrq0zG8.jpg" },
                    { 5814, "Luigi Pistilli (19 July 1929 – 21 April 1996) was an Italian actor of stage, screen, and television.", new DateTime(1929, 7, 19, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1996, 4, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0685559", "Acting", "Luigi Pistilli", new List<string> { "Gigi Pistilli", "루이지 피스틸리" }, "Grosseto, Tuscany, Italy", 8.5129999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bH5vmD2CMBHzJyBe0P0bL6iTUNL.jpg" },
                    { 5815, "Rada Rassimov (born Rada Đerasimović (Serbian Cyrillic: Рада Ђерасимовић) on 3 March 1941 in Trieste, Italy) is an Italian actress of Serb origin, who has appeared in film since the early 1960s and television since 1975.  Sister of actor Ivan Rassimov.", new DateTime(1938, 5, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0711502", "Acting", "Rada Rassimov", new List<string>(), "Trieste, Italy", 22.297999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\34yudNBJTb8JAV8EHqQF4NF8nmt.jpg" },
                    { 5817, "Livio Lorenzon (6 May 1923 – 23 December 1971) was an Italian actor who was mainly active during the 1950s and 1960s.", new DateTime(1923, 5, 6, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1971, 12, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0520859", "Acting", "Livio Lorenzon", new List<string> { "Elio Ardan", "Livio Ardan", "Charles Lawrence", "Charlie Lawrence", "Silvio Lorenzon" }, "Trieste, Friuli-Venezia Giulia, Italy", 5.9980000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3Uj1nh773MRqhno6EsjVkiDgFV5.jpg" },
                    { 5818, "Antonio Casale (17 May 1932 – 4 February 2017) was an Italian film actor of the 1960s and 1970s who appeared in mostly Spaghetti Western Italian films between 1965 and 1976.", new DateTime(1932, 5, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 2, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0142804", "Acting", "Antonio Casale", new List<string> { "Anthony Vernon" }, "Roma, Italy", 8.6189999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uAhNOD1ZA9Gh1CmCWkb4RRI1OKd.jpg" },
                    { 5819, "Angelo Novi (9 June 1930 – 6 May 1997) worked for thirty years as the exclusive photographer with some of the most known Italian film directors of his time, such as Bernardo Bertolucci, Sergio Leone, and Pier Paolo Pasolini. He studied at the Brera Academy in Milan, and from 1952 on, started to work as a photojournalist. The ability to capture the decisive moment, inspired by idols like Henri Cartier-Bresson and Robert Capa, is an important gist for his photographic style, which later honed in his work as a set photographer.\n\nNovi told his own story through the scenic action captured by his photographs. Emphasis on the decisive moment, the contrast of proximity and distance, and the black and whites, are all attributes of Novi's work. With his photographs, Novi has made a comprehensive contribution to the cultural memory of the golden era of the Italian cinema. As a silent observer, he captured the moments at the film sets both behind the scenes and in action, revealing intimate aspects that cannot be found on the screen.", new DateTime(1930, 6, 9, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1997, 5, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, "https://www.angelonovi.com/", "nm0637064", "Camera", "Angelo Novi", new List<string>(), "Lanzo d'Intelvi, Italy", 5.3470000000000004, null },
                    { 5820, "Alberto Grimaldi is an Italian film producer.  Grimaldi is credited with producing some of the most famous films in film history including \"For A Few Dollars More\" in 1965, The Good, the Bad and the Ugly in 1966, Last Tango in Paris in 1972 and Gangs of New York in 2002.", new DateTime(1925, 3, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2021, 1, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0342090", "Production", "Alberto Grimaldi", new List<string>(), "Napoli, Italy", 7.9279999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pnASo0rcU50WmOhzY9SceWf0KDO.jpg" },
                    { 5821, "", null, null, 2, null, "nm0015760", "Editing", "Eugenio Alabiso", new List<string> { " Eugene Alabiso ", "Eugene Ballaby ", "Alan Beugen ", "Eugene Miller" }, null, 2.9369999999999998, null },
                    { 5843, "José Terrón Peñaranda (5 July 1939 – 12 May 2019) was a Spanish film actor. He started in the cinema with his three brothers, Pedro, Ángel and Víctor, as a specialist, for his ability to do stunts on horses.  Terrón participated in more than 50 films in the 60s and 70s, especially in the spaghetti westerns , and he always played the villain because of his particular face.", new DateTime(1939, 7, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 5, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm1056271", "Acting", "José Terrón", new List<string>(), "Madrid, Madrid, Spain", 5.2889999999999997, null },
                    { 5935, "From Wikipedia, the free encyclopedia.\n\nSean Hood (born August 13, 1966) is an American screenwriter best known for horror films, and more recently, action/thrillers.\n\nDescription above from the Wikipedia article Sean Hood, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1966, 8, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0393517", "Writing", "Sean Hood", new List<string>(), "Milwaukee, Wisconsin, USA", 5.984, null },
                    { 6099, "", new DateTime(1942, 4, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0210832", "Production", "Valerio De Paolis", new List<string>(), "Turin, Piedmont, Italy", 1.3260000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rbsYkbJPgQAMuFY71RYrYatdXWT.jpg" },
                    { 6217, "Anupam Kher (born March 7, 1955) is an Indian actor, director and producer who works primarily in Hindi-language films. He has appeared in nearly 400 films and 100 plays. He has played a variety of characters including numerous critically acclaimed leading or parallel roles. The Government of India honoured him with the Padma Shri in 2004 and the Padma Bhushan in 2016 for his contribution in the field of Indian cinema and arts.  Kher is known internationally for Bend It Like Beckham (2002), Bride and Prejudice (2004) and The Mistress of Spices (2005). In 2012, he co-starred in the Academy Award-winning Silver Linings Playbook.", new DateTime(1955, 3, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://theanupamkher.com/", "nm0451600", "Acting", "Anupam Kher", new List<string> { "अनुपम खेर", "阿努潘·凱爾", "阿努潘·凯尔" }, "Shimla, Himachal Pradesh, India", 8.4979999999999993, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\f7hWJ4tvzR7uXmYoTiB41TpQ2NZ.jpg" },
                    { 6289, "", new DateTime(1965, 4, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0120717", "Acting", "Verena Buratti", new List<string>(), null, 6.2539999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yuauzvkee0BanUsUkh146mB7jco.jpg" },
                    { 6310, "From Wikipedia, the free encyclopedia.\n\nDavid Brisbin (born June 26, 1952) is an American television actor who gained fame as Mr. Ernst on the television show Hey Dude and as a newscaster in Forrest Gump. He has made frequent guest appearances on ER.\n\nHe is married to actress Laura Innes and they have two children together: Cal and Mia.\n\nDescription above from the Wikipedia article David Brisbin, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1952, 6, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0109773", "Acting", "David Brisbin", new List<string>(), "Andrews, West Texas, USA", 7.2060000000000004, null },
                    { 6368, "Embeth Jean Davidtz (born August 11, 1965) is an American-born South African actress.", new DateTime(1965, 8, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0001110", "Acting", "Embeth Davidtz", new List<string> { "Embeth Jean Davidtz", "エンベス・デイヴィッツ" }, "Lafayette, Indiana, USA", 26.663, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nwsdu9lOsKJ5v9RwOCc7kAiuxSO.jpg" },
                    { 6383, "Aaron Edward Eckhart (born March 12, 1968) is an American actor. Born in Cupertino, California, Eckhart moved to the United Kingdom at early age, when his father relocated the family. Several years later, he began his acting career by performing in school plays, before moving to Australia for his high school senior year. He left high school without graduating, but earned a diploma through a professional education course, and graduated from Brigham Young University (BYU) in 1994 with a Bachelor of Fine Arts (BFA) degree in film. For much of the mid-1990s, he lived in New York City as a struggling, unemployed actor.\n\nAs an undergraduate at BYU, Eckhart met director and writer Neil LaBute, who cast him in several of his own original plays. Five years later Eckhart made a debut as an unctuous, sociopathic ladies' man in LaBute's black comedy film In the Company of Men (1997). Under LaBute's guidance he worked in the director's films Your Friends & Neighbors (1998), Nurse Betty (2000), and Possession (2002).\n\nEckhart gained wide recognition as George in Steven Soderbergh's critically acclaimed film Erin Brockovich (2000), and, in 2006, he received a Golden Globe nomination for his portrayal of Nick Naylor in Thank You for Smoking. He gained further mainstream breakout in 2008 when he starred in the blockbuster Batman film The Dark Knight as District Attorney Harvey Dent / Two-Face. Eckhart's other key roles include The Pledge (2001), The Core (2003), Paycheck (2003), Rabbit Hole (2010), Battle: Los Angeles (2011), Olympus Has Fallen (2013) and its sequel London Has Fallen (2016), I, Frankenstein (2014), Sully (2016), Midway (2019) and Line Of Duty (2019).", new DateTime(1968, 3, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001173", "Acting", "Aaron Eckhart", new List<string> { "Аарон Екгарт", "艾伦·艾克哈特", "亞倫·艾克哈特" }, "Cupertino, California, USA", 32.613, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6rI3cYhdxOaOFSRB4C29MalpwDC.jpg" },
                    { 6455, "", new DateTime(1929, 3, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0887916", "Costume & Make-Up", "Theadora Van Runkle", new List<string>(), null, 2.274, null },
                    { 6573, "​From Wikipedia, the free encyclopedia.  \n\nWilliam Thomas Sadler (born April 13, 1950) is an American actor who works in film and television. His television and motion picture roles have included Lewis Burwell \"Chesty\" Puller in The Pacific, Luther Sloan in Star Trek Deep Space Nine, Sheriff Jim Valenti in Roswell, and—perhaps most notably—the Grim Reaper in Bill &amp; Ted's Bogus Journey, a role for which he was nominated for, and won, the Saturn Award for Best Supporting Actor, and his role as Colonel Stuart alongside Bruce Willis in Die Hard 2.", new DateTime(1950, 4, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0006669", "Acting", "William Sadler", new List<string> { "William Thomas Sadler", "Bill Sadler", "Γουίλιαμ Σάντλερ", "威廉·托馬斯·桑德勒" }, "Buffalo, New York, USA", 20.565000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rWeb2kjYCA7V9MC9kRwRpm57YoY.jpg" },
                    { 6574, "Clarence John Brown III (born January 5, 1959) is an American film, television and voice actor. He is known for his roles as the Kurgan in Highlander (1986), Captain Byron Hadley in The Shawshank Redemption (1994), Sergeant Charles Zim in Starship Troopers (1997), Brother Justin Crowe on the HBO series Carnivàle (2003–2005), Waylon \"Jock\" Jeffcoat on the Showtime series Billions (2018–2019) and Stanley Thomas in Promising Young Woman (2020).\n\nHis voice-over work includes Lex Luthor in the DC Animated Universe and various unrelated DC media, Doctor Neo Cortex in the Crash Bandicoot franchise (1997–2003), Mr. Krabs on SpongeBob SquarePants (1999–present), Surtur in Thor: Ragnarok (2017) and Lt. Hank Anderson in Detroit: Become Human (2018).", new DateTime(1959, 1, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://clancybrown.com", "nm0000317", "Acting", "Clancy Brown", new List<string> { "Clarence J. Brown III", "Κλάνσι Μπράουν", "克兰西·布朗" }, " Urbana, Ohio, U.S.", 41.832999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9RgzFqbmWBLVfq9wvyDo5UW8VT1.jpg" },
                    { 6575, "Gil Bellows (born June 28, 1967) is a Canadian film and television actor. He is best known for the roles of Tommy Williams in The Shawshank Redemption, Billy Thomas in the television series Ally McBeal and as CIA agent Matt Callan in the television series The Agency.", new DateTime(1967, 6, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0004743", "Acting", "Gil Bellows", new List<string> { "Gill Bellows " }, "Vancouver, British Columbia, Canada", 15.94, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eCOIv2nSGnWTHdn88NoMyNOKWyR.jpg" },
                    { 6576, "From Wikipedia, the free encyclopedia.\n\nMark Rolston (born December 7, 1956) is an American actor.\n\nDescription above from the Wikipedia article Mark Rolston, licensed under CC-BY-SA, full list of contributors on Wikipedia.\n\n​", new DateTime(1956, 12, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001679", "Acting", "Mark Rolston", new List<string> { "Mark Ralston", "Μαρκ Ρόλστον" }, "Baltimore, Maryland, USA", 12.768000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hcrNRIptYMRXgkJ9k76BlQu6DQp.jpg" },
                    { 6577, "From Wikipedia, the free encyclopedia\n\nJames Allen Whitmore Jr. (October 1, 1921 – February 6, 2009) was an American film, theatre, and television actor. During his career, Whitmore won three of the four EGOT honors; - a Tony, a Grammy, and an Emmy. Whitmore also won a Golden Globe and was nominated for two Academy Awards.  Following World War II, Whitmore appeared on Broadway in the role of the sergeant in Command Decision. Metro-Goldwyn-Mayer gave Whitmore a contract, but his role in the film adaptation was played by Van Johnson. His first major picture for MGM was Battleground, in a role that was turned down by Spencer Tracy, to whom Whitmore bore a noted physical resemblance. He was nominated for the Academy Award for Best Supporting Actor for this role, and won the Golden Globe Award as Best Performance by an Actor In A Supporting Role. Other major films included Angels in the Outfield, The Asphalt Jungle, The Next Voice You Hear, Above and Beyond, Kiss Me, Kate, Them!, Oklahoma!, Black Like Me, Guns of the Magnificent Seven, Tora! Tora! Tora!, and Give 'em Hell, Harry!, a one-man show for which he was nominated for the Academy Award for Best Actor for his portrayal of former U.S. President Harry S Truman. In the film Tora! Tora! Tora!, he played Admiral William F. \"Bull\" Halsey.\n\nWhitmore appeared during the 1950s on many television anthology series. He was cast as Father Emil Kapaun in the 1955 episode \"The Good Thief\" in the ABC religion anthology series Crossroads. Other roles followed on Jane Wyman Presents the Fireside Theater, Lux Video Theatre, Kraft Theatre, Studio One in Hollywood, Schlitz Playhouse, Matinee Theatre, and the Ford Television Theatre. In 1958, he carried the lead in \"The Gabe Carswell Story\" of NBC's Wagon Train, with Ward Bond.  Whitmore has a star on the Hollywood Walk of Fame at 6611 Hollywood Boulevard. The ceremony was held on February 8, 1960.", new DateTime(1921, 10, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2009, 2, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0926235", "Acting", "James Whitmore", new List<string> { "James Allen Whitmore Jr." }, "White Plains, New York, USA", 16.649999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d1nOu22OvPzdwS8euWE0FNHwx8K.jpg" },
                    { 6578, "Renee Blaine is an actress, known for The Shawshank Redemption (1994). She was born in Milwaukee, Wisconsin, but grew up in Colorado. Blaine began her career as a fashion model in the mid 1980s, appearing in magazines and ads for multiple brands while also traveling around the world.  After returning to the US, she spent several years modeling in the United States, while also having several appearances as an extra in the Walker, Texas Ranger TV show and the film Born on the Fourth of July.\n\nBlaine is now the mother of 3 children, 2 daughters and a son, and a grandmother.", null, null, 1, null, "nm0086169", "Acting", "Renee Blaine", new List<string>(), "Milwaukee, Wisconsin, USA", 5.0010000000000003, null },
                    { 6579, "After college graduation, Delate moved to New York City and spent his first few years adapting, both professionally and personally, to the novelty and pace of the city. Delate's first professional acting work (and his very special association with the New York Shakespeare Festival) began in 1981, when he was cast in both of the plays performed in Central Park that summer - Henry IV, Part I and The Tempest. Other plays followed (including Joseph Papp's Hamlet with Diane Venora), and in 1984-1985, Delate received critical acclaim for his performance in the award-winning play, Tracers, which had successful runs in both New York (NYSF) and London (Royal Court). An abundance of daytime television and commercial work followed. In 1987, William Friedkin cast him in Python Wolf and not long after, David Jones cast him opposite Robert DeNiro and Ed Harris in Jacknife. Theatre, film and television opportunities all combined to help Delate thrive as an actor. He spent three seasons with the River Arts Repertory, and three seasons with Phoenix Theatre Company doing rotating repertory theatre, along with numerous theatre acting stints in and out of New York. One piece of trivia from that time was that Delate got to play the Humphrey Bogart role of Rick in the only sanctioned stage production of Casablanca permitted by Warner Brothers.  Delate has had the privilege to work with some of the most talented and creative directors and actors in the industry -- most recently in The Brave One (directed by Neil Jordan, with Jodie Foster), in Salome on Broadway, directed by Estelle Parsons and elsewhere and in the film, Salomaybe (both with Al Pacino), as well as in My Brother (directed by Anthony Lover), Buffalo Soldiers (directed by Gregor Jordan, with Ed Harris and Joaquin Phoenix), The Truman Show (directed by Peter Weir, with Jim Carrey and Laura Linney), American Wake and Home Before Dark (both directed by Maureen Foley, the latter with Katherine Ross), Sudden Death (directed by Peter Hyams), Far From Heaven (directed by Todd Haynes), Ash Wednesday (directed by Edward Burns), and The Shawshank Redemption (directed by Frank Darabont, with Tim Robbins).", new DateTime(1949, 4, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0216507", "Acting", "Brian Delate", new List<string>(), "Trenton, New Jersey, USA", 6.1589999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rydDYe4VHjZsJZPWOus4KGkhroG.jpg" },
                    { 6580, "", new DateTime(1949, 4, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 7, 3, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0508742", "Acting", "Brian Libby", new List<string>(), "Valeggio sul Mincio, Veneto, Verona, Italy", 16.390000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sumWxPgIbCpnp1v1exfJWIt43i3.jpg" },
