                    { 6692, "Caroline Cruice Goodall (born November 13, 1959) is a British actress and screenwriter. She was nominated for AFI Awards for her roles in the 1989 miniseries Cassidy, and the 1995 film Hotel Sorrento. Her other film appearances include Hook (1991), Cliffhanger (1993), Schindler's List (1993), Disclosure (1994), White Squall (1996), The Princess Diaries (2001) and The Best of Me (2014).", new DateTime(1959, 11, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0328751", "Acting", "Caroline Goodall", new List<string> { "캐롤라인 구덜", "卡羅琳·古" }, "London, England, UK", 22.216000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4cagGtMqACvkuw6Llq8Li8UJ1AR.jpg" },
