                    { 6700, "", null, null, 2, null, "nm0624582", "Acting", "Harry Nehring", new List<string>(), null, 1.8540000000000001, null },
                    { 6701, "Norbert Weisser (born July 9, 1946) is a German-born American film and theatre actor, probably most known for his many roles in Albert Pyun-directed movies (15 and counting). Weisser is a founding member of the Odyssey Theater and the Padua Hills Playwrights Festival, where he developed the role of Trickster in Murray Mednick's epic seven-hour The Coyote Cycle. He has played roles in theaters throughout Europe and the US, including Broadway, where he played Rode opposite Ed Harris in Ronald Harwood's Taking Sides at the Brooks Atkinson Theater. Most recently he played Oskar in John O'Keefe's Times Like These in San Francisco, Albany, New York and Los Angeles, where he received an Ovation Award, an LA Weekly Theater Award and an LA Drama Critics Circle nomination for his performance. Weisser has directed plays at the Magic Theater in San Francisco and at the Mark Taper Forum's New Playwrights Festival in Los Angeles. Recently he produced two Albert Pyun films, Infection and Cool Air. He is the father of fellow actor Morgan Weisser, who starred in both movies. Weisser's television credits include: Amelia Earhart: The Final Flight, Riders of the Purple Sage, My Antonia, From the Earth to the Moon, Alias, The Agency, NCIS, ER, and Ghost Whisperer.", new DateTime(1946, 7, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://norbertweisser.com/index.htm", "nm0919256", "Acting", "Norbert Weisser", new List<string>(), "Neu-Isenburg, Germany", 6.8499999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A2QeLaigXmj1dtJHVLl27N8qNFd.jpg" },
