                    { 6712, "Ezra Dagan (born April 2, 1947) is an Israeli actor noted for his acting in the Steven Spielberg film, Schindler's List (1993). He portrayed the character Rabbi Menasha Lewartow.\n\nDagan also acted in films including Hunting Elephants (2012), The Attack (2012), The Other Son (2012), Mörderischer Besuch (TV movie) (2009), Naamonet (short) (1999), Body in the Sand (1996), The Revolutionary II (video) (1995), The Revolutionary (video) (1993), Schindler's List (1993), Me'Ahorei Hasoragim II (1986), Yaldei Stalin (1986), America 3000 (1983), Ha-Pachdani (1980), Festival Shirei Yeladim (1975), Nurith (1973), and A Gift from Heaven. In his career as a film artist, he has worked with Emmanuelle Devos (The Other Son), Ralph Fiennes (Schindler's List), Shmuel Shilo (Valdei Stalin) and Dori Ben-Zeev (Hasereth Festival Hayeladim).\n\nSource: Article \"Ezra Dagan\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1947, 4, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0196710", "Acting", "Ezra Dagan", new List<string>(), null, 6.2759999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4wEfV3uegO3o8tpKPQ4BWVZLe16.jpg" },
                    { 6751, "Siobhan J. Fallon Hogan (born May 13, 1961) is an American actress and comedian from Syracuse, New York. She began her career in television roles from the early 1980s to 1990s, including roles on Saturday Night Live and Seinfeld.\n\nIn 1994, Fallon made her film debut in 'Only You'. She has since had roles in a number of films including 'Forrest Gump' (1994), 'Men in Black' (1997), 'Dancer in the Dark' (2000), 'Holes' (2003), 'Daddy Day Care' (2003), 'Dogville' (2003), 'Funny Games' (2007), 'We Need to Talk About Kevin' (2011) and 'The House That Jack Built' (2018).", new DateTime(1961, 5, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0266441", "Acting", "Siobhan Fallon Hogan", new List<string> { "Siobhan Fallon ", "Siobhan J. Fallon" }, "Syracuse, New York, USA", 13.925000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5OExagnRsUcOYLMPTSrv4x2G95R.jpg" },
                    { 6800, "David Tattersall is an English cinematographer.", null, null, 2, null, "nm0005897", "Camera", "David Tattersall", new List<string> { "David Tattersall, BSC" }, null, 6.8220000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5Gnvt1M0of6qN1NMoVHvROz86QG.jpg" },
