                    { 6802, "", null, null, 1, null, "nm0905969", "Costume & Make-Up", "Karyn Wagner", new List<string> { "Karin Wagner" }, null, 5.1840000000000002, null },
                    { 6804, "Graham Greene (born June 22, 1952) is an Indigenous Canadian actor who has built a distinguished career in film, television, and theatre. Known for his versatility and impactful performances, Greene has appeared in numerous acclaimed productions, including The Green Mile (1999), Wind River (2017) and Dances with Wolves (1990). He earned an Academy Award nomination for his performance in Dances with Wolves. Throughout his career, Greene has been celebrated for his contributions to the entertainment industry and remains a respected figure in the acting world. He has been married to Hilary Blackmore since December 20, 1990.", new DateTime(1952, 6, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001295", "Acting", "Graham Greene", new List<string> { "葛拉罕·葛林" }, "Ohsweken, Ontario, Canada", 24.564, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ubX9pwrzQqnR41gAGyY1GoSZr1G.jpg" },
                    { 6805, "From Wikipedia, the free encyclopedia\n\nRobert William \"Dabbs\" Greer (April 2, 1917 – April 28, 2007) was an American actor who performed many diverse supporting roles in film and television for over 50 years. His distinctive voice and southern accent was a good fit for shows featuring rustic characters, especially westerns. He also was portrayed on other shows as a minister, and is probably best remembered as the Reverend Robert Alden in NBC's Little House on the Prairie. Earlier, Greer had a recurring role as Coach Ossie Weiss in the NBC sitcom Hank.", new DateTime(1917, 4, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2007, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0339428", "Acting", "Dabbs Greer", new List<string> { "Robert William \"Dabbs\" Greer", "Dabs Greer" }, "Fairview, Missouri, USA", 13.166, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ffm1QvndSpydujTPQ6gG2satfxq.jpg" },
                    { 6806, "Douglas Anthony \"Doug\" Hutchison (born 26 May 1960) is an American actor, known for his roles in The Green Mile, as corrections officer Percy Wetmore, Eugene Victor Tooms in The X-Files, as Horace Goodspeed in Lost and as Davros in 24. He owns the production company Dark Water Inc.\n\nDescription above from the Wikipedia article Doug Hutchison, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1960, 5, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0006535", "Acting", "Doug Hutchison", new List<string>(), "Dover, Delaware, USA", 21.157, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\afAENhxoHikCAKFaILFdSwVdkCw.jpg" },
                    { 6807, "Sam Rockwell was born on November 5, 1968, in San Mateo, California, the only child of two actors, Pete Rockwell and Penny Hess. The family moved to New York when he was two years old, living first in the Bronx and later in Manhattan. When Sam was five years old, his parents separated, at which point he and his father moved to San Francisco, where he subsequently grew up, while summers and other times were spent with his mother in New York.\n\nHe made his acting debut when he was ten years old, alongside his mother, and later attended J Eugene McAteer High School in a program called SOTA. While still in high school, he got his first big break when he appeared in the independent film Clownhouse (1989). The plot revolved around three escaped mental patients who dressed up as clowns and terrorized three brothers home alone--Sam played the eldest of the brothers. His next big break was supposed to have come when he was slated to star in a short-lived NBC TV-series called Dream Street (1989), but he was soon fired.\n\nAfter graduating from high school, Sam returned to New York for good and for two years he had private training at the William Esper Acting Studio. During this period he appeared in a variety of roles, such as the ABC Afterschool Specials (1972): Over the Limit (1990) (TV) and HBO's Lifestories: Families in Crisis (1992): Dead Drunk: The Kevin Tunell Story (Season 1 Episode 7: 15 March 1993); the head thug in Teenage Mutant Ninja Turtles (1990); and a guest-star turn in an Emmy Award-winning episode of Law & Order (1990), while working a string of regular day jobs and performing in plays.\n\nHis performances in The Green Mile (1999) and Galaxy Quest (1999) wowed audiences and critics alike with his chameleon-like performances as a crazed killer in the former and a goofy actor in the latter.\n\nMore recently, he appeared in another string of mainstream films, most notably as Eric Knox in Charlie's Angels (2000) and as Zaphod Beeblebrox in The Hitchhiker's Guide to the Galaxy (2005), while continuing to perform in smaller independent movies. After more than ten years in the business, Sam has earned his success. In 2018, he won an Academy Award for Best Supporting Actor as a troubled police deputy in Three Billboards Outside Ebbing, Missouri (2017).", new DateTime(1968, 11, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005377", "Acting", "Sam Rockwell", new List<string> { "Сэм Рокуэлл", "샘 록웰", "סם רוקוול", "Сем Роквелл", "山姆·洛克威" }, "Daly City, California, USA", 29.292000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1LvWTTwpxFjFhmNWUPWwfViOkrv.jpg" },
                    { 6828, "", null, null, 0, null, "nm0454950", "Sound", "Ken King", new List<string>(), null, 3.6440000000000001, null },
                    { 6851, "Anna Hill Johnstone (April 7, 1913 – October 16, 1992) was an American costume designer. Known for her collaborations with directors Elia Kazan, Sidney Lumet and Frank Perry, she received two Academy Award nominations for her work on The Godfather (1972) and Ragtime (1981).\n\nJohnstone's credits include East of Eden (1955), Baby Doll (1956), David and Lisa (1962), The Group (1966), The Godfather (1972), The Taking of Pelham One Two Three (1974), The Stepford Wives (1975), Dog Day Afternoon (1975), and Running on Empty (1988).\n\nDescription above from the Wikipedia article Anna Hill Johnstone, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1913, 4, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 10, 16, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0426895", "Costume & Make-Up", "Anna Hill Johnstone", new List<string>(), "Greenville, South Carolina, USA", 3.0699999999999998, null },
                    { 6856, "Kurt Vogel Russell (born March 17, 1951) is an American actor. He began acting on television at the age of 12 in the western series The Travels of Jaimie McPheeters (1963–1964). In the late 1960s, he signed a ten-year contract with The Walt Disney Company, where he starred as Dexter Riley in films, such as The Computer Wore Tennis Shoes (1969), Now You See Him, Now You Don't (1972), and The Strongest Man in the World (1975). According to Robert Osborne of Turner Classic Movies, he became the studio's top star of the 1970s.\n\nRussell was nominated for a Golden Globe Award for Best Supporting Actor – Motion Picture for his performance in Mike Nichols' Silkwood (1983). In the 1980s, he starred in several films directed by John Carpenter, including anti-hero roles such as army hero-turned-robber Snake Plissken in the futuristic action film Escape from New York (1981), its sequel Escape from L.A. (1996), the horror film The Thing (1982), and the kung-fu comedy action film Big Trouble in Little China (1986). For his portrayal of rock and roll superstar Elvis Presley in Elvis (1979), he was nominated for the Primetime Emmy Award for Outstanding Lead Actor in a Limited or Anthology Series or Movie.\n\nRussell starred in various other films, including Used Cars (1980), The Best of Times (1986), Overboard (1987), Tango & Cash (1989), Backdraft (1991), Tombstone (1993), Stargate (1994), Executive Decision (1996), Breakdown (1997), Vanilla Sky (2001), Miracle (2004), Sky High (2005), Death Proof (2007), The Hateful Eight (2015) and Once Upon a Time in Hollywood (2019). He also appeared in the Fast & Furious franchise as Mr. Nobody, having starred in Furious 7 (2015), The Fate of the Furious (2017), and F9 (2021), portrayed Ego in the Marvel Cinematic Universe (MCU) installments Guardians of the Galaxy Vol. 2 (2017) and What If...? (2021), and subsequently portrayed Santa Claus in The Christmas Chronicles (2018) and The Christmas Chronicles 2 (2020).", new DateTime(1951, 3, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000621", "Acting", "Kurt Russell", new List<string>(), "Springfield, Massachusetts, USA", 43.926000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6g1d98oH4miG4k0ZiZWmF3Dt0bO.jpg" },
