                    { 6935, "Hilton A. Green was a producer, production manager, and assistant director.", new DateTime(1929, 3, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 10, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0337906", "Production", "Hilton A. Green", new List<string> { "Hilton Green" }, "Los Angeles, California, USA", 3.5099999999999998, null },
