                    { 6963, "", null, null, 0, null, "nm0036153", "Crew", "Ryan Arndt", new List<string>(), null, 1.5580000000000001, null },
                    { 7004, "Paul Anthony Sorvino (/sɔːrˈviːnoʊ/, Italian: [sorˈviːno]; April 13, 1939 – July 25, 2022) was an American actor, opera singer, businessman, writer, and sculptor. He often portrayed authority figures on both sides of the law and was known for his roles as Paulie Cicero (based on Paul Vario) in the 1990 gangster film Goodfellas, and NYPD Sergeant Phil Cerreta on the TV series Law & Order. He took on supporting roles in A Touch of Class, Reds, The Rocketeer, Nixon, and Romeo + Juliet. He was the father of actors Mira Sorvino and Michael Sorvino.\n\nDescription above from the Wikipedia article Paul Sorvino, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1939, 4, 13, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 7, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000649", "Acting", "Paul Sorvino", new List<string> { "Paul Anthony Sorvino" }, "Brooklyn, New York, USA", 17.792999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4gDEo0wty5ixtrpV0U17PlHoFik.jpg" },
                    { 7036, "Eric Hamilton Stoltz (born September 30, 1961) is an American actor and director. He is known for playing sensitive misfits (Mask, Kicking and Screaming, The Waterdance, Killing Zoe). He was nominated for a Golden Globe Award for Best Supporting Actor in a Motion Picture for Mask.\n\n​From Wikipedia, the free encyclopedia.", new DateTime(1961, 9, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000655", "Acting", "Eric Stoltz", new List<string> { "艾瑞克·斯托罗兹", "Eric Hamilton Stoltz" }, "Whittier, California, USA", 18.454999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\idFuM00MeVmwGAiqvDaJcBiLAmD.jpg" },
                    { 7119, "", new DateTime(1923, 6, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0637360", "Acting", "Jerzy Nowak", new List<string>(), "Brzesko, Polska", 6.5049999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5zFZcl8yeXcoQCQ59d6J9bph4eB.jpg" },
                    { 7140, "Leonard Termo (March 6, 1935 – October 30, 2012) was an American character actor whose numerous film and television roles included Fight Club, Johnny Dangerously, and Seinfeld.", new DateTime(1935, 3, 6, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 10, 30, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0855657", "Acting", "Leonard Termo", new List<string> { " Lenny Termo " }, "Brooklyn, New York City, New York, USA", 4.3970000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9QummJWlDgiEMClBTGyMfF6nyMX.jpg" },
                    { 7163, "Nicholas Pileggi (born February 22, 1933 in New York City, New York) is an Italian-American author and screenwriter.\n\nDescription above from the Wikipedia article Nicholas Pileggi, licensed under CC-BY-SA, full list of contributors on Wikipedia​", new DateTime(1933, 2, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0683380", "Writing", "Nicholas Pileggi", new List<string>(), "New York City, New York, USA", 6.8360000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4OiAI0osmx3fHiHoqixTPq5ZSkD.jpg" },
                    { 7164, "Frank Vincent (August 4, 1939 - September 13, 2017) was an American actor, musician, author and entrepreneur. He was a favorite performer of director Martin Scorsese, having played important roles in three of Scorsese's most acclaimed films: Raging Bull (1980), Goodfellas (1990) and Casino (1995). He often played a gangster and worked both in features and television. He also lent his voice talents to video games. He played the New York Boss Phil Leotardo in the HBO series The Sopranos.\n\nDescription above from the Wikipedia article Frank Vincent, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1939, 8, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 9, 13, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0898634", "Acting", "Frank Vincent", new List<string> { "Фрэнк Винсент" }, "North Adams, Massachusetts, USA", 13.358000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fa1gikNsPKvX1roWUo2bBmixnvp.jpg" },
                    { 7170, "", new DateTime(1949, 12, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0208381", "Production", "Barbara De Fina", new List<string> { "Barbara DeFina" }, null, 6.0629999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gBKdvzHKLjqatJ4Im6WrpdaptrP.jpg" },
                    { 7219, "David Andrews (born January 1, 1952) is an American actor, best known for his role as General Robert Brewster in Terminator 3: Rise of the Machines. Andrews was born in Baton Rouge, Louisiana. His attended the Louisiana State University as an undergraduate and followed with a year at the Duke University School of Law and two at Stanford Law School, from which he graduated in the late 1970s. He set his career off in style by starring in the 1984 horror classic A Nightmare on Elm Street. For the rest of the 80s Andrews did not have any major hits, mainly focusing on a TV career. In 1990 he starred in Stephen King's Graveyard Shift and in 1994 he was James Earp in Kevin Costners Wyatt Earp. His career was boosted by starring in the TV series Mann & Machine. In 1995 he played astronaut Pete Conrad, alongside Tom Hanks, Kevin Bacon and Bill Paxton in the classic space drama Apollo 13.\n\nIn the late 90s Andrews concentrated on more television projects and starred in TV films such as Our Son, the Matchmaker, Fifteen and Pregnant, which also starred Kirsten Dunst, and the hit TV film Switched at Birth. In 1998 he played another astronaut, Frank Borman, in the HBO miniseries From the Earth to the Moon. He had a brief role as Major General Eldridge G. Chapman, commander of the 13th Airborne Division, in the Band of Brothers miniseries. 1999 was a great year for Andrews: not only that he did get the success from Switched at Birth but also Fight Club, which starred Brad Pitt and Edward Norton. Andrews started off the millennium by starring in Navigating the Heart before moving on to the sequel of the cannibal series Hannibal, starring Anthony Hopkins.\n\nIn 2002 he appeared in A Walk to Remember, and in 2003 he starred in Two Soldiers, The Chester Story and Terminator 3: Rise of the Machines. He also replaced John M. Jackson in the final season of JAG, playing Judge Advocate General Major General Gordon 'Biff' Cresswell. He was Edwin Jensen in the TV Movie The Jensen Project. Andrews played the role of Scooter Libby in the 2010 film, Fair Game, based on the Valerie Plame affair.", new DateTime(1952, 11, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0028625", "Acting", "David Andrews", new List<string> { "Stanley David Andrews " }, "Baton Rouge, Louisiana, USA", 9.4380000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\36LEerIIN7gpG52mM3Ier7YWDbh.jpg" },
                    { 7237, "", null, null, 2, null, "nm0366345", "Art", "Jay Hart", new List<string> { "Jay R. Hart" }, null, 3.1150000000000002, null },
                    { 7249, "Pete is one of New  Zealand's most well-known and respected Maori actors. He has been  working in the industry as an actor, writer, producer, director and  voice artist for over 20 years. Pete helped set up the production  company Puriri Films, where  works as a producer, director, writer and  presenter.", null, null, 2, "http://www.kractors.co.nz/detailsx.php?act_id=51", "nm0809572", "Acting", "Pete Smith", new List<string> { "Peter Smith" }, null, 7.8259999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xtDy3uPThZg1twK7Tgw709rtoEt.jpg" },
                    { 7299, "From Wikipedia, the free encyclopedia.\n\nRobert Albert Bloch (April 5, 1917 – September 23, 1994) was a prolific American writer, primarily of crime, horror and science fiction. He is best known as the writer of Psycho, the basis for the film of the same name by Alfred Hitchcock. He was also known as an excellent standup speaker with a wry sense of humour. He many times remarked that he had \"the heart of a little boy\", quipping \"I keep it in a jar on my desk.\"\n\nBloch wrote hundreds of short stories and over twenty novels, usually crime fiction, science fiction and, perhaps most influentially, horror fiction (Psycho). He was one of the youngest members of the Lovecraft Circle. H. P. Lovecraft was Bloch's mentor and one of the first to seriously encourage his talent.\n\nBloch was a contributor to pulp magazines such as Weird Tales in his early career, and was also a prolific screenwriter and a major contributor to science fiction fanzines and fandom in general.\n\nHe was the recipient of the Hugo Award (for his story \"That Hell-Bound Train\"), the Bram Stoker Award, and the World Fantasy Award. He served a term as president of the Mystery Writers of America (1970) and was a member of that organisation and of Science Fiction Writers of America, the Writers' Guild, the Academy of Motion Picture Arts and Sciences and the Count Dracula Society.In 2008, The Library of America selected Bloch’s story “The Shambles of Ed Gein” for inclusion in its two-century retrospective of American true crime.\n\nHis favourites amongst his own novels were The Kidnapper, The Star Stalker, Psycho, Night-World and Strange Eons.\n\nDescription above from the Wikipedia article Robert Bloch, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1917, 4, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1994, 9, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0088645", "Writing", "Robert Bloch", new List<string>(), "Chicago, Illinois, USA", 5.9139999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sc6dSKVCdqxCCqwHdBjtsCFLMyn.jpg" },
                    { 7300, "", new DateTime(1922, 5, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 8, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0825010", "Writing", "Joseph Stefano", new List<string>(), "Philadelphia, Pennsylvania, USA", 8.8070000000000004, null },
                    { 7301, "Anthony Perkins (April 4, 1932 – September 12, 1992) was an American actor and singer. He is best known for his role as Norman Bates in Alfred Hitchcock's Psycho and his Oscar-nominated role in Friendly Persuasion (1956). He made his film debut in The Actress (1953) directed by George Cukor before experiencing success on Broadway with Elia Kazan’s production of Tea and Sympathy (1955).\n\nHe quickly became one of Hollywood’s biggest stars, working alongside actors such as Henry Fonda (The Tin Star), Sophia Loren (Desire Under the Elms), Shirley MacLaine (The Matchmaker), Audrey Hepburn (Green Mansions), and Gregory Peck, Fred Astaire, and Ava Gardner (On the Beach).\n\nHe left Hollywood in 1960 and had a successful career in Europe, where he co-starred with Ingrid Bergman (Aimez-vous Brahms?), Melina Mercouri (Phaedra), Brigitte Bardot (Une ravissante idiote), and Romy Schneider, Jeanne Moreau, Elsa Martinelli, and Orson Welles (Le procès). He returned to Hollywood in 1968 with Pretty Poison, which became a cult classic.\n\nIn the decades that followed, his career continued to flourish alongside personalities like Diana Ross (Mahogany), Jeff Goldblum (Remember My Name), Elizabeth Taylor (Winter Kills), John Candy (Double Negative), and Lauren Bacall (Murder on the Orient Express). In 1973, he co-wrote The Last of Sheila with Stephen Sondheim.\n\nDuring his career, he won a Golden Globe, a Cannes Award, and a David di Donatello Award, and was nominated for two Tony Awards and one Academy Award. Perkins died on September 12, 1992, of AIDS complications.", new DateTime(1932, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000578", "Acting", "Anthony Perkins", new List<string> { "Tony Perkins", "Энтони Перкинс", "Антони Перкинс" }, "New York City, New York, USA", 28.867999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2BD15q5z5xpO0lAymi6VSGESk9Z.jpg" },
                    { 7302, "Janet Leigh (born Jeanette Helen Morrison; July 6, 1927 – October 3, 2004) was an American actress, singer, dancer, and author. Her career spanned over five decades. Raised in Stockton, California, by working-class parents, Leigh was discovered at 18 by actress Norma Shearer, who helped her secure a contract with Metro-Goldwyn-Mayer.\n\nLeigh appeared in radio programs before her first formal foray into acting, making her film debut in the drama The Romance of Rosy Ridge (1947). With MGM, she appeared in many films which spanned a wide variety of genres, which include the crime-drama Act of Violence (1948), the drama Little Women (1949), the comedy Angels in the Outfield (1951), the romance Scaramouche (1952) and the western drama The Naked Spur (1953). She played dramatic roles during the late 1950s, in such films as Safari (1956) and Orson Welles's film noir Touch of Evil (1958). With RKO Radio pictures she co-starred in the romantic comedy Holiday Affair (1949) with Robert Mitchum.\n\nLeigh achieved her biggest success starring as Marion Crane in Alfred Hitchcock's psychological thriller Psycho (1960). For her performance, Leigh won the Golden Globe Award for Best Supporting Actress and earned a nomination for the Academy Award for Best Supporting Actress. Intermittently, she continued to appear in films, including Bye Bye Birdie (1963), Harper (1966), Night of the Lepus (1972), and Boardwalk (1979). She made her Broadway debut in 1975 in a production of Murder Among Friends. She would also go on to appear in two horror films with her daughter, Jamie Lee Curtis: The Fog (1980) and Halloween H20: 20 Years Later (1998).\n\nIn addition to her work as an actress, Leigh also wrote four books between 1984 and 2002, two of which were novels. Leigh had two brief marriages as a teenager (one of which was annulled) before marrying actor Tony Curtis in 1951. The pair's highly publicized union ended in divorce in 1962, and after starring in The Manchurian Candidate that same year, Leigh remarried and scaled back her career. She died in October 2004 at age 77, following a year-long battle with vasculitis, an inflammation of the blood vessels.\n\nDescription above from the Wikipedia article Janet Leigh, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1927, 7, 6, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2004, 10, 3, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0001463", "Acting", "Janet Leigh", new List<string> { "Джанет Ли", "Jeanette Helen Morrison" }, " Merced, California, USA", 20.741, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2dv9IqJEx31RSoH7xAHlJZXF5uB.jpg" },
                    { 7303, "Vera June Miles (born August 23, 1929) is an American actress. Born in Boise City, Oklahoma, Vera Miles attended school in Pratt,  Kansas and Wichita, Kansas. The patrician beauty of Miss Miles won her  the title of \"Miss Kansas\" in 1948, leading soon to small roles in  Hollywood films and television series. Fame came to the forthright,  spirited Miles when she attracted the attention of two master directors,  Alfred Hitchcock and John Ford. Ford cast her in the classic western The Searchers (1956) and Hitchcock, who put her under personal contract and hailed her as his \"new Grace Kelly\", paired her with the great Henry Fonda in The Wrong Man (1956). Hitchcock cast Miles in the potentially star-making role of Judy Barton in Vertigo  (1958), but Miles withdrew from the film when she became pregnant.  Hitchcock gave Miles a supporting role in another masterpiece Psycho (1960), as did Ford when he cast her opposite John Wayne and James Stewart in The Man Who Shot Liberty Valance (1962), She also starred in such films as Beau James (1957) opposite Bob Hope, The FBI Story (1959) opposite Stewart, Back Street (1961) opposite Susan Hayward and John Gavin and Sergeant Ryker (1968) opposite Lee Marvin,  as well as showing her consistently remarkable and versatile talent on  dozens of popular television movies and series including The Alfred Hitchcock Hour (1962), Twilight Zone (1959), The Outer Limits (1963), The Fugitive (1963), My Three Sons (1960), Bonanza (1959), \"Columbo\" and Murder, She Wrote (1984). In 1983, she reprised her role as \"Lila Crane\" in the film sequel Psycho II (1983), starring Anthony Perkins.  Although, too often, the stunningly beautiful Miles' gifts were  underutilized, before her retirement in 1995, hers was a most intriguing  and enduring Hollywood career.", new DateTime(1929, 8, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0587256", "Acting", "Vera Miles", new List<string> { "	Vera June Ralston", "Vera June Miles" }, "Boise City, Oklahoma, USA", 17.664000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9PDTsJnBfrAlvVPOBBFS3ehN8lD.jpg" },
                    { 7304, "From Wikipedia, the free encyclopedia\n\nJohn Gavin (April 8, 1931 – February 9, 2018) was an American actor who was the United States Ambassador to Mexico (1981–86) and the president of the Screen Actors Guild (1971–73). He was best known for his performances in the films Imitation of Life (1959), Spartacus (1960), Psycho (1960), and Thoroughly Modern Millie (1967), playing leading roles in a series of films for producer Ross Hunter.\n\nBorn Juan Vincent Apablasa Jr., Gavin was of Mexican, Chilean and Spanish descent, and was fluent in Spanish. His father, Juan Vincent Apablasa Sr., was of Chilean origin, and his paternal ancestors, including Cayetano Apablasa, were early landowners in California under Spanish rule. Gavin's mother was Delia Diana Pablos. Gavin’s parents divorced when he was about two years old. Gavin’s mother married Herald Ray Golenor, who adopted Gavin and changed his name to John Anthony Golenor.", new DateTime(1931, 4, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 2, 9, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001260", "Acting", "John Gavin", new List<string> { "Juan Vincent Apablasa Jr.", "John Anthony Golenor", "John Golenor", "Jack Golenor", "Jack Gavin", "John Gilmore", "Джон Гэвин" }, "Los Angeles, California, USA", 9.8480000000000008, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\n8vlG1PRtNzv6vlwjTNK7UnoKr0.jpg" },
