                    { 7418, "Mary Zophres is an American costume designer who has worked in the film industry since 1994. She has been nominated for the Academy Award for Best Costume Design thrice for True Grit (2010), La La Land (2016), and The Ballad of Buster Scruggs (2018). She has also been nominated for the BAFTA Award for Best Costume Design four times for Catch Me If You Can (2002), True Grit, La La Land, and The Ballad of Buster Scruggs.", new DateTime(1964, 3, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0957861", "Costume & Make-Up", "Mary Zophres", new List<string>(), null, 6.5739999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kLvPS8HSyLSxvROaK9wlc9WlPlr.jpg" },
                    { 7449, "Shinobu Hashimoto (Japanese: 橋本 忍, Hashimoto Shinobu; 18 April 1918 – 19 July 2018) was a Japanese screenwriter, film director and producer. A frequent collaborator of Akira Kurosawa, he wrote the scripts for such internationally acclaimed films as Rashomon and Seven Samurai.", new DateTime(1918, 4, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 7, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0368074", "Writing", "Shinobu Hashimoto", new List<string> { "橋本忍", "Синобу Хасимото", " 桥本忍" }, "Tsurui, Ichikawa, Hyōgo, Japan", 9.3369999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\Aakm6YsthiBZHdkfE7OnqPVyrPl.jpg" },
                    { 7450, "Toshirō Mifune (April 1, 1920 - December 24, 1997) was a Japanese actor who is widely regarded as one of the greatest actors in the history of Japanese cinema. He was born in Qingdao, China, but was raised in Japan. Mifune's career spanned over 50 years, during which he collaborated extensively with renowned director Akira Kurosawa, creating some of the most iconic films in Japanese cinema.\n\nMifune gained international recognition for his performances in Kurosawa's films, particularly in samurai films. He portrayed strong, dynamic, and often rebellious characters, bringing a raw intensity to his roles. Some of his notable collaborations with Kurosawa include \"Rashomon\" (1950), \"Seven Samurai\" (1954), \"Yojimbo\" (1961), and \"The Hidden Fortress\" (1958), which inspired George Lucas's \"Star Wars.\"\n\nApart from his work with Kurosawa, Mifune appeared in numerous other films, showcasing his versatility as an actor. He played roles in various genres, including dramas, comedies, and war films. Some of his other notable films include \"The Throne of Blood\" (1957), \"High and Low\" (1963), and \"Red Beard\" (1965).\n\nMifune's charismatic presence, powerful performances, and ability to convey complex emotions made him an iconic figure in Japanese cinema. He received international recognition and awards for his contributions to the film industry, including several honors at the Venice Film Festival and a lifetime achievement award from the Academy of Motion Picture Arts and Sciences.", new DateTime(1920, 4, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1997, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.mifuneproductions.co.jp/index.php", "nm0001536", "Acting", "Toshirō Mifune", new List<string> { "Toshirô Mifune", "Toshiroh Mifune", "Тосиро Мифунэ", "Mifune Toshirō", "Toshiro Mifune" }, "Qingdao, China", 21.988, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3A9PqrtiXHLp8B2JL7m3YvVXrmL.jpg" },
                    { 7453, "​From Wikipedia, the free encyclopedia.  \n\nTakashi Shimura (志村 喬, Shimura Takashi, March 12, 1905 – February 11, 1982) was a Japanese actor who appeared in over 200 films between 1934 and 1981. He appeared in 21 of Akira Kurosawa's 30 films (more than any other actor), including as a lead actor in Drunken Angel (1948), Rashomon (1950), Ikiru (1952) and Seven Samurai (1954).[3] He played Professor Kyohei Yamane in Ishirō Honda's original Godzilla (1954) and its first sequel, Godzilla Raids Again (1955). For his contributions to the arts, the Japanese government decorated Shimura with the Medal with Purple Ribbon in 1974 and the Order of the Rising Sun, 4th Class, Gold Rays with Rosette in 1980.\n\nShimura died on February 11, 1982, in Tokyo, Japan, from emphysema at the age of 76. His effects were presented to the Film Centre of the National Museum of Modern Art, Tokyo.\n\nDescription above from the Wikipedia article Takashi Shimura, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1905, 3, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1982, 2, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0793766", "Acting", "Takashi Shimura", new List<string> { " 志村喬 ", "Shoji Shimazaki", "島崎捷爾", "Такаси Симура", "志村乔" }, "Ikuno, Hyogo, Japan", 21.824999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ydyAm2vyBbEPZRICIMqqjDm0NM9.jpg" },
                    { 7454, "From Wikipedia, the free encyclopedia\n\nMinoru Chiaki (千秋 実 Chiaki Minoru) was a Japanese actor who appeared in such films as Akira Kurosawa's Seven Samurai and The Hidden Fortress.\n\nIn Seven Samurai he was the good-natured samurai Heihachi and he was the first of the samurai to be killed. Ironically, in real life he turned out to be the last of the seven actors to die.\n\nLater in his career he appeared as a secondary actor in many Toei films. In 1986 he was given the Best Actor prize at the Japan Academy Prize ceremony for his performance in Toei's Gray Sunset (1985).\n\nDescription above from the Wikipedia article Minoru Chiaki, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1917, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1999, 11, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0156928", "Acting", "Minoru Chiaki", new List<string> { "千秋実", "Минору Тиаки", "千秋实" }, "Hokkaido, Japan", 6.8650000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4uqny8n2OmGixVVdzqUBA5zJ9aW.jpg" },
                    { 7455, "Kichijirō Ueda was a Japanese stage, film and television actor.", new DateTime(1904, 3, 30, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1972, 11, 3, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0879918", "Acting", "Kichijirō Ueda", new List<string> { "Kichijirou Ueda", "Kichijiroh Ueda", "上田 吉二郎", "Sadao Ueda", "上田 定雄", "上田吉二郎", "Китидзиро Уэда", "Kichijirô Ueda" }, "Kobe, Japan", 7.1280000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qjBYqwAobeFnOhpkxNnv36IvCQy.jpg" },
                    { 7456, "Noriko Honma (本間文子 Honma Noriko, born 29 November 1911 - 12 April 2009) is a Japanese actress whose film work occurred primarily during the 1950s. She was born in Hokkaido. She worked in many of Akira Kurosawa's films, first appearing in Kurosawa's Rashomon as the Miko, also in Ikiru, The Seven Samurai, Akahige, and Dreams.", new DateTime(1911, 11, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2009, 4, 12, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0393352", "Acting", "Noriko Honma", new List<string> { "本間文子 ", "本间文子", "Норико Хомма" }, "Yubari, Hokkaido, Japan", 7.4249999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\knJYqIRwatZYjlmsCjK1A7IA2za.jpg" },
                    { 7457, "Daisuke Katō (加東 大介 Katō Daisuke, February 18, 1911 – July 31, 1975) was a Japanese actor who appeared in over 150 films, including Akira Kurosawa's Seven Samurai (as the loyal comrade Shichiroji), Rashomon, Yojimbo (as the \"wild pig\" Inokichi), Ikiru, and Hiroshi Inagaki's Samurai Trilogy and Chushingura.", new DateTime(1911, 2, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1975, 7, 31, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0441961", "Acting", "Daisuke Katō", new List<string> { "加東大介", "Дайскэ Като", "加东大介", "市川莚司" }, "Tokyo, Japan", 9.0969999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7VATRGIU5NNhzdb6ZdJLKdqEvPW.jpg" },
                    { 7460, "Fumio Hayasaka (早坂 文雄 Hayasaka Fumio; August 19, 1914 – October 15, 1955) was a Japanese composer of classical music and film scores.", new DateTime(1914, 8, 19, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1955, 10, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0370593", "Sound", "Fumio Hayasaka", new List<string> { "早坂文雄" }, null, 2.5710000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A4t45XV0SXKnYzZNkzrjCl4jHUy.jpg" },
                    { 7467, "David Andrew Leo Fincher (born August 28, 1962) is an American film director. His films, mostly thrillers, have received 40 nominations at the Academy Awards, including three for him as Best Director.\n\nBorn in Denver, Colorado, Fincher was interested in filmmaking at an early age. He directed numerous music videos, most notably Madonna's \"Express Yourself\" in 1989 and \"Vogue\" in 1990, both of which won him the MTV Video Music Award for Best Direction. He made his feature film debut with Alien 3 (1992), which garnered mixed reviews, followed by the thriller Seven (1995), which was better received. Fincher found lukewarm success with The Game (1997) and Fight Club (1999), but the latter eventually became a cult classic. In 2002, he returned to prominence with the thriller Panic Room starring Jodie Foster.\n\nFincher also directed Zodiac (2007), The Social Network (2010), The Girl with the Dragon Tattoo (2011), and Mank (2020). For The Social Network, he won the Golden Globe Award for Best Director and BAFTA Award for Best Direction. His biggest commercial successes are The Curious Case of Benjamin Button (2008) and Gone Girl (2014), both of which grossed more than $300 million worldwide, with the former earning thirteen nominations at the Academy Awards, and eleven at the British Academy Film Awards.\n\nHe also served as an executive producer and director for the Netflix series House of Cards (2013–2018) and Mindhunter (2017–2019), winning the Primetime Emmy Award for Outstanding Directing for a Drama Series for the pilot episode of House of Cards. Fincher was the co-founder of Propaganda Films, a film, and music.", new DateTime(1962, 8, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000399", "Directing", "David Fincher", new List<string> { "Dave Fincher ", "David Andrew Leo Fincher ", "Дэвид Финчер", "大卫·芬奇", "เดวิด ฟินเชอร์", "デヴィッド・フィンチャー", "데이비드 핀처", "ديفيد فينشر", "Девід Фінчер" }, "Denver, Colorado, USA", 19.792000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tpEczFclQZeKAiCeKZZ0adRvtfz.jpg" },
                    { 7468, "Charles Michael \"Chuck\" Palahniuk (born February 21, 1962) is an American transgressional fiction novelist and freelance journalist. He is best known for the award-winning novel Fight Club, which was later made into a film directed by David Fincher and starring Brad Pitt, Edward Norton, and Helena Bonham Carter. He lives near Vancouver, Washington.\n\nDescription above from the Wikipedia article Chuck Palahniuk, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1962, 2, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://chuckpalahniuk.net/", "nm0657333", "Writing", "Chuck Palahniuk", new List<string>(), "Pasco, Washington. USA", 4.0919999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\r8WZhWea6RXCNO7HXvvB4lWYxzu.jpg" },
                    { 7469, "​Jim Uhls born as James Walter Uhls (born 1957) is an American screenwriter who rose to fame with his script adaptation of the critically acclaimed novel Fight Club. He graduated from the UCLA Film School.\n\nHe runs the Writers and Actors lab, a workshop teaching people how to write original screenplays.", new DateTime(1957, 3, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0880243", "Writing", "Jim Uhls", new List<string>(), "Missouri, USA", 6.7210000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uNkXdgsIdJF1xyj4BUSgHOfqjyb.jpg" },
                    { 7470, "Michael Lee Aday (September 27, 1947 – January 20, 2022) (height 6ft), better known as Meat Loaf, was an American singer and actor. He was noted for his powerful, wide-ranging voice and theatrical live shows. His Bat Out of Hell trilogy—Bat Out of Hell, Bat Out of Hell II: Back into Hell, and Bat Out of Hell III: The Monster Is Loose—has sold more than 65 million albums worldwide. More than four decades after its release, the first album still sells an estimated 200,000 copies annually and stayed on the charts for over nine years, making it one of the best-selling albums in history.\n\nAfter the commercial success of Bat Out of Hell and Bat Out of Hell II: Back Into Hell, and earning a Grammy Award for Best Solo Rock Vocal Performance for the song \"I'd Do Anything for Love\", Meat Loaf nevertheless experienced some difficulty establishing a steady career within the United States. This did not stop him from becoming one of the best-selling music artists of all time, with worldwide sales of more than 80 million records. The key to this success was his retention of iconic status and popularity in Europe, especially the United Kingdom, where he received the 1994 Brit Award for best-selling album and single, appeared in the 1997 film Spice World, and ranks 23rd for the number of weeks spent on the UK charts, as of 2006. He ranks 96th on VH1's \"100 Greatest Artists of Hard Rock\".\n\nAday appeared in over 50 movies and television shows, sometimes as himself or as characters resembling his stage persona. His film roles include Eddie in The Rocky Horror Picture Show (1975), and Bob Paulson in Fight Club (1999). His early stage work included dual roles in the original Broadway cast of The Rocky Horror Show, and he also appeared in the musical Hair, both on- and off-Broadway.\n\nDescription above from the Wikipedia article Meat Loaf, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1947, 9, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 1, 20, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.meatloaf.net", "nm0001533", "Acting", "Meat Loaf", new List<string> { "Meat Loaf Aday", "Marvin Lee Aday", "Meatloaf", "Michael Lee Aday" }, "Dallas, Texas, USA", 14.148, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7gKLR1u46OB8WJ6m06LemNBCMx6.jpg" },
                    { 7471, "Zach Grenier is an American character actor of film, television and stage. He is best known for his roles in films such as Fight Club, Tommy Boy, and Twister and for his roles in television such as David Lee in The Good Wife and Andy Cramed in Deadwood.", new DateTime(1954, 2, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.zachgrenier.info", "nm0340260", "Acting", "Zach Grenier", new List<string> { "James Hampton Grenier", "Zachary Grenier", "Zack Grenier" }, "Englewood, New Jersey, USA", 13.871, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fSyQKZO39sUsqY283GXiScOg3Hi.jpg" },
