                    { 7475, "Ceán Chaffin is an American film producer who has frequently collaborated with director and husband David Fincher. She and her fellow producers were nominated for Academy Award for Best Picture for The Curious Case of Benjamin Button (2008) and The Social Network (2010). She won American Film Institute's AFI Awards for these films as well as for The Girl with the Dragon Tattoo (2011). Chaffin was nominated for Producers Guild of America's Producers of the Year Awards for the three aforementioned films and was also nominated for a British Academy Film Award for The Curious Case of Benjamin Button and The Social Network.", new DateTime(1957, 6, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0149556", "Production", "Ceán Chaffin", new List<string>(), "Los Angeles, California, USA", 5.0579999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rk8DPo1CAMTWL0YjRsMFIy3gRmT.jpg" },
