                    { 7480, "James Haygood is a film editor. He got his big break back in the mid-1980s, when he connected with a young music-video director named David Fincher.", null, null, 2, null, "nm0371307", "Editing", "James Haygood", new List<string>(), null, 2.1829999999999998, null },
                    { 7481, "", null, null, 1, null, "nm0562644", "Production", "Laray Mayfield", new List<string>(), null, 5.431, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yBshxhOfzKrcvoVaFdI6VpH1BJ.jpg" },
                    { 7493, "", null, null, 2, null, "nm0073490", "Editing", "Michael Berenbaum", new List<string>(), null, 4.9740000000000002, null },
                    { 7497, "Holt McCallany (born Holt Quinn McAloney; September 3, 1963) is an American actor, writer, and producer. He is known for portraying Bill Tench on the series Mindhunter (2017–present) and has had several supporting roles in various television series and films.  His first job in the professional theater was as an apprentice actor at the Great Lakes Shakespeare Festival in Cleveland, Ohio, in the same apprenticeship once served by Tom Hanks, among others. Subsequently, he returned to New York City and was cast as an understudy in the Broadway production of Biloxi Blues.\n\nMcCallany landed a series of supporting parts in such films as Casualties of War, Alien 3, Creepshow 2, The Search for One-eye Jimmy, and Jade, as well as the TV miniseries Rough Riders. After playing the legendary boxing trainer Teddy Atlas in the HBO telefilm Tyson, he became a supporter of the Atlas Foundation Charity, a grassroots organization dedicated to helping children and families with medical and financial hardships.\n\nHe continued working in films and television throughout the nineties and 2000s with roles in films such as Fight Club, Three Kings, Men of Honor, and Below, among others. He played a detective with psychological problems in CSI: Miami and a soldier with post-traumatic stress disorder on Criminal Minds.\n\nHe appeared in the 2010 Warner Bros. film, The Losers, based on the graphic novel from DC Comics. McCallany also was the star of the 2011 FX television series, Lights Out, playing an aging boxer (\"Patrick 'Lights' Leary\") forced out of retirement and into a comeback bid to regain the heavyweight title, despite having pugilistic dementia.\n\nHe followed this with roles in films like Sully, Shot Caller, and Blackhat, among many others.\n\nSince 2017, McCallany co-stars in the Netflix series Mindhunter for director David Fincher. He plays Bill Tench, an FBI agent researching serial killers in the late-1970s. His first French language film will be released in September, 2019, an adaptation of the George Feydeau comedy Le Dindon.", new DateTime(1963, 9, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://holtmccallany.net/", "nm0564697", "Acting", "Holt McCallany", new List<string> { "Holt Mccallany ", "Holt McAloney", "Холт Маккэллани", "홀트 맥칼라니", "Голт МакКеллані", "赫特・麥卡藍" }, "New York City, New York, USA", 24.949999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tnXVshv7CD9b53BRjYrLjVJvnDS.jpg" },
                    { 7498, "From Wikipedia, the free encyclopedia.\n\nEion Francis Hamilton Bailey (born June 8, 1976) is an American actor, perhaps best known for appearing in the HBO miniseries Band of Brothers as Pvt. David Kenyon Webster and in the films Fight Club, Center Stage, Mindhunters and Sexual Life. He currently has a recurring role on the USA Network TV show Covert Affairs.\n\nDescription above from the Wikipedia article Eion Bailey, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", new DateTime(1976, 6, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0047248", "Acting", "Eion Bailey", new List<string> { "에이온 바일리" }, "Santa Ynez Valley, California, USA", 23.388000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3DW13W47cKk4LQZwS4EvRaNBoVu.jpg" },
                    { 7499, "Jared Joseph Leto (/ˈlɛtoʊ/; born December 26, 1971) is an American actor and musician. After starting his career with television appearances in the early 1990s, he achieved recognition for his role as Jordan Catalano on the television series My So-Called Life (1994). He made his film debut in How to Make an American Quilt (1995) and received critical praise for his performance in Prefontaine (1997).\n\nAfter supporting roles in The Thin Red Line (1998), Fight Club (1999), Girl, Interrupted (1999) and American Psycho (2000), and the lead role in Urban Legend (1998), he earned critical acclaim for portraying heroin addict Harry Goldfarb in Requiem for a Dream (2000). He began focusing increasingly on music, then returned to acting with Panic Room (2002), Alexander (2004), Lord of War (2005), Lonely Hearts (2006), Chapter 27 (2007), and Mr. Nobody (2009). His performance as a transgender woman in Dallas Buyers Club (2013) earned him an Academy Award, a Golden Globe Award, and a Screen Actors Guild Award for Best Supporting Actor. He starred in Suicide Squad (2016), Blade Runner 2049 (2017), The Little Things (2021) and House of Gucci (2021), of which the latter two earned him nominations for a Golden Globe Award and Screen Actors Guild Award for Best Supporting Actor.\n\nLeto is the lead vocalist, multi-instrumentalist and main songwriter for Thirty Seconds to Mars, a band he formed with his older brother Shannon Leto. Their debut album, 30 Seconds to Mars (2002), released to positive reviews but limited commercial success. The band achieved worldwide fame with the release of their second album A Beautiful Lie (2005). Their following releases, This Is War (2009), and Love, Lust, Faith and Dreams (2013), received further critical success, and their fifth album, America (2018), marked new commercial success. As of September 2014, they have sold over 15 million albums worldwide.\n\nLeto is considered a method actor, known for his constant devotion to and research of his roles. He often remains completely in character for the duration of shooting schedules of his films, even to the point of adversely affecting his health. He is also known to be selective about his film roles.\n\nDescription above from the Wikipedia article Jared Leto, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1971, 12, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001467", "Acting", "Jared Leto", new List<string> { "Джаред Лето", "จาเรด เลโท", "杰瑞德·莱托", "ジャレッド・レト", "جاريد ليتو", "Bartholomew Cubbins", "Τζάρεντ Λέτο", "자레드 레토", "Thirty Seconds to Mars", "30 Seconds to Mars", "Jared Joseph Leto" }, "Bossier City, Louisiana, USA", 23.620999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ca3x0OfIKbJppZh8S1Alx3GfUZO.jpg" },
                    { 7500, "", new DateTime(1948, 8, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0406203", "Acting", "Peter Iacangelo", new List<string>(), "Brooklyn, New York, USA", 5.5940000000000003, null },
                    { 7520, "Jeanette Nolan (December 30, 1911 – June 5, 1998) was an American actress. Nominated for four Emmy Awards, she had roles in the television series The Virginian (1962–1971) and Dirty Sally (1974), and in films such as Macbeth (1948).\n\nNolan began her prolific acting career at the Pasadena Playhouse in Pasadena, California, and, while a student at Los Angeles City College, made her radio debut in 1932 in Omar Khayyam, the first transcontinental broadcast from station KHJ. She continued acting into the 1990s.\n\nNolan made more than three hundred television appearances, including the religion anthology series, Crossroads and as Dr. Marion in the 1956 episode \"The Healer\" in Brian Keith's CBS Cold War series, Crusader. She appeared on Rod Cameron's syndicated series, State Trooper. Nolan was cast as Emmy Zecker in the 1959 episode \"Johnny Yuma\" of the ABC western series, The Rebel, starring Nick Adams. She appeared in two episodes of David Janssen's crime drama, Richard Diamond, Private Detective. She starred as Maggie Bowers in the Peter Gunn episode \"Love Me to Death\" in 1959. She played Sadie Grimes in Alfred Hitchcock Presents episode titled \"The Right Kind of House\" which first aired March 9, 1958 and Mrs.Edith in \"Coming Home\" June 13, 1961.\n\nNolan graduated from Abraham Lincoln High School in her native Los Angeles, California.\n\nIn 1935, Nolan married actor John McIntire; the couple remained together until his death in 1991. Nolan and McIntire had two children together, actors Holly and Tim.\n\nNolan and McIntire worked together several times from the late 1960s on, sometimes as voice actors. They appeared in a 1969 KCET television reading of Norman Corwin's 1938 radio play The Plot to Overthrow Christmas, with McIntire as the Devil and Nolan as Lucrezia Borgia.\n\nIn 1977, they appeared in Disney's twenty-third animated film The Rescuers, in which McIntire voiced the cat Rufus and Nolan the muskrat Ellie Mae. Four years later, the couple worked on the 24th Disney film, The Fox and the Hound, with McIntire as the voice of Mr. Digger, an ill-tempered badger, and Nolan as the original voice of Widow Tweed, the old kindly widow who takes in Tod after his mother was killed by an off-screen hunter.\n\nThey guest-starred on screen together, often portraying a married couple, as in an episode of The Love Boat in 1978, Charlie's Angels in 1979, The Incredible Hulk in 1980, Goliath Awaits in 1981, Quincy, M.E. in 1983, and Night Court in 1985, playing Dan Fielding's hick Louisianan parents.\n\nNolan died of a stroke in Cedars-Sinai Medical Center on June 5, 1998. She was buried in Eureka, Montana's Tobacco Valley Cemetery.\n\nFrom Wikipedia, the free encyclopedia.  CLR", new DateTime(1911, 12, 30, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 6, 5, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0634282", "Acting", "Jeanette Nolan", new List<string>(), "Los Angeles, California, USA", 19.928000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wb9G3heeItXTpXqPy4HlNDMJWrE.jpg" },
