                    { 7796, "Illeana Hesselberg, most commonly known as Illeana Douglas, (born July 25, 1961) is an American actress, director, screenwriter, and producer. Douglas has had a long-ranging diverse career as a character actor with a specialty in comedy. She is a granddaughter of Hollywood Golden Age screen star Melvyn Douglas.", new DateTime(1961, 7, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.illeanadouglas.com", "nm0001152", "Acting", "Illeana Douglas", new List<string> { "Illeana Douglass", "Illeana Hesselberg" }, "Quincy, Massachusetts, USA", 16.084, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\w2O2SOXzwtJu9eytb3hGS7T8ftR.jpg" },
