                    { 8210, "Wesley Cook \"Wes\" Bentley (born September 4, 1978) is an American film actor known for his roles as Ricky Fitts in American Beauty (1999) and Seneca Crane in The Hunger Games (2012). Bentley was one of four subjects in the documentary My Big Break (2009), which covered his fame after American Beauty and struggles with substance abuse. Rebuilding his career, he starred in the premier of Venus in Fur by David Ives in the off-Broadway production in 2010, whose run was extended.\n\nDescription above from the Wikipedia article Wes Bentley, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1978, 9, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0004747", "Acting", "Wes Bentley", new List<string> { "웨스 벤틀리" }, "Jonesboro, Arkansas, USA", 27.753, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qwFi0SsOqm7feN4ps7cAiQDTNHL.jpg" },
