                    { 8297, "Roger Avary (born Roger d'Avary on August 23, 1965) is a Canadian film and television producer, screenwriter and director in the American mass media industry. He was behind the screenplays of the films Silent Hill and Beowulf. Before that, he had worked on Reservoir Dogs and Pulp Fiction, the latter of which earned both him and Quentin Tarantino an Oscar for Best Original Screenplay at the 67th Academy Awards. He also directed the films Killing Zoe and The Rules of Attraction, among other film and television projects as well.", new DateTime(1965, 8, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.avary.com/", "nm0000812", "Writing", "Roger Avary", new List<string>(), "Flin Flon, Manitoba, Canada", 8.0549999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eq810bljrpQ0FB0SUmUTGyxqFv6.jpg" },
                    { 8311, "Farah Khan (born 9 January 1965) is an Indian film director and choreographer. She is best known for her choreographical work in numerous Bollywood films. Khan has choreographed dance routines for more than a hundred songs in over 80 Hindi films. Khan has since become a noted Hindi film director as well. In addition Khan has worked on international projects such as Marigold: An Adventure in India, Monsoon Wedding and the Chinese film Perhaps Love.\n\nDescription above from the Wikipedia article Farah Khan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1965, 1, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0007134", "Crew", "Farah Khan", new List<string>(), "India", 10.273999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yfmm3VIGRZ8RDRQ0pjn3Vizw6WC.jpg" },
