                    { 8396, "Tommy \"Tiny\" Lister (born Thomas Lister, Jr.; June 24, 1958, died December 10, 2020) was a character actor and former wrestler best known for his role as the neighborhood bully Deebo in the Friday series of movies. He also had a short-lived professional wrestling career, wrestling Hulk Hogan in the World Wrestling Federation (WWF) after appearing as \"Zeus\" in Hogan's movie No Holds Barred. Lister was blind in his right eye.  Lister had numerous guest appearances in TV series, including playing Klaang (the first Klingon ever to make contact with humans, not counting Worf in Star Trek: First Contact) in the pilot episode of Star Trek: Enterprise. He also co-starred in an episode of the courtroom series Matlock as Mr. Matlock's in-prison bodyguard.  Lister also appeared as Sancho in the music video for Sublime's song \"Santeria\". He was also in the video for Michael Jackson's song \"Remember the Time\". He also made a guest appearance in Austin Powers in Goldmember, as a prisoner in the Hard Knock Life spoof.", new DateTime(1958, 6, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 12, 10, 0, 0, 0, 0, DateTimeKind.Utc), 2, "https://web.archive.org/web/20180210132603/http://www.tommytinylister.com/", "nm0001474", "Acting", "Tommy Lister Jr.", new List<string> { "Zeus", "Z-Gangsta", "Tommy Lister", "Tommy Tiny Lister", "Tommy Duane Lister", "Tom 'Tiny' Lister", "Tiny Lister", "Tiny Tom Lister Jr.", "Tiny 'Zeus' Lister", "Tom Lister Jr.", "Thomas Duane Lister Jr.", "Tom 'Tiny' Lister Jr.", "طوم ليستر الابن", "Томми «Тайни» Дебо Ли́стер" }, "Compton, California, USA", 16.140000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\i1seZDiLC3AKrAYqfFSln6ZGNmF.jpg" },
