                    { 8591, "Ted Grossman is a stuntman and actor who played the Peruvian Porter in Raiders of the Lost Ark and the Deputy Sheriff in Indiana Jones and the Last Crusade. He also provided stunts for The Temple of Doom and Kingdom of the Crystal Skull. He also played a Porter in footage fpr the Indiana Jones Adventure: Temple of the Forbidden Eye ride at Disney World.", new DateTime(1931, 4, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0343722", "Acting", "Ted Grossman", new List<string> { "Teddy Grossman", "Ted M. Grossman" }, "Los Angeles, California, USA", 11.878, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2L7S57LmXg1EFwVOkI06JS5oAhM.jpg" },
