                    { 8891, "John Joseph Travolta (born February 18,1954) is an American actor, film producer, dancer, and singer. He first became known in the 1970s, after appearing on the television series Welcome Back, Kotter and starring in the box office successes Saturday Night Fever and Grease. Travolta's career re-surged in the 1990s, with his role in Pulp Fiction, and he has since continued starring in Hollywood films, including Face/Off, Ladder 49 and Wild Hogs. Travolta has twice been nominated for the Academy Award for Best Actor. The first, for his role in Saturday Night Fever and the second for Pulp Fiction. He won the Golden Globe Award for Best Actor - Motion Picture Musical or Comedy for his performance in Get Shorty.\n\nHe married actress Kelly Preston in 1991. The couple had a son, Jett, (April 13, 1992 - January 2, 2009), and have a daughter, Ella Bleu, born in 2000. They were married until Kelly's untimely death at the age of 57 in 2020 from breast cancer.\n\nHe was previously involved with actress Diana Hyland, whom he met while filming The Boy in the Plastic Bubble; the relationship ended when she died of breast cancer in 1977.\n\nHe is a certified pilot and owns five aircraft, including an ex-Australian Boeing 707–138 airliner. The plane bears the name Jett Clipper Ella in honor of his children. His $4.9 million estate in the Jumbolair subdivision in Ocala, Florida, is situated on Greystone Airport with its own runway and taxiway right to his front door.\n\nHe has been a practitioner of Scientology since 1975 when he was given the book Dianetics while filming the movie The Devil's Rain in Durango, Mexico.", new DateTime(1954, 2, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://travolta.com/", "nm0000237", "Acting", "John Travolta", new List<string> { "Джон Траволта", "جون ترافولتا", "ジョン・トラボルタ", "존 트래볼타", "จอห์น ทราโวลตา", "约翰·特拉沃尔塔", "John Joseph Travolta", "존 트라볼타", "約翰·屈伏塔" }, "Englewood, New Jersey, USA", 44.655000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zkAX8YV692YVDQgRBh5JPUddPMQ.jpg" },
                    { 9172, "Elizabeth Whitcraft is an American actress who played small parts in some notable American films in the 1980s and 1990s. She was often credited as Liza Whitcraft or Liz Whitcraft.\n\nBorn in 1961, and raised in New Jersey, she also lived for a time in Philadelphia and New York City, then moved to Los Angeles in the early 1980s.", new DateTime(1962, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0924378", "Acting", "Elizabeth Whitcraft", new List<string> { "Liza Whitcraft" }, null, 10.356, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vmOqdWVuM0kfj5cRUyusyNMwbgE.jpg" },
