                    { 9235, "​From Wikipedia, the free encyclopedia.\n\nNicoletta Braschi  (born April 14, 1960) is an Italian actress and producer, best known for her work with her husband, actor and director Roberto Benigni.\n\nBorn in Cesena, Braschi studied in Rome's Academy of Dramatic Arts where she first met Benigni in 1980. Her first film was with Benigni in 1983, the comedy Tu Mi Turbi (\"You Upset Me\"). She later appeared in two Jim Jarmusch films, Down by Law and Mystery Train.\n\nBraschi's two most successful collaborations with her husband have been Johnny Stecchino (1992) and La Vita è Bella (Life is Beautiful) (1997). The first, an Italian comedy that cast the actress as the girlfriend of a mobster (Benigni), was a huge hit in Italy; while the second, in which Braschi played the wife of an Italian Jew (Benigni) imprisoned in a concentration camp, was a widely-praised success that launched both Braschi and her husband into the international spotlight.\n\nShe was nominated for a Screen Actors Guild award as a cast member of Life is Beautiful. She is also a David di Donatello award winner (Italy's equivalent of the Oscars).\n\nIn 2002, she was a member of the jury at the Berlin Film Festival.\n\nIn 2010 she has returned to theatre starring in \"Tradimenti\".\n\nDescription above from the Wikipedia article Nicoletta Braschi, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1960, 8, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000971", "Acting", "Nicoletta Braschi", new List<string> { "Николетта Браски", "尼科萊塔·布拉斯基" }, "Cesena, Forlì-Cesena, Emilia-Romagna, Italy", 14.669, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9IeE3Iz9HXZVTrvhjSCKlR4FLxB.jpg" },
                    { 9236, "Born and raised in Florence, Italy, Giorgio was the only child born to Rimazio and La Tina Cantarini. Soon after Giorgio, whose family nickname is Gio, celebrated his 5th birthday, his parents were separated and thereafter divorced. He presently resides with his father in Florence while his mother lives in Los Angeles ", new DateTime(1992, 12, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0134493", "Acting", "Giorgio Cantarini", new List<string> { "喬治・肯特利尼" }, "Orvieto, Terni, Umbria, Italy ", 12.315, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ezOFvAPMQ535M0EhIkoUKW8JIwo.jpg" },
                    { 9237, "Giustino Durano (May 5, 1923 in Brindisi, Italy - February 18, 2002 in Bologna, Italy) was a long lasting movie actor who is best known for his work as the uncle of Guido Orefice (Roberto Benigni) in the 1997 film, Life Is Beautiful.\n\nDescription above from the Wikipedia article Giustino Durano, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1923, 5, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2002, 2, 20, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0243842", "Acting", "Giustino Durano", new List<string> { "朱斯提諾·杜拉諾" }, " Brindisi, Italy ", 6.8280000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\o302wA8DHLHDLhTXOF5wEi3C99G.jpg" },
                    { 9238, "Born in Florence , a graduate of the stage actor's theater workshop Vittorio Gassman in 1979 . He also starred in the movies films Life is Beautiful of 1997 (where he plays Rodolfo, his rival in love with Roberto Benigni ), the third star in the 2004 hunting season in 2008 and \"The Suite\" 2010  On television he played the role of Claudius in the Mercalli soap operas live in 2003 and, since November 2008 , to Mauritius in the soap opera Bassani Centovetrine until the early months of 2010. The actor in the soap back in April 2011. ", new DateTime(1955, 6, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0284997", "Acting", "Amerigo Fontani", new List<string>(), "Florence, italy", 4.9489999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uRQn3gGNPGQzG6XNli1b1TiEu6G.jpg" },
                    { 9239, "Sergio Bini, Bustric in art, graduated from the Faculty of Letters and Philosophy University of Bologna. He attended the National Circus School in Paris Annie Fratellini and Pierre Etaix and the abstract of pantomime with Etienne Decroux in Rome and the school of Roy Bosier. Then a period of study with Jon Strasberg \"Actors Studio\". After working in experimental theater he founded, along with three other youths, the Company Melquiades ", null, null, 2, null, "nm0082979", "Acting", "Sergio Bini Bustric", new List<string> { "瑟吉歐・畢尼・布斯特里克" }, null, 5.2359999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\crnlLn1SxP2LqbsXNr8CQrvaiNc.jpg" },
                    { 9240, "Lydia Alfonsi, born Lidia (Parma, 27 April 1928 - Parma, 21 September 2022), was an Italian actress. An actress of great expressiveness, her name is linked above all to the golden age of television dramas in the 1960s, with works such as La Pisana; Mastro Don Gesualdo; Luisa Sanfelice and Il segreto di Luca. In 1970, she received the French critics' award for best Italian television actress. Though acclaimed for her roles on the classical stage (including as Medea, Phaedra and Electra) she is probably best known abroad as a protagonist of films like Hercules (1958), Morgan the Pirate (1960) and The Trojan Horse (1961) (all starring Steve Reeves). Alfonsi also co-starred alongside Boris Karloff in Mario Bava 's atmospheric psycho- thriller Black Sabbath (1963). Alfonsi was named a Grand Officer of the Italian Republic by then-president of Italy Alessandro Pertini. She retired from screen acting in 1997.", new DateTime(1928, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 9, 21, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0019145", "Acting", "Lidia Alfonsi", new List<string> { "Lydia Alfonsi", "Лидия Альфонси" }, "Parma, Emilia-Romagna, Italy", 2.9900000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\85BrcBOeIcfV9XkV523wN0VGNRR.jpg" },
                    { 9241, "", new DateTime(1964, 12, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0211599", "Acting", "Pietro De Silva", new List<string>(), "Roma", 8.1880000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tjP3YLGB3VNtqNgqGmLjZbJENzG.jpg" },
                    { 9242, "Especially renowned actress of theater and television , has shot a few films, some of them famous, however, as the sweet life of Federico Fellini , Life is Beautifulby Roberto Benigni , Out of this world of Giuseppe Piccioni , and reconciled to Rosalia Polizzi . In 2004, lends his voice to the \"Dream\" on tour \"Catch the Dream\" by Renato Zero. In life and on stage, was the girlfriend of actor Harold Tieri , after the end of her marriage to the actor and impresario Mario Chiocchio from whom he had two sons. ", new DateTime(1940, 8, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0518057", "Acting", "Giuliana Lojodice", new List<string>(), "Bari, Italy", 7.6289999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cACsY8JyWaR3WeX7w1D09YssXbq.jpg" },
                    { 9243, "", null, null, 2, null, "nm0350147", "Acting", "Francesco Guzzo", new List<string>(), null, 13.425000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8HSTZitD85LIqOOhpTepILHyxW2.jpg" },
                    { 9244, "", null, null, 1, null, "nm0656455", "Editing", "Simona Paggi", new List<string>(), null, 3.6600000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2LCAI7o2iE2bYYlH2seYppYchdg.jpg" },
                    { 9245, "Nicola Piovani (born 26 May 1946) is an Italian light-classical musician, theater and film score composer. In 1998, he won the Academy Award for Best Original Dramatic Score for Roberto Benigni's film Life Is Beautiful (1997).\n\nAfter high school, Piovani enrolled at the Sapienza University of Rome, receiving his degree in piano from the Verdi Conservatory in Milan in 1967, and later studied orchestration under the Greek composer Manos Hadjidakis.\n\nIn 1971 and 1973 collaborated for the music of two albums of the songwriter Fabrizio De André: Storia di un impiegato and Non al denaro non all'amore né al cielo. In 2008, after De André departure, Piovani wrote the music for the film Amore che vieni, amore che vai, inspired by a novel of De André himself, Un destino ridicolo.\n\nAmong his more popular works is the score for the Federico Fellini film Intervista, his second of three collaborations with the famous director, the others being Ginger e Fred (Ginger and Fred in English) and La voce della luna (The Voice of the Moon). Years later, he composed a ballet titled Balletto Fellini.\n\nIn 2000, his Academy Award-winning score for Life Is Beautiful (La Vita è bella) was further nominated for a Grammy Award in the \"Best Instrumental Composition Written for a Motion Picture, Television or Other Visual Media\" category, losing to Randy Newman. In 2005, he was a member of the jury at the 27th Moscow International Film Festival. In light of his recent work with French directors, notably Danièle Thompson, Philippe Lioret, and Éric-Emmanuel Schmitt, the French Minister of Culture gave him the title of Chevalier (Knight) of the Ordre des Arts et des Lettres on 21 May 2008 at the Cannes Film Festival.\n\nTo date, Piovani has over 130 film scores to his credit, including films such as Slap the Monster on Page One (1972), The Perfume of the Lady in Black (1974), Flavia the Heretic (1974), Le Orme (1975), A Leap in the Dark (1980) The Night of the Shooting Stars (1982), and Kaos (1984). The music for the latter is considered by many as one of the best film scores ever done. However, he is reported to believe that \"Too many film scores make a composer a hack, but in the theatre music is above all craftsmanship\". Accordingly, he continues to work in musical theatre, and also composes concert and chamber music.\n\nPiovani also composed the first opera Amorosa presenza on a libretto by Aisha Cerami and Nicola Piovani, based on the novel by Vincenzo Cerami and is performed at the Teatro Verdi in Trieste in January 2022.\n\nIn 2023, he was awarded the Lifetime Achievement Award from the World Soundtrack Academy.\n\nIn 2024, Piovani composed the score for Loris Lai's debut feature film, How Kids Roll.\n\nSource: Article \"Nicola Piovani\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1946, 5, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0003607", "Sound", "Nicola Piovani", new List<string> { "Nikola Piovani" }, "Rome, Italy", 5.3680000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\56tRfEIn4RBPhjJ7JOGCOtTZApU.jpg" },
                    { 9247, "From Wikipedia, the free encyclopedia\n\nDanilo Donati (6 April 1926 - 1 December 2001) was an Italian costume designer and production designer. He won the Academy Award for Best Costume Design twice: the first time for his work in Romeo and Juliet (1968), the second time for his work in Fellini's Casanova (1976). In addition, he received numerous David di Donatello and Nastro d'Argento awards for his costume and production designs in various films.\n\nAmong the film directors with whom Donati had worked were Federico Fellini and Pier Paolo Pasolini.", new DateTime(1926, 4, 6, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2001, 12, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0232219", "Costume & Make-Up", "Danilo Donati", new List<string>(), "Suzzara, Lombardy, Italy", 5.7919999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2xo4XyJZUYDVI3yEQA12M582ibf.jpg" },
                    { 9257, "From Wikipedia, the free encyclopedia.\n\nBruno Kirby (April 28, 1949 – August 14, 2006) was an American film and television actor. He was perhaps best known for his roles in the Hollywood films City Slickers, When Harry Met Sally..., Good Morning, Vietnam, and The Godfather Part II.\n\nDescription above from the Wikipedia article Bruno Kirby, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1949, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 8, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0456124", "Acting", "Bruno Kirby", new List<string> { "B. Kirby Jr." }, "New York City, New York, USA", 17.277000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qFvS4YHzZeIc77Gom56XkTn5wxA.jpg" },
