                    { 9291, "Michael Shamus Wiles (born October 27, 1955) is an American character actor of film and television onscreen since the 1980s who has appeared in over 100 films and television shows.\n\nHe portrayed Marc Mitscher in Pearl Harbor and Mr. Parmagi in Hellraiser: Inferno. He is also known for recurring roles as ASAC George Merkert on Breaking Bad and as Jury on Sons of Anarchy. Other notable appearances include Puppet Master 4, Lost Highway, Fight Club, Rock Star and Transformers. In 2011, he appeared in Rockstar Games hit detective game L.A. Noire as Fire Chief Albert Lynch. He appeared in a 2015 production of the Hydrogen Jukebox.", new DateTime(1955, 10, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0928795", "Acting", "Michael Shamus Wiles", new List<string>(), "Everett, Washington, USA", 6.4880000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\niY4gYqAUjmnU4KRiguxpsKliWA.jpg" },
