                    { 9444, "", null, null, 0, null, "nm0333727", "Sound", "Marilyn Graf", new List<string>(), null, 2.1360000000000001, null },
                    { 9558, "", new DateTime(1965, 2, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0101500", "Crew", "Joey Box", new List<string> { "Joey R. Box", "Joe Box", "Richard \"Joey\" Box" }, "San Fernando Valley, Los Angeles, California, USA", 6.0410000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\q7XY8ZqhBoBfOb7RwpyrN0tM6TK.jpg" },
                    { 9560, "Ellen Burstyn (born Edna Rae Gillooly; December 7, 1932) is an American actress. Known for her portrayal of complicated women in dramas, Burstyn was the recipient of various accolades, and was among the few performers to have won an Oscar, Emmy, and Tony (Triple Crown of Acting).\n\nBorn in Detroit, Michigan, Burstyn left school and worked as a dancer and model. She made her stage debut on Broadway in 1957 and soon started to make appearances in television shows. Stardom followed several years later with her acclaimed role in The Last Picture Show (1971), which earned her a nomination for the Academy Award for Best Supporting Actress. Her next appearance in The Exorcist (1973), earned her a nomination for the Academy Award for Best Actress. The film has remained popular and several publications have regarded it as one of the greatest horror films of all time. She followed this with Martin Scorsese's Alice Doesn't Live Here Anymore (1974), which won her the Academy Award for Best Actress.\n\nShe appeared in numerous television films and gained further recognition from her performances in Same Time, Next Year (1978), which won her a Golden Globe Award, and Resurrection (1980), How to Make an American Quilt (1995), and Requiem For a Dream (2000). For playing a lonely drug-addicted woman in the last one of these, she was again nominated for an Academy Award and a Screen Actors Guild Award. In the 2010s, she made appearances in television series including the political dramas, Political Animals and House of Cards, which have earned her Emmy Award nominations. From 2000 till her death, she had been co-president of the Actors Studio, a drama school in New York City. In 2013, she was inducted into the American Theatre Hall of Fame for her work on stage.\n\nDescription above from the Wikipedia article Ellen Burstyn, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1932, 12, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000995", "Acting", "Ellen Burstyn", new List<string> { "Ellen McRae", "엘렌 버스틴", "Эллен Бёрстин", "Edna Rae Gilhooley" }, "Detroit, Michigan, USA", 19.552, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wjxo9Yw8ZoKewcRlHShfTIZGVQF.jpg" },
                    { 9619, "", new DateTime(1953, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0509793", "Sound", "Skip Lievsay", new List<string>(), null, 3.7229999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wnQisLNWHfsVCRPX8mvEn3s6tXY.jpg" },
                    { 9640, "Haley Joel Osment (born April 10, 1988) is an American actor. After a series of roles in television and film during the 1990s, including a small part in Forrest Gump playing the title character’s son, Osment rose to fame with his performance as Cole Sear in M. Night Shyamalan’s thriller film The Sixth Sense that earned him a nomination for Academy Award for Best Supporting Actor. He subsequently appeared in leading roles in several high-profile Hollywood films including Steven Spielberg's A.I. Artificial Intelligence and Mimi Leder's Pay it Forward. He made his Broadway debut in 2008 in a revival of American Buffalo, co-starring with John Leguizamo and Cedric the Entertainer.", new DateTime(1988, 4, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005286", "Acting", "Haley Joel Osment", new List<string> { "Хэйли Джоэл Осмент", "海利·喬·奧斯蒙" }, "Los Angeles, California, USA", 31.957999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2rnMTQB9Q3vLtmRyyUaenVwSgfY.jpg" },
                    { 9720, "Hideo Ishikawa (石川 英郎, Ishikawa Hideo, December 13, 1969) is a Japanese voice actor (seiyuu) and narrator from Nishinomiya City, Hyogo Prefecture. He is affiliated with Aoni Production.", new DateTime(1969, 12, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.aoni.co.jp/search/ishikawa-hideo.html", "nm0411050", "Acting", "Hideo Ishikawa", new List<string> { "이시카와 히데오", "いしかわ ひでお", "石川英郎" }, "Nishinomiya, Hyogo, Japan", 10.653, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gEjEDNGt3CHsyzFQdNqewZVbh0.jpg" },
                    { 9971, "Charles L. Campbell (August 17, 1930 – June 21, 2013) was an American sound engineer who won three Academy Awards for Best Sound Editing. He also served as Governor of the Academy of Motion Picture Arts and Sciences (AMPAS) 1984-1987. Source, Wikipedia", new DateTime(1930, 8, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 6, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0132287", "Sound", "Charles L. Campbell", new List<string>(), "Detroit, Michigan, USA", 3.4159999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dDFXRPCjCurvo0vGCnGjAqKOXPZ.jpg" },
                    { 10182, "Irving Rameses Rhames (born May 12, 1959) is an American actor. He is known for his supporting roles as IMF Agent Luther Stickell in the Mission: Impossible film series and gang kingpin Marsellus Wallace in Pulp Fiction (1994). He also appeared in Jacob's Ladder (1990), Dave (1993), Striptease (1996), Con Air (1997), Only in America (1997), Out of Sight (1998), Entrapment (1999), Bringing Out the Dead (1999), Dawn of the Dead (2004), I Now Pronounce You Chuck & Larry (2007), Jamesy Boy (2014). He voiced Cobra Bubbles in the animated films Lilo & Stitch (2002), Stitch! The Movie (2003), and Leroy & Stitch (2006).", new DateTime(1959, 5, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000609", "Acting", "Ving Rhames", new List<string> { "빙 레임스", "Винг Рэймс", "文·瑞姆斯", "Вінг Реймс" }, "New York City, New York, USA", 39.665999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ohAOsD8E4tu35PI2buzZORpn9Ef.jpg" },
                    { 10199, "Peter Robb-King is an English make-up artist. He was nominated for an Academy Award in the category Best Makeup and Hairstyling for the 1985 film Legend. He was also nominated for the annual Makeup Artists and Hairstylists Guild Awards 2019 for the film, Mary Poppins Returns.\n\nDescription above from the Wikipedia article Peter Robb-King, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1950, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0730228", "Costume & Make-Up", "Peter Robb-King", new List<string> { "Peter Robb King", "Peter-Robb King" }, null, 2.1499999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uyJpe7UQoFhpqChXpHwknqQ88X7.jpg" },
                    { 10297, "Matthew David McConaughey (born November 4, 1969) is an American actor. He first gained notice for his supporting performance in the coming-of-age comedy Dazed and Confused (1993), which was considered by many to be his breakout role. After a number of supporting roles in films including Angels in the Outfield (1994) and Texas Chainsaw Massacre: The Next Generation (1994), his breakthrough performance as a leading man came in the legal drama A Time to Kill (1996). He followed this with leading performances in the science fiction film Contact (1997), the historical drama Amistad (1997), the comedy-drama The Newton Boys (1998), the satire EDtv (1999), the war film U-571 (2000), and the psychological thriller Frailty (2001).\n\nIn the 2000s, McConaughey became best known for starring in romantic comedies, including The Wedding Planner (2001), How to Lose a Guy in 10 Days (2003), Failure to Launch (2006), Fool's Gold (2008), and Ghosts of Girlfriends Past (2009), establishing him as a sex symbol. After a two-year hiatus from film acting, McConaughey began to appear in more dramatic roles beginning with the legal drama The Lincoln Lawyer (2011). He was acclaimed for his supporting performances in Bernie (2011), Magic Mike (2012) and The Wolf of Wall Street (2013), and for his leading roles in Killer Joe (2011) and Mud (2012).\n\nMcConaughey's portrayal of Ron Woodroof, a cowboy diagnosed with AIDS, in the biopic Dallas Buyers Club (2013) earned him widespread praise and numerous accolades, including the Academy Award for Best Actor. In 2014, he starred as Rust Cohle in the first season of HBO's crime anthology series True Detective, for which he was nominated for the Primetime Emmy Award for Outstanding Lead Actor in a Drama Series. His film roles since have included Interstellar (2014), The Sea of Trees (2015), Free State of Jones (2016), Gold (2016), The Dark Tower (2017), and The Gentlemen (2019), earning varying degrees of commercial and critical success, as well as voice work in Kubo and the Two Strings (2016), Sing (2016), and Sing 2 (2021).", new DateTime(1969, 11, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000190", "Acting", "Matthew McConaughey", new List<string> { "マシュー・マコノヒー", "マシュー・デヴィッド・マコノヒー", "Меттью Мак-Конагей", "Меттью МакКонагей", "მეთიუ მაკკონაჰი", "馬修·麥康納" }, "Uvalde, Texas, USA", 28.856999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sY2mwpafcwqyYS1sOySu1MENDse.jpg" },
                    { 10546, "", null, null, 2, null, "nm0303031", "Production", "Fred T. Gallo", new List<string>(), null, 1.9219999999999999, null },
                    { 10565, "Richard Alva Cavett (/ˈkævɪt/; born November 19, 1936) is an American television personality and former talk show host. He appeared regularly on nationally broadcast television in the United States for five decades, from the 1960s through the 2000s.\n\nIn later years, Cavett has written an online column for The New York Times, promoted DVDs of his former shows as well as a book of his Times columns, and hosted replays of his TV interviews with Bette Davis, Lucille Ball, Salvador Dalí, Lee Marvin, Groucho Marx, Katharine Hepburn, Judy Garland, Marlon Brando, Orson Welles, Woody Allen, Ingmar Bergman, Jean-Luc Godard, Robert Mitchum, John Lennon, George Harrison, Jimi Hendrix, Richard Burton, Sophia Loren, Marcello Mastroianni, Kirk Douglas and others on Turner Classic Movies.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1936, 11, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0147118", "Acting", "Dick Cavett", new List<string> { "Richard Alva Cavett" }, "Gibbon, Nebraska, USA", 6.4459999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7g5J47vQY2k4GzGhlJr6KdYm04P.jpg" },
