                    { 10744, "A German actor known for his very tall stature. He is 196 cm (6 ft 6 inches) tall and is often characterised by bleached blonde hair in his films.\n\nDescription above from the Wikipedia article Götz Otto, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1967, 10, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.goetz-otto.de/", "nm0653248", "Acting", "Götz Otto", new List<string>(), "Dietzenbach, Germany", 20.248000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gUIvsX30Uey3KXYA5VYx5XvcRqf.jpg" },
                    { 10788, "", new DateTime(1965, 3, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0493034", "Art", "Steven Lawrence", new List<string> { "Steve Lawrence" }, "Lincoln, Lincolnshire, England, UK", 4.4109999999999996, null },
                    { 10855, "From Wikipedia, the free encyclopedia.\n\nChris Gorak is a film director who started as an art director and production designer. He has directed the 2006 film Right at Your Door and is directing the upcoming film The Darkest Hour.\n\nGorak attended Tulane University where he earned an architecture degree. He changed his career to film and worked as art director for directors like David Fincher, the Coen brothers, and Terry Gilliam. When Gorak worked as production designer on the 2004 film The Clearing, he expressed afterward to its producers an interest in film direction. They challenged him to provide something viable, and he wrote a script for an intended short film titled Right at Your Door. He eventually directed the 2006 feature thriller film Right at Your Door, which he said was reflective of authorities being impotent in a world after the September 11 attacks. He had initially worried about his film being too similar to 28 Days Later but found inspiration in filming on a low budget. After Right at Your Door, he planned to write and direct a cop drama titled SIS.[4] The film is not yet realized, and Gorak is currently directing the alien invasion film The Darkest Hour for release in 2011.\n\nGorak is a member of the Art Directors Guild.\n\nDescription above from the Wikipedia article Chris Gorak, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1969, 5, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0329755", "Art", "Chris Gorak", new List<string>(), "USA", 2.6389999999999998, null },
                    { 10949, "Michael E. Uslan was born on December 15, 1950 in Cedar Grove, New Jersey, USA as Michael Elliot Uslan. He is a producer and writer, known for Batman Begins (2005), Batman: Mask of the Phantasm (1993) and National Treasure (2004).", new DateTime(1952, 6, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0882388", "Production", "Michael Uslan", new List<string> { "Michael E. Uslan" }, null, 4.8029999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cXiiH0SSk5UHCvHOVAhHX7tNuls.jpg" },
