                    { 11472, "Irwin Winkler (born May 25, 1931) is an American film producer and director. He is the producer or director of 50 major motion pictures, dating back to 1967's Double Trouble, starring Elvis Presley. The fourth film he produced, They Shoot Horses, Don't They? (1969), starring Jane Fonda, was nominated for nine Academy Awards. In 1976, he won an Oscar for Best Picture for Rocky. As a producer, he has been nominated for Best Picture for three other films: Raging Bull, The Right Stuff, and Goodfellas.", new DateTime(1931, 5, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005563", "Production", "Irwin Winkler", new List<string>(), "New York City, New York, United States", 12.81, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eUDvzwxbcMbTcPnSmRfnL1ORZrK.jpg" },
