                    { 11476, "", new DateTime(1924, 8, 21, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 1, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0116529", "Costume & Make-Up", "Richard Bruno", new List<string> { "Richard Brunno", "Dick Bruno", "Richard S. Bruno" }, null, 3.2200000000000002, null },
                    { 11477, "Raymond Allen Liotta (December 18, 1954 – May 26, 2022) was an American actor and producer. His best-known roles include Shoeless Joe Jackson in Field of Dreams (1989), Henry Hill in Goodfellas (1990), and Tommy Vercetti in the video game Grand Theft Auto: Vice City (2002).\n\nHis other roles included Ray Sinclair in Something Wild (1986), for which he received a Golden Globe nomination, as well as starring in Unlawful Entry (1992), Cop Land (1997), Hannibal (2001), Blow (2001), John Q (2002), Identity (2003), Observe and Report (2009), Killing Them Softly (2012), The Place Beyond the Pines (2012), and Marriage Story (2019), as well as the drama series Shades of Blue (2016–2018).\n\nDescription above from the Wikipedia article Ray Liotta, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1954, 12, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 5, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000501", "Acting", "Ray Liotta", new List<string> { " Рэй Лиотта", "Raymond Allen Liotta", "Рей Ліотта" }, "Newark, New Jersey, USA", 25.834, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\iXKotiB0Xe9iJLCBbjAedHPLb7p.jpg" },
                    { 11478, "Lorraine Bracco (born October 2, 1954) is an American actress. She is known for her roles as Karen Hill in Goodfellas, Dr. Jennifer Melfi on the HBO television series The Sopranos, and Angela Rizzoli, Jane's mother on Rizzoli & Isles.", new DateTime(1954, 10, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "https://www.lorrainebracco.com/", "nm0000966", "Acting", "Lorraine Bracco", new List<string> { "Лоррейн Бракко", "洛琳·布萊克" }, "Bay Ridge, Brooklyn, New York City, New York, USA", 23.146999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dRz19binEYJuRapsy1w9jIyvsLr.jpg" },
                    { 11479, "Charles Lewis Low (July 21, 1928 – September 18, 2017) was an American actor.\n\nLow was born in New York City, to a Russian mother and Austrian-Polish father. He achieved his biggest success as Morris \"Morrie\" Kessler in the Martin Scorsese film Goodfellas (1990). The character of Morrie was famous for his \"Morrie's Wig Shop\" commercial which is seen as comical, and that coupled with his penchant for pestering Jimmy Conway about money leads most of the characters to see him as a nuisance, setting up his eventual murder by Tommy DeVito. Kessler's character is based on Martin Krugman. He was also known for wearing his dark brown leather blazer.\n\nHe has had small roles in other Robert De Niro films, such as The Mission, The King of Comedy, and most notably in Sergio Leone's 1984 film Once Upon a Time in America as Deborah and Fat Moe's father. He also guest starred in a first-season episode of The Sopranos, as Shlomo Teittleman. He can also be seen in Alan Taylor's 2003 film, Kill the Poor.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1937, 7, 21, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 9, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0522797", "Acting", "Chuck Low", new List<string> { "Chuck L. Low" }, "New York City, New York, USA", 3.161, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zaw5Tyk2K6aawV13fQ4tSPdbEUp.jpg" },
                    { 11480, "​From Wikipedia, the free encyclopedia.  \n\nFrank Sivero (born January 6, 1952) is an American character actor, perhaps best known for playing the roles of Genco Abbandando in Mario Puzo's and Francis Ford Coppola's The Godfather Part II and Frankie Carbone (based on Angelo Sepe) in Martin Scorsese's Goodfellas. Sivero was born Francesco LoGiudice in Siculiana, Sicily, Italy, and raised in Brooklyn, New York. He can be seen as an extra in The Godfather as one of the witnesses to Sonny Corleone's brutal beating of his brother-in-law, Carlo. Director Martin Scorsese cast him as Frankie Carbone after seeing his performance in The Godfather: Part II. He also appeared in the The Wedding Singer with Adam Sandler.\n\nDescription above from the Wikipedia article Frank Sivero,  licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1952, 1, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0803370", "Acting", "Frank Sivero", new List<string>(), "Siculiana, Italy", 11.071999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eqvhj0iNtcsN6EJhd21Goqi1DSq.jpg" },
                    { 11481, "Frank Michael DiLeo (October 23, 1947 – August 24, 2011) was an American music industry executive and actor, known for his portrayal of gangster Tuddy Cicero in Martin Scorsese's Goodfellas. From 1984 to 1989, and again in 2009, he was Michael Jackson's manager.", new DateTime(1947, 10, 23, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 8, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0226746", "Acting", "Frank DiLeo", new List<string>(), "Pittsburgh, Pennsylvania, USA", 6.9299999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3oZ8KEnZtgYotQyQgjnAq7mqTR8.jpg" },
                    { 11482, "Tony Darrow (born Anthony Borgese; October 1, 1938) is an Italian-American actor.\n\nDarrow was born in the East New York section of Brooklyn. Darrow had plenty of opportunity to observe would-be mobsters and their attitudes while growing up in his neighborhood in Brooklyn. As a teenager, he gravitated towards show business, entering and winning talent shows while working odd jobs.\n\nAfter ten years of singing in nightclubs, Darrow received an offer to appear in what turned out to be a cult film, Street Trash in which he played a mobster. Several months after Street Trash, Darrow was contacted by the film director Martin Scorsese. It turned out that Scorsese had seen Street Trash and wanted him to audition for a role in Goodfellas. He was successful and was cast as the owner of the Bamboo Lounge, Sonny. Darrow was also in the Woody Allen films Bullets over Broadway, Mighty Aphrodite, Deconstructing Harry, Small Time Crooks and Sweet and Lowdown.\n\nIn 1999, Darrow played a large role in Analyze This with Robert De Niro and Billy Crystal. The following year, he appeared in Mickey Blue Eyes with Hugh Grant, and got another big role as mobster Larry Barese in the HBO hit series The Sopranos, which he was on for the entire series run (1999–2007). More recently, Darrow starred in the independent film Lynch Mob.", new DateTime(1938, 10, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0201700", "Acting", "Tony Darrow", new List<string> { "Anthony Borgese" }, "Brooklyn, New York, USA", 11.367000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kc6cGKm2yYx5ekHo4zGizhMLBge.jpg" },
                    { 11483, "Catherine Scorsese was an American actress and mother of filmmaker Martin Scorsese. Scorsese was of Italian descent and frequently played the role of an Italian mother. She is perhaps most well known for her appearance in her son's film Goodfellas, as Mrs. DeVito, Tommy's mother. She published a recipe book, Italianamerican: The Scorsese Family Cookbook.", new DateTime(1912, 4, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1997, 1, 6, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0778734", "Acting", "Catherine Scorsese", new List<string> { "Catherine Cappa", "凯瑟琳·斯科塞斯" }, "New York City, New York, USA", 10.398, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gQvsfbecS75QeJ0JNex7r5Yf6Z1.jpg" },
                    { 11484, "Suzanne Shepherd was an American actress and theater director. She is best known for her portrayal of Karen's overbearing mother in the film Goodfellas, Carmela Soprano's mother Mary De Angelis in the HBO television series The Sopranos, and the assistant school principal in Uncle Buck. Shepherd studied acting with Sanford Meisner, and later went on to teach Meisner's program of acting study, the first woman to do so. She was a founding member of the Compass Players in the early 1960s, along with such other actors as Alan Alda and Alan Arkin.", new DateTime(1934, 10, 31, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2023, 11, 17, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0791877", "Acting", "Suzanne Shepherd", new List<string>(), "United States of America", 7.0940000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7trwhBrNHhH2STDxMrDeqUqZf42.jpg" },
                    { 11485, "Gina Mastrogiacomo (November 5, 1961 – May 2, 2001) was an American actress.", new DateTime(1961, 11, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2001, 5, 2, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0557848", "Acting", "Gina Mastrogiacomo", new List<string>(), "Great Neck, Long Island, New York, USA", 16.738, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wB21RlcvbONf8UD5CzJ9MLoZIVJ.jpg" },
                    { 11486, "James Michael Imperioli (born March 26, 1966), commonly known as Michael Imperioli, is an Italian-American actor and television writer. He is perhaps best known for his role as Christopher Moltisanti on The Sopranos for which he won the Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series in 2004. He also appeared as Det. Ed Green's temporary replacement, Det. Nick Falco, in the TV drama series Law &amp; Order. Imperioli spent the 2008-2009 television season as Detective Ray Carling in the US version of Life on Mars. He was starring as Detective Louis Fitch in the new ABC police drama Detroit 1-8-7 until its cancellation.\n\nDescription above from the Wikipedia article Michael Imperioli, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1966, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0408284", "Acting", "Michael Imperioli", new List<string> { "James Michael Imperioli", "Michael Imperiola", "Майкл Империоли", "麥克·英普雷歐里" }, "Mount Vernon, New York, USA", 9.609, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bCDwQGrecRujCibI8rvsxEc91We.jpg" },
                    { 11641, "From Wikipedia, the free encyclopedia\n\nScott Spiegel (born December 24, 1957) is an American screenwriter, film director, producer and actor. He is best known for co-writing the screenplay for the movie Evil Dead II with longtime friend, film director Sam Raimi, with whom he attended Wylie E. Groves High School in Birmingham, Michigan. Spiegel played the role of Scotty in Raimi's Within the Woods, which served as a precursor to The Evil Dead.\n\nWhen Spiegel first moved to Los Angeles, he shared a house in with directors Raimi and Joel Coen, producer Ethan Coen and actresses Holly Hunter, Frances McDormand and Kathy Bates. He shared yet another house with roommate and film editor Bob Murawski (Spider-Man). In the early 1990s, he introduced film director Quentin Tarantino to producer Lawrence Bender, who helped Tarantino get Reservoir Dogs made.\n\nSpiegel grew up in what was then \"rural\" Birmingham, Michigan. He attended Walnut Lake Elementary school and then went on to attend West Maple Jr. High School. It was here that Scott met Sam Raimi and Bruce Campbell. Spiegel worked at the local grocery market across from Walnut Lake Elementary School and it is from this market that Scott would later draw upon the memories to come up with classic scenes that would eventually be worked into many of the scenes of the movies he would either write or direct.\n\nIn 1999, Spiegel directed the direct-to-video sequel to From Dusk Till Dawn, Texas Blood Money. Spiegel formed the production company Raw Nerve with film directors Eli Roth, and Boaz Yakin. Raw Nerve produced the film Hostel (2005), directed by Roth.\n\nDescription above from the Wikipedia article Scott Spiegel, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1957, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0818547", "Acting", "Scott Spiegel", new List<string> { "Peter Perkinson", "Scott Spiegal", "Scott Speigel" }, "Birmingham, Michigan, USA", 7.9950000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6K4SKM2BGq4hPgakeZGd0Ktzjie.jpg" },
