                    { 11801, "", null, null, 1, null, "nm0722012", "Art", "Sandy Reynolds-Wasco", new List<string> { "Sandy Reynolds Wasco", "Alexandra Reynolds Wasco", "Alexandra Reynolds-Wasco", "Sandy Wasco" }, null, 1.778, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eVShxdABLMhMi5fn4NEVdk7vk70.jpg" },
                    { 11802, "", null, null, 1, null, "nm0374214", "Costume & Make-Up", "Betsy Heimann", new List<string> { "Betsy Faith Heimann", "벳시 하이만" }, "Chicago, Illinois, USA", 3.508, null },
                    { 11803, "Peter Greene (born Peter Green; October 8, 1965) is an American character actor.\n\nA native of Montclair, New Jersey, Greene did not pursue a career in acting until his mid 20s. He initially landed several roles in cinema and television in the early 1990s.\n\nGreene's breakthrough came in 1994-1995 with a roles in Pulp Fiction, The Mask, Clean, Shaven, and The Usual Suspects. Greene is possibly best remembered for his role in Pulp Fiction, as Zed who rapes Marsellus Wallace. The Mask saw him play the villainous Dorian Tyrell opposite Jim Carrey and Cameron Diaz. Greene's most accomplished role was that of schizophrenic Peter Winter in Clean, Shaven. The Usual Suspects saw him play the small but memorable character, Redfoot. Greene often plays villains such as in Under Siege 2: Dark Territory, Training Day (as a corrupt narcotics officer) and martial arts/crime film Fist of the Warrior (opposite Ho-Sung Pak, Roger Guenveur Smith and Sherilyn Fenn).\n\nHe worked with one director, Jordan Alan, twice. Once on the film Kiss and Tell, a dark comic turn for the actor and then again 4 years later in The Gentleman Bandit (aka Gentleman B). After Greene's arrests in 1998 for drug related crimes, Alan had to put the actor through rehab to get him through the second film and eventually, after coming upon Greene doing heroine with Mike Starr, he was forced to replace Greene's voice because of the vocal problems caused by drugs. Despite these problems, Mr. Alan vouched for Greene to producer Tobe Jaffe for the movie Blue Streak.\n\nHe played Martin Lawrence's nemesis in Blue Streak.\n\nGreene has continued to mostly work as a character actor. He appeared in the short-lived television drama The Black Donnellys. He also appeared as a policeman in Prodigy of Mobb Deep's video for \"A,B,C's\", as well as the focal character in House of Pain's video for \"Fed Up\".\n\nGreene recently appeared in the opening scene of the premier of the new FX series Justified.\n\nDescription above from the Wikipedia article Peter Greene, licensed under CC-BY-SA, full list of contributors on Wikipedia​", new DateTime(1965, 10, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0338886", "Acting", "Peter Greene", new List<string> { "Питер Грин", "彼得·格林纳" }, "Montclair, New Jersey, USA", 23.898, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8vzHKC17QU2PiQRI1dikbKchtOB.jpg" },
                    { 11804, "From Wikipedia, the free encyclopedia.\n\nDuane Whitaker  (born June 23, 1959) is an American actor.\n\nDuane Whitaker is probably best known for his role in Quentin Tarantino's popular 1994 film Pulp Fiction as Maynard, the sadistic pawn shop owner. He wrote and portrayed the title role in Eddie Presley (based on his own successful stage play). Whitaker also wrote, directed and appeared in Together and Alone.\n\nOther notable roles include; a racist cop in Tales from the Hood, the bouncer Roadrash in Hobgoblins, Boss Man in Feast, The Sheriff in Trailer Park of Terror, Luther in From Dusk Till Dawn 2: Texas Blood Money (which he also co-wrote), Buddy in Dead Letters (film), Winslow in Broke Sky, Mickey in Cordoba Nights and Dr. Bankhead in The Devil's Rejects.\n\nMost recently Duane has appeared in the feature films Albino Farm and Dozers and on TV in the Cold Case episode \"The Brush Man\" and appears in the new Rob Zombie film Halloween II. Whitaker has also written numerous screenplays including \"Stripteaser.\"\n\nOn March 31, 2010, American Cinematheque hosted a screening of Eddie Presley and \"Together and Alone\" at Grauman's Egyptian Theatre in Los Angeles.\n\nDuane is a graduate of Monterey High School in Lubbock, Texas.\n\nDescription above from the Wikipedia article Duane Whitaker, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1959, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.duanewhitaker.com/", "nm0924261", "Acting", "Duane Whitaker", new List<string>(), "Abilene, Texas, USA", 9.7159999999999993, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\83nCcAaMYim24qWRwJcC1ZvfgK5.jpg" },
                    { 11805, "​From Wikipedia, the free encyclopedia\n\nFrank Joseph Whalley (born July 20, 1963) is an American film and television actor known for his roles in independent films.", new DateTime(1963, 7, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001844", "Acting", "Frank Whaley", new List<string> { "Frank Joseph Whaley", "Frank Whalley", "Φρανκ Γουόλεϊ" }, "Syracuse, New York, USA", 25.960000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fYcqfn6nQy8qO40DMBdDzWQuloq.jpg" },
                    { 11806, "Julia Anne Sweeney (born October 10, 1959) is an American actress, comedian and author, best known as a cast member on Saturday Night Live and for her autobiographical solo shows.", new DateTime(1959, 10, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0842140", "Acting", "Julia Sweeney", new List<string> { "Julia Anne Sweeney" }, "Spokane, Washington, USA", 8.6780000000000008, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lE4Ugwp0Cq1it6OfzP0no6ItQs7.jpg" },
                    { 11807, "", null, null, 1, null, "nm0522503", "Acting", "Laura Lovelace", new List<string>(), null, 7.5709999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1MLB30laQt2k80i15kdn0X7Zn5U.jpg" },
                    { 12047, "Andrew Kevin Walker (born August 14, 1964) is an American screenwriter, producer and script doctor. He is known for having written Seven (1995), for which he earned a nomination for the BAFTA Award for Best Original Screenplay, as well as several other films, including 8mm (1999), Sleepy Hollow (1999) and many uncredited script rewrites.", new DateTime(1964, 8, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://andrewkevinwalker.com", "nm0001825", "Writing", "Andrew Kevin Walker", new List<string> { "Andrew Walker", "Andy Kevin Walker", "Andy Walker" }, "Altoona, Pennsylvania, USA", 6.2569999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\t7O6bNRscxOYadGNB1EWvBaSC0d.jpg" },
                    { 12074, "John Arthur Lithgow (born October 19, 1945) is an American actor. Prolific in films, television and on stage, Lithgow is the recipient of numerous accolades, including two Golden Globe Awards, six Primetime Emmy Awards, three Screen Actors Guild Awards, two Tony Awards and nominations for two Academy Awards and four Grammy Awards. He was inducted into the American Theater Hall of Fame and has received a star on the Hollywood Walk of Fame.\n\nLithgow studied at Harvard University winning a Fulbright scholarship and getting a chance to attend the London Academy of Music and Dramatic Art. From there he focused his training on the New York stage beginning a distinguished career on Broadway. In 1973, Lithgow received his first Tony Award for his performance in The Changing Room. In 1976 Lithgow acted alongside Meryl Streep in three plays 27 Wagons Full of Cotton, A Memory of Two Mondays and Secret Service. In the 1980s he continued to receive Tony Awards nominations for his performances in Requiem for a Heavyweight (1985) and M. Butterfly (1988). In 2002, Lithgow received his second Tony Award, this time for a musical, The Sweet Smell of Success and another nomination for Dirty Rotten Scoundrels (2005). In 2007, he made his Royal Shakespeare Company debut as Malvolio in Neil Bartlett's production of Twelfth Night. He has also appeared on Broadway in the acclaimed plays The Columnist (2012) and A Delicate Balance (2014). He portrayed Bill Clinton in Hillary and Clinton (2019) alongside Laurie Metcalf as Hillary Clinton.\n\nLithgow is also known for his television roles such as Dick Solomon in the sitcom 3rd Rock from the Sun (1996–2001) winning three Primetime Emmy Awards for Best Actor in a Comedy Series for his performance. He also played Arthur Mitchell in the drama Dexter (2009) and he won the Primetime Emmy Award for Outstanding Guest Actor in a Drama. In 2004, Lithgow played Blake Edwards in the HBO television movie, The Life and Death of Peter Sellers. He has also appeared on 30 Rock, How I Met Your Mother, Louie and Drunk History. Lithgow won great acclaim for his portrayal of Winston Churchill in Peter Morgan's historical drama The Crown (2016–2019) on Netflix. For acting in The Crown he won a Primetime Emmy Award and Screen Actors Guild Award. In 2020, he had a recurring role on the HBO period series Perry Mason.\n\nHe is also well known for his film roles. His early screen roles included Bob Fosse's All That Jazz (1979) and Brian De Palma's Blow Out (1981). He received his first Academy Award nomination for his breakout performance in The World According to Garp (1982) and received a second Academy Award nomination for Terms of Endearment (1983). He then starred in the films Footloose (1984), Harry and the Hendersons (1987), The Pelican Brief and Cliffhanger (1993), A Civil Action (1998), Rugrats in Paris: The Movie (2000), Shrek (2001), Kinsey (2004), Dreamgirls (2006), Love Is Strange (2014), Miss Sloane (2016) and Beatriz at Dinner (2017). In 2019 he appeared in Mindy Kaling's comedy Late Night and portrayed Roger Ailes in Bombshell.", new DateTime(1945, 10, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001475", "Acting", "John Lithgow", new List<string> { "莊李富高", "존 리스고", "John Arthur Lithgow", "جان لیسگو", "Джон Литгроу", "約翰.李斯高" }, "Rochester, New York, USA", 27.736999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8Y1sjBdnVR483S8PrnAQzlESwhx.jpg" },
                    { 12178, "Hiroyuki Okiura (沖浦 啓之, Okiura Hiroyuki, born October 13, 1966 in Katano, Osaka) is a Japanese animation director and animator working for Production I.G.\n\nOkiura left high school at the age of 16 and went into the animation industry as a member of the studio Anime R, where he studied under Moriyasu Taniguchi and which Taniguchi superintended. He is known for his detailed effects animation in, for example, the chopper attack scene in Patlabor 2: The Movie and his highly realistic character animation in works such as the opening credits to Cowboy Bebop: The Movie and several Production I.G features. His debut work as a director, Jin-Roh, completed in 1998, was the recipient of the Minami Toshiko Award at the 11th Yubari International Fantastic Film Festival in February 2000.\n\nOkiura's next written and directed feature film, A Letter to Momo, premiered at the 2011 Toronto International Film Festival, about 11 years after his first film. It was in development for seven years.", new DateTime(1966, 10, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0645657", "Visual Effects", "Hiroyuki Okiura", new List<string> { "沖浦 啓之", "Okiura Hiroyuki", "冲浦启之" }, "Katano, Osaka, Japan", 6.1840000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rMmavTg6TqMfv5r0ZifQvay639f.jpg" },
                    { 12188, "", new DateTime(1954, 9, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0644833", "Art", "Hiromasa Ogura", new List<string> { "Hiroaki Ogura", "小倉 宏昌" }, "Tokyo, Japan", 4.694, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gsvLM1ZFHq2BhQ8kWmMPMecNwGW.jpg" },
                    { 12371, "", new DateTime(1961, 7, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0149150", "Acting", "Richard Cetrone", new List<string> { "Rich Cetrone", "Rick Cetrone", "Richard Cietrone", "Ρίτσαρντ Σίτρόν", "Ричард Цетрон" }, "Pittsburgh, Pennsylvania, USA", 9.0640000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lZQqNU3QUcnIssWhIfatePfU6M7.jpg" },
                    { 12401, "From Wikipedia, the free encyclopedia.\n\nGary Kurtz (born July 27, 1940 in Los Angeles, California) is an American film producer whose list of credits include American Graffiti, Star Wars and The Empire Strikes Back. He later produced The Dark Crystal and Return to Oz after departing from the Star Wars series. Kurtz also co-produced the 1989 low-budget science fiction film Slipstream, which reunited him with Star Wars star Mark Hamill.\n\nDescription above from the Wikipedia article Gary Kurtz, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1940, 7, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 9, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0476030", "Production", "Gary Kurtz", new List<string>(), "Los Angeles, California, United States", 3.5, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\q6tgPiNqzEOIYmHxMrpWoUirmmu.jpg" },
                    { 12415, "Richard Burton Matheson (February 20, 1926 – June 23, 2013) was an American author and screenwriter, primarily in the fantasy, horror, and science fiction genres.\n\nHe is best known as the author of I Am Legend, a 1954 science fiction horror novel that has been adapted for the screen three times, the first of which, The Last Man on Earth, was co-scripted by him and starred Vincent Price. (The other two adaptations are The Omega Man with Charlton Heston and I Am Legend with Will Smith.) Matheson also wrote 16 television episodes of The Twilight Zone, including \"Nightmare at 20,000 Feet\" and \"Steel\", as well as several adaptations of Edgar Allan Poe stories for Roger Corman and American International Pictures – House of Usher, The Pit and the Pendulum, Tales of Terror and The Raven. He adapted his 1971 short story \"Duel\" as a screenplay directed by Steven Spielberg for the television film Duel that year.\n\nIn addition, to I Am Legend and Duel, nine more of his novels and short stories have been adapted as motion pictures: The Shrinking Man (filmed as The Incredible Shrinking Man), Hell House (filmed as The Legend of Hell House), What Dreams May Come, Bid Time Return (filmed as Somewhere in Time), A Stir of Echoes, Steel (filmed as Real Steel), and Button, Button (filmed as The Box). The movie Cold Sweat was based on his novel Riding the Nightmare, and Les seins de glace (\"Icy Breasts\") was based on his novel Someone is Bleeding. Both Steel and Button, Button had previously been episodes of The Twilight Zone.\n\nDescription above from the Wikipedia article Richard Matheson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1926, 2, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2013, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0558577", "Writing", "Richard Matheson", new List<string> { "Richard Burton Matheson", "Logan Swanson", "Richard Matheson Sr." }, "Allendale, New Jersey, USA", 5.0499999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fTsTj0EMqH5GfVN0Kj252jsYZnB.jpg" },
                    { 12500, "Patricia Alma O'Connell (née Hitchcock; July 7, 1928 — August 9, 2021), commonly known as Pat Hitchcock, was an English-born American actress and producer. She was the only child of English director Alfred Hitchcock and Alma Reville, and had small roles in several of his films, starting with Stage Fright (1950).", new DateTime(1928, 7, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2021, 8, 9, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0386877", "Acting", "Patricia Hitchcock", new List<string> { "Patricia Alma Hitchcock", "Pat Hitchcock", "Patricia Hitchcock O'Connell", "Pat Hitchcock O'Connell", "Patricia Alma O'Connell" }, "Kensington, London, England, UK", 7.4509999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bgMYy4SJLFcFex91an1D593pBY9.jpg" },
                    { 12639, "", null, null, 0, null, "nm0763588", "Art", "Hugo Santiago", new List<string>(), null, 2.0470000000000002, null },
                    { 12645, "Jeffrey DeMunn (born April 25, 1947) is an American theatre, film and television actor.He is known as a favorite of director Frank Darabont, who has cast him in all four of his films, The Green Mile, The Shawshank Redemption, The Majestic and The Mist (he also appeared in the 1988 remake of The Blob, which Darabont co-wrote). He also has an extensive television résumé, appearing in shows such as Kojak, Law & Order, and two of its spin-offs, SVU and Trial by Jury.\n\nHe has been involved in more Stephen King adaptations than any other actor. He has acted in film adaptations of Rita Hayworth and Shawshank Redemption, The Green Mile, The Mist and the T.V. miniseries Storm of the Century. He also narrated the audiobooks for Dreamcatcher and The Colorado Kid.\n\nIn 1995, he won a CableACE Award as Best Supporting Actor in a Movie or Miniseries for his portrayal of serial killer Andrei Chikatilo in the HBO film Citizen X.\n\nDescription above from the Wikipedia article Jeffrey DeMunn, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1947, 4, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0218810", "Acting", "Jeffrey DeMunn", new List<string> { "Джеффри ДеМанн", "Jeffrey De Munn", "Jeff De Munn", "Jeff DeMunn", "Jeff Demunn", "Jeffrey Demunn" }, "Buffalo, New York, USA", 11.741, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eSouAAduXaziFpqLw59AG55jtGY.jpg" },
                    { 12834, "Barry Robert Pepper is a Canadian actor. He is best known for roles such as Private Daniel Jackson in Saving Private Ryan, Sergeant Michael Strank in Flags of Our Fathers, Dean Stanton in The Green Mile, Roger Maris in 61*, \"Lucky\" Ned Pepper in True Grit and Jonnie Goodboy Tyler in Battlefield Earth. He has been nominated for three Screen Actors Guild Awards and a Golden Globe Award. In 2011, for his role as Robert F. Kennedy in the miniseries The Kennedys, Pepper won the Emmy Award for Outstanding Lead Actor in a Miniseries or a Movie.", new DateTime(1970, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.barrypepper.com", "nm0001608", "Acting", "Barry Pepper", new List<string> { "배리 페퍼" }, "Cambell River, British Columbia, Canada", 24.527000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pmdNUqrpsoozh7QYqUgEgZQ69cA.jpg" },
                    { 12997, "", new DateTime(1961, 6, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0321621", "Production", "Richard N. Gladstein", new List<string>(), null, 2.1019999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zXZVhSR8NWFjZd1nHA0WG0bflB.jpg" },
