                    { 13413, "", new DateTime(1935, 4, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0011268", "Acting", "Phil Adams", new List<string>(), "Los Angeles, California, USA", 5.3380000000000001, null },
                    { 13663, "Robert Kenneth Shaye  (born March 3, 1939), often referred to as Bob Shaye, is an American businessman, film producer, director and actor. He is also the brother of actress Lin Shaye.", new DateTime(1939, 3, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0790144", "Production", "Robert Shaye", new List<string> { "Bob Shaye", "L.E. Moko" }, "Detroit, Michigan, USA", 8.891, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d36a4pYeoEpIkcjcDUxWupUYD7r.jpg" },
                    { 13925, "Paul Dillon is an American character actor who began his career in show business in Chicago. His film career began in 1994 with the film Blink in which he played the role of Neal Booker. He played Paddy O'Brien in Austin Powers: International Man of Mystery, the most successful film in which he has a credited role.\n\nDillon also has appeared on many hit TV series including NYPD Blue, CSI: Miami, The Guardian, and his recurring role as Angelo in The Pretender. Most recently, he had a guest appearance as Ezekiel in the new ABC drama Night Stalker. Currently, he plays Gary in the play Rantoul and Die.", null, null, 2, null, "nm0227051", "Acting", "Paul Dillon", new List<string>(), "Joliet, Illinois, USA", 6.1399999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eadglYBBzdsVMp2hxnfopdnDNFP.jpg" },
