                    { 13939, "Ritchie Coster (born 1 July 1967) is an English actor. He is best known for playing the roles of Dietrich Banning in The Tuxedo (2002), the Chechen in The Dark Knight (2008), Elias Kassar in Blackhat (2015), Mayor Austin Chessani on the second season of the HBO anthology television series True Detective and Francisco Scaramucci / Mr. Blue on the SyFy television series Happy!.", new DateTime(1967, 7, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0182662", "Acting", "Ritchie Coster", new List<string>(), "London, England, UK", 12.997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\s0QLFPGEbZkyKBqpbM4upC2jMgk.jpg" },
                    { 14049, "George 'Bud' Davis is an American stuntman, stunt coordinator, and occasional actor. In the 20th century, he evolved the horror genre as a sadistic madman in the 70's. When the 80's hit Bud found himself going further into stunts, in which he worked on Forrest Gump. When the 90's begin he was primarily a stuntman, which he continued into the 2000's. His later works included Inglorious Bastards & Unstoppable.", new DateTime(1936, 12, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0204294", "Crew", "Bud Davis", new List<string> { "Bud G. Davis", "George H. Davis", "Bob Davis", "Bud George Davis", "George 'Bud' Davis", "George Bud Davis", "Bud George" }, "USA", 6.3220000000000001, null },
