                    { 14151, "From Wikipedia, the free encyclopedia\n\nLeopoldo Trieste (3 May 1917, Reggio Calabria – 25 January 2003) was an Italian actor, film director and script writer.\n\nTrieste was born in Reggio Calabria. He worked with directors such as Pietro Germi, Francis Ford Coppola, Giuseppe Tornatore, Tinto Brass, Charles Vidor, René Clément and Federico Fellini.\n\nDescription above from the Wikipedia article Leopoldo Trieste, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1917, 5, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2003, 1, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0872689", "Acting", "Leopoldo Trieste", new List<string> { "Леопольдо Триесте" }, "Reggio Calabria, Calabria, Italy", 5.0899999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rviagoREwu8GhuDKzju8rNoYuo1.jpg" },
                    { 14332, "Philip Suriano (born 1948) is an American actor, best known for playing Dominic Santoro in Martin Scorsese's 1995 film Casino, based on real-life mobster Michael Spilotro.", new DateTime(1948, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0839642", "Acting", "Philip Suriano", new List<string> { "Phillip Suriano", "Phil Suriano" }, "United States of America", 4.782, null },
