                    { 15011, "​From Wikipedia, the free encyclopedia.  \n\nBrent Briscoe (May 21, 1961 – October 18, 2017) was an American actor and screenwriter. Briscoe was born in Moberly, Missouri. After finishing his education at the University of Missouri, Briscoe launched his career as a theater actor. He then segued into screenwriting and acting in feature films. He moved to Los Angeles permanently after working with Billy Bob Thornton on Sling Blade and the two frequently collaborated in the subsequent years. He also frequently worked with Mark Fauser, his college roommate.", new DateTime(1961, 5, 21, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 10, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0109785", "Acting", "Brent Briscoe", new List<string>(), "Moberly, Missouri, USA", 9.6539999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4N7ZjV0Tb2EwwRzOBGp7h01oXVu.jpg" },
                    { 15318, "Keith Campbell was born on April 26, 1962 in Boise, Idaho, USA. He is an actor and assistant director, known for The Amazing Spider-Man (2012), Men in Black (1997) and Minority Report (2002).", new DateTime(1962, 4, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0132625", "Crew", "Keith Campbell", new List<string> { "Keith Blackwell" }, "Boise, Idaho, USA", 6.3529999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oPAqYzvsm2m3HtnxKTuzglgFxum.jpg" },
                    { 15327, "Nathan Crowley was born in London, United Kingdom. He attended Brighton School of Art in England. He has received Academy Award nominations for The Prestige, The Dark Knight, and Interstellar, also Bafta Nominations for Batman Begins, The Dark Knight, \"Interstellar, and Dunkirk his seventh collaboration with director Christopher Nolan. He also received an Emmy nomination for his work on the HBO series Westworld. Crowley has been the Designer on four of the Costume institutes exhibitions at the Metropolitan Museum of Art that accompany the costume ball in New York every May. Super Heroes, American Women, Impossible Conversations, and China through the looking glass. He recently collaborated with Sofia Coppola on La Traviata at the Teatro del l'Opera di Roma.", new DateTime(1966, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0189769", "Art", "Nathan Crowley", new List<string>(), "London, United Kingdom", 4.3230000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hvxjQvBCYBK2rNJhUlaLpHRVLjj.jpg" },
                    { 15328, "", null, null, 2, null, "nm0442606", "Art", "Kevin Kavanaugh", new List<string>(), null, 4.133, null },
                    { 15426, "", null, null, 1, null, "nm0742788", "Production", "Laura Rosenthal", new List<string>(), null, 3.5070000000000001, null },
                    { 15659, "Marianna Hill, born Marianna Schwarzkopf, is an American stage and screen actress mostly working in American television. Her initial acting experience came when she was an apprentice at the Laguna Playhouse and later as an actress at the La Jolla Playhouse. She is a life member of The Actors Studio.\n\nShe has appeared in more than 70 feature films and television episodes. She co-starred in the Elvis Presley film Paradise, Hawaiian Style in 1966 as Lani Kaimana; the Clint Eastwood film High Plains Drifter as Callie Travers in 1973; and in The Godfather II as Deanna Dunn-Corleone.", new DateTime(1941, 2, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0384494", "Acting", "Marianna Hill", new List<string> { "Mariana Hill", "Marianne Hill", "Marianna Renfred", "Marianna Schwarzkopf" }, "Santa Barbara, California, USA", 28.047999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2Exz1SqtPkbM0EkkAKOk6I5OTg6.jpg" },
                    { 15845, "", null, null, 0, null, "nm0128550", "Costume & Make-Up", "John Caglione Jr.", new List<string>(), null, 1.6180000000000001, null },
                    { 15869, "John Stephenson (born August John Stephenson; August 9, 1923 in Kenosha, Wisconsin, U.S.) is an American actor and voice actor. He is best remembered for his voice acting in the original Flintstones and Scooby-Doo TV cartoon series. He has also been credited as John Stevenson.\n\nDescription above from the Wikipedia article John Stephenson (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1923, 8, 9, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 5, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0827267", "Acting", "John Stephenson", new List<string> { "John Stevenson " }, "Kenosha, Wisconsin, U.S", 10.798, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2WWZ5IAdGNlsCAcw8CefvsBeo9i.jpg" },
                    { 15874, "", null, null, 2, null, "nm0006124", "Sound", "Richard Harvey", new List<string>(), null, 5.1299999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\plP0RHQxPjbFAT2Uw1dqKvD4Mcc.jpg" },
                    { 16060, "Brian Tochi (born Brian Keith Tochihara; May 2, 1963) is an American actor. During the late 1960s through much of the 1970s, he was one of the most widely seen East Asian child actors working in U.S. television, appearing in various TV series and nearly a hundred advertisements. He is best known for his characters Toshiro Takashi from the Revenge of the Nerds film franchise, Cadet (later Lieutenant) Tomoko Nogata from the third and fourth films in the Police Academy film series, and as the voice of Leonardo in the first three live-action Teenage Mutant Ninja Turtles movies. He is also known as Brian Keith Tochi.\n\nDescription above from the Wikipedia article Brian Tochi licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1963, 5, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0865058", "Acting", "Brian Tochi", new List<string> { "Brian Keith Tochihara", "Brian Keith Tochi" }, "Los Angeles, California, USA", 11.605, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oFmxzHpo3bw9wn8yx5fNCt9xTC7.jpg" },
                    { 16142, "Kazuchika Kise (黄瀬 和哉, Kise Kazuchika, March 6, 1965) is an animator, animation director, and director from Osaka, Japan. He works for the animation studio Production I.G.", new DateTime(1965, 3, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0457124", "Visual Effects", "Kazuchika Kise", new List<string> { "黄瀬和哉", "きせ かずちか", "키세 카즈치카", "黄濑和哉" }, "Osaka, Japan", 7.391, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rb6egNuug67QbRMgYLPMKN45FKL.jpg" },
                    { 16194, "", null, null, 0, null, "nm0504717", "Costume & Make-Up", "Philip Leto", new List<string> { "Phil Leto" }, null, 1.3180000000000001, null },
                    { 16318, "Mario Brega (25 March 1923 – 23 July 1994) was an Italian character actor. His heavy build meant that he regularly portrayed a thug in his films, particularly earlier in his career in westerns. Later in his career, however, he featured in numerous Italian comedy films. Brega stood at 6 feet 4 inches (1.93 m) and well over 250 pounds (110 kg) at his heaviest but after the 1960s slimmed down significantly.\n\nBrega was born in Rome. He was a butcher before he drifted into acting, where his heavy physique ensured him a plethora of character roles. Debuting with director Dino Risi, he then played some minor roles in Sergio Leone's Spaghetti Western movies: A Fistful of Dollars, as Chico; For a Few Dollars More, as Niño; The Good, the Bad and the Ugly as Corporal Wallace; and also as a gangster in Once Upon a Time in America. He appeared in many other Spaghetti Westerns, including Death Rides a Horse, The Great Silence, and My Name is Nobody. Later in his career he had comical roles with director Carlo Verdone, such as in Un sacco bello and Talcum Powder.\n\nHe died of heart attack in Rome in 1994.\n\nDescription above from the Wikipedia article Mario Brega, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1923, 3, 25, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1994, 7, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0103828", "Acting", "Mario Brega", new List<string> { "Richard Stuyvesant ", "M. Braga" }, "Rome, Lazio, Italy", 15.539, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\anV1dBcJDSkL8OaUoSqBoAU7FPK.jpg" },
                    { 16477, "", new DateTime(1946, 5, 31, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 12, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0325975", "Acting", "Danny Goldring", new List<string> { "Dan Goldring" }, "Woodstock, Illinois, USA", 5.8949999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6mLImvnDzy2vkXh16IaKBz3V1vO.jpg" },
                    { 16522, "", new DateTime(1949, 9, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 5, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0630022", "Crew", "Jimmy Nickerson", new List<string> { "James Nickerson", "Jim Nickerson" }, "Pittsburgh, Pennsylvania, USA", 5.3419999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zidbZdFLUj5DqmZT7yAbp3wEzmr.jpg" },
                    { 16525, "​Joe Spinell was born Joseph J. Spagnuolo in Manhattan, New York of Italian immigrant parents, and the last of six children. His father, Pelegrino Spagnuolo (b. 1892, d. 1950), died from liver and kidney disease. His mother Filomena Spagnuolo (b. 1903, d. 1987) was a bit-part actress who acted in a few movies, some of them alongside her son. Spinell stood 5 foot and 11 inches. He was born at his family's apartment in Manhattan's Little Italy on 2nd Avenue in Manhattan. A few years after the death of his father, he moved with his mother and older siblings to Woodside, Queens, New York where he lived off-and-on for the remainder of his life. Spinell suffered most of his life from hemophilia as well as chronic asthma. Because of his large, heavyset frame and imposing looks, Spinell was often cast as criminals, thugs, or corrupt police officers. His most notable roles were as mafioso Willi Cicci in The Godfather and The Godfather Part II, and as loan shark Tony Gazzo in Rocky and Rocky II. Although primarily known as a character actor, Spinell co-wrote and starred as a serial killer in the 1980 film, Maniac. Joe Spinell died in his apartment on January 13, 1989 at the age of 52. The cause of his untimely death is arguable to this day. Some say that his death was caused by sudden heart attack due to heavy drug use, drinking and emotional distress in light of his mother passing away two years earlier. It is also speculated that he may have died from asthma complications, or bled to death from hemophilia related causes. He was planning a sequel to Maniac before his death. He was buried in Calvary Cemetery, Queens near his home. He is the distant cousin of the American football team St. Louis Ram's Head Coach Steve Spagnuolo. Spinell was married to adult film star Jean Jennings from February 1977 to July 1979. Together they had one daughter, but they eventually divorced.", new DateTime(1936, 10, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1989, 1, 13, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0818874", "Acting", "Joe Spinell", new List<string> { "Joseph J. Spagnuolo", "Joseph Spagnuolo" }, "Manhattan, New York", 14.048999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jiok99ZvHDOj51BBgio2qvum0Mb.jpg" },
                    { 16551, "", null, null, 1, null, "nm0379142", "Costume & Make-Up", "Ilona Herman", new List<string>(), null, 4.0780000000000003, null },
                    { 16555, "Bill McKinney was an American character actor whose most famous role was the sadistic mountain man who abused and then sodomized Bobby Trippe (Ned Beatty) in the movie Deliverance. McKinney is also recognizable for his performances in seven Clint Eastwood films, most notably as Union cavalry commander Captain \"Redlegs\" Terrill in The Outlaw Josey Wales. Most of Bill McKinney's colleagues perceived him as big, brutal and dangerous. At first glance. Still, he was only 5' 10\" (1,78 m).", new DateTime(1931, 9, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 12, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0571853", "Acting", "Bill McKinney", new List<string> { "William McKinney", "William Mc Kinney" }, "Chattanooga, Tennessee, USA", 18.274999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bXGJNizj5SbEFPjeBupnRxgwPq0.jpg" },
                    { 16654, "", null, null, 2, null, "nm0322774", "Production", "Michael S. Glick", new List<string>(), null, 3.1549999999999998, null },
                    { 17052, "Christopher John \"Topher\" Grace (born July 12, 1978) is an American actor. He is best known for his portrayal of Eric Forman on the FOX sitcom That '70s Show, Eddie Brock/Venom in the Sam Raimi film Spider-Man 3, and Edwin in the 2010 film Predators.\n\nHe stars as Tom on the ABC comedy Home Economics.", new DateTime(1978, 7, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0333410", "Acting", "Topher Grace", new List<string> { "Christopher John Grace" }, "New York City, New York, USA", 20.763999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hvXoqAKI958higegGERDLKaLhj8.jpg" },
