                    { 17449, "Robert J. Stephenson (born May 18, 1967) is an American film and television actor, film producer and screenwriter who is probably best known as Sheriff Jimmy Taylor on the CBS TV series Jericho.", new DateTime(1967, 5, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.bobstephenson.com", "nm0827307", "Acting", "Bob Stephenson", new List<string> { "Robert Stephenson", "Robert J. Stephenson" }, "Oxnard, California, USA", 9.1850000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\htF2P5zyyFFB1jpBNGVvTiGH01F.jpg" },
                    { 17490, "Isiah Whitlock Jr. (born September 13, 1954) is an American actor. He is most famous for his role on the HBO television series, The Wire as corrupt state senator Clay Davis. In 2011, Whitlock played an insurance agent named Ronald Wilkes in the film Cedar Rapids. Wilkes is a self-described fan of The Wire and does an impersonation of character Omar Little. Whitlock has said that the references to the series were written in before he became involved in Cedar Rapids.\n\nHe is also notable for appearing in Spike Lee films She Hate Me and 25th Hour as Agent Amos Flood. In all three projects, Whitlock established a catchphrase from his characters' distinct pronunciation of the word \"shit\" (\"sheee-it\").\n\nHe appeared as Eugine, a supporting role, in the 2003 film Pieces of April. He had a bit part in Goodfellas as a doctor who gives Henry Hill a Valium while attending to his brother. In 2007, he played Ethan Banks in Enchanted.\n\nWhitlock has made appearances on Chappelle's Show and has played various characters on Law & Order and its' spinoff, Law & Order: SVU. He also appears in promotional spots for the Wii video game Punch-Out!! portraying the character Doc Louis.", new DateTime(1954, 9, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.isiahwhitlockjr.com/", "nm0926086", "Acting", "Isiah Whitlock Jr.", new List<string> { "Isaiah Whitlock " }, "South Bend, Indiana, USA", 12.117000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8OIhQb53rMX7VcTLZbAMeVd7tHc.jpg" },
                    { 17540, "Yoshio Tsuchiya (土屋 嘉男 Tsuchiya Yoshio, May 18, 1927 – February 8, 2017) was a Japanese actor known for his frequent appearances in Akira Kurosawa's Samurai films as well as Ishiro Honda's science fiction films.", new DateTime(1927, 5, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 2, 8, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0875237", "Acting", "Yoshio Tsuchiya", new List<string> { "土屋嘉男" }, "Koshu, Yamanashi Prefecture, Japan", 8.3960000000000008, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kJS04UByTERRVYF7TwozrXwh5cs.jpg" },
                    { 17630, "Michael Tadross is an American producer, director and sometimes actor. He has played a pivotal role as a leading figure in the film industry for over thirty years.\n\nWarner Bros. films he has produced include Sherlock Holmes, Run All Night, Cop Out, Winter's Tale, Arthur, and I Am Legend - one of the highest-budgeted science fiction movies to be entirely filmed in New York City. Earlier in his career, for Warner Bros., he produced The Devil's Advocate, Jack Frost, and Eraser.\n\nHis producing credits also include Hitch, Basic, Rollerball, The Thomas Crown Affair, Indecent Proposal, School Ties, Brenda Starr, and Die Hard: With A Vengeance - the highest grossing worldwide film of 1995.\n\nHe was Unit Production Manager for Ghost, Coming To America, Black Rain, Trading Places and Death Wish III, and was First Assistant Director on Cocktail, and Masquerade, to name a few. He's also been awarded one gold and two platinum records.\n\nHe began his film career as a camera trainee and assistant film editor. He is now a member of the Producer's Guild of America, the Director's Guild of America, and the Academy of Motion Pictures Arts & Sciences. He also worked as Executive Vice President of Feature Production at Paramount Pictures\n\nHe was nominated for the NAACP Image Award and received The Movie Guide Award for best family-oriented film of 2006 (Hitch). He is also cited in the Who's Who of Executives and Professionals.", null, null, 2, null, "nm0846333", "Production", "Michael Tadross", new List<string>(), null, 5.4539999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7lEZHHqKnowFWEXsTlmX2emnvdW.jpg" },
                    { 17677, "", null, null, 0, null, "nm1132783", "Art", "Naaman Marshall", new List<string>(), null, 1.7989999999999999, null },
                    { 17921, "Clem Caserta had a prosperous career in Hollywood as an actor. He initiated his acting journey by playing characters in renowned films such as \"Once Upon A Time In America\" (1984) alongside Robert De Niro, \"The Untouchables\" (1987), and the action-packed \"Black Rain\" (1989) with Michael Douglas.", null, null, 2, null, "nm0143344", "Acting", "Clem Caserta", new List<string>(), null, 11.124000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d3Vm8hym67OrDkMZPU9bXZKZeWj.jpg" },
                    { 17928, "", null, null, 2, null, "nm0195844", "Acting", "Joseph D'Onofrio", new List<string> { "Joe D'Onofrio" }, null, 6.96, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sbDtKGXn4mQIjnTVCUfLMf15Kmj.jpg" },
                    { 18052, "From Wikipedia, the free encyclopedia.\n\nNathan Gamble (born January 12, 1998) is an American child actor who made his feature film debut in Babel (2006), for which he was nominated for a 2007 Young Artist Award.\n\nGamble was born in Tacoma, Washington, the son of theater directors who run a drama camp for children. His additional screen credits include Dry Rain (2007), Saving Sam (2007), Diggers (2007), The Mist (2007), The Dark Knight (2008), and Marley & Me (2008).\n\nOn television, Gamble appeared in Runaway in 2006; crossover episodes of CSI: Crime Scene Investigation and Without a Trace in 2007; and House and Ghost Whisperer in 2008. In 2009 he played the role of Henry Pryor, son of the title character in Hank. In 2010 he played the role of Daniel in a short film called Displaced, the film was commissioned by the City of Seattle as part of the Water Calling series and aired at Seattle Channel.\n\nGamble has completed filming the role of Poe Malloy in Captain Cook's Extraordinary Atlas for Warner Bros. Television. He portrayed Lucas Thompson in the film The Hole, which was released in 2010.\n\nDescription above from the Wikipedia article Nathan Gamble, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1998, 1, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1997480", "Acting", "Nathan Gamble", new List<string> { "나단 겜블" }, "Tacoma, Washington, USA", 14.635999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\utbynIWozMtWsRZH9nt1BE2ae5P.jpg" },
