                    { 18127, "Sheila Paige was co-founder of Women Make Movies, Inc. with Ariel Dougherty, and co-director from 1972-1975.  In addition to Women’s Happy Time Commune, she has produced and directed films and videos and also interactive online theater productions for the Upstage Festivals 2008 and 2009.  As a script supervisor, she has worked in the film industry on many major motion pictures, including the notable features King of Comedy and Good Fellas, and on TV movies and series such as Orange is the New Black and Gossip Girl.  Currently, she is pursuing a new video project and writing and illustrating children’s books.", null, null, 0, "http://www.sheilapaigefilms.com", "nm0656748", "Directing", "Sheila Paige", new List<string>(), null, 3.149, null },
                    { 18265, "Mauro Fiore is an Italian-American cinematographer, known for his work with directors such as Antoine Fuqua, Michael Bay, and Joe Carnahan. He won the Academy Award for Best Cinematography for his work on James Cameron's 2009 film Avatar.", new DateTime(1964, 11, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0278475", "Camera", "Mauro Fiore", new List<string>(), "Marzi, Calabria, Italy", 5.9290000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nQcYPuPZTG4mXz0LRBDZVaabmg3.jpg" },
