                    { 19110, "Virginia Lee Gregg (March 6, 1916 – September 15, 1986) was an American actress known for her many roles in radio dramas and television series.", new DateTime(1916, 3, 6, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1986, 9, 15, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0339615", "Acting", "Virginia Gregg", new List<string>(), "Harrisburg, Illinois, USA", 12.305, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\AmNAKjlShaPxv7C3Z2xYC0vvSk5.jpg" },
                    { 19111, "John Robert Anderson (October 20, 1922 – August 7, 1992) A tall, sinewy, austere-looking character actor with silver hair, rugged features and a distinctive voice, John Robert Anderson appeared in hundreds of films and television episodes. Immensely versatile, he was at his best submerging himself in the role of historical figures (he impersonated Abraham Lincoln three times and twice baseball commissioner Judge Kenesaw Mountain Landis, men whom he strongly resembled). He was a familiar presence in westerns and science-fiction serials, usually as upstanding, dignified and generally benign citizens (a rare exception was his Ebonite interrogator in The Outer Limits (1963) episode \"Nightmare\"). He had a high opinion of Rod Serling and was proud to be featured in four episodes of The Twilight Zone (1959), most memorably as the tuxedo-clad angel Gabriel in \"A Passage for Trumpet\" (doing for Jack Klugman what Henry Travers did for James Stewart in It's a Wonderful Life (1946)).", new DateTime(1922, 10, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 8, 7, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0026930", "Acting", "John Anderson", new List<string> { "John R. Anderson" }, "Clayton, Illinois, USA", 17.459, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cJGjTONNdfLRO7gQpyjbstAarTY.jpg" },
                    { 19460, "Saul Bass was an American graphic designer and Oscar-winning filmmaker, best known for his design of motion-picture title sequences, film posters, and corporate logos.", new DateTime(1920, 5, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1996, 4, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000866", "Art", "Saul Bass", new List<string>(), "New York City, New York, USA", 5.2709999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ndhWNcKj2TwTi8pRqPP0JqrCoa4.jpg" },
                    { 19578, "Alexis Arquette (July 28, 1969 – September 11, 2016) was an American actress, cabaret performer, underground cartoonist, and activist. Actors Rosanna, Richmond, Patricia, and David Arquette were her siblings.", new DateTime(1969, 7, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2016, 9, 11, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0000793", "Acting", "Alexis Arquette", new List<string> { "Robert Arquette", "Lex Arquette", "Eva Destruction" }, "Los Angeles, California, USA", 10.356999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jNRBwGKXOZFWLI2ceff1sMUdxcE.jpg" },
