                    { 19588, "Miyu Irino is a Japanese actor and voice actor from Tokyo. He voices the lead character Sora in the Kingdom Hearts video game series. His major anime voice roles include Todomatsu Matsuno in Osomatsu-san, Haku in Spirited Away, Daisuke Niwa in D.N.Angel, Syaoran Li in Tsubasa Reservoir Chronicle, Sena Kobayakawa in Eyeshield 21, Astral in Yu-Gi-Oh! Zexal, Jintan in Anohana: The Flower We Saw That Day, Yuichiro Hyakuya in Seraph of the End, and Ishida Shouya in A Silent Voice. On June 26, 2009, he released his debut mini-album called Soleil, and in August 2009, Irino played a leading role in the movie Monochrome Girl. His first single album, Faith, was released on November 25, 2009.", new DateTime(1988, 2, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://junction99.com/?page_id=1134", "nm0997115", "Acting", "Miyu Irino", new List<string> { "이리노 미유", "入野 自由" }, "Tokyo, Japan", 25.361999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8qEEhHUObNvGQr4e6eqLu5z4qTz.jpg" },
                    { 19589, "Junko Nakajima (中島 淳子 Nakajima Junko, born 2 May 1952), more commonly known by her stage name Mari Natsuki (夏木 マリ Natsuki Mari), is a Japanese singer, dancer and actress. Born in Tokyo, she started work as a singer from a young age. In 2007 she announced her engagement to percussionist Nobu Saitō, with their marriage taking place in Spring 2008.", new DateTime(1952, 5, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "https://www.natsukirock.com/", "nm0622412", "Acting", "Mari Natsuki", new List<string> { "夏木マリ", "中島淳子", "Nakajima Junko", "夏木真理 " }, "Tokyo, Japan", 15.677, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aRs3dGqA2bCuGSZ7lJGhQKe8rhp.jpg" },
