                    { 19781, "​From Wikipedia, the free encyclopedia.  \n\nLurene Tuttle (August 29, 1907, Pleasant Lake, Indiana - May 28, 1986, Encino, California) was a character actress, who made transitions from vaudeville to radio, to films and television. Her most enduring impact was as one of network radio's most versatile actresses. Often appearing in 15 shows a week, comedies, dramas, thrillers, soap operas, and crime dramas, and she became known as the First Lady of Radio.\n\nHeaven Only Knows (1947) was her first film. She went on to roles in other films such as Orson Welles's Macbeth (1948), Mr. Blandings Builds His Dream House (1948) and Alfred Hitchcock's Psycho (1960), as the wife of Sheriff Chambers. In Don't Bother to Knock (1952) she portrayed a mother who lets a disturbed Marilyn Monroe babysit her daughter. The next year she appeared again with Marilyn in Niagara, as Mrs. Kettering. She had a rare starring role in Ma Barker's Killer Brood (1960). She played Grandma Pusser in the original Walking Tall film trilogy, and also appeared in horror films such as The Manitou (1978), starring Tony Curtis. Her final film role was in the 1983 film Testament.  Tuttle became a familiar face to millions of television viewers with more than 100 appearances from 1950 to 1986, often in the role of an inquisitive busybody. On television and in films, Tuttle streamlined herself into a pattern of roles between wise, loving wives/mothers or bristling matrons. She was familiar to the early television audience as wife/mother Lavinia (Vinnie) Day in Life with Father (1953–1955). Columnist Hedda Hopper called the selection of Leon Ames as Father and Tuttle as Mother \"what I consider 22 carat casting with two all-Americans.\"\n\nDescription above from the Wikipedia article Lurene Tuttle, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1907, 8, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1986, 5, 28, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0878354", "Acting", "Lurene Tuttle", new List<string> { "Lorene Tuttle" }, "Pleasant Lake, Indiana, USA", 11.19, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\t0dLpAfrSECNGjtGsGiO4SQquVW.jpg" },
                    { 20030, "Jacques Perrin was a French actor and filmmaker. He is occasionally credited as Jacques Simonet. Simonet was his father's name and Perrin his mother's.", new DateTime(1941, 7, 13, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 4, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0674742", "Acting", "Jacques Perrin", new List<string> { "Jacques André Perrin Simonet", "Жак Перрен", "Jacques Simonet" }, "Paris, France", 15.198, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lGbDfSdDgFg3QHgungWIDsV9uh7.jpg" },
                    { 20093, "", new DateTime(1990, 5, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0495358", "Acting", "Scotty Leavenworth", new List<string> { "Scott Leavenworth" }, "Riverside, California, USA", 12.353999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9BIHEHn2woFz998IsXh6Ntb2BmV.jpg" },
                    { 20334, "Tsunehiko Kamijō (上條 恒彦 Kamijō Tsunehiko, born March 7, 1940 in Nagano) is a Japanese singer, actor and voice actor.", new DateTime(1940, 3, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.k-seven.co.jp/talent/?id=1371806761-124055", "nm0436639", "Acting", "Tsunehiko Kamijô", new List<string> { "上條恒彦", "上条恒彦", "Tsunehiko Kamijō" }, "Nagano, Nagano Prefecture, Japan", 8.2010000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\v2poQi0qYEWdTaMf2pVTWmcdwZp.jpg" },
                    { 20372, "Edison Koon-Hei Chen (born 7 October 1980) is a Hong Kong-based Chinese Canadian film actor, rapper, Cantopop singer, model, record producer, fashion designer, and a pop icon. Chen is also the founder of CLOT Inc., and the CEO of Clot Media Division Limited. His native language is English, he is able to speak and sing Cantonese and Mandarin and also speaks conversational Japanese,which allows him to be a part of multiple entertainment industries around the world. On 21 February 2008 he publicly announced that he intended to step away \"indefinitely\" from the Hong Kong entertainment industry due to the sex photo scandal in 2008. However, he returned to the industry in 2010 and he stated \"indefinitely\" could mean 5 minutes or 2000 years.\n\nDescription above from the Wikipedia article Edison Chen, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1980, 10, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0155211", "Acting", "Edison Chen", new List<string> { "Edison Chen Koon-Hei", "陳冠希", "진관희", "陈冠希", "Trần Quán Hy" }, "Vancouver, Canada", 19.628, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9JsNQ3m7oZLfmnql5I8qP1RC3sd.jpg" },
                    { 20643, "", null, null, 0, null, "nm0650038", "Production", "Lorne Orleans", new List<string>(), null, 3.8370000000000002, null },
                    { 20738, "Song Kang-ho (송강호) is a South Korean actor. Considered one of the best actors of the 21st century, he is most known for his collaborations with directors Park Chan-wook and Bong Joon-ho. He was awarded Best Actor at the 75th Cannes Film Festival for his performance in Broker (2022), and has been named Gallup Korea's Film Actor of the Year four times.", new DateTime(1967, 1, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.sublimeartist.co.kr/post/song-kang-ho", "nm0814280", "Acting", "Song Kang-ho", new List<string> { "송강호", "Song Kang Ho", "Song Kangho", "宋康昊", "ソン・ガンホ", "Сон Кан Хо", "Song Gang-ho", "Сун Ган-ху", "سونگ کانگ-هو", "سونغ كانغ هو", "Սոն Կան Հո", "Σονγκ Κανγκ-χο", "סונג קאנג-הו", "सॉंग कांग-हो", "ซง คังโฮ", "సూంగ్ కాంగ్-హో", "சாங் கேங்-ஹொ", "ਸੌਂਗ ਕੰਗ-ਹੋ", "সং কাং-হো", "სონ კან ჰო", "സോംഗ് കാങ്-ഹോ" }, "Gimhae, South Gyeongsang, South Korea", 18.423999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7dw9wIpFZ5nJZ3zqrue8t7hUUgQ.jpg" },
                    { 20752, "​From Wikipedia, the free encyclopedia.  \n\nAlex Rocco (born Alessandro Federico Petricone Jr.; February 29, 1936 – July 18, 2015) was an American actor. Known for his distinctive, gravelly voice, he was often cast as villains, including Moe Greene in The Godfather (1972) and his Primetime Emmy Award–winning role in The Famous Teddy Z. Rocco did a significant amount of voice-over work later in his career.\n\nDescription above from the Wikipedia article Alex Rocco, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1936, 2, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 7, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0733678", "Acting", "Alex Rocco", new List<string> { "Alessandro Federico Petricone Jr." }, "Cambridge, Massachusetts, USA", 15.807, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uAG4qvYhYHuCyyXGm3lqC4o6ujc.jpg" },
                    { 20827, "Hideo Oguni (小国 英雄 Oguni Hideo, 9 July 1904 – 5 February 1996) was a Japanese writer who wrote over 100 screenplays. He is best known for co-writing screenplays for a number of films directed by Akira Kurosawa, including Ikiru, The Seven Samurai, Throne of Blood and The Hidden Fortress. His first film with Kurosawa was Ikiru, and according to film professor Catherine Russell, it was Oguni who devised that film's two-part structure. Film critic Donald Richie regarded him as the \"humanist\" among Kurosawa's writers. In 2013, Oguni and frequent screenwriting collaborators Kurosawa, Shinobu Hashimoto and Ryūzō Kikushima were awarded the Jean Renoir Award by the Writers Guild of America West.\n\nWriting credits other than for Kurosawa films include Heinosuke Gosho's Entotsu no mieru basho in 1953, Koji Shima's Warning from Space in 1956, Tora! Tora! Tora!, and Hiroshi Inagaki's Machibuse in 1970.", new DateTime(1904, 7, 9, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1996, 2, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0644823", "Writing", "Hideo Oguni", new List<string> { "小国英雄" }, "Hachinohe, Aomori Prefecture, Japan", 8.5289999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\y0tQBvlY2laUovsnBHzFWRLewrU.jpg" },
                    { 20828, "​From Wikipedia, the free encyclopedia.  \n\nYoshio Inaba (稲葉 義男 Inaba Yoshio, July 15, 1920–April 20, 1998) was a Japanese actor best known for his role as one of the title characters (the good-natured, second-in-command Gorobei) in Akira Kurosawa's Seven Samurai. He died of a heart attack at the age of 77.\n\nDescription above from the Wikipedia article Yoshio , licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1920, 7, 15, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 4, 20, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0408343", "Acting", "Yoshio Inaba", new List<string> { "稲葉義男", "Ёсио Инаба", "稻叶义男" }, "Narita, Chiba Prefecture, Japan", 12.353999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5qIAqM5PegWTNq67qNofz78fb6U.jpg" },
                    { 20829, "Seiji Miyaguchi (宮口 精二 Miyaguchi Seiji, November 15, 1913–April 12, 1985) was a Japanese actor who appeared in such films as Akira Kurosawa's Seven Samurai (as Kyuzo, the master swordsman) despite the actor's confession to have never handled a sword before the role, Ikiru as a yakuza boss from \"restaurant row,\" and Masaki Kobayashi's Kwaidan. He died of lung cancer.\n\nDescription above from the Wikipedia article Seiji Miyaguchi, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1913, 11, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1985, 4, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0594348", "Acting", "Seiji Miyaguchi", new List<string> { "宮口精二", "宫口精二", "Сэйдзи Миягути" }, "Tokyo, Japan", 9.6969999999999992, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\97XiJh1TSdu4hmJUp4Am5afgBZx.jpg" },
                    { 20830, "From Wikipedia, the free encyclopedia\n\nIsao Kimura (木村 功 Kimura Isao), also known as Kō Kimura, was a Japanese actor. He appeared in several films directed by Akira Kurosawa. The first was Stray Dog (1949) as Yusa the criminal. Perhaps his most notable collaboration with Kurosawa was in Seven Samurai as the youngest of the samurai, Katsushiro. During his career he also appeared in several films directed by Mikio Naruse as well as appearing in the famous Lone Wolf and Cub film series. In addition to a film career spanning almost thirty years, Kimura founded and directed an acting company which ultimately went bankrupt. He died of esophageal cancer at 57 years old.", new DateTime(1923, 6, 22, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1981, 7, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0454087", "Acting", "Isao Kimura", new List<string> { "木村功", "Kō Kimura", "Исао Кимура" }, "Senda, Hiroshima Prefecture, Japan", 10.875, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\afLPuf3x7UYXryAbqAGqmRcVNNW.jpg" },
                    { 20831, "Keiko Tsushima (津島 恵子 Tsushima Keiko, 7 February 1926 – 1 August 2012) was a Japanese actress, whose real name was Naoko Mori (森 直子 Mori Naoko). She was notable for her prominent role in Akira Kurosawa's 1954 film Seven Samurai. She also starred in Japanese television series such as Sakura and Kimi ga Jinsei no Toki.", new DateTime(1926, 2, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 8, 1, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0875477", "Acting", "Keiko Tsushima", new List<string> { "Tsushima Keiko", "Shizuko Kojima", "津島 恵子", "Mori Naoko", "森 直子", "Naoko Mori", "Кэйко Цусима", "Сидзуко Кодзима", "Наоко Мори", "津岛惠子" }, "Tsushima, Nagasaki Prefecture, Japan", 9.1530000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\c4h0z00YkEUav0lGHoqVpeUzbul.jpg" },
                    { 20832, "Producer, director, and writer.", new DateTime(1914, 6, 19, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1977, 5, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0609404", "Production", "Sōjirō Motoki", new List<string> { "本木荘二郎", "Keiichi Kishimoto", "岸本恵一", "Takeo Takagi", "高木丈夫", "Junzo Fujimoto", "藤本潤三", "Junji Fujimoto", "藤本潤二 ", "本木庄二郎", "品川照二", "Teruji Shinagawa" }, "Minato, Tokyo, Japan", 1.6830000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3elxuzpG4zmKcXmJxAkRnUDjCn7.jpg" },
