                    { 20982, "Marton Csokas (born 30 June 1966) is a New Zealand film and television actor.\n\nDescription above from the Wikipedia article Marton Csokas, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1966, 6, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0190744", "Acting", "Marton Csokas", new List<string> { "Мартон Чокаш", "마튼 초카스", "馬頓·索柯斯" }, "Invercargill, New Zealand", 27.268999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jKtjjwf8MHnUsQ3YA56LH9pJjee.jpg" },
                    { 21129, "Marla Sucharetza is an American stage and screen actress. She holds an BA in Music, Theater & Dance from the Ohio State University, Columbus, Ohio.", new DateTime(1965, 5, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0837051", "Acting", "Marla Sucharetza", new List<string> { "Marla Sucharetza Cross" }, "New York City, New York, USA", 8.7989999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2IdHi0THFukYDDkbZ64eCWoIE81.jpg" },
                    { 21181, "Fabio Testi (born 2 August 1941) is an Italian film actor, notable as the star of, among many other films, First Action Hero.  Born in Peschiera del Garda, Italy, the 1.84m tall actor started his film career as a stuntman in his college years. His most famous job as a stuntman was in Sergio Leone's Once Upon a Time in the West, where he fell from a rooftop and hit the ground on his shoulder.  Testi married only once, in 1979, to Lola Navarro, with whom he fathered three children.  He skirted international stardom through a series of unusual role choices and a firm decision to remain in Italy. He chose to work with people like Miles Deem, known as the \"Ed Wood of Spaghetti Westerns\" when better roles were available. Testi was cast by director Andrzej Żuławski in L'important c'est d'aimer (1975), opposite Romy Schneider, Klaus Kinski, Jacques Dutronc and Claude Dauphin.\n\nDescription above from the Wikipedia article Fabio Testi, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1941, 8, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.agenziaisabellagullo.net/testif.html", "nm0601377", "Acting", "Fabio Testi", new List<string>(), null, 11.521000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rSPYBXxsF1xvm5dGd3RKZixy4Jp.jpg" },
                    { 21258, "", null, null, 2, null, "nm0657856", "Crew", "Gary Paller", new List<string> { "Gary M. Paller", "Garry Paller" }, null, 1.764, null },
                    { 21315, "An American actor. His career began with a well-received performance in King of the Gypsies (1978), for which he earned his first Golden Globe Award nomination. His second Golden Globe nomination came for his portrayal of Paul Snider in Star 80 (1983), followed by Globe and Academy Award nominations for his supporting role in Runaway Train (1985). In a career spanning almost forty years, Roberts has performed in over 200 films, including Raggedy Man (1981), The Pope of Greenwich Village (1984), The Specialist (1994), Cecil B. Demented (2000), National Security (2003), The Dark Knight (2008), The Expendables (2010) and Inherent Vice (2014). His equally varied television work includes three seasons with the sitcom Less than Perfect, as well as recurring roles on the NBC drama Heroes and the CBS soap opera The Young and the Restless. His sisters Julia Roberts and Lisa Roberts Gillan, and daughter Emma Roberts, also have acting careers.", new DateTime(1956, 4, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0000616", "Acting", "Eric Roberts", new List<string> { "Eric Anthony Roberts", "Ерік Робертс" }, "Biloxi, Mississippi, USA", 26.183, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\NiWg1TaUcal7xn1ZQeyA2dLd5F.jpg" },
                    { 21316, "​From Wikipedia, the free encyclopedia.  \n\nNestor Gastón Carbonell (born December 1, 1967) is an American actor, known for portraying Richard Alpert in ABC's drama Lost and Mayor Anthony Garcia in the film The Dark Knight. He is also known for his role on the sitcom Suddenly Susan.", new DateTime(1967, 12, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0004801", "Acting", "Nestor Carbonell", new List<string> { "Néstor Gastón Carbonell ", "네스터 카보넬" }, "New York City, New York, USA", 29.047999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vNPnSKSteGkInJAQEicHzKpZR6L.jpg" },
                    { 21382, "Gene Canfield is known for Meet Joe Black (1998), Scent of a Woman (1992) and Murder by Numbers (2002).", null, null, 2, null, "nm0133932", "Acting", "Gene Canfield", new List<string>(), null, 7.4660000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\luiINXn3z8m8ABxaqdTSJd8q4vm.jpg" },
                    { 21385, "Gennaro Anthony \"Tony\" Sirico, Jr. (July 29, 1942–July 8, 2022) was an American character actor most famous for his role as Paulie Gualtieri in the television series The Sopranos.", new DateTime(1942, 7, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 7, 8, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0802831", "Acting", "Tony Sirico", new List<string> { "Anthony Sirico Jr. ", "Tony Sirico Jr.", "Anthony Sirico ", "G. Anthony Sirico ", "Genaro Anthony Sirico ", "Тони Сирико" }, "Brooklyn, New York City, New York, USA", 10.028, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yiTvFhaPlVIWETNObwqB72hgNeI.jpg" },
                    { 21416, "William Joseph Devane (born September 5, 1937) is an American film, television and theater actor,  known for his role as Greg Sumner on the primetime soap opera Knots Landing and as James Heller on the Fox serial drama 24, the role he reprised in Live Another Day. He is also known for his supporting roles in films such as McCabe & Mrs. Miller,  Family Plot), Marathon Man, Rolling Thunder and Space Cowboys.\n\nDevane began his acting career with the New York Shakespeare Festival where he performed in 15 plays. In 1966, Devane portrayed Robert F. Kennedy in the Off-Broadway spoof MacBird. He gained acclaim for his role as President John F. Kennedy in a television docudrama about the Cuban Missile Crisis, The Missiles of October, and again when he played blacklisted radio personality John Henry Faulk in the Emmy Award-winning TV movie Fear on Trial. He is widely known for his ten years as the ambitious and hardnosed politician-turned-corporate titan Greg Sumner on Knots Landing.\n\nIn 1994, Devane appeared as Al Capone in Lois & Clark: The New Adventures of Superman in an episode entitled \"That Old Gang of Mine\". He also had a recurring role on the CBS show Early Edition as the lead character's father. Devane appeared in the films McCabe & Mrs. Miller; Lady Liberty; Family Plot; Marathon Man; Rolling Thunder; Yanks; Testament; Timestalkers; Forgotten Sins; Exception to the Rule; Payback; Hollow Man and Space Cowboys.\n\nDevane has played members of the Presidential Cabinet on two evening dramas. In 2004, on The West Wing, he guest-starred as the Secretary of State and potential Vice-Presidential nominee. Devane appeared in several scenes with Martin Sheen; they also appeared together as President John F. Kennedy and his brother Robert, respectively, 30 years earlier in The Missiles of October. In 2005, he joined the cast of 24 as Secretary of Defense James Heller for seasons 4, 5 and 6.", new DateTime(1939, 9, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001137", "Acting", "William Devane", new List<string> { "William Joseph Devane", "Γουίλιαμ Ντιβέιν" }, "Albany, New York, USA", 30.236000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\opWtw9Or6cIWor0VIUdjB5Ujowq.jpg" },
                    { 21490, "", new DateTime(1954, 5, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0648846", "Acting", "Peter Onorati", new List<string>(), "Boonton, New Jersey, USA", 13.192, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1ZrzYcnGcoMKA0jmcoC15GsrOxz.jpg" },
                    { 21684, "Bong Joon-ho (Korean: 봉준호), born September 14, 1969, is a South Korean film director, producer and screenwriter. His films are characterised by emphasis on social themes, genre-mixing, black humor, and sudden tone shifts.\n\nHe first became known to audiences and achieved a cult following with his directorial debut film, the black comedy Barking Dogs Never Bite (2000), before achieving both critical and commercial success with his subsequent films: the crime thriller Memories of Murder (2003), the monster film The Host (2006), the science fiction action film Snowpiercer (2013), and the Academy Award-winning black comedy social thriller Parasite (2019), all of which are among the highest-grossing films in South Korea, with Parasite also being the highest-grossing South Korean film in history.\n\nAll of Bong's films have been South Korean productions, although both Snowpiercer and Okja (2017) are mostly in the English language. Two of his films have screened in competition at the Cannes Film Festival—Okja in 2017 and Parasite in 2019; the latter earned the Palme d'Or, which was a first for a South Korean film. Parasite also became the first South Korean film to receive Academy Award nominations, with Bong winning Best Picture, Best Director, and Best Original Screenplay, making Parasite the first film not in English to win Best Picture. In 2017, Bong was included on Metacritic's list of the 25 best film directors of the 21st century. In 2020, Bong was included in Time's annual list of 100 Most Influential People and Bloomberg 50.", new DateTime(1969, 9, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0094435", "Directing", "Bong Joon-ho", new List<string> { "봉준호", "奉俊昊", "Bong Jun-ho", "ポン・ジュノ", "بونگ جون-هو", "בונג ג'ון-הו", "Пон Чжун Хо", "Bong Joon Ho", "Joon Ho Bong" }, "Daegu, South Korea", 30.234999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tKLJBqbdH6HFj2QxLA5o8Zk7IVs.jpg" },
                    { 21718, "", null, null, 0, null, "nm0467162", "Art", "Gary Kosko", new List<string>(), null, 4.633, null },
                    { 21735, "", new DateTime(1980, 5, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0837969", "Acting", "Billy L. Sullivan", new List<string> { "Billy Civitella", "Billy Sullivan" }, "New York, USA", 7.4820000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1SB7xuFNP3DMeelVRuN6i1pO0mr.jpg" },
                    { 21743, "Gerald Alexander Held (born 19 October 1958) is a German actor. He is internationally best known for his historical depictions, as Walther Hewel in the 2004 film Der Untergang, Robert Mohr in the 2005 film Sophie Scholl - Die letzten Tage and as state prosecutor Siegfried Buback in the 2008 film Der Baader Meinhof Komplex.\n\nDuring his school years, Held was a solo singer of the Regensburger Domspatzen, and played football for TSV 1860 München, winning five youth championships. He finished his acting training at the Otto Falckenberg School of the Performing Arts in Munich, and then joined the Munich Kammerspiele. Further engagements at the Staatsschauspiel Hannover, the Freien Volksbühne Berlin, the Theater Basel, and the Salzburg Festival followed.\n\nIn 1993, Held was cast by director Klaus Emmerich in Morlock in his first television film role. Since then he has appeared in numerous cinema and TV productions, including Steven Spielberg's Schindler's List, Marc Rothemund's Sophie Scholl - The Last Days, and Oliver Hirschbiegel's Downfall. In the Sat.1 series Der Bulle von Tölz with Ottfried Fischer, he played a Social Democratic Party of Germany Bundestag member, who mostly has to look after his opponents in the \"Bavarian Unity Party\".\n\nIn 2007, he starred alongside Iris Berben as the greedy villain Heinrich von Strahlberg in the two-part TV film Afrika, mon amour. In 2008, he played Alois Kugler, the opponent of Brandner Kaspar, in the film of the same name, directed by Joseph Vilsmaier. In 2009, he played the politically tactical abbot Kuno in the Margarethe von Trottas film Vision alongside Barbara Sukowa, Heino Ferch, and Hannah Herzsprung, and in the same year, he was seen in Sönke Wortmann's Pope Joan as the Frankish Emperor Lothar I. In 2010, he played the Attorney General Dr. Sasse alongside Ulrich Tukur in Dieter Wedel's two-part TV film Greed. Since 2010, he has starred in the crime series Stralsund as the head commissioner Karl Hidde. Since 2014, he has played the lead role of head commissioner Ludwig Schaller in the crime series München Mord.\n\nHeld's father was actor José Held, who died in 1974. From December 2005, Held was married to German actress Patricia Gräfin Fugger von Babenhausen (1961–2014).\n\nSource: Article \"Alexander Held\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1958, 10, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0374901", "Acting", "Alexander Held", new List<string> { "Alexander G.Held" }, "Munich, Germany", 5.6660000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zE9NoMX4657qMX52EMFah9pHYSI.jpg" },
                    { 21796, "", null, null, 0, null, "nm0861595", "Art", "Sally Thornton", new List<string>(), null, 1.621, null },
                    { 22054, "", new DateTime(1950, 2, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2018, 10, 10, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0503911", "Crew", "Ken Lesco", new List<string> { "Kenny Lesco", "Kenneth R. Lesco" }, null, 5.8129999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2V2tdPMpe4XNXyd0xfkRKjUuNNQ.jpg" },
                    { 22059, "", null, null, 1, null, "nm0777719", "Production", "Emily Schweber", new List<string>(), null, 3.27, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6IU90Qj0JPysGHlU9BeZvTRLrne.jpg" },
                    { 22461, "Vincent Gallo is American director, producer, screenwriter, actor, singer-songwriter, and painter best known for his films The Brown Bunny (2003) and Buffalo '66 (1998).\n\nVincent Gallo  (born April 11, 1961) is an American film actor, director, producer, screenwriter, singer-songwriter, and painter. Although he has had minor roles in mainstream films such as Goodfellas, he is most associated with independent movies, including Buffalo '66, which he wrote, directed, did the music for and starred in; The Brown Bunny, which he also wrote, directed, produced, starred in and photographed; Arizona Dream; The Funeral; and Palookaville. In the late 1970s and early 1980s, Gallo was a painter in the New York City art scene showing with famed art dealer Annina Nosei, performed in a rap duo and was part of the first hip hop television broadcast Graffiti Rock, and played in an industrial band called Bohack which released an album title It Took Several Wives.\n\nIn the early 2000s, he released several solo recordings on WARP records. Gallo is known for his outspoken views and generally sarcastic nature, once stating: \"I stopped painting in 1990 at the peak of my success just to deny people my beautiful paintings; and I did it out of spite.\" Gallo was awarded the Coppa Volpi for Best Actor at the 67th Venice International Film Festival for his performance as a wordless escaping Muslim prisoner in Jerzy Skolimowski's Essential Killing. His own feature film Promises Written In Water, which he wrote, directed, produced and starred in, also screened In Competition at the festival.", new DateTime(1961, 4, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.vincentgallo.com/", "nm0001252", "Acting", "Vincent Gallo", new List<string> { "Enzo Gallo", "Prince Vince", "Vinnie Gallo", "Vincent Vito Gallo", "ヴィンセント・ギャロ", "Винсент Галло", "Bohack", "文森特·加洛", "빈센트 갈로" }, "Buffalo - New York - USA", 12.493, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2H8ucxG6LWAHCJAJf9OGfhSXpqQ.jpg" },
