                    { 27643, "From Wikipedia, the free encyclopedia\n\nMarco Leonardi (born November 14, 1971) is an Italian actor.\n\nLeonardi was born in Australia to Italian parents. He moved to Italy at the age of four and starred in the famous movie Cinema Paradiso and in the Mexican movie Like Water for Chocolate (1993). He has made several movies in the United States, such as Once Upon a Time in Mexico. Other appearances include the Canadian film The Five Senses.\n\nLeonardi was engaged to Mexican actress Lumi Cavazos from 1991 to 1999.Leonardi lived in Los Angeles for 10 years.\n\nDescription above from the Wikipedia article Marco Leonardi, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1971, 11, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0502813", "Acting", "Marco Leonardi", new List<string>(), "Melbourne, Victoria, Australia", 10.615, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5VVhO9rPvRgKsZME2gZKtG9WgWD.jpg" },
                    { 27647, "Angelo Infanti (16 February 1939 – 12 October 2010) was an Italian film actor. He appeared in more than 90 films between 1961 and 2010. He was born on 16 February 1939 in Zagarolo, Italy. He died on 12 October 2010 in Tivoli, Italy due to cardiac arrest.\n\nInfanti is best known to non-Italian audiences as Fabrizio in The Godfather. Fabrizio was a bodyguard to Michael Corleone who was hiding in Sicily. Fabrizio betrays Michael by setting up explosives in his car, but kills his new bride instead. In the novel, Fabrizio is later shot dead in revenge for the killing. A scene was filmed of him being killed by the Corleones using a car bomb but was cut from the motion picture before its theatrical release. It appears in the 1977 The Godfather: A Novel for Television, which combined the first two films – The Godfather and The Godfather Part II, adding back scenes that had been previously cut and telling the story chronologically beginning with Vito Andolini's childhood in Sicily.\n\nSource: Article \"Angelo Infanti\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1939, 2, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2010, 10, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0408636", "Acting", "Angelo Infanti", new List<string>(), "Zagarolo, Lazio, Italy", 9.4870000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dkRVpiDj9YyiuM15XZKT11zZBIR.jpg" },
                    { 27690, "", null, null, 2, null, "nm0859459", "Acting", "Rohn Thomas", new List<string>(), null, 4.4669999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\iDZbEoYDdZQbmFppaNVJG36Scms.jpg" },
