                    { 29082, "", new DateTime(1951, 9, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://gcm.co.nz/artists/bruce-phillips", "nm0680274", "Acting", "Bruce Phillips", new List<string> { "Bruce Phillps" }, null, 5.6159999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lHVBdDMqMkn51PD3RpOxD4H7qyb.jpg" },
                    { 29094, "John Bach (born 5 June 1946) is a British-born New Zealand actor who has acted on stage, television and film over a period of more than four decades. Though born in the United Kingdom, he has spent most of his career living and working in New Zealand.\n\nIn 1997, his leading role as the titular detective character of Duggan was created for him, firstly in a couple of telemovies, then in a successful New Zealand series.", new DateTime(1946, 6, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://gcm.co.nz/artists/john-bach", "nm0045324", "Acting", "John Bach", new List<string>(), "Cardiff, Wales, UK", 6.4059999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\v7l9SKwlTaMQiIfWwfUAP1Sd1nz.jpg" },
                    { 29389, "Carlo Savina (2 August 1919 - 23 June 2002) was an Italian composer and conductor who composed, arranged, and conducted music for films-and is especially remembered for being the music director of films such as The Godfather (1972), Amarcord (1973), and The Bear (1988).\n\nSavina worked with many of the notable film score composers of the 20th century including: Ennio Morricone, Armando Trovajoli, Nino Rota, Mario Nascimbene, Stanley Myers, Stephen Sondheim, Philippe Sarde, and Miklos Rozsa. His work ranged from composing music for frequent Spaghetti Westerns such as Johnny Oro to being the musical director and conductor in Federico Fellini's Orchestra Rehearsal.\n\nIn 1985 he won the David di Donatello Best Music award for the film score of Pizza Connection.\n\nCarlo Savina came from a musical family—his father was the first clarinet for the orchestra of Italian public radio broadcaster EIAR. Carlo learned the violin as a child and went on to graduate from the Conservatory of Music Giuseppe Verdi in Turin where he studied piano, violin, composition, and conducting. In 1945 he began composing music for radio. Early in his career he was awarded a prize by the Accademia Musicale Chigiana. He started his own orchestra and soon was famous. In 1950 he began composing and arranging music for film. For the next thirty years he composed, arranged, and conducted music for over 200 films and became one of the most prolific, and perhaps underrated, screen and television composers of the 20th century.\n\nSource: Article \"Carlo Savina\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1919, 8, 2, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2002, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0006274", "Sound", "Carlo Savina", new List<string> { "Herbert Buckman", "Charles Hanger", "James Munshin" }, "Turin, Piedmont, Italy", 1.3839999999999999, null },
                    { 29608, "", null, null, 0, null, "nm0616735", "Production", "Jake Myers", new List<string>(), null, 2.988, null },
                    { 29616, "William \"Bill\" Armstrong (born June 6, 1954) is a Canadian-born British actor, screenwriter and activist who played Lydecker in the extended Special Edition of the 1986 film Aliens.", new DateTime(1954, 6, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0035628", "Acting", "William Armstrong", new List<string> { " Bill Armstrong", "Williams Armstrong" }, "Montreal, Quebec, Canada", 7.1050000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lW4dqrVuKKi3CK094JBJedSH6Qz.jpg" },
