                    { 30657, "Alessandro was an Italian musician and composer. He played multiple instruments, including the guitar, mandolin, mandolincello, sitar, accordion and piano, and composed more than 40 film scores and countless library music.", new DateTime(1925, 3, 18, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2017, 3, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, "http://www.alessandroni.com/", "nm0018145", "Sound", "Alessandro Alessandroni", new List<string>(), "Roma, Italy", 3.214, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vgUlqCSQygJ8H7jQmZmaNCjVLnH.jpg" },
