                    { 31549, "Phillip \"Phil\" LaMarr (born January 24, 1967) is an American actor, comedian and voice actor. One of the original cast members on the sketch comedy series MADtv, he is also known for his voice acting on the animated series Futurama, Static Shock, Samurai Jack, Justice League, Justice League Unlimited, Star Wars: Knights of the Old Republic II The Sith Lords, Star Wars: The Clone Wars, Metal Gear Solid 2: Sons of Liberty, Metal Gear Solid 4: Guns of the Patriots, and inFAMOUS.", new DateTime(1967, 1, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.phillamarr.com/", "nm0482851", "Acting", "Phil LaMarr", new List<string> { "Phil La Mar", "Phil LaMaar", "Phil LaMar", "Phil Lamarr", "Phillip La Marr", "Phil La Marr", "Phillip LaMarr", "Pill LaMarr", "Phil Lamaar", "Phil Marr" }, "Los Angeles, California, USA", 10.965, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\l5w0qABfsFBxjfWNnpFiaXnh4Nm.jpg" },
                    { 31649, "Brooke Smith (born May 22, 1967) is an American actress known for her roles as Dr. Erica Hahn on the ABC medical drama series Grey's Anatomy, Sheriff Jane Greene on the A&E horror series Bates Motel, and Catherine Martin in The Silence of the Lambs (1991), along with roles in several movies and guest starring and recurring appearances in many television shows including Big Sky and Them.", new DateTime(1967, 5, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0807548", "Acting", "Brooke Smith", new List<string>(), "New York City, New York, USA", 21.161999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A0D7CqSZ0rjlq83M4GMM4CcoUTA.jpg" },
                    { 32130, "Ricardo López-Nuño Díez, better known as Ricardo Palacios, was a Spanish actor, film director and screenwriter. Born in Reinosa (Cantabria), Palacios graduated from the Official Film School in Madrid as an actor and director. He debuted in the 1961 TV series Poly. He participated in about 150 films and television series, being mainly active in the Spaghetti Western genre, and he was also a recurring presence in films directed by Jesús Franco. In 1987, Palacios made his directorial debut with the comedy film ¡Biba la Banda!, starring Alfredo Landa, and in 1997 he directed the TV-series La Banda de Pérez. After spending over a month in hospital with heart problems, Ricardo died on 11 February 2015 of heart failure.", new DateTime(1940, 3, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2015, 2, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0529890", "Acting", "Ricardo Palacios", new List<string> { "Ricardo López-Nuño Díez", "Ricardo López Nuño", "Ricardo José López-Nuño Díez", "Ricardo López" }, "Reinosa, Cantabria, Spain", 5.7480000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bxZDV7vgoqHGtqbdmnOkELSnMB6.jpg" },
                    { 32202, "Leah Cairns is a Canadian actress. She is best known for her role as Lieutenant Margaret \"Racetrack\" Edmondson in Battlestar Galactica.", new DateTime(1974, 6, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://onewordproductions.co.uk/leahcairns/", "nm1489668", "Acting", "Leah Cairns", new List<string>(), "North Vancouver, British Columbia, Canada", 8.8819999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pdPcPWuPcheSRPwJFmnMI66XTn5.jpg" },
                    { 32393, "Paul McCrane (born January 19, 1961) is an American actor, director and singer.", new DateTime(1961, 1, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005204", "Acting", "Paul McCrane", new List<string> { "Paul Mc Crane", "Paul David McCrane" }, "Philadelphia, Pennsylvania, USA", 15.715, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nzFUnpptZ5hhiivD1lsUcPDB8V0.jpg" },
                    { 32490, "", null, null, 2, null, "nm0195310", "Costume & Make-Up", "Alan D'Angerio", new List<string> { "Alan Dangerio" }, null, 2.7440000000000002, null },
                    { 32656, "Gary Lee Davis (born 2 January 1946) is an American actor.", new DateTime(1946, 1, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0204632", "Acting", "Gary Lee Davis", new List<string> { "Gary Davis" }, "Missouri, USA", 8.4719999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\a0UgFGytMZGJrDH6T0VBcsGt1qd.jpg" },
                    { 32830, "Víctor Israel, born Josep Maria Soler Vilanova, was a Spanish film actor. He appeared in more than 200 feature films, shorts and tv-productions from 1961 to 2008. He made frequent appearances in rugged action films, excessive horror movies and gritty Italian spaghetti Westerns. Seldom did he have more than a few lines of dialogue and often he appeared in uncredited roles. Remembered as a veteran character actor.", new DateTime(1929, 6, 13, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2009, 9, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0411486", "Acting", "Víctor Israel", new List<string>(), "Barcelona, Spain", 6.6580000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cQfmoEOvlOhjsYnWr65sah8zku4.jpg" },
                    { 33132, "Yoshirō Muraki was a Japanese production designer, art director, and costume designer. He was nominated three times for the Academy Award for Best Art Direction for his work in the films Tora! Tora! Tora! (1970), Kagemusha (1980), and Ran (1985). He was also nominated for the Academy Award for Best Costume Design for his work in Yojimbo (1961). He is most well known for his collaborations with director Akira Kurosawa, having done work on all of Kurosawa's films from Record of a Living Being (1955) onward, with the exception of Dersu Uzala (1975).", new DateTime(1924, 8, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2009, 10, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0613499", "Art", "Yoshirō Muraki", new List<string> { "村木与四郎", "むらき よしろう", "Yoshiro Muraki" }, "Tokyo Prefecture, Japan", 2.6259999999999999, null },
                    { 33399, "Bronagh Gallagher (born April 26, 1972) is an Irish singer and actress from Derry, Northern Ireland.\n\nDuring her teens she got involved, through school, in drama and music activities, and joined a local amateur dramatics group, the Oakgrove Theatre Company. At one time she was a backing singer in a local band, The Listener. Her big break came when she starred as Bernie in The Commitments. She has also appeared in such films as Thunderpants, You, Me & Marley, Divorcing Jack, Pulp Fiction, Star Wars Episode I: The Phantom Menace and Last Chance Harvey, Sherlock Holmes, and on stage in a Théâtre de Complicité production of The Street of Crocodiles.\n\nHer first album Precious Soul was released in 2004 on the Salty Dog Records label and was produced by John Reynolds. The album features collaborations with Brian Eno on the songs \"He Don't Love You\" and \"Hooks\". Gallagher wrote most of the music on the album, played the drums and sang lead vocals.\n\nDescription above from the Wikipedia article Bronagh Gallagher, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1972, 4, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.bronaghgallagher.com/", "nm0302345", "Acting", "Bronagh Gallagher", new List<string> { "Brona Gallagher" }, "Derry City, Northern Ireland", 12.109, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nFeWufPvkdYOj4wyjF0zb9tL1rb.jpg" },
                    { 33685, "Tatiana S. Riegel A.C.E., is an American film editor known for independent films such as Lars and the Real Girl, The Way Way Back and I, Tonya. She received an ACE Eddie award for \"Best Edited Miniseries or Motion Picture for Non-Commercial Television\".  Riegel was a long-time assistant to the late editor Sally Menke, editor of seven films by Quentin Tarantino. Riegel became a member of Academy of Motion Picture Arts and Sciences in 2014 and was nominated for Best Film Editing in 2018 for I,Tonya.", null, null, 1, null, "nm0726186", "Editing", "Tatiana S. Riegel", new List<string> { "Tatiana S. Riegel, ACE" }, "USA", 2.8919999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mms5qpMvookGWLw2UZ54QqO9hES.jpg" },
                    { 33790, "Mario Morra (born 1935) is an Italian film editor, director and screenwriter.\n\nBorn in Rome, Morra began working as an assistant editor in the early 1960s, and made his debut as film editor in 1964. He gradually established himself up as one of the most representative of his profession, very active in art films as well as in less ambitious works. In 1990 he was nominated to BAFTA Award for Best Editing for Giuseppe Tornatore's Cinema Paradiso.\n\nIn the 1970s and 1980s, Morra was also director or writer of several successful documentaries and Mondo films, often in collaboration with Antonio Climati like Turbo Time a documentary about the world of car and motorcycle racing.\n\nSource: Article \"Mario Morra\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1935, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0606211", "Editing", "Mario Morra", new List<string>(), "Rome, Lazio, Italy", 4.1829999999999998, null },
