                    { 34377, "Bokuzen Hidari (左 卜全 Hidari Bokuzen, 20 February 1894 - 26 May 1971) was a Japanese actor and comedian born in Kotesashi Village (now part of Tokorozawa), Iruma District, Saitama Prefecture, Japan. He appeared in such films as Akira Kurosawa's Seven Samurai, The Lower Depths and Ikiru. Hidari was famous among Japanese audiences for his portrayals of meek, downtrodden men, and although a teetotaller, was renowned for his convincing drunk scenes (see esp. \"Ikiru\").", new DateTime(1894, 2, 20, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1971, 5, 26, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0383091", "Acting", "Bokuzen Hidari", new List<string> { "左卜全", "Бокудзэн Хидари" }, "Tokorozawa, Saitama Prefecture, Japan", 5.5010000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qYUGXKAwhLuVrJGiAmnBWAxToQb.jpg" },
                    { 34380, "Asakazu Nakai (Japanese: 中井朝一; August 29, 1901 – February 28, 1988) was a Japanese cinematographer, born in Kobe. He worked on a dozen films with filmmaker Akira Kurosawa. He was nominated for the Academy Award for Best Cinematography for his work in the film Ran (1985). In 1950 he won the award for Best Cinematography at the Mainichi Film Concours for Stray Dog.", new DateTime(1901, 8, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1988, 2, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0620014", "Camera", "Asakazu Nakai", new List<string> { "中井朝一" }, "Kobe, Hyōgo Prefecture, Japan", 5.415, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4ZpLw1cVZT5VhcN8kQG8m4XKZLk.jpg" },
