                    { 35013, "David Oyelowo (born April 1, 1976) is an English actor, director and producer. His family originates from Nigeria. David studied Theatre Studies for A level and his teacher suggested he should become an actor. After A levels David enrolled for a year on an Art foundation course. In December 2000 David became the first black actor to play an English monarch for the RSC taking the title role in Henry VI. His performance won him the 'Ian Charleson' Award 2001 for best newcomer in a classical play.", new DateTime(1976, 4, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0654648", "Acting", "David Oyelowo", new List<string> { "David Oyetokunbo Oyelowo", "데이빗 오예로워", "大衛·歐洛沃" }, "Oxford, Oxfordshire, England, UK", 13.847, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7UZHRwOKe2cYxj8SeNUklyPYkns.jpg" },
