                    { 35736, "Karan Johar often informally referred to as KJo,  is an Indian film director, producer, screenwriter, costume designer,  actor and television personality who is primarily known for his work in  Hindi films. He is the son of Hiroo Johar and the acclaimed producer Yash Johar.\n\nJohar made his directorial debut with the blockbuster romance Kuch Kuch Hota Hai (1998), which earned him the Filmfare Awards for Best Director and Best Screenplay. His next two films were the ensemble dramas Kabhi Khushi Kabhie Gham... (2001) and Kabhi Alvida Naa Kehna (2006), which were both very successful in the overseas market. His counter-terrorism drama My Name Is Khan (2010) earned him his second Filmfare Award for Best Director. These, along with the several successful films he has produced under the Dharma Productions banner, have established him as one of the leading director-producers in Hindi cinema.", new DateTime(1972, 5, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0424103", "Production", "Karan Johar", new List<string> { "KJo", " 	Karan Dharma Kama Johar", "Κάραν Τζόχαρ" }, "Mumbai, Maharashtra, India", 10.771000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zip1x7OXOBxXxcdYvKOgw6MnAWm.jpg" },
                    { 35740, "Sharmishta Roy is an Indian film art director and production designer who works predominantly in Hindi cinema.", null, null, 1, null, "nm0747181", "Art", "Sharmishta Roy", new List<string>(), null, 5.1050000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qCCd7KVlZzV1xxFoq9s6amiqSPF.jpg" },
                    { 35742, "Shah Rukh Khan (born November 2, 1965) is a prominent Bollywood actor and producer. He made his film debut in Deewana (1992). In 2005, the Government of India honoured him with the Padma Shri for his contributions towards Indian Cinema.\n\nIn 2003, he founded the motion picture production company Red Chillies Entertainment together with his wife Gauri Khan.", new DateTime(1965, 11, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.13377.org/shah-rukh-khan/", "nm0451321", "Acting", "Shah Rukh Khan", new List<string> { "SRK", "Shahrukh Khan", "शाहरुख़ ख़ान", "شاہ رخ خان", "Shah Rukh", "沙鲁克·汗", "Σαρούκ Καν", "Σαχ Ρουκ Κχαν", "King Khan", "Badshah", "சாருக் கான்", "ஷாருக்கான்", "沙·魯克·罕" }, "New Delhi, Delhi, India", 27.872, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tCEppfUu0g2Luu0rS5VKMoL4eSw.jpg" },
