                    { 35770, "Yash Raj Chopra was a highly accomplished Indian filmmaker. The founder of  film studio, Yash Raj Films - he was responsible for some of the most popular Bollywood films to come out of India in the past 40 years.  Chopra won several prestigious awards including the Filmfare Award for Best Director, the Dadasaheb Phalke Award and Padma Bhushan.", new DateTime(1932, 9, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 10, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0007181", "Directing", "Yash Chopra", new List<string> { "यश चोपड़ा", "Яш Чопра" }, "Shaheed Bhagat Singh Nagar, Punjab, India", 8.4570000000000007, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uDthb94NlawtgRT8BKufFkZdJR5.jpg" },
