                    { 36221, "Sam Anderson (born April 2, 1947) is an American actor. He is best known for his character roles such as Sam Gorpley on Perfect Strangers, Holland Manners on Angel, dentist Bernard Nadler on Lost, Happy Days-loving Doctor Harad who delivered Phoebe's triplets in Friends' 100th episode, and in film, as the principal in Forrest Gump.", new DateTime(1947, 4, 2, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0027402", "Acting", "Sam Anderson", new List<string>(), "Wahpeton, North Dakota, USA", 10.201000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\AnSyGuhjALUwUzMfQFhYMSJp4ra.jpg" },
