                    { 37821, "Michael Conner Humphreys was born in 1985 in Independence, Mississippi, USA. He is an actor, known for Forrest Gump (1994), Pathfinders: In the Company of Strangers (2011) and Little Forrest (2009).", new DateTime(1985, 3, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0402011", "Acting", "Michael Conner Humphreys", new List<string>(), "Independence, Mississippi, USA", 9.5600000000000005, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\irYRs3COggVHg91jL3CrlCIWmnx.jpg" },
                    { 37822, "Peter Dobson (born July 19, 1964) is an American actor. His film roles include appearances in Sing (1989), Last Exit to Brooklyn (1989), The Marrying Man (1991), The Frighteners (1996), and Drowning Mona (2000), in addition to a cameo as Elvis Presley in Forrest Gump (1994). On television, he starred as the title character in the CBS comedy Johnny Bago (1993) and the lead of the USA Network comedy-drama Cover Me (2000–2001).", new DateTime(1964, 7, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0229930", "Acting", "Peter Dobson", new List<string> { "Derek Hoyle" }, "Red Bank, New Jersey, USA", 8.2490000000000006, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hvBUOf3hLnjUGbZuSwZWG5m76ur.jpg" },
                    { 37823, "Sonny Shroyer was born in Valdosta, Georgia, a small city on the Georgia-Florida border. Shroyer, whose given name is Otis Burt Shroyer Jr., grew up steeped in the traditions of the deep South. He worked in the tobacco warehouses pushing tobacco buggies and helped his father in their fruit stand-ice cream parlor business. His prowess in high school football landed him a football scholarship at Florida State University (he later ended up playing football in the movie The Longest Yard (1974) with another FSU football player, Burt Reynolds). However, his football career was cut short by an injury, and Shroyer finished his education at the University of Georgia, where he earned his degree in business.", new DateTime(1935, 8, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0795449", "Acting", "Sonny Shroyer", new List<string>(), "Valdosta, Georgia, USA", 6.5629999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\f68GKDlKc2KVGfmDoGNTQdO45of.jpg" },
