                    { 38803, "Roman François Coppola (April 22, 1965) is the son of Francis Ford Coppola and an American filmmaker, screenwriter, producer, and entrepreneur. With the 2012 film Moonrise Kingdom, he and co-writer Wes Anderson were nominated for the Academy Award for Best Original Screenplay. His television series Mozart in the Jungle won the 2016 Golden Globe Award for Best Television Series – Musical or Comedy. In 2019, Coppola was invited to join the Academy of Motion Picture Arts and Sciences.\n\nCoppola serves as president of the San Francisco-based film company American Zoetrope. He is also the founder and owner of The Directors Bureau, a commercial and music video production company.  Coppola began his directing career by overseeing in-camera visual effects and second unit direction for Francis Ford Coppola's Bram Stoker’s Dracula, which garnered a BAFTA Award nomination for Visual Effects. He has continued to do second unit direction throughout his career, including his father's Jack, The Rainmaker, Youth Without Youth, and Tetro; collaborator Wes Anderson's The Life Aquatic with Steve Zissou and The Darjeeling Limited; and his sister Sofia Coppola's The Virgin Suicides and Marie Antoinette.\n\nIn the 1990s, Coppola established himself as an influential music video and commercial director. Through his production company, The Directors Bureau, he directed all four music videos for The Strokes' 2001 debut album, Is This It, as well as \"12:51\" for Room on Fire. His other music videos include clips for Daft Punk, Lilys, Moby, The Presidents of the United States of America, Ween, Green Day, and Fatboy Slim. His music video for Phoenix's \"Funky Squaredance\" was invited into the permanent collection at the New York Museum of Modern Art. He has also been a supporter of cousin Jason Schwartzman's musical side project, Coconut Records.\n\nHis first feature film, CQ, premiered at the 2001 Cannes Film Festival and was well-received critically. Set in Paris in 1969, CQ centers on a young film editor trying to juggle his personal and professional life while simultaneously juggling a science fiction adventure and his own personal art film. Coppola's second feature, A Glimpse Inside the Mind of Charles Swan III, debuted in 2012 at the Rome Film Festival. Charlie Sheen starred as the title character, a graphic designer dealing with a break-up. The cast also included Bill Murray and Jason Schwartzman. Reviews for the film tended toward the negative.\n\nCoppola is also an inventor and entrepreneur, responsible for the Photobubble Company, Pacific Tote Company, and a number of projects through the \"Special Projects\" arm of his production company.", new DateTime(1965, 4, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0178910", "Writing", "Roman Coppola", new List<string> { "Roman François Coppola" }, "Neuilly-sur-Seine, France", 8.8339999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dq454EhrDVKBsiYzuLr0IkKa18v.jpg" },
                    { 39614, "Blasco Giurato (born 7 June 1941) is an Italian cinematographer.\n\nBorn in Rome, Giurato is the brother of journalist Luca Giurato and of singer-songwriter Flavio Giurato. He was nominated to the BAFTA Award for Best Cinematography for Giuseppe Tornatore's Cinema Paradiso. In 1993, he won the Globo d'oro for the cinematography of Tornatore's A Pure Formality. In 1997, he was nominated for the David di Donatello for Best Cinematography for his work in Maurizio Zaccaro's The Game Bag.\n\nSource: Article \"Blasco Giurato\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1941, 6, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005721", "Camera", "Blasco Giurato", new List<string>(), "Rome, Lazio, Italy", 5.1239999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jgrj6D4uTbCbI3JKrItVsiISdcY.jpg" },
                    { 39618, "", new DateTime(1947, 6, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0224214", "Acting", "Nicola Di Pinto", new List<string>(), "Naples, Italy", 4.6829999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1TCh4CylEp4uLIaM2o2N6YSyyZg.jpg" },
                    { 39816, "Edward James Begley Sr. (March 25, 1901 – April 28, 1970) was an American actor of theatre, radio, film, and television.", new DateTime(1901, 3, 25, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1970, 4, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0003225", "Acting", "Ed Begley", new List<string> { "Edward Begley", "Edward James Begley" }, "Hartford, Connecticut, USA", 9.6669999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\AuPwjGgPphtfQOShb8pTtp5W7Ft.jpg" },
                    { 39996, "Sidney Lumet (June 25, 1924 – April 9, 2011) was an American director, producer and screenwriter with over 50 films to his name. He was nominated for the Academy Award as Best Director for 12 Angry Men (1957), Dog Day Afternoon (1975), Network (1976) and The Verdict (1982). He did not win an individual Academy Award, although he did receive an Academy Honorary Award and 14 of his films were nominated for various Oscars, such as Network, which was nominated for 10, winning 4.\n\nThe Encyclopedia of Hollywood states that Lumet was one of the most prolific directors of the modern era, making more than one movie per year on average since his directorial debut in 1957. He was noted by Turner Classic Movies for his \"strong direction of actors\", \"vigorous storytelling\" and the \"social realism\" in his best work. Film critic Roger Ebert described him as having been \"one of the finest craftsmen and warmest humanitarians among all film directors.\" Lumet was also known as an \"actor's director,\" having worked with the best of them during his career, probably more than \"any other director.\"\n\nLumet began his career as an Off-Broadway director, then became a highly efficient TV director. His first movie was typical of his best work: a well-acted, tightly written, deeply considered \"problem picture,\" 12 Angry Men (1957). From that point on Lumet divided his energies among other idealistic problem pictures along with literate adaptations of plays and novels, big stylish pictures, New York-based black comedies, and realistic crime dramas, including Serpico and Prince of the City. As a result of directing 12 Angry Men, he was also responsible for leading the first wave of directors who made a successful transition from TV to movies. In 2005, Lumet received an Academy Award for Lifetime Achievement for his \"brilliant services to screenwriters, performers, and the art of the motion picture.\" Two years later, he concluded his career with the acclaimed drama Before the Devil Knows You're Dead (2007).\n\nDescription above from the Wikipedia article Sidney Lumet, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", new DateTime(1924, 6, 25, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 4, 9, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0001486", "Directing", "Sidney Lumet", new List<string> { "西德尼·吕美特", "Сидни Люмет" }, "Philadelphia, Pennsylvania, USA", 15.109, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hjj3V2DkPJ46zo5uz9bsZQzAk6R.jpg" },
                    { 40039, "Joshua Regnall Stewart (born February 6, 1977) is an American actor best known for his role as Holt McLaren in the FX TV series Dirt. He was also cast as Brendan Finney in the final season of the NBC TV series Third Watch.", new DateTime(1977, 2, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1577637", "Acting", "Josh Stewart", new List<string> { "Τζος Στιούαρτ", "Joshua Regnall Stewart" }, "Diana, West Virginia, USA", 18.937999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\prgoT9fq5Z2ZCGmC1rrSZkq4wH9.jpg" },
                    { 40120, "", null, null, 2, null, "nm0125639", "Camera", "Brian 'Buzz' Buzzelli", new List<string>(), null, 0.97699999999999998, null },
                    { 40224, "Thomas Morris is an Austrian stage, film and television actor and published author. He studied acting at the Franz Schubert-Conservatory in Vienna, Austria.", new DateTime(1966, 5, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.thomas-morris.de", "nm0004623", "Acting", "Thomas Morris", new List<string>(), "Vienna, Austria", 8.7609999999999992, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5wFMGMbPs15tbwIulOkANsANeWx.jpg" },
                    { 40277, "Blumberg was nominated for an Oscar for Best Original Screenplay in 2010 for co-writing The Kids Are All Right.\n\nBlumberg made his directorial debut with the Hollywood film Thanks for Sharing starring Mark Ruffalo, Tim Robbins, Gwyneth Paltrow, Josh Gad, Joely Richardson, and Alecia Moore. The film is about sex addiction and how a group of New Yorkers deal with recovery.\n\nBlumberg grew up in Shaker Heights, Ohio, and graduated from University School. He is of Jewish descent.  He graduated from Yale University in 1991 with a BA in History, where Edward Norton was his roommate.", new DateTime(1969, 7, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0089742", "Writing", "Stuart Blumberg", new List<string> { "Stuart Ethan Blumberg" }, "Cleveland, Ohio, USA", 5.9809999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\28QBps35AtsONGU8yNXmKdoLmAB.jpg" },
