                    { 40349, "Erica Yohn was a talented American actress known for her contributions to film, television, and theatre. She showcased her versatility and skill in various roles throughout her career. Yohn gained recognition for her voice work in animated films, notably as Mama Mousekewitz in \"An American Tail\" and its sequel, \"An American Tail: Fievel Goes West.\" Her expressive voice brought characters to life, endearing her to audiences and securing her a place among the cherished performers in animated cinema. Yohn's dedication to her craft and memorable contributions in the realm of voice acting left a lasting impact on the entertainment industry.", new DateTime(1930, 10, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 1, 27, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0948361", "Acting", "Erica Yohn", new List<string>(), "Bronx, New York City, New York, USA", 4.5860000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ArpkNzcdaYQTjg6VdYtDFxAygIX.jpg" },
