                    { 40684, "David Leitch (born November 16, 1975) is an American filmmaker, actor, stunt performer and stunt coordinator who made his directorial debut on the 2014 action film John Wick with Chad Stahelski, though only Stahelski was credited. Leitch then directed the 2017 thriller film Atomic Blonde, starring Charlize Theron, and 2018's Deadpool 2, the sequel to the 2016 film. In 2019, he directed Hobbs & Shaw, a spin-off of the Fast & Furious franchise.", new DateTime(1975, 11, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0500610", "Directing", "David Leitch", new List<string> { "Дэвид Литч", "David M. Leitch", "デヴィッド・リーチ", "大衛·雷奇", "데이비드 리치", "ديفيد ليتش", "Девід Літч" }, "Kohler, Wisconsin, USA", 23.815999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\by8W1oRzWtapDRZIfpedAkkXY51.jpg" },
