                    { 42267, "Randy has been nominated for fifteen Oscars, an Emmy and a Grammy. He has received two Oscars: one for The Right Stuff, and one for The Incredibles. Randy was honored with the C.A.S. Career Achievement Award in 2010 and the MPSE Career Achievement Award in 2014. His career in radio and music recording made the transition to film industry in 1975, when he was hired on Apocalypse Now (1979) as a sound effects recordist.", new DateTime(1951, 8, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://randythomblog.wordpress.com", "nm0858378", "Sound", "Randy Thom", new List<string> { "David Randall Thoms", "David Randall Thom", "Randall Thom", "兰迪·汤姆" }, "Shreveport, Louisiana, USA", 6.3220000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\oWv5U4r7NcIlQjs0IxMWE3dsx2l.jpg" },
