                    { 42308, "Beau Starr (born September 1, 1944) is an American actor who has starred in movies and on television. He is known for his film role as Sheriff Ben Meeker in the 1988 hit horror movie Halloween 4: The Return of Michael Myers; he reprised his role in the 1989 sequel Halloween 5: The Revenge of Michael Myers as well as playing Henry Hill's Father in Martin Scorsese's Goodfellas. Many also remember him as Lt. Harding Welsh in Due South.", new DateTime(1944, 9, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0823462", "Acting", "Beau Starr", new List<string> { "Beau Davis " }, "Queens, New York, USA", 10.804, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yFNI54Z6lZGZ7jqeDvZ9UhyLEfB.jpg" },
