                    { 42824, "Actor and Stuntman Carl Ciarfalio has played dozens of anonymous henchman roles in action movies such as Death Wish 4: The Crackdown, License to Kill, and Rapid Fire. He achieved cinematic notoriety by being the infamous victim of when Joe Pesci decided to put a rival gangster's head in a vice in Casino.", new DateTime(1953, 11, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0161893", "Crew", "Carl Ciarfalio", new List<string> { "Carl N. Ciarfalio", "Carl Nick Ciafalio", "Carl Nick Ciarfalio", "Carl Ciarfallio", "Carl Ciarfallo", "Carl Ciarflio", "Carl Ciarfolio", "Carl Ciartalio", "Carl Ciafalio" }, "Alhambra, California, USA", 4.8440000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yADROfK7uJkmd8p3GyjxH8WZqRL.jpg" },
                    { 42961, "Jacqueline Lovell (born 9 December 1974) is an American actress born and raised in Southern California. Most of her roles have been in B-films and erotic movies.  From a very young age, she had the immense innate talent and enthusiasm for performance. She expressed this through school musicals and church plays from grade school through high school. In much of her free time, she was writing skits and performing them for her family. She attended many schools during her formative years, which instilled drive and independence in her. At eighteen, she went to Santa Monica College to pursue accounting and later landed a full time job as an accountant.\n\nHowever, she quickly realized her hunger was not being fulfilled. So she set sail and journeyed into the world of modeling. She quickly became the number one nude model in 1995 and was in over 150 magazines by '96. She completed more than 80 videos for Playboy, Penthouse and numerous independents.  After being in the industry for one year, Jacqueline's desire to grow as a person led her to acting classes. As she studied her craft, her vocation became clear. She was cast in lead roles for Full Moon Entertainment, Zalman King Productions, Mystique Films, and many more.", new DateTime(1974, 12, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0522550", "Acting", "Jacqueline Lovell", new List<string> { "Sara St. James", "Jacqueline Nyahay", "Jackie Lovell", "Andie Mcpherson", "Sara" }, "Southern California, California, USA", 12.872, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vIXpalWXdJZBsnS3zkjQZMjnV1L.jpg" },
                    { 43241, "Attilio Dottesio (16 July 1909 – 12 February 1989) was an Italian film character actor and singer.", new DateTime(1909, 7, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1989, 2, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0234581", "Acting", "Attilio Dottesio", new List<string> { "Dean Reese", "A. D'Ottesio", "Attilio D'Ottesio", "Attilio D'ottesio", "Attilio Diottesio", "Attilio Dottavio", "Attilio Dottosio", "Dan Reesy", "William Burke", "Aldo Dottesio" }, "Desenzano del Garda, Lombardy, Italy", 6.6740000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\Qe1u3NCklcxRKaua9JRVVRDEjy.jpg" },
