                    { 46592, "", null, null, 2, null, "nm0799135", "Art", "Domenic Silvestri", new List<string>(), null, 8.5570000000000004, null },
                    { 46921, "​From Wikipedia, the free encyclopedia\n\nMichael Jace (born July 13, 1965) is an American actor. He starred in State of Play with Russell Crowe. He is best known for his role as the bisexual Los Angeles Police Officer Julien Lowe in the FX drama The Shield. He can be see in Marshall Cook's next movie, Division III: Football's Finest. He also has starred in the movies The Replacements; playing a prison inmate turned football player, Forrest Gump; playing a member of the Black Panthers, The Fan; playing an arrogant ticket scalper, as well as an array of TV appearances including the 1995 HBO TV movie Tyson (as boxer Mitch Green), Law & Order, and the 1999 Fox TV movie Michael Jordan: An American Hero (as Jordan).\n\nDescription above from the Wikipedia article Michael Jace, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1965, 7, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0413052", "Acting", "Michael Jace", new List<string>(), "Paterson, New Jersey, USA", 8.7439999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dTHdnj0qfBx6sXr9cT4Xxu0AcIG.jpg" },
                    { 46929, "Ivonne Coll is a Puerto Rican stage, film and television actress and former Miss Universe Pageant, best known for playing series regular Alba Gloriana Villanueva on the comedy-drama series \"Jane the Virgin\", as well as recurring character Adrianna Vasquez on the television series \"Switched at Birth\".", new DateTime(1947, 6, 18, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.ivonnecoll.com", "nm0171583", "Acting", "Ivonne Coll", new List<string> { "Ivonne Coll Mendoza" }, "Fajardo, Puerto Rico", 10.832000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7cyzeWeX8zD4IwAUDfyE9BK8woY.jpg" },
                    { 47525, "", new DateTime(1956, 6, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0081070", "Acting", "Andrew Bicknell", new List<string>(), null, 12.196999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vmsE8VHaXGbkxvUYafsOCVc8iyQ.jpg" },
                    { 47533, "Paula Malcomson (born June 1, 1970) is a Northern Irish actress born in Belfast, Northern  Ireland. Malcomson is sometimes credited as Paula Williams. She starred  as \"Trixie\" in the HBO series Deadwood and Colleen in ABC's Lost. She  played the role of Amanda Graystone in the Battlestar Galactica spin-off  series Caprica, on the Sci Fi Channel, as well as the role of Maureen  Ashby on the FX Series Sons of Anarchy. Malcomson recently guest starred  in a March 2011 episode of Fringe. She will play Mrs. Everdeen in the  film adaptation of The Hunger Games, her first major starring movie  role.", new DateTime(1970, 6, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0539155", "Acting", "Paula Malcomson", new List<string> { "Паула Малкомсон", "Paula Malcolmson" }, "Belfast, Northern Ireland, UK", 22.806000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9lJy6ze86ZfVcBcyBK9UZq8FJiC.jpg" },
                    { 47756, "Archible Ernest \"Buck\" Houghton Jr. is chiefly remembered as producer of The Twilight Zone (1959) during its first three seasons (more than a hundred episodes in total), his influence palpable in all facets of production, from script selection to renting production facilities, to casting, scoring and editing. Houghton had graduated from UCLA with majors in English and economics. He was at that time known as 'Arch'. The origin of his nickname 'Buck' may have been the result of buck teeth as a child. His career began in Hollywood as back stage help on films by Cecil B. DeMille, then as reader for Val Lewton and story editor to David O. Selznick. Via subsequent stints at Paramount's casting and budget departments, the Office of War Information (where he worked on short propaganda films) and four years as executive assistant at RKO, Houghton worked his way up to television producer by the early 1950's. He served as associate producer on an excellent early action series, Yancy Derringer (1958), which is, sadly, almost forgotten today. William Self, who preferred to remain in his executive position with CBS, offered Houghton the job of producing \"The Twilight Zone\" and Houghton enthusiastically accepted, having perused the first two scripts. He became popular with many of the directors, for example Douglas Heyes (usually put in charge of more character-driven assignments like \"The Invaders\"), who regarded him as the best producer he ever worked with. Most importantly, Houghton complemented the creative genius of Rod Serling by his expertise in all minutiae of production.\n\nHoughton left \"Twilight Zone\" at the end of season three, having raised objections about extending the show to the -- as it turned out, much less suitable -- one-hour format. Few of his subsequent appointments proved entirely satisfactory: Houghton more often found his style cramped, clashing with stars he regarded as 'autocratic' (The Richard Boone Show (1963), Hawaii Five-O (1968)) or executive producers he disliked (Lost in Space (1965)). There were several more production credits to his name in the 80's -- mostly B-grade made-for-TV films -- before his retirement in 1994.", new DateTime(1915, 5, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1999, 5, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0396443", "Production", "Buck Houghton", new List<string> { "Archible Ernest \"Buck\" Houghton Jr." }, "Denver, Colorado, USA", 1.21, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\awYLIMQA0KiIfMsFvmipseorWZv.jpg" },
                    { 47774, "From Wikipedia, the free encyclopedia\n\nVincent Pastore (born July 14, 1946) is an Italian-American actor, often cast as a mobster and best known for the role of Salvatore \"Big Pussy\" Bonpensiero on The Sopranos.", new DateTime(1946, 7, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0665114", "Acting", "Vincent Pastore", new List<string> { "Vinny Pastore", "Vinnie Pastore" }, "Bronx, New York, USA", 16.611999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dyRRn8POwLUMHT7lIISujioYOym.jpg" },
                    { 48587, "", new DateTime(1959, 3, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0112393", "Acting", "Brian Brophy", new List<string>(), null, 6.3700000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cvC2xxeBgeGSQVBvqJBy7tVgiIw.jpg" },
                    { 49487, "Born in Heidelberg; a curious and shy boy; found the key for his world through passion for music, dance and theater; Richard studied music and drama in Germany, acting and direction in France and method acting with Susan Strasberg and Francesca de Sapio in Italy. He first went on stage in 1981 at the local theater Hildesheim, then, from 1983 in France on independent stages, at national theaters and in the streets. In 1989 he moved to Italy and met Susan Strasberg: His cinema debut was in 1990 starring in \"Il Piacere delle Carni\" by Barbara Barni. In 1993, he moved to Paris and got the leading role in the film version of Brechts/Eislers\" The Lindbergh's Flight\". Since then he has worked on film, television, theater and dance productions all over Europe, in Canada, South Africa, USA, Macedonia, Morocco which brought him happiness and a lot of richly diversified creative and thrilling experiences Richard lives in Berlin and Paris since 2007. He speaks 5 languages fluently, travels a lot and loves to be challenged. - IMDb Mini Biography By: r sammel", new DateTime(1960, 10, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0759898", "Acting", "Richard Sammel", new List<string>(), "Heidelberg, Germany", 8.1750000000000007, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\91IPxy0IuHhIqcrJdI0hYBpJmOg.jpg" },
                    { 49895, "Alfredo Sánchez Brell (23 February 1931 – 10 July 2010), born Alfredo Sánchez Brell,  was a Spanish stage and screen actor, director, and producer who appeared in over 150 films between 1961 and 1996. His parents were exiled to Mexico,  where Aldo began a football career in Puebla F.C., known as Madrileño Sánchez. When he returned to Spain he played for Alcoyano and Rayo Vallecano, and finally started to work as an actor.", new DateTime(1931, 2, 23, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2010, 7, 10, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0759757", "Acting", "Aldo Sambrell", new List<string> { "Aldo Sanbrell", "Alfredo Sambrell", "Alfred S. Brell", "Madrileño Sánchez" }, "Vallecas,  Madrid, Spain", 9.3979999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lJsoZtOeNaer5jZSydSjONL32xp.jpg" },
                    { 50784, "Antonio Costanzo Dimitri, also known as Antonio Di Mitri, Tony Di Mitri, Tony Dimitri and George Stevenson (Manduria, 12 June 1931 – Rome, 8 December 2019), was an Italian actor and singer.", new DateTime(1931, 6, 12, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 12, 8, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0224105", "Acting", "Tony Di Mitri", new List<string> { "Antonio Dimitri", "George Stevenson" }, "Manduria, Italy", 5.9900000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kEtaOz3d7QQUHSLMOqK9cYrEOrU.jpg" },
                    { 51302, "Joe grew up in Park Ridge and Wheaton, Illinois, for 27 years. Ever since watching Evel Knievel live at the old Chicago amphitheater jump 10 buses at age 8 and seeing Hooper (1978) in the theaters as an impressionable 13-year-old boy, he knew he wanted to become a Hollywood Stuntman.\n\nAfter many odd jobs, sales was his niche, but stunts always loomed in the background. He was a successful food broker, selling steak and seafood door to door throughout the Chicagoland area. When a stunt school opened in Chicago in 1988, Joe jumped at the opportunity. From there, he honed his stunt skills and learned about the motion picture industry, hustling sets and working as an extra. After several years he hustled the sets and got his big break doubling for Steven Seagal and hasn't looked back. Since then, Joe has also doubled for Arnold Schwarzenegger, Will Ferrell, John Cusack, Jeff Goldblum, David Hasselhoff, Dan Marino, and Vince Vaughn. He has been nominated twice for the World Stunt Awards and has won two Emmy awards for best action sequences for television.", new DateTime(1964, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0117851", "Crew", "Joe Bucaro III", new List<string> { "Joe Bocaro", "Giuseppe Bucaro III", "Joey Bucaro III", "Joseph Bucaro III", "Joey Bucaro", "Joe Bucaro", "Jon Bucaro", "Joseph Bucaro", "Ryder Joe Bucaro", "Joey Bucarro", "Joe Buccaro", "Joe Bucero", "Chicago Bucaro" }, "Wheaton, Illinois, USA", 3.0920000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gvJs1YQZRrSbkiSGAiCAugaXyzl.jpg" },
                    { 51333, "Claudio Miranda, ASC is a Chilean cinematographer. Miranda was born in Santiago to a Chilean father and a Danish mother. When he was a year old, he and his family emigrated to the United States. He is best known for his work on Ang Lee's film Life of Pi (2012), for which he won the Academy Award for Best Cinematography, and for David Fincher's film The Curious Case of Benjamin Button (2008), which was the first film shot entirely digitally to be nominated for the Academy Award for Best Cinematography and the American Society of Cinematographers Award. He is also known for his collaborations with American director Joseph Kosinski. He is the second Chilean person to win an Academy Award.", new DateTime(1965, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0592073", "Camera", "Claudio Miranda", new List<string>(), "Valparaíso, Chile", 2.4470000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nrNR3DeuX4kfPmv7POrVlRO22UX.jpg" },
                    { 51637, "", new DateTime(1955, 9, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0696341", "Acting", "Antonio Prester", new List<string> { "Antonino Prester", "Nino Prester" }, "Palermo, Sicily, Italy", 3.2869999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\z8wGJL9bCiHrXi31zvmcngZP5S5.jpg" },
                    { 51651, "", new DateTime(1965, 10, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.assboeck.de/", "nm0039784", "Acting", "Joachim Paul Assböck", new List<string> { "Yoakhim Paul Assbek", "Joachim Paul Assboeck", "Joachim Assboeck", "Joachim P. Assböck", "Joachim-Paul Assböck", "Joachim Assböck", "Paul Assböck", "Joachim P. Asspöck" }, "Cologne, Germany", 6.1139999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dR5xVd4z7LtkUwpLn9ks92z1cqU.jpg" },
                    { 51656, "James Quattrochi arrived in Los Angeles in 1991 - a young actor wanting to expand his involvement in the film industry. Having acted in many interesting projects his dream was to take his talents behind the camera. In 1995 James produced and stared in, In the Kingdom of the Blind, with William Petersen, Paul Winfield and Michael Biehn. The film was an official selection of the Palm Springs Film Festival and The Santa Barbara Film Festival. \"Kingdom\" went on to receive worldwide distribution, allowing James to follow up this project by directing the critically acclaimed film \"True Friends\". This film won the Charleston International Film Festival and James was voted \"Best Up And Coming Director\" by the Laifa Film Awards, with James receiving a letter of endorsement from director Martin Scorcese. The film was also honored with the Imagen Award, having been chosen over \"The Mask of Zorro\".\n\nJames followed \"True Friends\" by directing \"Jesus, Mary and Joey, starring Olympia Dukakis, Charles Durning, Stacy Keach, Jennifer Esposito, Marley Shelton, Leo Rossi, Jason Gedrick and Mellisa Joan Hart. James then took on the immense challenges of producing Choker, a film that was conceived, written, cast and shot in the span of only nine weeks.\n\nLast year James was hired to produce \"All In\" A father and daughter who get caught up in the world of championship poker, the film stars Dominique Swain, Michael Madsen, Academy Award Winner Louis Gossett, Jr., and James Russo. This film now has world wide distribution through Fox.\n\nHis recent project \"The Prince and The Pauper\" James produced and directed this feature film starring The Sprouse Twins. Sony Pictures has signed on to distribute the film.", new DateTime(1961, 6, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0006786", "Acting", "James Quattrochi", new List<string> { "James Quarter" }, "Bronx, New York, USA", 7.8899999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fy7pSTUy6JfZRdaYhsTWNZ84IHw.jpg" },
                    { 52164, "", new DateTime(1955, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0455135", "Costume & Make-Up", "Peter Swords King", new List<string> { "Peter 'Swords' King", "Peter \"Swords\" King", "Peter King", "Peter Swords-King" }, "UK", 2.5630000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\d6EybfjAJKCl7PM5orYeTsnOo0P.jpg" },
