                    { 52603, "Alfonso Rene Freeman is an American actor. He has appeared in such films as The Shawshank Redemption, Seven, Nurse Betty, Ten 'til Noon and The Bucket List. Wikipedia", new DateTime(1959, 9, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0293285", "Acting", "Alfonso Freeman", new List<string>(), "Los Angeles, California, USA", 12.609999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9H4wX5clEpFfD3SG2JPoGH3LIgV.jpg" },
                    { 52657, "Vincenzo \"Enzo\" Cannavale (5 April 1928 – 18 March 2011) was an Italian film actor. He appeared in more than 100 films since 1949, including Cinema Paradiso, which won the Academy Award for Best Foreign Language Film at the 62nd Academy Awards in 1990. He was awarded the Nastro d’Argento for Best Supporting Actor in 32 dicembre (December 32nd) by Luciano De Crescenzo.\n\nSource: Article \"Enzo Cannavale\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1928, 4, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 3, 18, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0134073", "Acting", "Enzo Cannavale", new List<string> { "Vincenzo Cannavale" }, "Castellammare di Stabia, Campania, Italy", 18.477, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qKTBcs4UEwBhZIeYBpVcDjZVJKg.jpg" },
                    { 53010, "From Wikipedia, the free encyclopedia\n\nJohn Herrick McIntire (June 27, 1907 – January 30, 1991) was an American character actor who appeared in 65 theatrical films and many more television series. McIntire is well known for having replaced Ward Bond, upon Bond's sudden death in November 1960, as the star of NBC's Wagon Train. He played Christopher Hale, the leader of the wagon train (and successor to Bond's character, Seth Adams) from early 1961 to the series' end in 1965. He also replaced Charles Bickford, upon Bickford's death in 1967, as ranch owner Clay Grainger (brother of Bickford's character) on NBC's The Virginian for four seasons.\n\nMcIntire died on January 30, 1991 (aged 83) from emphysema and lung cancer in Pasadena in Los Angeles County. Aside from Nolan, he was also survived by their daughter, Holly McIntire-Wright and a grandson Luke Wright. McIntire and Nolan's son, actor/musician Tim McIntire, predeceased his parents, having died in 1986 from heart problems.  CLR", new DateTime(1907, 6, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1991, 1, 30, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0570615", "Acting", "John McIntire", new List<string> { "John Herrick McIntire", "John McIntyre", "John Mc.Intire", "John Mc.Intyre" }, "Spokane, Washington, USA", 12.218999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\knjm7tflaLTysmynYUnvJgv5wIq.jpg" },
                    { 53196, "Sergio Salvati is an Italian cinematographer. His father, Aldofo Salvati, was a key grip in the early days of Italian cinema, and through his father's contacts Sergio began his career developing negatives in a small photographic laboratory in Rome. In 1956, his father was working with Enzo Serafin, who asked Sergio to work with him as camera assistant on Raw Wind in Eden starring Esther Williams and Jeff Chandler. Many other films shot in Italy would follow, both cult classics and commercial cinema.", new DateTime(1938, 6, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0759331", "Camera", "Sergio Salvati", new List<string>(), "Roma, Italy", 4.516, null },
                    { 53401, "John \"Johnny\" Anthony Williams also known as \"Johnny Roast beef\" Williams is an American character actor with nearly 100 credits to his name. He is perhaps best remembered as Johnny Roastbeef in the Martin Scorsese classic Goodfellas (1990). He is also appeared in the Movies The Mask (1994) alongside Cameron Diaz and Jim Carrey as well as  Greenbook (2018) which starred Viggo Mortensen Mahershala Ali. He has also made dozens of appearances in tv shows.", null, null, 2, null, "nm0930971", "Acting", "Johnny Williams", new List<string> { "John Anthony Williams", "Johnny 'Roastbeef' Williams", "John Williams" }, null, 11.005000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mQNhYK7SCzj6TY6m764ROposuRY.jpg" },
