                    { 54855, "Joseph Pilato (March 16, 1949 - March 24, 2019) was an American film and voice actor.", new DateTime(1949, 3, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2019, 3, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0683334", "Acting", "Joseph Pilato", new List<string> { "Joe Pilato", "Joey Pal" }, "Boston, Massachusetts, USA", 6.5579999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\msCVPwTXO9jWOhY6IGb6FP8oH6b.jpg" },
                    { 55061, "Kajol (born Kajol Mukherjee, 5 August 1974), also known by her married name Kajol Devgan, is an Indian film actress, who predominantly works in Hindi cinema. Born in Mumbai to the Mukherjee-Samarth family, she is the daughter of actress Tanuja Samarth and late filmmaker Shomu Mukherjee. Regarded as one of India's most successful and highest-paid actresses, Kajol is the recipient of numerous accolades, including six Filmfare Awards, among twelve nominations. Along with her late aunt Nutan, she holds the record for most Best Actress wins at Filmfare, with five. In 2011, the Government of India awarded her with the Padma Shri, the fourth highest civilian honour of the country.\n\nAfter making her acting debut in the 1992 romance Bekhudi, with her mother Kajol had her first commercial success with the 1993 thriller Baazigar. She rose to prominence by featuring as the female lead in five of India's annually top-grossing romances—Yeh Dillagi (1994), Ishq (1997), Pyaar Kiya To Darna Kya (1998), Pyaar To Hona Hi Tha (1998) and Hum Aapke Dil Mein Rehte Hain (1999)—and received wide critical recognition for playing against type in the 1997 mystery film Gupt: The Hidden Truth, that earned her a Filmfare Award for Best Villain, and the 1998 psychological thriller Dushman. Her acclaimed portrayal of a conservative NRI in the blockbuster romance Dilwale Dulhania Le Jayenge (1995), a tomboy in the blockbuster romance Kuch Kuch Hota Hai (1998), a lower middle class Punjabi woman in the blockbuster melodrama Kabhi Khushi Kabhie Gham... (2001), a blind Kashmiri woman in the romantic thriller Fanaa (2006) and a divorced, single mother in the drama My Name Is Khan (2010) garnered her five Filmfare Awards for Best Actress. Following a five-year sabbatical from full-time acting in 2001, Kajol received praise for portraying the lead female roles in the dramas U Me Aur Hum (2008) and We Are Family (2010), and the comedy Dilwale (2015).\n\nIn addition to acting in films, Kajol is a social activist and is noted for her work with widows and children, for which she received the Karmaveer Puraskaar in 2008. She has featured as a talent judge for Zee TV's reality show Rock-N-Roll Family and holds a managerial position at Devgn Entertainment and Software Ltd. Kajol has been married to actor Ajay Devgn since 1999, with whom she has two children.", new DateTime(1974, 8, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0004418", "Acting", "Kajol", new List<string> { "Kajol Mukherjee", "Kajol Devgan", "काजोल देवगन", "काजोल", "काजोल मुखर्जी", "카졸" }, "Mumbai, Maharashtra, India", 23.579000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\h4m0TkDuEMCUNaPrQxMRyFb2AQ7.jpg" },
