                    { 55667, "Tooru Hara is a Japanese producer. He joined Toei Douga in 1959 and founded Top Craft in 1972 when Toei Douga dismissed many of its employees. After the company was reorganised into Studio Ghibli, he became its CEO until 1991, when he left the company and was succeeded by Toshio Suzuki.", new DateTime(1935, 12, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0361701", "Production", "Tooru Hara", new List<string> { "Toru Hara", "Tohru Hara", "原 徹" }, "Fukuoka Prefecture, Japan", 2.1659999999999999, null },
