                    { 56112, "David Lee Smith (born September 8, 1963) is an American actor, known for his role as John Oldman, the protagonist of the 2007 science fiction film, The Man from Earth and its 2017 sequel, The Man from Earth: Holocene; he co-starred with John Billingsley and Tony Todd. He has also appeared in other movies, including Fight Club, and dozens of television episodes, some as a recurring character such as IAB Sergeant Rick Stetler in CSI: Miami.", new DateTime(1963, 9, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0807900", "Acting", "David Lee Smith", new List<string>(), "Birmingham, Alabama, USA", 8.9459999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\A3vP0a0CqmQSdslPRnEYDiyIZ3V.jpg" },
