                    { 57597, "Ron Dean (born August 15, 1938) is an American film and television actor. He appeared in films including Rudy, Risky Business, The Breakfast Club, Cocktail, The Babe, The Fugitive, The Client, and The Dark Knight. He is known for often playing detectives and other law-enforcement characters, most notably Det. Marion Zeke Crumb in the television show Early Edition.", new DateTime(1938, 8, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0212939", "Acting", "Ron Dean", new List<string>(), "Chicago, Illinois, USA", 9.4719999999999995, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mgqdr4VFrTVZatkki2suNLYxeDG.jpg" },
                    { 58015, "", null, null, 2, null, "nm0582338", "Production", "Ricardo Mestres", new List<string>(), null, 1.8029999999999999, null },
                    { 58535, "Paul Herman (March 29, 1946 - March 29, 2022) was an American actor. Among other roles, he was known for playing Randy in David O. Russell's dramedy Silver Linings Playbook (2012) and Whispers DiTullio in Martin Scorsese's crime epic The Irishman (2019).\n\nHis other appearances in movies include Once Upon a Time in America, At Close Range, We Own the Night, Heat, Crazy Heart, Quick Change, Sleepers, Cop Land, The Fan, Analyze That, The Day Trippers, and American Hustle. He had a recurring role on The Sopranos as \"Beansie\" Gaeta, as well as another HBO series, Entourage, as Vincent Chase's accountant, Marvin.\n\nHerman had also played minor background characters in two other Scorsese crime films. In Goodfellas, he was The Pittsburgh Connection, and in the montage sequence 'Back Home, Years Ago' in Scorsese's Casino, he was a gambler who rushes to the phone booth to place the same bet that Sam Rothstein (Robert De Niro) did.\n\nIn 2009's Crazy Heart, Herman played the manager of Jeff Bridges' character.\n\nHerman, along with his brother Charlie, ran the Columbus Cafe in the 1990s. Located across from Lincoln Center, it was frequented by actors, ballet dancers, gangsters, and FBI and DEA agents. Herman also had a small ownership stake in the cafe, along with Mikhail Baryshnikov as well as other actors.\n\nSource: Article \"Paul Herman\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1946, 3, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 3, 29, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0379200", "Acting", "Paul Herman", new List<string>(), "Brooklyn, New York,  USA", 6.056, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4UMlDFKuOZ71hNPaSl8e4vVnA9N.jpg" },
                    { 58549, "William Mills Irwin (born April 11, 1950) is an American actor, clown, and comedian. He began as a vaudeville-style stage performer and has been noted for his contribution to the renaissance of American circus during the 1970s. He has also made a number of appearances on film and television, and he won a Tony Award for his role in Who's Afraid of Virginia Woolf on Broadway. He is also known as Mr. Noodle on the Sesame Street segment Elmo's World, has appeared in the Sesame Street film short Does Air Move Things?, and regularly appeared as a therapist on Law & Order: Special Victims Unit.", new DateTime(1950, 4, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0410347", "Acting", "Bill Irwin", new List<string> { "William Irwin", "Fool Moon ", "比爾·歐文" }, "Santa Monica, California, USA ", 10.722, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bAV5qsljgiHQkn3QluB5clVYC13.jpg" },
                    { 58552, "From Wikipedia, the free encyclopedia\n\nBurr Gore Steers (born October 8, 1965) is an American actor, screenwriter and director.\n\nDescription above from the Wikipedia article Burr Steers, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1965, 10, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0824882", "Directing", "Burr Steers", new List<string> { "Burr Gore Steers" }, "Washington, D.C.", 6.6059999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\k9rAVWornL0SUIykpjd3K3IfSll.jpg" },
                    { 58692, "Melinda McGraw (born October 25, 1968) is an American actress. She has starred in movies such as The Dark Knight (2008), Wrongfully Accused (1998), and Skateland (2010), and is also known for her television performances on NCIS, Mad Men, Men of a Certain Age, The X-Files, The West Wing and The Commish.\n\nMcGraw has starred in The Pursuit of Happiness (1995), Soul Man (1997–1998), Living in Captivity (1998), Wednesday 9:30 (8:30 Central) (2002), and Center of the Universe (2004).\n\nNotable guest appearances include Quantum Leap, Night Court, Seinfeld, Cybill, The Larry Sanders Show, Mad About You, The District, The Practice, and Inconceivable. She has been featured in four episodes of Desperate Housewives as Annabel Foster.", new DateTime(1963, 10, 25, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0569927", "Acting", "Melinda McGraw", new List<string>(), "Nicosia, Cyprus", 15.131, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\negqs0C6FVhBTTjuZDteecw2WYg.jpg" },
                    { 58809, "", null, null, 2, null, "nm0457725", "Directing", "Martin Kitrosser", new List<string> { "Marty Kitrosser", "Martin 'The Cobra' Kitrosser" }, null, 6.423, null },
                    { 59285, "Ezra Buzzington is \"that guy\" from \"Oh, that guy!\". He's been in dozens of popular films but isn't one you'd recognize on the street. He's worked twice with David Fincher, Terry Zwigoff, Rob Zombie and Alexandre Aja. Other directors include George Clooney, the Farrelly Brothers, Paul Thomas Anderson and Chris Nolan. You know him. You just don't know you know him.", new DateTime(1957, 4, 7, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0125653", "Acting", "Ezra Buzzington", new List<string>(), "Muncie, Indiana, USA", 6.5659999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\j3kJRKgQdHAMXvJUtPHXJsGGW5X.jpg" },
