                    { 59839, "Harvey Weinstein (born March 19, 1952) is an American former film producer and convicted sex offender. He and his brother Bob Weinstein co-founded the entertainment company Miramax, which produced successful independent films including Sex, Lies, and Videotape (1989), The Crying Game (1992), Pulp Fiction (1994), Heavenly Creatures (1994), Flirting with Disaster (1996), and Shakespeare in Love (1998). After leaving Miramax, Weinstein and his brother Bob founded The Weinstein Company, a mini-major film studio. He was co-chairman, alongside Bob, from 2005 to 2017.\n\nDescription above from the Wikipedia article Harvey Weinstein, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1952, 3, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0005544", "Production", "Harvey Weinstein", new List<string>(), "New York City, New York, USA", 10.582000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yUeo7hPc6fdHB2vy2zkGqg3bJyv.jpg" },
                    { 60121, "", null, new DateTime(2022, 2, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0223653", "Acting", "John Di Benedetto", new List<string> { "John DiBenedetto" }, null, 4.242, null },
                    { 60628, "Andrea Morricone (born 10 October 1964) is an Italian composer and conductor, known for his film scores. He is the third child, and second son, of late composer and Academy Award winner Ennio Morricone. He composed the film scores for the American films Capturing the Friedmans and Liberty Heights. He collaborated with his father on the score for Cinema Paradiso, for which they won a BAFTA Award for For Best Original Film Music. The Love Theme from Cinema Paradiso is a work by Andrea Morricone. He has also composed music for many other Italian films, including The Inquiry and The Entrepreneur.\n\nSource: Article \"Andrea Morricone\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1964, 10, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0606297", "Sound", "Andrea Morricone", new List<string>(), "Rome, Lazio, Italy", 4.2880000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cthoyITrrNWZMzwMsHrFyAJePc6.jpg" },
