                    { 61981, "Michael Clarke Duncan (December 12, 1957 - September 3, 2012) was an American film and television actor, best known for his breakout role as John Coffey in the feature film The Green Mile, which netted him an Academy Award nomination for Best Actor in a Supporting Role and a Golden Globe nomination for Best Performance by an Actor in a Supporting Role in a Motion Picture.", new DateTime(1957, 12, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 9, 3, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0003817", "Acting", "Michael Clarke Duncan", new List<string> { "Michael Duncan", "Michael Clark Duncan", "Michael C. Duncan", "Michael 'Big Mike' Duncan" }, "Chicago, Illinois, USA", 14.648, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3RX8OBqt3gbvFwKYZqiom4O3Ta6.jpg" },
