                    { 63537, "", new DateTime(1961, 7, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0521025", "Acting", "Scotch Ellis Loring", new List<string>(), "Limestone, Maine, USA", 4.1219999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qIvaaeBTZWwtJxJfBqpM4xBnwXE.jpg" },
                    { 64856, "An American actor and professional martial artist who has appeared in numerous films and television series. He is the first African American to portray a major comic book superhero in a major motion picture, having starred as Al Simmons, the protagonist in the 1997 film Spawn. White was born in Brooklyn, New York and moved as a teen to Bridgeport, Connecticut, where he graduated from Central High School in 1988. White started martial arts training at the age of seven and is now an accomplished martial artist, holding seven legitimate black belts in Shotokan, Tae Kwon Do, Kobudo, Goju Ryu, Tang Soo Do, Wushu and Kyokushin, with a specific focus in Kyokushin (although his style incorporates aspects of many different martial arts forms). His first major starring role and breakout performance was in the 1995 HBO film Tyson, as heavyweight boxer Mike Tyson. In 1997, he portrayed the eponymous character in the 1997 movie Spawn. His work in Spawn earned him a nomination for the Blockbuster Entertainment Award for Best Male Newcomer. White starred opposite Jean-Claude Van Damme in Universal Soldier: The Return. In 2001, he also starred opposite fellow martial artist Steven Seagal in Exit Wounds. In 2003, he starred in Busta Rhymes' and Mariah Carey's music video \"I Know What You Want\". Since 2003, in addition to his on screen roles, White has been doing voice work, including Static Shock, Justice League, and the Spawn animated series. White showcases his martial arts skills in the direct-to-DVD film Undisputed II: Last Man Standing. He also appears in Michelle Yeoh's Silver Hawk in 2004. His film, Why Did I Get Married? opened at number one at the box office on October 12, 2007. White played the role of the mob boss Gambol in the 2008 film The Dark Knight. He also starred in the film Blood and Bone and the Blaxploitation homage Black Dynamite, both released in 2009. White wrote the scripts for both Black Dynamite and his upcoming 3 Bullets in which he stars with Bokeem Woodbine. White will make his directorial debut and star in Never Back Down 2, which is slated for a 2011 release. In August 2005 he wed his girlfriend of two years, Courtenay Chatman. The couple have a daughter named Morgan Michelle who was born on December 24, 2008. Michael has two sons from a previous relationship. He is an avid chess player, as seen in his movie Blood and Bone.", new DateTime(1967, 11, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.michaeljaiwhite.com/", "nm0925220", "Acting", "Michael Jai White", new List<string> { "麥可・傑・懷特" }, "Brooklyn, New York City, New York, USA", 38.088000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\YPoHYuzR37wFpPpwEXZYQlhLln.jpg" },
                    { 65314, "Giuseppe Tornatore (born 27 May 1956) is an Italian film director and screenwriter.  Born in Bagheria near Palermo, Tornatore developed an interest in acting and the theatre from at least the age of 16 and put on works by Luigi Pirandello and Eduardo De Filippo.  He worked initially as a freelance photographer. Then, switching to cinema, he made his debut with Le minoranze etniche in Sicilia (The Ethnic Minorities in Sicily), a collaborative documentary film which won a Salerno Festival prize. He then worked for RAI before releasing his first full-length film, Il Camorrista, in 1985. This evoked a positive response from audience and critics alike and Tornatore was awarded the Silver Ribbon for best new director.  Tornatore's best known screen work was released in 1988: Nuovo Cinema Paradiso, a film narrating the life of a successful film director who has returned to his native town in Sicily for the funeral of his mentor. This obtained worldwide success and won an Academy Award for Best Foreign Language Film. Subsequently Tornatore released several other films. In 2007 he won the Silver George for Best Director at the 29th Moscow International Film Festival for The Unknown Woman.", new DateTime(1956, 5, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0868153", "Directing", "Giuseppe Tornatore", new List<string> { "Peppuccio Tornatore" }, "Bagheria, Sicilia, Italia", 5.2850000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pjVrtNGsCSNs5IeRVr34PMn1hVR.jpg" },
