                    { 68186, "Dominic Chianese (born February 24, 1931) is an American actor, singer, and musician. He is best known for his roles as Corrado \"Junior\" Soprano on the HBO series The Sopranos (1999–2007), Johnny Ola in The Godfather Part II (1974), and Leander in Boardwalk Empire (2011–2013).\n\nDescription above from the Wikipedia article Dominic Chianese, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1931, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0156940", "Acting", "Dominic Chianese", new List<string> { "Доминик Кьянезе" }, "Bronx, New York City, New York, USA", 4.8449999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2H6SwlN5TSgJI6RmCXskzX5QYFz.jpg" },
