                    { 68909, "Hong Kyung-pyo (Korean: 홍경표, born August 11, 1962) is a South Korean cinematographer. He has worked with several acclaimed Korean directors, including Bong Joon-ho, Lee Chang-dong, and Na Hong-jin.\n\nZack Sharf praised him as one of 30 cinematographers to watch, praising his \"dynamic camerawork\". The director he has done the most work with, Bong Joon-ho, stated that any future Korean films he opted to do would use Hong as his cinematographer.", new DateTime(1962, 8, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0393240", "Camera", "Hong Kyung-pyo", new List<string> { "홍경표", "Hong Gyeong-pyo", "Hong Kyeong-pyo", "Alex Hong", "洪坰杓（豆瓣）", "洪庆表（dorama.info）" }, "South Korea", 7.5279999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mFl2oMc8UK5Ia4zEsPOgKbN1NMC.jpg" },
