                    { 69948, "William Bowers (Las Cruces, 1916 - Woodland Hills, California, 1987) was a reporter in Long Beach, California before becoming a screenwriter and specializing in writing comedy westerns and also turned out several thrillers. His first credited screenplay was My Favorite Spy in 1942.\n\nHis career noticeably picked up after his Oscar nomination for the gritty Gregory Peck Western The Gunfighter in 1950, leading to such assignments as the remake of My Man Godfrey in 1957 and The Sheepman in 1958 (a second Oscar nomination).\n\nBowers produced the last film that he wrote, the superior Western parody Support Your Local Sheriff! (1969). He also had a bit part as an actor in The Godfather Part II (1974).", new DateTime(1916, 1, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1987, 3, 27, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0101115", "Writing", "William Bowers", new List<string>(), "Las Cruces, New Mexico, USA", 4.1619999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vpcZRLHdB6zJuKkvGhNTfvMKIdp.jpg" },
                    { 70083, "", new DateTime(1963, 4, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0041066", "Acting", "Antonella Attili", new List<string>(), "Roma, Lazio, Italy", 14.231, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hoLib8DJzJ7fPQhtUjmo5n4ntu0.jpg" },
                    { 70129, "Takao Saito (斎藤 孝雄 Saitō Takao, March 5, 1929 – December 6, 2014) was a Japanese cinematographer who frequently collaborated with filmmaker Akira Kurosawa. He was nominated for the Academy Award for Best Cinematography for his work in the film Ran (1985).", new DateTime(1929, 3, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2014, 12, 6, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0756912", "Camera", "Takao Saitō", new List<string> { "斎藤 孝雄", "Takao Saitô" }, "Kyoto, Japan", 2.278, null },
                    { 70131, "​From Wikipedia, the free encyclopedia.  \n\nTatsuya Nakadai (仲代 達矢 Nakadai Tatsuya,  born Motohisa Nakadai December 13, 1932) is a Japanese leading film actor. He became a star after he was discovered working as a Tokyo shop clerk by filmmaker Masaki Kobayashi during the early 1950s. He became the favorite leading man of internationally-acclaimed director Akira Kurosawa after a well publicized fallout between Kurosawa and the legendary Toshirō Mifune. Beginning in the late 1950s, he worked with a number of Japan's best-known filmmakers, starring or co-starring in five Kurosawa films, along with significant films made by Hiroshi Teshigahara (The Face of Another), Mikio Naruse (When a Woman Ascends the Stairs), Kihachi Okamoto (Kill! and Sword of Doom), Hideo Gosha (Goyokin), Shiro Toyoda (Portrait of Hell) and Kon Ichikawa (Enjo and Odd Obsession). Notably, his long-term collaboration with Masaki Kobayashi invites comparison to the working relationship between Akira Kurosawa and Toshirō Mifune. Nakadai was featured in 11 Kobayashi films including the The Human Condition trilogy, Harakiri, Samurai Rebellion and Kwaidan. The Thick-Walled Room marked Nakadai's acting debut. His next role was a little noticed and uncredited one in Akira Kurosawa's Seven Samurai where he appears for a few seconds as a samurai wandering about town.\n\nDescription above from the Wikipedia article Tatsuya Nakadai, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1932, 12, 13, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.mumeijuku.net/", "nm0619938", "Acting", "Tatsuya Nakadai", new List<string> { "仲代達矢", "Тацуя Накадай", "Tatsuya Nakadaki", "仲代达矢" }, "Tokyo, Japan", 9.9770000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4LygOe0vFQplLIft5IUWI5OewPX.jpg" },
