                    { 72888, "Francisco Braña Pérez (Pola de Allande, Asturias, February 24, 1934 - Majadahonda, February 13, 2012) was a Spanish actor.", new DateTime(1934, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 2, 13, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0106394", "Acting", "Frank Braña", new List<string> { "Francisco Braña Pérez", "Frank Blank", "Francisco Brama", "Franck Brana", "Frank Brana", "Paco Brana", "Francisco Braña", "Paco Braña" }, "Pola de Allande, Asturias, Spain", 17.341000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\pm3atvF3WIxv1RsVSLeie5YSKjy.jpg" },
