                    { 74091, "Makoto Niitsu (新津 誠, Niitsu Makoto), known as Makoto Shinkai (新海 誠, Shinkai Makoto) is a Japanese animation director, author, and manga artist. Shinkai began his career as a video game animator with Nihon Falcom in 1996, and gained recognition as a filmmaker with the release of the original video animation (OVA) She and Her Cat (1999). Beginning his longstanding association with CoMix Wave Films, Shinkai then released the science-fiction OVA Voices of a Distant Star in 2002, and followed this with his debut feature film The Place Promised in Our Early Days (2004). Shinkai's second feature film, the romantic drama anthology 5 Centimeters per Second (2007), gained critical acclaim, as did his subsequent releases, the dramas Children Who Chase Lost Voices (2011) and The Garden of Words (2013). Shinkai's 2016 fantasy romance Your Name was a critical and commercial success, becoming the third highest-grossing anime film of all time. His 2019 film, Weathering with You, also achieved similar critical and commercial success. His seventh film, Suzume, was released in Japan in November 2022.", new DateTime(1973, 2, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1396121", "Directing", "Makoto Shinkai", new List<string> { "신카이 마코토", "新海诚", "Макото Шінкай", "しんかい まこと", "मकोतो शिनकाई", "Makoto Niitsu", "新海 誠" }, "Koumi, Japan", 32.012999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mSCk6PmAR99bCsKJYlMx94vq5qe.jpg" },
                    { 74401, "Hoyte van Hoytema (born 4 October 1971) is a Dutch-Swedish cinematographer. Hoytema is also known for his collaborations with director Christopher Nolan, having shot Interstellar (2014), Dunkirk (2017), Tenet (2020), and Oppenheimer (2023). His work has been highly praised by film critics and audiences alike and has earned him multiple awards, including an Academy Award from two nominations and a BAFTA Award from four nominations for Best Cinematography.", new DateTime(1971, 10, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0887227", "Camera", "Hoyte van Hoytema", new List<string> { "Hoyte van Hoytema II" }, "Horgen, Switzerland", 9.4130000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\y2HXvac1oPzciwxfdyWc5syThRk.jpg" },
