                    { 76064, "Kathleen Beller (born February 19, 1956, in Westchester, New York) is an actress. She was nominated for a Golden Globe Award for Best Motion Picture Actress in a Supporting Role for her role in Promises in the Dark (1979). She was noted for her youthful appearance, unusually long hair, large brown eyes and buxom figure.\n\nDescription above from the Wikipedia article Kathleen Beller, licensed under CC-BY-SA, full list of contributors on Wikipedia.​", new DateTime(1956, 2, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0000898", "Acting", "Kathleen Beller", new List<string> { "Kathy Beller" }, "Westchester, New York, USA", 15.782999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vhJMUW99Jka8ISQc3Po0BPAAGE4.jpg" },
                    { 77295, "​From Wikipedia, the free encyclopedia.\n\nJesse V. Johnson is a stunt coordinator and filmmaker, born on November 29, 1971, in Winchester, England, UK.\n\nJohnson has made primarily Action films. These include the 2009 revenge thriller The Butcher and the Crime drama Charlie Valentine. Johnson frequently works with actors Keith David and Steven Bauer. Many of Johnson's films involve a man who tries to leave a life of violence behind him.\n\nPrior to becoming a filmmaker, he worked as a stuntman and later a stunt coordinator. His stunt performing credits include: M:i:III, Charlie's Angels, Mars Attacks!, Planet of the Apes, Starship Troopers, War of the Worlds, Total Recall and Terminator 3: Rise of the Machines. He worked as a stunt coordinator on Beowulf.\n\nDescription above from the Wikipedia article Jesse V. Johnson, licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1971, 11, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0425364", "Directing", "Jesse V. Johnson", new List<string>(), "Winchester, England, UK", 4.2599999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\8LqBbiV21OHfyYqnnxCICdKMWU4.jpg" },
                    { 77921, "Hideaki Anno (born May 22, 1960 in Ube, Yamaguchi) is a Japanese animation and film director. Anno is best known for his work on the popular anime series Neon Genesis Evangelion. His style has come to be defined by the touches of superflatism and postmodernism that he injects into his work, as well as the thorough portrayal of characters' thoughts and emotions, often through unconventional sequences incorporating psychoanalysis and emotional deconstruction of these characters. He married comics artist Moyoco Anno in 27 April 2002. Anime directed by Anno that have won the Animage Anime Grand Prix award have been Nadia: The Secret of Blue Water in 1990, Neon Genesis Evangelion in 1995 and 1996, and The End of Evangelion in 1997.\n\nDescription above from the Wikipedia article Hideaki Anno, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1960, 5, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0030417", "Directing", "Hideaki Anno", new List<string> { "庵野 秀明", "안노 히데아키", "Хидэаки Анно", "هيدياكي أنّو", "Хідеакі Анно", "庵野秀明", "空母そ・そ・そ・そ" }, "Ube, Yamaguchi, Japan", 10.292999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\AfV9h1RW6uALpx751APdUoX8ONc.jpg" },
                    { 77938, "", null, null, 2, null, "nm2025992", "Sound", "Toru Noguchi", new List<string> { "Tooru Noguchi", "野口透", "Tôru Noguchi" }, null, 2.5139999999999998, null },
                    { 78047, "Matt Rippy, is an American actor, born in Houston, Texas. He is most known for his role as the 'real' Captain Jack Harkness in Torchwood in 2006. He also appears in the films Day of the Dead and Boogeyman 3. In 1994, Rippy moved to England and was a member of the theatre group the Reduced Shakespeare Company. In a recent television appearance, Rippy portrayed the namesake of Jack Harkness of Torchwood in the first series' twelfth episode Captain Jack Harkness. In the episode, Captain Jack (Rippy) was a young American volunteer serving as an RAF Group Captain stationed in Cardiff. He was in a heterosexual relationship, and was eventually revealed to be attracted to Torchwood's Jack, who after an unfortunate \"temporal shift\", landed in 1941 during the height of the Cardiff blitz. Matt Rippy also starred in the fourth series of Ultimate Force, in the final episode, \"Slow Bomb\". He appeared in an episode of the BBC's Bonekickers on 29 July 2008. He appeared in episode 4, \"The Cradle of Civilisation\" as an illegal looter of Babylonian artefacts. In 2008 Rippy appeared in The Dark Knight, as the first mate aboard a hostage ship of convicts, as a newscaster in Hellboy II: The Golden Army, and in a brief cameo role in Penelope starring Christina Ricci. In 2010, he appeared as a Punter named \"Jesse\", in the premiere of the third season of Secret Diary of a Call Girl.  Description above from the Wikipedia article Matt Rippy, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1968, 1, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1208061", "Acting", "Matt Rippy", new List<string> { "Matthew Damon Rippy", "Matthew Rippy" }, "Houston, Texas, USA", 9.7550000000000008, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nJhQoU3YaGcdd9xFbdXGjO1ciMN.jpg" },
