                    { 81687, "Rick Avery is an American stuntman, stunt coordinator, actor, director and author. He has worked on more than 400 films and television projects, including The Crow, The Prestige, The Dark Knight Rises, Gangster Squad, and American Sniper. He is also notable for having doubled for Robert De Niro, Dustin Hoffman, Richard Gere and John Travolta.", null, null, 2, null, "nm0043076", "Crew", "Rick Avery", new List<string>(), "New York City, New York, USA", 2.6139999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7CiosKnycMKSi3UD2cXFJJNceAZ.jpg" },
