                    { 82240, "Lindsey Adams Buckingham (born October 3, 1949) is an American guitarist, singer, composer and producer, most notable for being the guitarist and male lead singer of the musical group Fleetwood Mac. Aside from his tenure with Fleetwood Mac, Buckingham has also released five solo albums and a live album. As a member of Fleetwood Mac, he was inducted into the Rock and Roll Hall of Fame in 1998.", new DateTime(1949, 10, 8, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0118495", "Acting", "Lindsey Buckingham", new List<string> { "Fleetwood Mac" }, "Palo Alto, California, USA", 7.9669999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nghrXAFaZxnY5wkGOmZqbyWRoPe.jpg" },
                    { 82312, "​From Wikipedia, the free encyclopedia.\n\nMaja Ostaszewska  (born September 3, 1972) is a Polish actress.\n\nShe was born in Kraków, the daughter of Polish musician Jacek Ostaszewski. She started her acting training in her native Kraków and later graduated from PWST, in 1996. She has since acted mostly on Teatr Rozmaitości in Warsaw, working with well-known Polish directors such as Krystian Lupa, Krzysztof Warlikowski and Grzegorz Jarzyna.\n\nIn 1993, during her acting training, she played a small role in Steven Spielberg's Schindler's List. Although her actual real film debut was in 1997, with the TV movie Przystań. For this role, she received the Best Actress Award at the Polish Film Festival held in Gdynia in 1998.\n\nOstaszewska recently played one of the main characters in Academy Award nominated Andrzej Wajda's Katyń.\n\nDescription above from the Wikipedia article Maja Ostaszewska (b. 10 April 1966 in Radzymin) is a Polish movie and stage actor., licensed under CC-BY-SA, full list of contributors on Wikipedia", new DateTime(1972, 9, 3, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0652292", "Acting", "Maja Ostaszewska", new List<string> { "マヤ・オスタシェフスカ " }, " Kraków, Malopolskie, Poland", 6.7750000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1d1QZzGSTfCX9zZHqG4ST8N3mj3.jpg" },
                    { 82779, "Vito Giusto Scozzari (January 26, 1918 – June 5, 1996), also known as Vito Scotti, was an American character actor who played both dramatic and comedy roles on Broadway, in films, and later on television, primarily from the late 1930s to the mid-1990s. He was known as a man of a thousand faces for his ability to assume so many divergent roles in more than 200 screen appearances in a career spanning 50 years and for his resourceful portrayals of various ethnic types. Of Italian heritage, he played everything from a Mexican bandit, to a Russian doctor, to a Japanese sailor, to an Indian travel agent.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1918, 1, 26, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1996, 6, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0780005", "Acting", "Vito Scotti", new List<string> { "Vitto Scotti" }, "San Francisco, California, USA", 8.0429999999999993, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\zDGtXkASxpo3DzMNz6OI3NOp9v0.jpg" },
                    { 83002, "Jessica Michelle Chastain (born March 24, 1977) is an American actress and film producer. Known for her roles in films with feminist themes, she has received various accolades, including an Academy Award, a Golden Globe Award, in addition to nominations for two British Academy Film Awards. Time magazine named her one of the 100 most influential people in the world in 2012.\n\nBorn and raised in Sacramento, California, Chastain developed an interest in acting from an early age. In 1998, she made her professional stage debut as Shakespeare's Juliet. After studying acting at the Juilliard School, she was signed to a talent holding deal with the television producer John Wells. She was a recurring guest star in several television series, including Law & Order: Trial by Jury. She also took on roles in the stage productions of Anton Chekhov's play The Cherry Orchard in 2004 and Oscar Wilde's tragedy Salome in 2006.\n\nChastain made her film debut in the drama Jolene (2008), and gained wide recognition for her starring roles in the dramas Take Shelter (2011) and The Tree of Life (2011). Her performance as an aspiring socialite in The Help (2011) earned her a nomination for the Academy Award for Best Supporting Actress. In 2012, she won a Golden Globe Award and received a nomination for the Academy Award for Best Actress for playing a CIA analyst in the thriller Zero Dark Thirty. Chastain made her Broadway debut in a revival of The Heiress in the same year. Her highest-grossing releases came with the science fiction films Interstellar (2014) and The Martian (2015), and the horror film It Chapter Two (2019), and she continued to receive critical acclaim for her performances in the dramas A Most Violent Year (2014), Miss Sloane (2016), Molly's Game (2017) and The Good Nurse (2022). For her portrayal of Tammy Faye in the biopic The Eyes of Tammy Faye (2021), which she also produced, Chastain won the Academy Award for Best Actress.\n\nIn television, Chastain starred in drama miniseries Scenes from a Marriage (2021) and George & Tammy (2022). For the latter, she won a SAG Award. Her performance also garnered her nominations for a Primetime Emmy Award and a Golden Globe Award.\n\nChastain is the founder of the production company Freckle Films, which was created to promote diversity in film. She is vocal about mental health issues, as well as gender and racial equality. She is married to fashion executive Gian Luca Passi de Preposulo, with whom she has two children.\n\nDescription above from the Wikipedia article Jessica Chastain, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1977, 3, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://jessica-chastain.com", "nm1567113", "Acting", "Jessica Chastain", new List<string> { "Джессика Честейн", "جيسيكا شاستاين", "제시카 채스테인", "ジェシカ・チャステイン", "杰西卡·查斯坦", "제시카 차스테인", "Τζέσικα Τσάστεϊν", "Џесика Частејн", "Джессіка Честейн", "Джэсіка Чэстэйн", "Jessica Michelle Chastain", "劳模姐", "ჯესიკა ჩესტეინი", "ג'סיקה מישל צ'סטיין", "潔西卡·雀絲坦" }, "Southern California, California, USA", 25.715, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bXFXSlfCzoE5Py7KBP9P0Y0Ot1v.jpg" },
