                    { 93801, "Hiroshi Kamiya is a Japanese voice actor, singer and narrator affiliated with Aoni Production. He is best known for being the voice of Choromatsu Matsuno from Osomatsu-san, Takashi Natsume from Natsume Yūjin Chō, Seijuro Akashi from Kuroko's Basketball, Levi Ackerman from Attack on Titan, Mephisto Pheles from Blue Exorcist, Yuzuru Otonashi from Angel Beats!, Yato from Noragami, Nozomu Itoshiki from Sayonara, Zetsubou-Sensei, Koyomi Araragi from the Monogatari series, Sōma from Working!!, Izaya Orihara from Durarara!!, Trafalgar Law from One Piece, Tieria Erde from Mobile Suit Gundam 00, and Kinshirō Kusatsu from Cute High Earth Defense Club LOVE!. He won \"Best Lead Actor\" and \"Best Personality\" at the Third Seiyu Awards, and \"Best Supporting Actor\" at the Second Seiyu Awards. He hosts radio show Dear Girl Stories along with voice actor Daisuke Ono.", new DateTime(1975, 1, 28, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.aoni.co.jp/search/kamiya-hiroshi.html", "nm0436778", "Acting", "Hiroshi Kamiya", new List<string> { "Камия Хироси", "かみや ひろし", "Kamiya Hiroshi", "ヒロC", "ピロシ", "かみやん", "카미야 히로시", "神谷 浩史" }, "Matsudo, Chiba, Japan", 22.196000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\u2r0u8tOa0cyh7nawcEOPpcEZr1.jpg" },
