                    { 95140, "John Voldstad was born in Norway but raised in the United States since early childhood. A film and television actor, Voldstad is best-known for his roles on the long-running television series Newhart (1982) playing \"Darryl #2\" (one of a bizarre trio of brothers, two of whom never speak) and in the cult film Stripes (1981) as \"Stillman's Aide\".", new DateTime(1951, 2, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0901390", "Acting", "John Voldstad", new List<string>(), "Oslo, Norway", 5.4329999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\35w34difjEgy3ZBdzUD1lDYUEuj.jpg" },
