                    { 96552, "Kamatari Fujiwara (藤原 釜足 Fujiwara Kamatari, January 15, 1905 - December 21, 1985) was a Japanese actor.\n\nFujiwara was born in Tokyo, on January 15, 1905, in Tokyo, Japan. Fujiwara's parents ran a printing business. The business did not go well, so at the age of 10, Fujiwara started working at a local confectionery store. By the age of 14 he had started selling timber for building and manufacturing in Shizuoka prefecture. A year later he returned to Tokyo to study as a pharmacist.\n\nFukiwara worked regularly and extensively with Akira Kurosawa, and was known for both being adept at comic acting, as well as being able to do serious roles.", new DateTime(1905, 1, 15, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1985, 12, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0297869", "Acting", "Kamatari Fujiwara", new List<string> { "藤原 釜足", "Каматари Фудзивара", "藤原鶏太", "藤原釜足" }, "Fukagawa, Tokyo, Japan", 9.2260000000000009, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tHosLdBr1JVudTdAm96prol6rah.jpg" },
