                    { 99846, "From Wikipedia, the free encyclopedia\n\nSho Kosugi (born Shōichi Kosugi; June 17, 1947) is a Japanese martial artist with training in shindō jinen-ryū karate who gained popularity as an actor during the 1980s, usually playing a ninja. He is the father of Kane Kosugi and Shane Kosugi. After taking a hiatus from film, he started a taiko group in California. In Japan, he also runs an internationally oriented group of martial arts acting schools known as the Sho Kosugi Institute.\n\nIt is common for Kosugi to have his sons co-star in movies when the plot includes family relations. Films in which Kosugi's sons perform alongside their father include Black Eagle, Revenge of the Ninja, and Kabuto (aka Shogun Warrior).\n\nDescription above from the Wikipedia article Sho Kosugi, licensed under CC-BY-SA, full list of contributors on Wikipedia. ​", new DateTime(1948, 6, 17, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0467563", "Acting", "Sho Kosugi", new List<string> { "小杉正一", "ショー・コスギ" }, "Minato, Tokyo, Japan", 10.849, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cdoP2qnJILJlWT4xvYDxg2doaf6.jpg" },
                    { 99939, "Henry \"Henny\" Youngman (16 March 1906 – 24 February 1998) was a British-born American comedian and musician famous for his mastery of the \"one-liner\", his best known being \"Take my wife... please\".", new DateTime(1906, 3, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0950267", "Acting", "Henny Youngman", new List<string>(), "Manhattan, New York, USA", 4.1059999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\jRAZU4C1L0WbYlZLZadCxzscuNl.jpg" },
                    { 100503, "", null, null, 2, null, "nm0553937", "Acting", "Raymond Martino", new List<string> { "Ray Martino" }, null, 2.5430000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\i6fEvqkz2oi3LxYZdYujIloB5wq.jpg" },
                    { 100650, "Francis Xavier McCarthy (born February 15, 1942) is an American actor who has appeared in films such as Interstellar (2014) and Deep Impact (1998).", new DateTime(1942, 2, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0565133", "Acting", "Francis X. McCarthy", new List<string> { "Francis Xavier McCarthy", "Frank McCarthy", "Frank Mc Carthy", "Francis-Xavier McCarthy", "Francis McCarthy", "Franck McCarthy", "Frank X. McCarthy", "Francis X. McCarty" }, "USA", 11.103, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4DyZhRmxGrwhr2UNc1CTZHdvZ0R.jpg" },
                    { 100799, "George Sawaya (August 14, 1923 – September 17, 2003) was an American stuntman and actor. He acted in almost one hundred different films and television episodes, but always as minor characters. His careerwas relatively consistent from the 1950s to the 1980s.  Sawaya acted in the original Star Trek several times, first as Chief Humboldt in \"The Menagerie, Part I\" and then as Klingons in \"Errand of Mercy\" and \"Day of the Dove\".", new DateTime(1923, 8, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2003, 9, 17, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0768070", "Acting", "George Sawaya", new List<string> { "George C. Sawaya", "George Sawaja" }, "Los Angeles, California, USA", 3.9900000000000002, null },
                    { 100930, "Lorenzo Robledo (3 July 1918 – September 2006) was a Spanish film actor, who made over 85 appearances in film between 1956 and 1982. He is a familiar face in Italian westerns, having appeared in a total of 32 Spaghetti Western films throughout the 1960s and early 1970s.\n\nRobledo is probably best known for his roles in Sergio Leone's Spaghetti Western films of the 1960s and 1970s, portraying minor characters in the trilogy of films A Fistful of Dollars (1964), For a Few Dollars More (1965), The Good, the Bad and the Ugly (1966), and Once Upon a Time in the West in 1968. He acted in many other westerns prolifically including the tortured sheriff in Four of the Apocalypse (1975).", new DateTime(1921, 7, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 9, 1, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0696468", "Acting", "Lorenzo Robledo", new List<string>(), "Madrid, Spain", 7.383, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1URdsmesjkTb6wA7HfXGUJg2kUM.jpg" },
                    { 101014, "", new DateTime(1984, 11, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0742389", "Acting", "Beatrice Rosen", new List<string>(), "New York City, New York, USA", 11.148, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\r6SOgmpY4lCByduoRkuCNVRLYAV.jpg" },
                    { 101015, "Chin Han is a Singaporean American actor known for his roles in Dark Knight, Ghost in the Shell and  televisions series such as Marco Polo. Beginning as a teen actor in stage classics like Moliere's L'Ecole des femmes and Shakespeare's Twelfth Night, he went on to star in Singapore's first English language television series Masters of the Sea. In 1998 Chin Han made his US film debut in Blindness and has been active in both film and television since the late-2000s. He is currently based in Los Angeles.", new DateTime(1969, 11, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1977856", "Acting", "Chin Han", new List<string> { "Chin-han Ng ", "黄经汉", "Chin Han", "친 한", "Ng Chin Han" }, "Singapore", 14.381, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3XJXmYm6r4Hvm3izOArU58fhQrT.jpg" },
                    { 101608, "Robin R. Bottin is an American special make-up effects creator. Known for his collaborations with directors John Carpenter, Paul Verhoeven and David Fincher, Bottin worked with Carpenter on both The Fog and The Thing, with Verhoeven on RoboCop, Total Recall and Basic Instinct, and with Fincher on Se7en and Fight Club. His many other film credits include The Howling, Legend, Innerspace and Fear and Loathing in Las Vegas.\n\nWell respected in his field of prosthetic makeup (better known as special make-up effects), and described in 2013 as a \"special effects genius\", Bottin was nominated for an Oscar in 1986 for Best Makeup, and was awarded a Special Achievement Academy Award at the 1991 Academy Awards. He has two BAFTA nominations, and won two Saturn Awards with five further nominations.\n\nDescription above from the Wikipedia article Rob Bottin, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1959, 4, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0001964", "Crew", "Rob Bottin", new List<string> { "Robin Bottin" }, "El Monte, California, USA", 7.4100000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\aaxVEbFQFw0NjgK7ZpAWtPmTOEu.jpg" },
                    { 102096, "Antonio Molino Rojo (14 September 1926 – 2 November 2011) was a Spanish film actor who appeared primarily in Spaghetti Westerns in the 1960s and 1970s.", new DateTime(1926, 9, 14, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 11, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0590158", "Acting", "Antonio Molino Rojo", new List<string> { "Red Mills" }, "Venta de Baños, Palencia, España", 6.968, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1J1l8QvjfjhjKhZnq1zqWOUuQr3.jpg" },
                    { 102121, "Romano Puppo was an Italian stuntman and actor who found himself cast in many \"tough guy\" roles from the 1960's through to the 1980's. He doubled for Lee Van Cleef  in his Spaghetti Western outings and was one of the pallbearers at Van Cleef's funeral. Puppo died having a heart attack while riding his motorcycle outside of Trieste, Italy in 1994.", new DateTime(1933, 3, 25, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1994, 5, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0057269", "Acting", "Romano Puppo", new List<string>(), " Rome, Italy", 7.2789999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xCsRVTkSORKri2zW9Je2SSr57ZD.jpg" },
                    { 102252, "Anaita Shroff Adajania is an Indian award-winning fashion stylist, costume designer and actress. She is the Fashion Director for Vogue India magazine.", null, null, 1, null, "nm1224956", "Costume & Make-Up", "Anaita Shroff Adajania", new List<string> { "Anaita Shroff " }, "Mumbai, Maharashtra, India", 2.3199999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\yLDxdFAcESXvsfgZKv8ob8TSWvw.jpg" },
                    { 102314, "Judy Herrera is an American actress.\n\nDescription above from the Wikipedia article Judy Herrera, licensed under CC-BY-SA, full list of contributors on Wikipedia.", null, null, 1, null, "nm0004264", "Acting", "Judy Herrera", new List<string> { "Jade Herrera" }, "New Mexico, USA", 6.7380000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4ZzqIwI7AlJddVmoEGRqnA5gCYi.jpg" },
                    { 102429, "Roger William Corman (born April 5, 1926) is an American film director, producer, and actor. He has been called \"The Pope of Pop Cinema\" and is known as a trailblazer in the world of independent film. Many of Corman's films are based on works that have an already-established critical reputation, such as his cycle of low-budget cult films adapted from the tales of Edgar Allan Poe.\n\nIn 1964, Corman—admired by members of the French New Wave and Cahiers du Cinéma—became the youngest filmmaker to have a retrospective at the Cinémathèque Française, as well as in the British Film Institute and the Museum of Modern Art. He was the co-founder of New World Pictures, the founder of New Concorde and is a longtime member of the Academy of Motion Picture Arts and Sciences. In 2009, he was awarded an Honorary Academy Award \"for his rich engendering of films and filmmakers\".\n\nCorman mentored and gave a start to many young film directors such as Francis Ford Coppola, Ron Howard, Martin Scorsese, Jonathan Demme, Peter Bogdanovich, Joe Dante, John Sayles, and James Cameron, and was highly influential in the New Hollywood filmmaking movement of the 1960s and 1970s. He also helped to launch the careers of actors like Peter Fonda, Jack Nicholson, Dennis Hopper, Bruce Dern, Sylvester Stallone, Diane Ladd, and William Shatner. Corman has occasionally taken minor acting roles in the films of directors who started with him, including The Silence of the Lambs, The Godfather Part II, Apollo 13, The Manchurian Candidate, and Philadelphia.\n\nDescription above from the Wikipedia article Roger Corman, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1926, 4, 5, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2024, 5, 9, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0000339", "Production", "Roger Corman", new List<string> { "Roger William Corman", "The Pope of Pop Cinema" }, "Detroit, Michigan, USA", 17.382000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\kWvtdBp4AVSOwluWwZ1WhsKlAfk.jpg" },
                    { 102589, "", null, null, 0, null, "nm0476345", "Directing", "Michael Kusley", new List<string> { "Mike Kusley" }, null, 2.1379999999999999, null },
                    { 103529, "Antonio Casas (11 November 1911 - 14 February 1982) was a Spanish footballer turned film actor who appeared in film between 1941 and his death in 1982.\n\nCasas originally began as a footballer for Atlético Madrid, but entered film in 1941 and made nearly 170 appearances in film and TV between then and 1982. He appeared in A Pistol for Ringo in 1965 and Sergio Leone's Spaghetti Western The Good, the Bad and the Ugly in 1966. One of his best-known roles was in Luis Buñuel's Tristana.", new DateTime(1911, 11, 11, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1982, 2, 14, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0143030", "Acting", "Antonio Casas", new List<string> { "Anthony Casas", "Antonio Casas-Arenzana" }, "A Coruña, Galicia, Spain", 13.449999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\x3CWO3b5ZlJiAXWtMvnF5n3ntwB.jpg" },
                    { 103627, "Tano Cimarosa, real name Gaetano Cisco, (1 January 1922 – 24 May 2008) was an Italian actor, screenwriter and film director. He participated in more than fifty movies.\n\nHe played the \"Blacksmith\" in the Oscar-winning film Cinema Paradiso from 1988. He is known to horror film fans for directing Reflections in Black in 1975.\n\nSource: Article \"Tano Cimarosa\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1922, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2008, 5, 24, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0162326", "Acting", "Tano Cimarosa", new List<string> { "Gaetano Cisco", "Gaetano Cimarosa" }, "Messina, Sicily, Italy", 9.4749999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ap7ccf4mAo73TluShYU6LtsE0jm.jpg" },
                    { 104378, "Younger brother of Tom Hanks. Provided the voice for the tie-in \"Woody\" action figures from Toy Story (1995) voiced in the movie by older brother Tom Hanks. He regularly substitutes for his brother by recording Woody's voice for \"Toy Story\" merchandise, video games, audio storybooks, Disney theme park ride narrations, etc. Brother-in-law of actress Rita Wilson. Former brother-in-law of Samantha Lewes. Jim and his wife, Karen Hanks, have one son and live in Venice, California.", new DateTime(1961, 6, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0360028", "Acting", "Jim Hanks", new List<string>(), "Shasta County, California, USA", 8.2799999999999994, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\cCbIqfWR8pS5vsQ8A4Bvqc7wMnQ.jpg" },
                    { 104504, "From Wikipedia, the free encyclopedia\n\nJonathan \"John\" Aprea (born March 4, 1941) is an American actor and comedian, best known for his role as the young Sal Tessio in The Godfather: Part II (1974) and on television as Lucas Castigliano in Another World from 1989 to 1992. In 2006, he appeared in The Heiress. He also portrayed Nick Katsopolis in Full House for 2 seasons. He also co-starred with Lee Horsley in Matt Houston during the 1980s.", new DateTime(1941, 3, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0032501", "Acting", "John Aprea", new List<string> { "Jonathan \"John\" Aprea" }, "Englewood, New Jersey, USA", 8.1929999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hZ8Wlv3WaRMqNrRtWZBkw4lcjJj.jpg" },
