                    { 106161, "Reiko Mori, known by her stage name Noriko Sengoku, was a Japanese film and television actress active primarily in the 1950s and 1960s. She made her film debut in 1947 and starred in several of Akira Kurosawa's early films such as Drunken Angel, The Quiet Duel, Stray Dog, Scandal, The Idiot and Seven Samurai.", new DateTime(1922, 5, 29, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 12, 27, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0784279", "Acting", "Noriko Sengoku", new List<string> { "千石規子", "千石规子" }, "Setagaya, Tokyo, Japan", 7.3289999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1LXOl1fSe0H04AyEJjPeBEJbWdo.jpg" },
                    { 106165, "Eijirō Tōno (東野英治郎 Tōno Eijirō, 17 September 1907 – 8 September 1994) was a Japanese actor who, in a career lasting more than 50 years, appeared in over 400 television shows, nearly 250 films and numerous stage productions. He is best known in the West for his roles in films by Akira Kurosawa, such as Seven Samurai (1954) and Yojimbo (1961), and films by Yasujirō Ozu, such as Tokyo Story (1953) and An Autumn Afternoon (1962). He also appeared in Kill! by Kihachi Okamoto and Tora! Tora! Tora!, a depiction of the Japanese attack on Pearl Harbor. His final film was Juzo Itami's A-ge-man (Tales of a Golden Geisha) in 1990. Tōno also starred as the title character in the long-running television jidaigeki series Mito Kōmon from 1969 to 1983. In the early years of his career he acted under the name of Katsuji Honjo (本庄克二).", new DateTime(1907, 9, 17, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1994, 9, 8, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0867391", "Acting", "Eijirō Tōno", new List<string> { "東野英治郎", "Tōno Eijirō", "Эйдзиро Тоно", "东野英治郎" }, "Gunma, Japan", 5.3639999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wsUx6WKA7Z7az2IOIbv5G4cAfXA.jpg" },
                    { 106187, "", null, null, 2, null, "nm0553778", "Acting", "Lou Martini Jr.", new List<string> { "Louis Azzara " }, null, 2.9489999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\85s5KR0BA6dhMJtOrvtKGY8Bz8E.jpg" },
                    { 106663, "", null, null, 0, null, "nm0614236", "Writing", "Edward D. Murphy", new List<string> { "Edward Murphy" }, null, 4.1050000000000004, null },
                    { 106811, "Tall and solidly built, this Italian-American professional wrestler turned actor was born Lenny Passaforo in Brooklyn, New York, and is best remembered for his first on-screen role as the not too bright but ever loyal bodyguard Luca Brasi in The Godfather (1972). Montana didn't get a lot of screen time before being eliminated by the henchmen of opposing gangster Al Lettieri with a garrote and a knife; however, he caught the eye of casting agents and over the next ten years racked up roles in 16 movies. Usually cast as \"muscle for hire\", he was equally good at playing the intimidating thug or a buffoonish hoodlum, such as in Battle Creek Brawl (1980) and The Jerk (1979). His last film appearance was in the B-thriller Blood Song (1982), which he also co-wrote. He died in May 1992 of a heart attack while in Italy.", new DateTime(1926, 3, 13, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 5, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0598926", "Acting", "Lenny Montana", new List<string> { "Lenny Passaforo" }, " Brooklyn, New York, USA", 8.4149999999999991, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3R52Zh3MBCaSPqmcyWcD1Y0N4wo.jpg" },
                    { 107023, "Emil Sitka (December 22, 1914 – January 16, 1998) was a veteran American actor, who appeared in hundreds of movies, short films, and television shows, and is best known for his numerous appearances with The Three Stooges and he was the unofficial \"last Stooge\", since he was tapped to be the new middle Stooge when Larry Fine suffered a stroke in 1970. He is one of only two actors to have worked with all six Stooges (Shemp Howard, Moe Howard, Larry Fine, Curly Howard, Joe Besser, Joe DeRita) on film in the various incarnations of the group (Harold Brauer, a recurring villain who appeared in three 1940s shorts, was the other).", new DateTime(1914, 12, 22, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 1, 16, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0803238", "Acting", "Emil Sitka", new List<string>(), "Johnstown, Pennsylvania, USA", 8.3239999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hsSU6n8qZTOYNvj2t27ArQIfF1r.jpg" },
                    { 107571, "Olaf Sergiusz Linde-Lubaszenko (born 6 December 1968 in Wrocław) is a Polish actor and film director. He is the son of Edward Linde-Lubaszenko, who is an actor of German and Swedish descent and Asja Łamtiugina, a Russian actress.\n\nOlaf Lubaszenko starred in films by Krzysztof Kieślowski, Barbara Sass, Władysław Pasikowski, Janusz Majewski, Juliusz Machulski and others.", new DateTime(1968, 12, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0523821", "Acting", "Olaf Lubaszenko", new List<string>(), "Wrocław, Poland", 4.7839999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sWWcetTVDT4px4eXPsSyKaITTqU.jpg" },
