                    { 107637, "Polish and Russian actor. In 1993 he graduated from the Ludwik Solsky Higher Theater School in Krakow. Since 1993 - on the stage. He played in the theaters of Warsaw, Kielce, Wroclaw. He made his debut in the film by Steven Spielberg \"Schindler's List\" (1993). Pavel Delong is one of the most popular Polish new generation actors in Russia and the CIS countries. Actively removed in Russia, Belarus, Ukraine, France. Has a son, Paul (born in 1993). Lives in Moscow.", new DateTime(1970, 4, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0216117", "Acting", "Paweł Deląg", new List<string> { "Павел Делонг", "Pavel Delong", "Pawel Delong", "Pawel Delag", "Павел Делёнг" }, "Kraków, małopolskie, Polska", 15.965, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vS4Otxn5Rj08g2DN7DpPg8Efld7.jpg" },
                    { 108026, "Real name: Yukio Abe. Born September 8, 1925, as the son of an electrician in Tokyo. Graduated from Tokyo City Asakusa Technical College. Passed the 1st Toho New Face exam and joined Toho. It is in sync with Toshiro Mifune and Hajime Izu. Debuted in 1947 with Kurosawa's \"One Wonderful Sunday\".  Later appeared as a regular in the many Toho movies. It was nicknamed \"Boo-chan\" by the studio associates.", new DateTime(1925, 9, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1998, 3, 11, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0757021", "Acting", "Sachio Sakai", new List<string> { "堺左千夫" }, "Tokyo, Tokyo, Japan", 9.3279999999999994, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\5b6g3ZHfSXxfNgInvwz44lUv43I.jpg" },
