                    { 115834, "", null, null, 0, null, "nm1979503", "Production", "Tyler Ott", new List<string>(), null, 1.5129999999999999, null },
                    { 116135, "George Edwin Eldredge (September 10, 1898 – March 12, 1977) was an American actor who appeared in over 180 movies during a career that stretched from the 1930s to the early 1960s. He also had a prolific television career during the 1950s. He was the older brother of actor John Dornin Eldredge.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1898, 9, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1977, 3, 12, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0253140", "Acting", "George Eldredge", new List<string> { "George Eldridge", "Geo. Eldredge", "George Edwin Eldredge" }, "San Francisco, California, USA", 5.2670000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4sWV8w8lX6UC0mnI8wmESKcwO6z.jpg" },
