                    { 119243, "Bunta Sugawara was a Japanese actor who appeared in almost 200 Japanese feature films, most prevalently in Yakuza films. On December 1, 2014, it was announced that Sugawara had died from liver cancer in a Tokyo hospital on November 28, 2014 at the age of 81. (Wikipedia)", new DateTime(1933, 8, 16, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2014, 11, 28, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0837420", "Acting", "Bunta Sugawara", new List<string> { "菅原文太", "스가와라 분타" }, "Sendai, Miyagi, Japan", 7.9649999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lHPLlP8zNwGMmcUI8rGks5vp8Vn.jpg" },
