                    { 119431, "Saro Urzì was born on February 24, 1913, died  November 2, 1979 (age 66) in San Giuseppe Vesuviano, Italy. He was an actor.", new DateTime(1913, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1979, 11, 2, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0882237", "Acting", "Saro Urzì", new List<string> { "Rosario Urzì ", "Saro Urzzi ", "Саро Урци" }, " Catania, Sicily, Italy", 13.494999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wp88yz8T1TJcw5egiDu1m5a302D.jpg" },
                    { 119515, "", new DateTime(1938, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 6, 21, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0622095", "Acting", "Nazzareno Natale", new List<string> { "Nazareno Natale" }, null, 6.6470000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\7pfizuGwnW24yBa8hxILUME3S8B.jpg" },
                    { 119992, "Salvatore Leopoldo \"Leo\" Gullotta (born 9 January 1946) is an Italian actor, voice actor, comedian and writer.\n\nBorn in Catania and the last of six children, Gullotta started his career as an extra in Teatro Massimo Bellini. In his long career as actor, Gullotta has starred in about 100 films and has participated in numerous shows and drama series for television. In 1987 he won his first David di Donatello for Best Supporting Actor for his role in Il Camorrista by Giuseppe Tornatore, and later worked with Tornatore four more times. In 1997 and 2000 he won two more David di Donatello for Best Supporting Actor, for the Maurizio Zaccaro films Il carniere and Un uomo perbene. He has also won two Silver Ribbon for Best supporting Actor, in 1984 for Mi manda Picone by Nanni Loy and in 2001 for Vajont by Renzo Martinelli.\n\nGullotta has starred in many theatrical plays and dramas, and was part of the theater company \"Il Bagaglino\". He won the Flaiano Prize as stage actor of the year in 2010. He celebrated fifty years of activity that same year.\n\nGullotta is also a well known voice actor, among others. He was the Italian voice of Manny in the first three films of the Ice Age film series. He reprised this role in short films and video games. He also dubbed Burt Young in Rocky, Joe Pesci in Once Upon a Time in America, Moonwalker, My Cousin Vinny and The Irishman, and the robot Johnny 5 in Short Circuit. He also became the new Italian voice of Woody Allen after the death of Oreste Lionello in 2009.\n\nIn 1998 Gullotta debuted as writer with the book Mille fili d'erba (Di Renzo Editore, ISBN 88-86044-87-9).\n\nGullotta is openly gay. He did not reveal his sexuality to the public until 1995. In 2019, he married his partner of 32 years. Gullotta is discreet about the details of his husband.\n\nSource: Article \"Leo Gullotta\" from Wikipedia in english, licensed under CC-BY-SA 3.0.", new DateTime(1946, 1, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0347842", "Acting", "Leo Gullotta", new List<string> { "Leo", "Salvatore Leopoldo Gullotta" }, "Catania, Sicily, Italy", 10.800000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\wn9LQjKRZxrXm6a5zyfrLs71ChM.jpg" },
                    { 120152, "Agnese Nano (born 5 November 1965 in Rome) is an Italian film, TV and theater actress. Her first appearance was in 1987 but she became famous after her role as the young \"Elena Mendola\" in Cinema Paradiso by Giuseppe Tornatore, in 1988. Nano felt that playing Elena \"was a deeply nurturing experience, crucial for the development of her future career.\"\n\nSource: Article \"Agnese Nano\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1965, 11, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0620919", "Acting", "Agnese Nano", new List<string>(), "Rome, Italy ", 19.419, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gUbvX3dm8rIq58phY8jSl3oPgUe.jpg" },
