                    { 122345, "From Wikipedia, the free encyclopedia.                    \n\n                    \n\nTommy Campbell (born October 6, 1978) is a stand-up comedian, actor and writer. He is a dual-citizen of Ireland and Canada and currently resides in London, England. He spends most of his time acting, writing and performing stand-up around the world.                \n\n                    \n\nDescription above from the Wikipedia article Tommy Campbell (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia.                    ​", new DateTime(1978, 10, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1035174", "Acting", "Tommy Campbell", new List<string>(), null, 4.5140000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1AkUnOFAkTZ0WRisDy6LtEMxroF.jpg" },
