                    { 122596, "A founding member and the former Associate Artistic Director of The Actors' Gang, the Los Angeles based theater ensemble, VJ is a cast member in a touring production of a world premiere adaptation of George Orwell's 1984. VJ's travels with the Actors' Gang include stops in London, Hong Kong, Buenos Aires, Madrid, Edinburgh, Athens, Melbourne, and Barcelona as well as extended runs at the Public Theater in New York City. He is married to Lindsley Allen; the dancer, choreographer and former co-creator of The Pussycat Dolls.  - IMDb Mini Biography", null, null, 2, "http://www.vjfoster.com/", "nm0288106", "Acting", "Vincent Foster", new List<string> { "VJ Foster", "Vincent Jeffrey Foster", "Jeff Foster", "V.J. Foster" }, null, 7.7640000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4H11cOROVjOyVNOoaIDdYYOkNNr.jpg" },
