                    { 126698, "Kenji Nojima was born March 16, 1976 in Suginami, Tokyo, Japan. He is a voice actor (seiyuu), singer and narrator employed by Japanese voice talent agency Aoni Production. He is the son of veteran voice actor Akio Nojima and is the younger brother of voice actor Hirofumi Nojima. He is married to fellow voice actress Chie Sawaguchi since 2004 and they have two children together.\n\nYuka Takamine is Kenji Nojima's alias when working on adult titles.", new DateTime(1976, 3, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.aoni.co.jp/actor/na/nojima-kenji.html", "nm1261186", "Acting", "Kenji Nojima", new List<string> { "野島健児", "Takamine Yuka", "高嶺悠賀", "のじま けんじ", "野岛健儿" }, "Suginami, Tokyo, Japan", 14.452999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\nRSPVjDkdpnrQabnK5mENH118zN.jpg" },
