                    { 128201, "Jean Ann Ewers (September 11, 1929 – August 27, 2011), known professionally as Eve Brent and Jean Lewis, was an American actress who portrayed Jane in Tarzan's Fight for Life.\n\nEve Brent began her career in radio and early television and later moved on to the college and little theater stage. Arriving in Hollywood with a husband and infant son in the 1950s, she landed some films including Gun Girls (1957), Journey to Freedom (1957), The Bride and the Beast (1958), and episodic TV roles. Maverick director Samuel Fuller changed her name to Eve Brent when she appeared in his western Forty Guns (1957), the first of dozens of screen roles for her under that name. She then played Jane opposite Gordon Scott's Tarzan in Tarzan and the Trappers, Tarzan's Fight for Life (both 1958), and in episodes of a Tarzan TV series. In addition to her big-screen and episodic TV assignments, she has appeared in hundreds of commercials.\n\nShe later had the role of Elaine Connelly in The Green Mile and a small role in The Curious Case of Benjamin Button.", new DateTime(1929, 9, 11, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 8, 27, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0107573", "Acting", "Eve Brent", new List<string> { "Eve Brent Ashe", "Jean Ann Lewis", "Jean Lewis", "Jean Ewers" }, "Houston, Texas, USA", 10.759, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3TctvAVPmpYs5tQSPOkPijc0RdV.jpg" },
                    { 128386, "Colin Andrew Ignatius Peter McFarlane (born 15 September 1961) is a British actor and voice actor. He is best known for his role as Gillian B. Loeb in two films of Christopher Nolan's The Dark Knight Trilogy, Ulysses in the STARZ television drama series Outlander and as the voice of Bulgy in the children's television series Thomas & Friends.", new DateTime(1961, 9, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0568801", "Acting", "Colin McFarlane", new List<string>(), "Upper Clapton, London", 6.7229999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tCLiWpKooSQJfyC260qNeNYTe9S.jpg" },
