                    { 142686, "David Leslie Johnson-McGoldrick (né Johnson) is an American screenwriter and producer of film and television. He wrote the horror films Orphan (2009), The Conjuring 2 (2016) and its sequel The Conjuring: The Devil Made Me Do It (2021), and the DC Extended Universe films Aquaman (2018) and its sequel Aquaman and the Lost Kingdom (2023).", null, null, 2, null, "nm0424901", "Writing", "David Leslie Johnson-McGoldrick", new List<string> { "David Leslie Johnson", "David Johnson", "Dave Johnson" }, "Lexington, Ohio, USA", 6.5650000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4asz1xDkGKMferQ2L9Gexd9CPvs.jpg" },
                    { 143328, "Kenneth Todd Freeman (born July 9, 1965) is an American actor. He has been nominated for two Tony Awards over the course of his career and has won one Drama Desk Award. He has played supporting roles in films such as Grosse Pointe Blank (1997) and The Cider House Rules (1999), played a prominent recurring role on Buffy the Vampire Slayer (1998–1999), and was a series regular on A Series of Unfortunate Events (2017–2019).\n\nBorn in Houston, Texas, Freeman went to the local High School for the Performing and Visual Arts before later graduating from the University of North Carolina School of the Arts in 1987.\n\nFreeman has been an ensemble member of the Steppenwolf Theatre Company in Chicago, Illinois since 1993. In the same year, he was nominated for the Tony Award for Best Actor in a Play for his lead performance in the Apartheid drama The Song of Jacob Zulu. More recently, Freeman has played the role of Doctor Dillamond from Wicked in the first North American tour, Chicago and Broadway productions. In 2015, he was nominated for his second Tony Award, this time for Best Featured Actor in a Play as Sissy Na Na in Airline Highway. He won the Drama Desk Award for Outstanding Featured Actor in a Play for the same role.\n\nHe has also had supporting roles in various films such as Eraser (1996), Grosse Pointe Blank (1997), The Cider House Rules (1999), and The Dark Knight (2008). On television, he earned a recurring role on Buffy the Vampire Slayer as Mr. Trick.\n\nHe performed in the Steppenwolf Theatre Company's production of Downstate, which concluded its run on November 18, 2018.\n\nHe portrayed Mr. Poe in the 2017 Netflix comedy drama series A Series of Unfortunate Events.", new DateTime(1965, 7, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0293461", "Acting", "K. Todd Freeman", new List<string> { "Kenneth Todd Freeman", "К. Тодд Фриман", "К. Тодд Фримэн", "K. 토드 프리먼" }, "Houston, Texas, USA", 6.0090000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2v7WacMtmuX6MrUx6X5bvy0gk8O.jpg" },
