                    { 144476, "From Wikipedia, the free encyclopedia.\n\nHiromasa Yonebayashi (born 1973 in Ishikawa Prefecture, Japan), nicknamed Maro, is a Japanese animator and director for Studio Ghibli. Making his directing debut with them in the film The Borrower Arrietty, he became the youngest director of a Studio Ghibli film.\n\nDescription above from the Wikipedia article Hiromasa Yonebayashi, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1973, 7, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0948488", "Directing", "Hiromasa Yonebayashi", new List<string> { "Хиромаса Ёнэбаяси", "米林宏昌", "Maro" }, "Ishikawa Prefecture, Japan", 7.1790000000000003, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bV0Xg5JHzTdcCDaLX7fKHn3gYH2.jpg" },
