                    { 145531, "Christopher John Fields (born September 23, 1968) is a Los Angeles-based director, teacher, and actor. He is the artistic director of the award-winning Echo Theater Company, a theatre he founded in 1997.", new DateTime(1968, 9, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0276211", "Acting", "Christopher John Fields", new List<string>(), "New York City, New York, USA", 4.8470000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\3ASDmbBZQnk526pPeNtb8LOJXBX.jpg" },
