                    { 146971, "Farida Jalal (born 14 March 1949) is an Indian actress. In a film career spanning almost fifty years, Jalal acted in over 200 films in the Hindi, the Telugu, and the Tamil film industries. Best known for her character driven roles in independent cinema and supporting work in mainstream Bollywood productions, Jalal has received such accolades as four Filmfare Awards and two Bengal Film Journalists Association Awards.\n\nJalal started her career with Taqdeer (1967). She went on to play leading and supporting roles in numerous motion pictures through the 1970s and early 80s. She is widely remembered for her roles in Paras (1971), Henna (1991) and Dilwale Dulhania Le Jayenge (1995), all of which garnered the Filmfare Award for Best Supporting Actress. She became a household name after portraying motherly roles and strong female characters in the 1990s and the early 2000s. She has also won the Filmfare Critics Award for Best Performance for her role in Mammo (1994). She won the Best Actress Award at the 2012 Harlem International Film Festival for her role in A Gran Plan (2012).\n\nShe has successfully transitioned to numerous shows on Indian television alongside her work in films. Some of her notable works are the sitcom Yeh Jo Hai Zindagi, Dekh Bhai Dekh, Shararat and Ammaji Ki Galli. She was seen in the soap opera Satrangi Sasural on channel Zee TV portraying the role of Gomti Vatsal a.k.a. Dadi Maa.", new DateTime(1949, 3, 14, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0416077", "Acting", "Farida Jalal", new List<string> { "फरीदा ज़लाल", "Farida Jalaal" }, "New Delhi, Delhi, India", 31.263000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\tJdqL4BRSAWVFX1W6cmwxFs9IFh.jpg" },
                    { 146972, "Achala Sachdev was an Indian actress who appeared in classic films of Hindi language film industry.  She later became known for mother and grandmother roles in Hindi films.", new DateTime(1920, 5, 3, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2012, 4, 30, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0755087", "Acting", "Achala Sachdev", new List<string> { "अचला सचदेव", "ਅਚਲਾ ਸਚਦੇਵ", "Ачала Сачдев", "Achla Sachdev" }, "Peshawar, North-West Frontier Province, British India", 6.7000000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6kgq6Mnmd01HZzvbsEDQAFBurog.jpg" },
                    { 146973, "Pooja Ruparel is an Indian actress who appears in Bollywood movies and TV series. She is well known for her iconic role as \"Chutki\" in Dilwale Dulhania Le Jayenge, one of India's most successful films. She has also acted in a number of plays, apart from being a stand-up comedian and a singer.\n\nPooja Ruparel started appearing in Bollywood movies as a child artist in 1993. She first appeared in King Uncle starring Jackie Shroff and Shah Rukh Khan, and gained nationwide popularity through her role as \"Chutki\" in Dilwale Dulhania Le Jayenge. Pooja has also acted in a number of movies and TV series ever since, including Amit Sahani Ki List, X: Past Is Present, 24 (Indian TV series) and Zabaan Sambhalke.", new DateTime(1982, 11, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0750408", "Acting", "Pooja Ruparel", new List<string>(), "Mumbai, India", 9.4939999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\evHnj6s0Z2sbV1Mq0dfXxQQU8Mf.jpg" },
                    { 146974, "Mandira Bedi is an Indian actress, fashion designer, and television presenter who gained celebrity status playing the title role in the 1994 television serial, Shanti, shown on India's national channel, Doordarshan, which was the first ever daily soap on Indian television.\n\nShe followed up her career in TV serials with shows like Aurat (DD and Sony), Dushman (DD) and Kyunki Saas Bhi Kabhi Bahu Thi (Star Plus) with hosting duties for ICC Cricket World Cups in the years 2003 and 2007 and the Champions Trophies in the years 2004 and 2006 as well as the Indian Premier League season 2 for Sony Max. She fronted the coverage of IPL season 3 for the British Network – ITV. She debuted as a fashion designer during Lakme Fashion Week 2014 with her saree collection.\n\nBedi also promoted faux leather for PETA. On 26 October 2013, Bedi launched her signature sari store.", new DateTime(1972, 4, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://mandirabedi.in", "nm0990671", "Acting", "Mandira Bedi", new List<string> { "Mandhira Bedi", "Manthira Bedi", "Manthra Bedi", "Mandhra Bedi", "मंदिरा बेदी", "മന്ദിര ബേദി", "மந்திரா பேடி" }, "Calcutta, West Bengal, India", 5.8730000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\l50tq0OwzIxE4Z5JXDUSQvqCltN.jpg" },
