                    { 148122, "Geoffrey Lewis Blake is an American film and television actor. Geoffrey Blake is an Emmy nominated, two-time SAG Award winning actor best known for his role as 'Wesley' opposite Robin Wright's 'Jenny' in the iconic Academy Award Best Picture Forrest Gump.", new DateTime(1962, 8, 20, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0086553", "Acting", "Geoffrey Blake", new List<string> { " Geffrey Blake", "Geoffrey Ferrell " }, "Baltimore, Maryland, USA", 10.635999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\uKdiO6QagiT0mZ7tf9Xrl8OZUKy.jpg" },
                    { 148447, "Sayaka Ohara (大原 さやか, Ōhara Sayaka) is a Japanese voice actress, affiliated with Haikyō. Her major roles include Layla Hamilton in Kaleido Star, Yūko Ichihara in xxxHolic and Tsubasa Reservoir Chronicle, Alicia Florence in Aria, Beatrice in Umineko no Naku Koro ni, Milly Ashford in Code Geass, Erza Scarlet in Fairy Tail, Irisviel in the Fate/Zero and Fate/kaleid liner Prisma Illya series and the initial voice of Gammisers in episode 27-34 of Kamen Rider Ghost. She has also voiced in a variety of video games and live-action overseas dubs, and hosts a number of radio shows, many of which are related to her voice projects. In 2013, she received a Best Supporting Actress award at the 7th Seiyu Awards.", new DateTime(1975, 12, 6, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "https://haikyo.co.jp/profile/profile.php?ActorID=11570", "nm1360441", "Acting", "Sayaka Ohara", new List<string> { "Sayaka Ōhara", "Sayaka Oohara", "Охара Саяка", "大原沙耶香", "Sayaka Ôhara", "오하라 사야카", "大原 さやか" }, "Yokohama, Kanagawa Prefecture, Japan", 19.295000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4WQXLzj0gjYqkYFcTTxAkIwedvr.jpg" },
