                    { 151007, "Peter A. Ramsey (born December 23, 1962) is an American illustrator, storyboard artist, film director, screenwriter and film producer. He is best known for directing DreamWorks Animation's Rise of the Guardians (2012), becoming the first African American to direct a major American animated film, and co-directing Sony Pictures Animation's Spider-Man: Into the Spider-Verse (2018). For Spider-Man: Into the Spider-Verse, he became the first African American to be nominated for and win an Academy Award for Best Animated Feature.", new DateTime(1962, 12, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.sonypicturesanimation.com/our-team/filmmakers/peter-ramsey", "nm0709056", "Art", "Peter Ramsey", new List<string>(), "Los Angeles, California, USA", 10.391999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eAL9QdCEYyxiMP9cl9lQddg8zEa.jpg" },
