                    { 156052, "Bill Gratton was born on July 7, 1939 in Portland, Oregon, USA as William Alfred Gratton. He was an actor, known for Blast from the Past (1999), The Green Mile (1999) and Jagged Edge (1985). He died on June 23, 2011 in Los Angeles, California, USA.", new DateTime(1939, 7, 7, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2011, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0336029", "Acting", "Bill Gratton", new List<string>(), "Portland, Oregon, USA", 5.2690000000000001, null },
                    { 157865, "Karen Maruyama is an American actress and comedienne. She has appeared on television in supporting roles in a number of sitcoms, including recurring characters on The Jamie Foxx Show, Strip Mall, Suddenly Susan, and Arrested Development. Maruyama is well known as an improv performer and instructor, and was a featured guest on both the American and British versions of Whose Line Is It Anyway?, as well as a member of The Groundlings. She also appeared as a parking lot attendant in an episode of Curb Your Enthusiasm. She also played a nurse in The Bucket List (2007) and a housekeeper in the 2012 film The Campaign. She is part of the cast of The Jim Henson Company's live stage show \"Puppet Up! - Uncensored\" which has toured to Aspen, Las Vegas, Edinburgh, Sydney and Melbourne and is currently appearing monthly at Avalon Hollywood. In 2013, on the serie 2 Broke Girls (third season, seventh episode), she appears how Han's mother, under the name Su-Min.\n\nKaren was also featured as a fashion victim in an episode of the makeover show How Do I Look?. She also appeared as a non-celebrity contestant on the 1984 CBS game show, Body Language, under the name Karen Upshaw, saying she was from Perris, California. She was paired with celebrity players Ted Lange and Constance Towers. She was also on The New $25,000 Pyramid in 1983 with Audrey Landers and Michael McKean.", new DateTime(1958, 5, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0555462", "Acting", "Karen Maruyama", new List<string>(), "U.S.A", 13.09, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6XCu6ZFSkF8ppMO40Jx6HgDKJgj.jpg" },
