                    { 204484, "Ken Burns (born 1953) is a highly celebrated American documentarian who gradually amassed a considerable reputation and a devoted audience with a series of reassuringly traditional meditations on Americana. Burns' works are treasure troves of archival materials; he skillfully utilizes period music and footage, photographs, periodicals and ordinary people's correspondence, the latter often movingly read by seasoned professional actors in a deliberate attempt to get away from a \"Great Man\" approach to history. Like most non-fiction filmmakers, Burns wears many hats on his projects, often serving as writer, cinematographer, editor and music director in addition to producing and directing. He achieved his apotheosis with The Civil War (1990), a phenomenally popular 11-hour documentary that won two Emmys and broke all previous ratings records for public TV. The series' companion coffee table book--priced at a hefty $50--sold more than 700,000 copies. The audio version, narrated by Burns, was also a major best-seller. In the final accounting, \"The Civil War\" became the first documentary to gross over $100 million. Not surprisingly, it has become perennial fund-raising programming for public TV stations around the country. Burns arrived upon the scene with the Oscar-nominated Brooklyn Bridge (1981), a nostalgic chronicle of the construction of the fabled edifice. The film was more widely seen when rebroadcast on PBS the following year. Though Burns has made other nonfiction films for theatrical release, notably an acclaimed and ambiguous portrait of Depression-era Louisiana governor Huey Long (1985), PBS would prove to be his true home. He cast a probing eye on such American subjects as The Statue of Liberty (1985), The Congress (1988) (PBS), painter Thomas Hart Benton (1988) (PBS) and early radio with Empire of the Air: The Men Who Made Radio (1991) (PBS). Burns returned to long-form documentary with his most ambitious project to date, an 18-hour history of Baseball (1994), which aired on PBS in the fall of 1994. He approached the national pastime as a template for understanding changes in modern American society. Ironically, this was the only baseball on the air at the time, as the players and owners were embroiled in a bitter strike.", new DateTime(1953, 7, 29, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0122741", "Directing", "Ken Burns", new List<string>(), "Brooklyn, New York, USA", 7.0250000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rFGB5AOkjcPFSXiBq1PAnbsCxBW.jpg" },
                    { 204997, "Hanna Rose Hall (born July 9, 1984) is an American actress and assistant director, known for her roles as Young Jenny in Forrest Gump (1994), Cecilia Lisbon in The Virgin Suicides (1999), and Judith Myers in Rob Zombie's Halloween (2007).", new DateTime(1984, 7, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0355632", "Acting", "Hanna Hall", new List<string> { "Hanna R. Hall" }, "Denver, Colorado, USA", 15.452999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xkZ2Hwz1QLXvQCgGlWgVgx00Rtd.jpg" },
