                    { 222591, "Jesús Guzmán Gareta (Madrid, 15 June 1926) is a veteran Spanish actor, known for La morte sull'alta collina (1969) Crónicas de un pueblo (1971), Cachimba (2004) and Maestros (2000). He appeared in many western films shot in Almería such as Un par de asesinos (1970), Per qualche dollaro in più (1965), The Good, the Bad and the Ugly (1966) and Ocaso de un pistolero (1965).", new DateTime(1926, 6, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0350065", "Acting", "Jesús Guzmán", new List<string> { "Jesús Guzman", "Jesus Guzman" }, "Madrid - Spain", 4.0119999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1taaHdzP0JUWpenwF7riZ4NhY9E.jpg" },
                    { 223913, "", new DateTime(1967, 4, 9, 0, 0, 0, 0, DateTimeKind.Utc), null, 0, null, "nm0851864", "Camera", "Sam Taybi", new List<string>(), null, 2.661, null },
                    { 225730, "Ryunosuke Kamiki (born May 19, 1993) is a Japanese actor. He entered the industry in 1995 when he was only 2 years old. He made his drama debut in \"Good News\", which gained him immense popularity through his first full-time role as Naoya, playing the son of SMAP's Masahiro Nakai. In 2001, he was discovered by Hayao Miyazaki, and ended up voicing Bao in the animated film \"Spirited Away\" by Studio Ghibli, the highest-grossing Japanese film in Japan. From 1999 to 2002 he had appeared in over a dozen projects, earning him the title of a child prodigy. He was awarded his first award for \"Backdrop del mio Papá\" when he was only 11. From 2004 to 2020, he has won awards every one or two alternative years.\n\nToday, Ryu remains an iconic and beloved actor in the Japanese industry. He has the reputation of a reliable lead actor who goes into character as soon as the cameras start rolling. For his successful transition from a child actor to a main lead combined with his modest personality, has made him a role model for many. When choosing works, he likes to experiment with roles or plots. He does not mind too much about popularity or being the main lead as long as he likes his role. Rather than \"aiming for a big goal ahead\", he is the type to do the job in front of him wholeheartedly.\n\nHe has appeared in numerous award-winning projects. In 2011, he won his first international award for playing the main lead in the Amade Prize–winning \"Threads of Our Hearts\". To date, he has been an integral part of all the top 4 highest-grossing Japanese movies in Japan. His works continue to break records as his movie \"your name.\" became the highest-grossing Japanese movie of all time internationally.\n\nRyu, alongside acting and voice acting, has dabbled in multiple fields. For variety shows he often does many documentaries. He even interviewed Will Smith for the magazine TV program 'ZIP!'. In 2015, he released his first book \"Master's Café\". Ryu challenged his first stage play with \"Beautiful: The Woman Who Met with God\", directed and written by Suzuki Matsuo, in 2019. The following year, he debuted in multiple fields such as a radio DJ for 'All Night Nippon 0' (ANN0) on 11th October 2020, which airs 3 am at nights between Saturday and Sunday. His directorial debut was with the music video for \"I Treasure You\" for SUPER HANDSOME COLLECTION \"JUMP↑\". He opened his own YouTube channel. He was also the official photographer for Takeru Satoh's 2021 calendar.\n\nIn 2020, Ryu was awarded at the Elan d'or Award Ceremony, one of the most prestigious awards in Japan for completing 25 years in the industry. To thank his fans, he started the 25th Anniversary Celebration Project.", new DateTime(1993, 5, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://co-lavo.co.jp/artist/ryunosuke_kamiki/", "nm1126340", "Acting", "Ryunosuke Kamiki", new List<string> { "카미키 류노스케", "Ryuchan", "Ryu", "Kamisama", "神木隆之介	", "Ryuunosuke Kamiki", "Ryūnosuke Kamiki", "神木 隆之介", "Ryûnosuke Kamiki" }, "Saitama, Japan", 37.488999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ut7ewXjdgUmgkhJ1EtbOo9tbc7s.jpg" },
