                    { 553790, "Tetsuya Nishio (西尾 鉄也, Nishio Tetsuya, born 23 June 1968 in Aichi Prefecture) is a Japanese animator and character designer. He began his career in 1988 as an inbetween animator for the TV series Osomatsu-kun. He was affiliated with Studio Pierrot before joining Production I.G.\n\nHe is considered one of the \"Three Gods of IG\" along with Hiroyuki Okiura and Kazuchika Kise and was rewarded the Best Character Design Award at the 8th Tokyo Anime Awards in 2009 for his outstanding work on Sky Crawlers, where he designed the characters and was key animation supervisor.", new DateTime(1968, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1536037", "Visual Effects", "Tetsuya Nishio", new List<string> { "西尾 鉄也", "双堂健", "Ken Soudou" }, "Aichi, Japan", 4.7729999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\lIEmjhT7hNZqz4ajg2NT61bl6US.jpg" },
