                    { 851784, "Mackenzie Christine Foy (born November 10, 2000) is an American actress and model. She is known for portraying Renesmee Cullen in the 2012 film The Twilight Saga: Breaking Dawn – Part 2, which earned her a Young Artist Award nomination as Best Supporting Young Actress in a Feature Film. She portrayed young Murphy in the 2014 space epic Interstellar, for which she received a Saturn Award for Best Performance by a Younger Actor among other awards nominations. She starred as Clara in Disney's 2018 film The Nutcracker and the Four Realms.", new DateTime(2000, 11, 10, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm3237775", "Acting", "Mackenzie Foy", new List<string> { "Kenzie", "매켄지 포이", "Μακένζι Κριστίν Φόι", "Μακένζι Φόι" }, "Los Angeles, California, USA", 25.919, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\6n8yZKJ3YHkm4Ds3zNjJpankHUk.jpg" },
