                    { 931327, "Chris received an MFA with Honors in directing from Columbia University’s Graduate Film Division, where the faculty awarded him a full Departmental Research Assistant fellowship for merit as a top student. He also served as a teaching assistant at Columbia, where he instructed undergraduates in weekly classes in film history, theory and craft. Chris was born in Kisumu, Kenya and spent much of his youth overseas. He has also worked as a rough carpenter and spent nine summer seasons as a commercial salmon fisherman in Alaska’s Bering Sea. He is fluent in Spanish and currently lives in Brooklyn, New York.", new DateTime(1974, 11, 30, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm2343031", "Directing", "Christopher Zalla", new List<string> { "Chris Zalla" }, "Kenya", 3.198, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\90jkloUBJroXXUPGhykAOdgXzBg.jpg" },
