                    { 936275, "Aoi Yuki (悠木 碧, Yūki Aoi, born March 27, 1992) is a Japanese voice actress (seiyuu), actress and singer from Sanmu City, Chiba Prefecture. She is affiliated with Aoni Production. Her real name and former stage name is Aoi Yabusaki (八武 崎碧, Yabusaki Aoi). She was previously affiliated with Breath and Pro Fit.", new DateTime(1992, 3, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "https://www.aoni.co.jp/search/yuki-aoi.html", "nm2976492", "Acting", "Aoi Yuki", new List<string> { "Aoi Yabusaki", "Aoi Yuuki", "Aoi Yūki", "ゆうき あおい", "八武崎碧", "유우키 아오이", "悠木 碧" }, "Chiba, Japan", 29.309000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\4kHNZSUIux52UU2BD3H6b5c5ymZ.jpg" },
                    { 936765, "Jeff Atmajian (born 1960 in Fresno, California) is a composer, arranger and orchestrator for films. His regular clientele include composers such as James Newton Howard, Marc Shaiman, Rachel Portman, Mark Watters, John Debney and Gabriel Yared. His composing credits are primarily for short films. In 2006, he scored the 90-minute documentary about the Armenian genocide called Screamers.\n\nSource: Article \"Jeff Atmajian\" from Wikipedia in English, licensed under CC-BY-SA 3.0.", new DateTime(1960, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://jeffatmajian.com/", "nm0040873", "Sound", "Jeff Atmajian", new List<string> { "Jeff Atamjian", "Jeff Atmajin" }, "Fresno, California, USA", 2.6120000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\118QAIvoXmXVK0U2XqKohpE4CfT.jpg" },
