                    { 996220, "Jessica Lauren Graff is an American professional stunt woman and athletics-based television personality. She is a black belt in Taekwondo, a black sash in Kung Fu, and is trained in five other styles of martial arts. She is also a championship pole vaulter and a competitive gymnast.", new DateTime(1984, 1, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.jessiegraff.com/", "nm2421085", "Crew", "Jessie Graff", new List<string> { "Jessica Lauren Graff" }, "New York City, New York, USA", 7.4569999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ePoVxfGq9LUj8RJ9FfmViNFqcBB.jpg" },
