                    { 1006721, "Luciano Charles Scorsese (May 5, 1913–August 23, 1993) was an American actor and father of filmmaker Martin Scorsese. Scorsese was born in New York City, the son of Teresa and Francesco Scorsese, Sicilian immigrants from Polizzi Generosa, a small town near Palermo. He married Catherine Cappa in 1933. He was the father of Academy Award-winning film director Martin Scorsese. In 1976 he made his first film appearance in Taxi Driver, albeit in a still newspaper photograph with his wife, as Iris’ father. He later appeared in his son’s 1980 film, Raging Bull, where he played \"Charlie.” He featured in the gangster film Goodfellas in 1990, portraying \"Vinnie\" who was based on the real-life gangster Thomas Agro.\n\nDescription above from the Wikipedia article Charles Scorsese, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1913, 5, 8, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1993, 8, 23, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0778737", "Acting", "Charles Scorsese", new List<string> { "查尔斯·斯科塞斯" }, "New York City, New York, USA", 7.2539999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\fYjjxe3xxjcDIrry6O94QYUcz86.jpg" },
                    { 1007574, "", null, null, 0, null, "nm0201482", "Acting", "Axel Darna", new List<string>(), null, 3.5819999999999999, null },
                    { 1009730, "Nizou Yamamoto (山本 二三, Yamamoto Nizō) was born on 27 June 1953 in Fukue-shi (a town within Gotou City [Gotou-shi]), in Nagasaki Prefecture, and was one of the most well-known anime art directors and background artists in Japan. He was especially famous for his work on several of the Studio Ghibli films directed or produced by Hayao Miyazaki or Isao Takahata including Laputa: Castle in the Sky (1986), Grave of the Fireflies (1988), Only Yesterday (1991), Whisper of the Heart (1995), Princess Mononoke (1997), and Spirited Away (2001).", new DateTime(1953, 6, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2023, 8, 19, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0945464", "Art", "Nizou Yamamoto", new List<string> { "Ямамото Нидзо", "山本二三", "Nizô Yamamoto", "Nizo Yamamoto" }, "Fukue, Nagasaki, Japan [now Goto, Nagasaki, Japan]", 3.7570000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\xp8NAt7gKBqDoVb06vNF7ALiCgl.jpg" },
