                    { 1019578, "Peter Dillon is an Irish stunt coordinator and stunt performer for film and television productions. During a break from his regular job as a secondary school teacher for German and Geography, he started his film career on the set of The Lord of the Rings Trilogy in New Zealand in 1998.", null, null, 2, null, "nm1952494", "Crew", "Peter Dillon", new List<string> { "Peter Dylan" }, "Killiney, County Dublin, Ireland", 1.877, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\e6C1bHTSEqzLrnpBFSfdATOkS4t.jpg" },
                    { 1019727, "Christopher Jones is an American actor and dancer. He is best known for playing Wade in the feature film You Got Served.", new DateTime(1982, 2, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0427757", "Acting", "Christopher Jones", new List<string> { "Christopher Michael Jones", "Christopher M. Jones", "Chris Jones" }, "Myrtle Beach, South Carolina, USA", 3.7959999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2EuDwtnOIJgLlBZWwpWYia0rxz3.jpg" },
                    { 1024279, "Matthew Thomas \"Matt\" Skiba (born February 24, 1976) is an American musician, singer, and songwriter, known for his role as the founding lead vocalist and guitarist for Alkaline Trio and the guitarist and co-lead vocalist of the band Blink-182 (2015–2022). His lyrical content commonly involves dark romantic themes.\n\nAlkaline Trio was formed in 1996 with Skiba as the frontman. Since then, the band has released nine full-length albums over two decades. Skiba also recorded albums with side projects including Heavens and theHell, as well as two full-length solo albums with his backing band, the Sekrets.\n\nFollowing Tom DeLonge's second departure from Blink-182 in early 2015, Skiba began touring with the pop-punk trio, then joined the band permanently later that year; he has since recorded two albums with them.", new DateTime(1976, 2, 24, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1928349", "Acting", "Matt Skiba", new List<string> { "Alkaline Trio", "Blink-182" }, "Chicago, Illinois, USA", 1.5940000000000001, null },
