                    { 1029281, "Minami Ichikawa (市川 南, Ichikawa Minami, born July 22, 1966) is a Japanese film producer born in Tokyo, Japan. He is the president of Toho Pictures, Inc., Managing Director of Toho Co., Ltd. and director of Toho Film Art Co., Ltd. His father is film producer Kiichi Ichikawa (市川 喜一) and his mother is actress Chieko Seki (関千 恵子). He is a jury member of the Toho Cinderella audition.", new DateTime(1966, 7, 22, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1549716", "Production", "Minami Ichikawa", new List<string> { "いちかわ みなみ", "市川 南" }, "Tokyo, Japan", 15.462, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\hbLwY27J83U0FFTPqYvfFXpBRco.jpg" },
