                    { 1034754, "", null, null, 0, null, "nm0357381", "Art", "James Hambidge", new List<string>(), null, 5.4119999999999999, null },
                    { 1035044, "Carlo Leva (27 February 1930 – 4 April 2020) was an Italian production designer.  After beginning his career as second assistant art director in Genoa on the set of The Walls of Malapaga, Leva studied Architecture in Rome, specializing in production design, costume design and set decoration for movies and advertising.\n\nIn 1962, Leva was hired as assistant art director on Robert Aldrich's Sodom and Gomorrah, where he met second unit director Sergio Leone, who later hired him as assistant art director on A Fistful of Dollars, For a Few Dollars More and The Good, the Bad and the Ugly and as set decorator on Once Upon a Time in the West.[1] He befriended also director Enzo Muzii, with whom he worked on movies such as Something Like Love, and later worked with many other directors, such as Federico Fellini, Dario Argento (for The Cat o' Nine Tails) and Carol Reed.\n\nIn 2017, Leva took part in the documentary film Sad Hill Unearthed, narrating the reconstruction of the cemetery scene of The Good, the Bad and the Ugly.", new DateTime(1930, 2, 27, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2020, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0505115", "Art", "Carlo Leva", new List<string>(), "Bergamasco, Italy", 2.7730000000000001, null },
