                    { 1077276, "Enzo Petito (24 July 1897 – 17 July 1967) was an Italian film and stage character actor. A theatre actor under Eduardo De Filippo in the 1950s in the Teatro San Ferdinando of Naples, with whom he was professionally closely associated, Petito also appeared in several of his films, often co-starring Eduardo or/and brother, Peppino De Filippo, brothers who are considered to be amongst the greatest Italian actors of the 20th century. Petito played minor roles in some memorable commedia all'Italiana movies directed by the likes of Dino Risi and Mario Monicelli in the late 1950s and early 1960s, often appearing alongside actors such as Nino Manfredi, Alberto Sordi, Peppino De Filippo, Anna Maria Ferrero, and Totò.\n\nAlthough never a leading actor, he made a number of small appearances as character actors alongside Italy's leading film stars in films throughout the early to mid-1960s and is arguably best known in world cinema for his role as the store keeper in the Sergio Leone classic Spaghetti Western film The Good, the Bad and the Ugly in 1966. His roles ranged from storekeepers and cobblers to priests and homeless men. His role of most esteem, however, is perhaps as Napoleon in Sergio Corbucci's comedy Chi si ferma è perduto in 1963.", new DateTime(1897, 7, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1967, 7, 17, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0677654", "Acting", "Enzo Petito", new List<string> { "Vincenzo Squatriti" }, "Naples, Italy", 4.3760000000000003, null },
                    { 1077277, "Claudio Scarchilli (10 February 1924, Rome – 25 July 1992) was an Italian film actor who appeared in films throughout the 1960s. He acted in nearly twenty films within that decade.\n\nHe is best known in world cinema for his small roles in several of Sergio Leone's films, portraying Pedro, member of Tuco's gang, in the Spaghetti Western The Good, the Bad and the Ugly in 1966, and Once Upon a Time in the West in 1968.\n\nHis brother Sandro Scarchilli was also an actor and also appeared in The Good, the Bad and the Ugly in 1966.\n\nHe made his last appearance in 1970.", new DateTime(1924, 2, 10, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1992, 7, 25, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0769116", "Acting", "Claudio Scarchilli", new List<string>(), "Rome, Italy", 5.4560000000000004, null },
                    { 1077278, "Sandro Scarchilli (22 April 1934, Rome – 31 August 1999) was an Italian film actor who appeared in several films in the late 1960s and 1970s.", new DateTime(1925, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1999, 8, 31, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0769118", "Acting", "Sandro Scarchilli", new List<string>(), "Rome, Italy", 4.181, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\9QXMXMqQ3eEY2k5N6U2q4wzCJrS.jpg" },
