                    { 1224317, "Michael Jeffrey Gilden was an American actor with dwarfism. He lived and worked in Los Angeles. Gilden performed or did stunt work in a variety of television series and films, including Charmed, CSI: Crime Scene Investigation, Family Law, Cybill, NCIS and Pulp Fiction, and had a role as an Ewok in the film Star Wars Episode VI: Return of the Jedi. He appeared twice in Season 4 of the hit series NCIS. Gilden was also a Financial Advisor. In August 1997, he met Meredith Eaton through mutual friends in Atlanta, Georgia. Gilden encouraged Eaton to pursue a career in acting, and she became an actress in 1999. The couple married on May 20, 2001. Gilden committed suicide on December 5, 2006, hanging himself in his Los Angeles home. He was 44. He was buried in a private service at Mission Hills, California, on December 10.", new DateTime(1962, 9, 22, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2006, 12, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm0318402", "Acting", "Michael Gilden", new List<string>(), "Los Angeles, California, USA", 4.6399999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rZk317gtqOAF6MgImnJ6l5j9RQL.jpg" },
                    { 1224996, "Lauren Wendy Sánchez (born December 19, 1969) is an American media personality who gained fame as an entertainment reporter and news anchor. She has been a guest host on The View, co-host on KTTV Fox 11's Good Day LA and anchor on the Fox 11 Ten O'clock News, and anchor and special correspondent on Extra. Sánchez has also been a regular contributor on shows including Larry King Live, The Joy Behar Show and Showbiz Tonight.", new DateTime(1969, 12, 19, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0761078", "Acting", "Lauren Sánchez", new List<string> { "W. Lauren Sanchez" }, "Albuquerque, New Mexico, USA", 9.4139999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ahOwHtOHrFZUoJDOd7VvF7RPiL.jpg" },
