                    { 1226835, "Markus William Redmond (born February 5, 1971) is an American film director, screenwriter, producer, and actor.  He is best known for his pivotal role as a hospital orderly \"Raymond Alexander,\" in 71 episodes of the comedy-drama series Doogie Howser, M.D., co-created by legendary television producer, Steven Bochco; and for the famous police station scene it the cult classic Fight Club.  Redmond was born in Philadelphia, Pennsylvania. In 1971, he moved with his family to Ventura County in Los Angeles and began taking acting lessons.", new DateTime(1971, 2, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0715076", "Acting", "Markus Redmond", new List<string> { "Marcus Redmond", "Markus William Redmond" }, "Philadelphia, Pennsylvania, USA", 5.117, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1nbshlVnSpr72aPq1Ntx7jwbLbw.jpg" },
