                    { 1274295, "Cie Allman-Scott, Ph.D. is a seasoned show host and Media Psychologist who successfully evolved to both sides of the camera from years of modeling and acting. A published author of both #1 best-selling books and audio books, Dr. Scott is also the writer of TV commercials, infomercials, episodic and \"how to\" daytime TV programs, music videos, and transformative self-help tools. Dr. Cie has thirty years of full time experience as an actress, TV host and narrator, including voice-overs for hundreds of productions.\n\nShe spends half of her time lecturing throughout the world and appearing on television as a Media Psychologist. As an actress, TV host and producer, \"Dr. Cie\" earned 8 Tellys, 2 Vision Awards, and 2 Emmy nominations for production and hosting.", new DateTime(1967, 3, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm0021515", "Acting", "Cie Allman", new List<string>(), "Chicago, Illinois, USA", 2.456, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\2zyIj8rLX6iVIpvJrFfCVg9khtQ.jpg" },
