                    { 1279727, "Debbie Evans is a prolific American stuntwoman. An accomplished motorcyclist, her entertainment roots began with halftime shows at various stadium events, which included her famous headstand on the seat of a balancing motorcycle. Not one to shy away from the challenge of a male-dominated field, she accepted the offer to do a motorcycle jump over a 30-foot ravine for the movie Deathsport. This job would be the beginning a stunt career that would span decades, and garner her accolades and awards for future work to come. Shortly after her path started, things exploded for Debbie when she tied for second overall in the 1978 CBS Stunt Competition as the only female competitor, and won first place in the car race, beating out all of the top male stunt drivers.\n\nDebbie honed all aspects of her physical ability, performing just about every stunt there is, but never steering too far from her first love...motorcycles and cars! Debbie has won 7 Taurus World Stunts Awards, one of the highest acknowledgements in her industry. She has also been inducted into the American Motorcyclist (AMA) Hall of Fame, The Hollywood Stuntman's Hall of Fame, along with many other awards and nominations.", null, null, 1, null, "nm0262700", "Crew", "Debbie Evans", new List<string> { " Debbie J. Evans ", "Debbi Evans ", "Debra Evans ", "Debbie Evans-Leavitt ", "Debbie Evans Leavitt" }, null, 5.7789999999999999, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\eDLKuLGUsI2Wk5HYiq2n0DjQZ7C.jpg" },
