                    { 1337623, "Sergio Luiz Pereira (born July 15, 1960), known professionally as Sergio Kato, (Years active‎: 1975–present). Is a Brazilian-American actor, model, ballet dancer, former martial artist, former military. Kato has appeared in many TV-commercial and films (cameo appearance). He found greater fame in his hometown of Rio de Janeiro, after a stage play at the Scala Rio music venue. Since then, Kato has been working for many advertising campaigns, TV shows, and films. Former model and active actor  2020. Aside from the acting career, Kato still modeling not as much. Print-adds, campaigns and TV Commercials for grief clothing.\n\nStill young, in 1982 he served the Brazilian Air Force, then in 1985, he moved to the United States. After studying English at California High School and, studied at the University of California in Los Angeles, where he received a Diploma from the UCLA School of Theater, Film, and Television. Similarly, the movie industry changes rapidly, many projects in Europe and the USA.\n\nModeling\n\nSergio Kato signed with a modeling agency in New York City appeared in ads for Calvin Klein with Dylan Bruno and modeled in Paris, Japan and Milan. His modeling career also includes modeling for Polo Ralph Lauren, Georgio Armani, Dolce & Gabbana, Timex.  From Wikipedia.", new DateTime(1960, 7, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://www.sergiokato.com", "nm1415992", "Acting", "Sergio Kato", new List<string> { "Sergio Kato", "Sergio Pereira", "Sergio Luiz Pereira " }, "Alem Paraiba, Minas Gerais, Brazil", 6.516, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qj9GQAqeiBziJaXtSZRw8yZ6b8T.jpg" },
