                    { 1347525, "Park Seo-jun is a South Korean actor. Born on December 16, 1988, he made his debut in a 2011 music video for Bang Yong Guk’s single “I Remember”. He went on to star in such popular television dramas as “Dream High 2” (2012), “A Word From Warm Heart” (2013), “A Witch’s Romance” (2014), “Kill Me, Heal Me” (2015), “She Was Pretty” (2015), “Hwarang” (2016-2017) and “Fight My Way” (2017). In addition to his acting, Park Seo Joon served as host of the popular music variety show “Music Bank” from 2013 to 2015. His latest work was the hit drama “Itaewon Class” (2020), and he's currently filming the movie “Dream”.", new DateTime(1988, 12, 16, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.awesomeent.co.kr/portfolio-items/%EB%B0%95%EC%84%9C%EC%A4%80/", "nm6124994", "Acting", "Park Seo-jun", new List<string> { "Park Seo Jun", "박서준", "Park Seo Joon", "Park Seo-joon", "박용규", "Park Yong-gyu", "Пак Со Чжун", "朴叙俊", "Seo-jun Park", "Park Yong-kyu", " パク・ソジュン", "朴敘俊", "樸敘俊", "朴書俊", "朴瑞俊" }, "Seoul, South Korea", 22.218, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\rLAhC54IdUBRmpSRQrCC6a0wTLV.jpg" },
