                    { 1360008, "Defending Jacob (2020) Midnight Butterflies (2020) Boston't Finest (2010) The Life And Death of Normand Bailey (2013) Pseudo Love (2018) Black Mass (2015) Joseph Oliveira was born in Bretanha,Saint Michael,Azores. Emigrated with his parents in the late 60 s to Fall River,Massachusetts.USA. Started his career as a background actor in the classic film Jaws (1975). Joseph has participated in numerous film projects, TV series, commercials etc. Joseph Oliveira is also a published Author of fictional novels.", null, null, 2, null, "nm5857646", "Acting", "Joseph Oliveira", new List<string> { "Joe Oliveira", "Joe Pesci" }, null, 8.2680000000000007, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\dbDEEQ2OO2MQejuGNryhn8vkxCM.jpg" },
