                    { 1360103, "Addison Teague was born and raised in Columbia, Missouri. In 1995, he moved to Los Angeles to attend USC Film School, where he received the Mary Pickford Sound Scholarship and worked as a teaching assistant for Tomlinson Holman (the inventor of THX for Lucasfilm).\n\nIn 2000, Addison moved to Marin County to begin his professional career at Skywalker Sound. Over the next 7 years, he would edit sound effects on 19 films, including Pirates of the Caribbean, Lord of the Rings, and Munich.\n\nIn 2007, he relocated back to Los Angeles to work directly alongside Jim Cameron for three years on Avatar, for which he earned a British Academy Award nomination. Staying in Los Angeles, Addison has carved out a unique role as an LA-based Skywalker Supervising Sound Editor and Sound Designer, setting up and working in close proximity to the director and picture editor. During this phase, Addison has overseen films including Tron Legacy (earning him a Best Sound Editing Academy Award nomination), Rango, The Lone Ranger, and the Amazing Spider-Man series.", null, null, 2, "https://www.skysound.com/people/addison-teague", "nm0853529", "Sound", "Addison Teague", new List<string>(), "Columbia, Missouri, USA", 4.5570000000000004, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\AuS7v1bP0Wt6R1xz9jx5H95vUO2.jpg" },
