                    { 1451280, "Masaru Ooshiro (大城 勝, Ōshiro Masaru) is a Japanese animator and character designer. Masaru was one of the core figures in the World Masterpiece Theater series in the 1990s, and was the character designer on Remi, Nobody's Girl. Since the 2000s, he has often been involved in children's animation, and frequently participates in the movie versions of Doraemon and Shin-chan. Animator Tsutomu Ooshiro (大城 勉, Ōshiro Tsutomu) is his younger brother.", null, null, 2, null, "nm0651927", "Visual Effects", "Masaru Ooshiro", new List<string> { "大城勝", "おおしろ まさる", "Masaru Ōshiro", "Masaru Oshiro" }, null, 3.0670000000000002, null },
                    { 1451927, "Atsushi Yamagata (山形 厚史, Yamagata Atsushi, April 4, 1965) is a Japanese animator, animation director and character designer born in Hokkaido Prefecture.", new DateTime(1965, 4, 4, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0945295", "Visual Effects", "Atsushi Yamagata", new List<string> { "山形厚史" }, "Hokkaido Prefecture, Japan", 2.2810000000000001, null },
