                    { 1452721, "Randall William Cook (born 1951) is an American special effects artist most known for The Lord of the Rings trilogy. He worked on Ghostbusters, as designer, sculptor and animator of the 'Terror Dogs'; The Gate, as visual effects designer and director; King Kong as second unit director. He currently works as a consultant and is preparing several personal properties for production.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1951, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 0, null, "nm0177241", "Visual Effects", "Randall William Cook", new List<string> { "Randy Cook" }, "  United States", 4.2359999999999998, null },
