                    { 1456611, "Japanese animator, designer, and animation director.\n\nNicknamed as \"Master\" (師匠, Shishou), by Takahiro Kishida during the production of Bubblegum Crisis. Since then the nickname has been widely recognized within the industry.", new DateTime(1968, 3, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0393108", "Visual Effects", "Takeshi Honda", new List<string> { "本田雄" }, "Ishikawa, Japan", 2.5209999999999999, null },
