                    { 1456632, "Shinya Ohira is one of the most talented and recognized animators in the world of anime. His animation style includes using exaggerating motion, manipulating gravity and balance with the use of different perspective shots, lots of rapid camera movement, and unconventional angles. With his boldly distorted and vigorous drawing style, his cuts are unique and instantly recognizable.\n\nHe has worked as an animator for over thirty years. His early work in the 1980s mainly consisted of action and effects cuts. He bounced around several studios (including Sunrise, Madhouse, and Pierrot).", new DateTime(1966, 12, 12, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0648955", "Visual Effects", "Shinya Ohira", new List<string> { "Shinnosuke Harada", "Shin'ya Ôhira", "Shinya Ohara", "大平晋也", "Shinya Oohira" }, "Aichi, Japan", 5.9429999999999996, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\m1ZKwGxAbXqwbaemNArFMLz8uph.jpg" },
