                    { 1456775, "", null, null, 1, null, "nm1069482", "Art", "Naomi Kasugai", new List<string> { "春日井 直美" }, null, 2.3929999999999998, null },
                    { 1456777, "Kenichi Konishi (小西 賢一, Kon'ishi Kenichi, June 23, 1968) is a Japanese male animator born in Saitama Prefecture. He is a member of the Japanese Animation Creators Association (JAniCA).\n\nAfter graduating from Tokyo Animator College, he joined Studio Ghibli as the first trainee in 1989. He was in charge of the original drawings for Whisper of the Heart and Princess Mononoke, and in 1999 he was the animation director for My Neighbors the Yamadas. After that, he became a freelancer, and while continuing to participate in Studio Ghibli works, he is active mainly in numerous theater works. In 2006 he was invited to become the animation supervisor on the film remake of Doraemon: Nobita's Dinosaur. He was the animation director in the 2013 film directed by Isao Takahata The Tale of the Princess Kaguya.", new DateTime(1968, 6, 23, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm1069565", "Visual Effects", "Kenichi Konishi", new List<string> { "小西賢一", "こにし けんいち", "Ken'ichi Konishi" }, "Saitama, Japan", 2.6890000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\bgPzpkbm3xjXd5ujTIq36kk6IEa.jpg" },
