                    { 1456830, "Norio Matsumoto is a prolific action and character animator. He began his career after graduating from Tatsunoko's animators training program. He worked as an \"inbetweener\" for Oh! Productions (1987-89), mentored under Tomohiro Hirata and was influenced by Satoru Utsunomiya and Takashi Nakamura, for which he has adapted elements of their approach for a wider audience. Norio is perhaps best known for his work on the Naruto franchise, being the lead animator on Wakabayashi's episodes 30, 71, 133; and episode 167 of Shippuden.", null, null, 2, null, "nm1634547", "Visual Effects", "Norio Matsumoto", new List<string> { "松本憲生" }, "Japan", 7.1660000000000004, null },
