                    { 1478367, "Sakakida debuted in film in 1921, and appeared in a number pre-war films with various studios, including Nikkatsu, Takamatsu-Azuma, Empire Kinema, and Makino Talkie, before finally landing at PCL in 1937, which would later become Toho.\n\nAfter the war, Sakakida appeared in numerous supporting roles for Toho, predominantly sci-fi, beginning with the original Godzilla in 1954. He played the mayor of the island town attacked by Godzilla in the first half of the film. One of his last appearances was in Terror of Mechagodzilla (1975), in a still shot of a group of scientists restraining Akihiko Hirata’s character.", new DateTime(1900, 1, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0757059", "Acting", "Keiji Sakakida", new List<string> { "榊田敬二", "さかきだ けいじ, 榊田敬治" }, "Japan", 0.63600000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mxtunUGffh5qcEAUnrE6deIGmw8.jpg" },
