                    { 1608033, "Lata Mangeshkar was an Indian playback singer and occasional music composer. She was the best-known and most respected playback singer in India. She was referred to as the Nightingale of India and the Queen of Melody. Mangeshkar's career started in 1942 and had spanned over seven decades. She recorded songs for over a thousand Hindi films and had sung songs in over thirty-six regional Indian languages and foreign languages, primarily in Marathi and Hindi. She was the recipient of three National Film Awards, 12 Bengal Film Journalists' Association Awards, four Filmfare Best Female Playback Awards, two Filmfare Special Awards, Filmfare Lifetime Achievement Award and many more. The Dadasaheb Phalke Award was bestowed on her in 1989 by the Government of India. She was also the second vocalist, after M. S. Subbulakshmi, to have ever been awarded the Bharat Ratna in 2001, India's highest civilian honor. She was the first Indian to perform in Royal Albert Hall in 1974. She was conferred France's highest civilian award (Officer of the Legion of Honour) in 2007. Due to all of her achievements, many singers and musicians consider her to be one of the greatest female singers in the Hindi film industry. She had four siblings—Asha Bhosle, Hridaynath Mangeshkar, Usha Mangeshkar and Meena Mangeshkar—of whom she is the eldest.\n\nDescription above from the Wikipedia article Lata Mangeshkar, licensed under CC-BY-SA, full list of contributors on Wikipedia.", new DateTime(1929, 9, 28, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2022, 2, 6, 0, 0, 0, 0, DateTimeKind.Utc), 1, null, "nm0542196", "Sound", "Lata Mangeshkar", new List<string> { "Lata M", "Latha Mangeshkar", "Latha Mangeskar" }, "Indore, India", 2.036, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\1JgCDCQpi3KIasQykS3Bd0IHGpp.jpg" },
