                    { 1624179, "Scott Mann started in front of the camera before getting behind the camera.  From the late ‘80’s to the mid ‘90’s, Scott was a fashion model from Wickliffe, Ohio and worked in the Cleveland, Pittsburgh, Chicago, and Atlanta markets, and also across the Pacific in Honolulu and Tokyo.  During his career, Scott has appeared in national ad campaigns for Miller Brewing Co., Matrix Hair Essentials, Fitness Quest, and has appeared in regional television spots for GNC, and The Art Institute.  In 1993, Scott won the role of “Glenn Quentin” in the 7 time Academy Award nominated motion picture, “The Shawshank Redemption”.  In 1995, Scott was voted to Cleveland Magazine's annual list of \"Most Interesting People\".\n\nWhile modeling in Cleveland and Chicago, Scott would also work as a photo assistant for local photographers. A developed interest to be behind the lens was now created.  Scott has been shooting a variety of media over the years.  One of his latest techniques is 'digitally painting' on his images, which has created some of his latest works.\n\nIn October of 2010, Scott was awarded the job to create 21 original 'digital paintings' for the Great Hall entrance to the new Cuyahoga County Juvenile Justice Center in Cleveland, Ohio.", null, null, 2, "http://scottmannphoto.com/", "nm0542957", "Acting", "Scott Mann", new List<string> { "Scott Mann (I)" }, null, 3.6469999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\sOqi4IDMyOo96eZhk15gqsxDitc.jpg" },
