                    { 1691564, "Tomohiro Yamaguchi (山口 智広, Yamaguchi Tomohiro, December 26, 1987) is a Japanese voice actor from Tokyo. He is affiliated with Tokyo Actor's Consumer's Cooperative Society (Haikyō). He was formerly affiliated with B-Box until March 31, 2023. His former stage name is Tomohiro Yamaguchi (山口智大). On March 23, 2017 he changed his name spelling from 山口智大 to 山口智広.", new DateTime(1987, 12, 26, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "https://haikyo.co.jp/profile/profile.php?ActorID=13112", "nm6415381", "Acting", "Tomohiro Yamaguchi", new List<string> { "山口智広", "山口智大", "やまぐち ともひろ" }, "Tōkyō, Japan", 6.1639999999999997, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\vj0zpzYm2wMuBR9pYfSs06HN6T5.jpg" },
