                    { 1693424, "Mirela Rupic is an American fashion and costume designer. She was born in 1967 in a small town located in Orange County. California. Rupic studied stage and costume design at the Woodbury University in San Diego. After completing her studies, Rupic worked in San Diego as assistant designer for some of the most important American costume designers such as Colleen Atwood, Michael Kaplan, Lou Eyrich, for movies directed by: Rob Marshall \"Chicago\", Ridley Scott \"Blade Runner\", David Fincher \"Fight Club\", Brad Falchuk \"American Horror Story\", Ian Brennan \"Glee\" and more.\n\nHer works in the past several years include \"X-Men: Days of Future Past\" directed by Bryan Singer in which Mirela won the Australian Academy Award and the Prix Nova Award for best costume design. She was also nominated for the Silver Ribbon for \"Prisoners\" directed by Denis Villeneuve.\n\nThe most recent movies Mirela Rupic has been involved in, and still in post-production, are expected to bring her designs one step closer to the world-known costume designers.", new DateTime(1967, 3, 21, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, null, "nm7963050", "Costume & Make-Up", "Mirela Rupic", new List<string>(), "Orange County, California, U.S.", 3.3359999999999999, null },
