                    { 1808925, "Alexander Zemeckis is an American business owner, president, and developer of addiction recovery programs, as well as a former child actor. He is the son of director Robert Zemeckis and actress Mary Ellen Trainor.\n\nAlex earned a Bachelor of Arts degree from San Diego State University and a Master’s Degree in Spiritual Psychology from the University of Santa Monica. He has worked in the addiction treatment & mental health communities helping young adults find new ways to live.\n\nThroughout his career, Alex has worked in various direct care and administrative roles including sober coaching and companion work, admissions, business development and outreach and as a residential mentor for a prominent treatment program in Colorado.\n\nIn 2013, he launched The Grounds Recovery (for men) in San Diego putting into action the skills and lessons he learned throughout his own personal and professional journey. After nearly 8 years of successfully working with men at The Grounds, Alex soon learned that there was a strong need for women’s aftercare programs. Thus, he launched Mare’s House as the female component to The Grounds Recovery. As president & owner of The Grounds & Mare’s House, Alex personally oversees the admissions and business development departments of both programs.", new DateTime(1985, 12, 11, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0954754", "Acting", "Alexander Zemeckis", new List<string>(), "Los Angeles, California, USA", 2.6070000000000002, null },
