                    { 1844168, "Paul Jasmin (born April 1935) is an American artist based in Los Angeles, California. Jasmin was an illustrator, a painter, and an actor before finding photography. His commercial work has appeared in Vogue, Teen Vogue, GQ, Details, V Magazine, V Man, Vogue Hommes, W Magazine, and Interview. Jasmin has illustrated and photographed fashion campaigns for luxury brands, including Valentino, A.P.C, and he sits on the faculty of Art Center College of Design in Pasadena, California.\n\nFrom Wikipedia, the free encyclopedia", new DateTime(1935, 4, 15, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, "nm0419220", "Acting", "Paul Jasmin", new List<string>(), "Helena, Montana, USA", 0.92000000000000004, null },
                    { 1845278, "Baron Yamazaki (バロン 山崎, Baron Yamazaki, born August 5, 1971) is a Japanese narrator, radio personality, and voice actor from Ibaraki Prefecture. He has business partnerships with two companies, Dana Works and Voicegarage, and is mainly active as a freelancer. He was formerly affiliated with Flip Up and SO Promotion. His real name and former stage name is Takeshi Yamazaki (山崎 剛, Yamazaki Takehsi).", new DateTime(1971, 8, 5, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, "http://www.dana-works.co.jp/dana-works/baron-yamazaki/", "nm6619653", "Acting", "Baron Yamazaki", new List<string> { "Takeshi Yamazaki", "山崎剛", "バロン山崎", "バロン やまざき" }, "Ibaraki, Japan", 2.5219999999999998, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\brjVSfFp4KXrmEL1XBSonyd8JXE.jpg" },
