                    { 1852819, "Howard Stanley Puris (born 1938), known as Tony Powers or Anthony Powers, is an American songwriter, recording artist, music video artist, and actor. He was responsible for writing or co-writing the hit songs \"Remember Then\", \"Why Do Lovers Break Each Other's Heart\", \"98.6\", \"Lazy Day\", and many others including \"We're The Banana Splits\", the Kiss song \"Odyssey\", and Powers' own \"Don't Nobody Move (This is a Heist)\". He had a minor role in GoodFellas (1990), where he played Jimmy Two Times, who got that nickname because he said everything twice, like, “I’m gonna go get the papers, get the papers.”", null, null, 2, null, null, "Acting", "Anthony Powers", new List<string>(), "The Bronx, New York, U.S", 3.23, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\ve0ni5S8bUh5vIAr8r40IPuDnWK.jpg" },
