                    { 1870620, "Lanny's first gig was playing Santa in Birmingham, Michigan Cub Scouts. Next, as Pontius Pilate, at a church in Darien, Connecticut. But the acting bug first really bit when he tore up the scenery at Yale University as Jimmy in The Rainmaker, getting a laugh on every line, never getting enough ever since. He has studied with Uta Hagen and Bill Hickey, and has earned a Gold Medal in Acting from the Royal Academy of Dramatic Art. After many years doing stage throughout the country, he came back to Los Angeles to continue in film and television. Lanny speaks fluent Native French and has two French grandchildren.", new DateTime(1942, 1, 1, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(2021, 1, 5, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, "nm3060034", "Acting", "Lanny Lutz", new List<string> { "Charles Allan Lutz" }, "Washington, District of Columbia, USA", 0.19600000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\qvbIYI9LbUSkPtAs4bsSZ1MwtD3.jpg" },
