                    { 2505025, "Iginio Lardani was a graphic and film titles designer best known for his iconic title design work in the Spaghetti Western genre.\n\nBorn in Áscoli Piceno, Italy, on December 24, 1924, Lardani was a European contemporary of title design titans Saul Bass and Maurice Binder. He was an autodidact with a great interest in painting. He moved to Rome at the age of 25 and entered the world of film through poster design. After creating the Italian posters for films like High Noon, he designed the title sequences to Sergio Leone’s Dollars Trilogy — A Fistful of Dollars (1964), For a Few Dollars More (1965), and The Good, The Bad and The Ugly (1966). Often allowed an entirely free hand when designing titles and trailers, he worked from his study in Via Reno, Rome. He also designed the opening titles for Face to Face (1967), The Mercenary (1969), and Tepepa (1969).\n\nOutside of the Spaghetti Western genre, Lardani designed the openings for Casanova ’70 (1965), Il compagno Don Camillo (1965), Queimada (1969), and A Special Day (1977). Often affectionately referred to as “Gigi” and sometimes mistakenly called “Eugenio”, he also designed and edited film trailers, most notably those of Mogliamante (1977) by Marco Vicario and Una Gionata Particolare (1977) by Ettore Scola, which were awarded first and second place at Cannes in 1978.", new DateTime(1924, 12, 24, 0, 0, 0, 0, DateTimeKind.Utc), new DateTime(1986, 5, 15, 0, 0, 0, 0, DateTimeKind.Utc), 2, null, null, "Art", "Igino Lardani", new List<string>(), "Áscoli Piceno, Italy", 0.55700000000000005, null },
