                    { 2856721, "Mina Meguro, born on March 27, 1973, in Tokyo, Japan, is a versatile actress and voice artist. She is affiliated with the prestigious Bungakuza theater company. After graduating from Otsuka Women's Junior and Senior High School (now Otsuka Nakano Junior High School and High School), Meguro embarked on her journey in the performing arts. In 1991, she joined the Bungakuza Actor Training Institute, where she progressed from undergraduate to trainee and eventually became a full-fledged member of the Bungakuza theater company in 1996.  Meguro made her stage debut in 1994 with the Bungakuza Atelier production \"Singer.\" Her exceptional performances in roles such as Filima in \"Heart Broken\" and Christine in \"My Sister Indis House\" earned her the prestigious Yomiuri Theater Award for Outstanding Actress and the Sugimura Haruko Award in 2001. Meguro shares a connection with voice actress Mie Sonozaki, a friend from her days in the theater club at Otsuka Women's Junior and Senior High School.", new DateTime(1973, 3, 27, 0, 0, 0, 0, DateTimeKind.Utc), null, 1, "http://www.bungakuza.com/member/prof/meguro-mina.htm", "nm6946831", "Acting", "Mina Meguro", new List<string> { "目黒未奈" }, "Tokyo, Japan", 0.52400000000000002, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\mx1n8cmUTMT0oZH4zyqo3zx84MN.jpg" },
