                    { 2903654, "He was born and rised in Puebla city. In 2016 he entered to the philosophy and literature school of the National Autonomous University of Mexico. Six months later he is admitted to the National School of Cinematographic Arts (now ENAC, then CUEC). Throughout his studies he has developed a comprehensive training through the areas of directing, cinematography, sound and production.\n\nHe is currently studyin the sixth semester of the degree in cinematography at the ENAC within the speciality of documentary cinema.", new DateTime(1997, 10, 1, 0, 0, 0, 0, DateTimeKind.Utc), null, 2, null, null, "Directing", "Víctor Estrada", new List<string>(), "Puebla, Puebla, Mexico", 3.2730000000000001, "D:\\code\\projects\\CineVerse\\Data\\data\\images\\profiles\\gJx8eqchsJDgLjtr3lSRltIXOls.jpg" },
