                    { 4254376, "Neil Nadelman is an American veteran anime industry translator, Neil got his start as a fan-turned-professional in the early 1990s, gaining notoriety for his translation and subtitling work on a long list of projects, such as Macross Plus OAVs, The Slayers and Slayers Try TV series, Revolutionary Girl Utena and Irresponsible Captain Tylor. A gigantic Gundam fan, he also worked for Sunrise translating the original Gundam TV series and the One Year War OVAs, and is the man who popularized the use of the term \"Zeke\" as a derogatory name for Zeon soldiers in the Gundam universe.", null, null, 2, "https://www.linkedin.com/in/neiln", "nm1599303", "Crew", "Neil Nadelman", new List<string>(), null, 0.073999999999999996, null },
